INSERT INTO `script_texts` VALUES ('-1000000', '<StrawberryScripts Text Entry Missing!>', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'DEFAULT_TEXT');
INSERT INTO `script_texts` VALUES ('-1000001', '%s goes into a killing frenzy!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_GENERIC_FRENZY_KILL');
INSERT INTO `script_texts` VALUES ('-1000002', '%s goes into a frenzy!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_GENERIC_FRENZY');
INSERT INTO `script_texts` VALUES ('-1000003', '%s becomes enraged!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_GENERIC_ENRAGED');
INSERT INTO `script_texts` VALUES ('-1000004', '%s goes into a berserker rage!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_GENERIC_BERSERK');
INSERT INTO `script_texts` VALUES ('-1000005', '%s goes into a frenzy!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'EMOTE_BOSS_GENERIC_FRENZY');
INSERT INTO `script_texts` VALUES ('-1000006', '%s becomes enraged!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'EMOTE_BOSS_GENERIC_ENRAGED');
INSERT INTO `script_texts` VALUES ('-1000100', 'Come, little ones. Face me!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'azuregos SAY_TELEPORT');
INSERT INTO `script_texts` VALUES ('-1000101', 'Follow me, $N. I\'ll take you to the Defias hideout. But you better protect me or I am as good as dead', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'defias traitor SAY_START');
INSERT INTO `script_texts` VALUES ('-1000102', 'The entrance is hidden here in Moonbrook. Keep your eyes peeled for thieves. They want me dead.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'defias traitor SAY_PROGRESS');
INSERT INTO `script_texts` VALUES ('-1000103', 'You can go tell Stoutmantle this is where the Defias Gang is holed up, $N.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'defias traitor SAY_END');
INSERT INTO `script_texts` VALUES ('-1000104', '%s coming in fast! Prepare to fight!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'defias traitor SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1000105', 'Help!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'defias traitor SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1000106', 'Everyone ready?', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'torek SAY_READY');
INSERT INTO `script_texts` VALUES ('-1000107', 'Ok, Lets move out!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'torek SAY_MOVE');
INSERT INTO `script_texts` VALUES ('-1000108', 'Prepare yourselves. Silverwing is just around the bend.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'torek SAY_PREPARE');
INSERT INTO `script_texts` VALUES ('-1000109', 'Silverwing is ours!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'torek SAY_WIN');
INSERT INTO `script_texts` VALUES ('-1000110', 'Go report that the outpost is taken. We will remain here.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'torek SAY_END');
INSERT INTO `script_texts` VALUES ('-1000111', 'Our house is this way, through the thicket.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'magwin SAY_START');
INSERT INTO `script_texts` VALUES ('-1000112', 'Help me!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'magwin SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000113', 'My poor family. Everything has been destroyed.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'magwin SAY_PROGRESS');
INSERT INTO `script_texts` VALUES ('-1000114', 'Father! Father! You\'re alive!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'magwin SAY_END1');
INSERT INTO `script_texts` VALUES ('-1000115', 'You can thank $N for getting me back here safely, father.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'magwin SAY_END2');
INSERT INTO `script_texts` VALUES ('-1000116', '%s hugs her father.', null, null, null, null, null, null, null, null, '0', '2', '7', '0', 'magwin EMOTE_HUG');
INSERT INTO `script_texts` VALUES ('-1000117', 'Thank you for agreeing to help. Now, let\'s get out of here $N.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'wounded elf SAY_ELF_START');
INSERT INTO `script_texts` VALUES ('-1000118', 'Over there! They\'re following us!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'wounded elf SAY_ELF_SUMMON1');
INSERT INTO `script_texts` VALUES ('-1000119', 'Allow me a moment to rest. The journey taxes what little strength I have.', null, null, null, null, null, null, null, null, '0', '0', '1', '16', 'wounded elf SAY_ELF_RESTING');
INSERT INTO `script_texts` VALUES ('-1000120', 'Did you hear something?', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'wounded elf SAY_ELF_SUMMON2');
INSERT INTO `script_texts` VALUES ('-1000121', 'Falcon Watch, at last! Now, where\'s my... Oh no! My pack, it\'s missing! Where has -', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'wounded elf SAY_ELF_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000122', 'You won\'t keep me from getting to Falcon Watch!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'wounded elf SAY_ELF_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000123', 'Ready when you are, $c.', null, null, null, null, null, null, null, null, '0', '0', '0', '15', 'big will SAY_BIG_WILL_READY');
INSERT INTO `script_texts` VALUES ('-1000124', 'The Affray has begun. $n, get ready to fight!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'twiggy SAY_TWIGGY_BEGIN');
INSERT INTO `script_texts` VALUES ('-1000125', 'You! Enter the fray!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'twiggy SAY_TWIGGY_FRAY');
INSERT INTO `script_texts` VALUES ('-1000126', 'Challenger is down!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'twiggy SAY_TWIGGY_DOWN');
INSERT INTO `script_texts` VALUES ('-1000127', 'The Affray is over.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'twiggy SAY_TWIGGY_OVER');
INSERT INTO `script_texts` VALUES ('-1000128', 'We need you to send reinforcements to Manaforge Duro, Ardonis. This is not a request, it\'s an order.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge SAY_COMMANDER_DAWNFORGE_1');
INSERT INTO `script_texts` VALUES ('-1000129', 'You cannot be serious! We are severely understaffed and can barely keep this manaforge functional!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge SAY_ARCANIST_ARDONIS_1');
INSERT INTO `script_texts` VALUES ('-1000130', 'You will do as ordered. Manaforge Duro has come under heavy attack by mana creatures and the situation is out of control. Failure to comply will not be tolerated!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge SAY_COMMANDER_DAWNFORGE_2');
INSERT INTO `script_texts` VALUES ('-1000131', 'Indeed, it is not a request.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge SAY_PATHALEON_CULATOR_IMAGE_1');
INSERT INTO `script_texts` VALUES ('-1000132', 'My lord!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge SAY_COMMANDER_DAWNFORGE_3');
INSERT INTO `script_texts` VALUES ('-1000133', 'Duro will be reinforced! Ultris was a complete disaster. I will NOT have that mistake repeated!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge PATHALEON_CULATOR_IMAGE_2');
INSERT INTO `script_texts` VALUES ('-1000134', 'We\'ve had too many setbacks along the way: Hellfire Citadel, Fallen Sky Ridge, Firewing Point... Prince Kael\'thas will tolerate no further delays. I will tolerate nothing other than complete success!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge PATHALEON_CULATOR_IMAGE_2_1');
INSERT INTO `script_texts` VALUES ('-1000135', 'I am returning to Tempest Keep. See to it that I do not have reason to return!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge PATHALEON_CULATOR_IMAGE_2_2');
INSERT INTO `script_texts` VALUES ('-1000136', 'Yes, my lord.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge COMMANDER_DAWNFORGE_4 SAY_ARCANIST_ARDONIS_2');
INSERT INTO `script_texts` VALUES ('-1000137', 'See to it, Ardonis!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dawnforge COMMANDER_DAWNFORGE_5');
INSERT INTO `script_texts` VALUES ('-1000138', 'Avruu\'s magic... it still controls me. You must fight me, mortal. It\'s the only way to break the spell!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'aeranas SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1000139', 'Avruu\'s magic is broken! I\'m free once again!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'aeranas SAY_FREE');
INSERT INTO `script_texts` VALUES ('-1000140', 'Let\'s go.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lilatha SAY_START');
INSERT INTO `script_texts` VALUES ('-1000141', '$N, let\'s use the antechamber to the right.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lilatha SAY_PROGRESS1');
INSERT INTO `script_texts` VALUES ('-1000142', 'I can see the light at the end of the tunnel!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lilatha SAY_PROGRESS2');
INSERT INTO `script_texts` VALUES ('-1000143', 'There\'s Farstrider Enclave now, $C. Not far to go... Look out! Troll ambush!!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lilatha SAY_PROGRESS3');
INSERT INTO `script_texts` VALUES ('-1000144', 'Thank you for saving my life and bringing me back to safety, $N', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lilatha SAY_END1');
INSERT INTO `script_texts` VALUES ('-1000145', 'Captain Helios, I\'ve been rescued from the Amani Catacombs. Reporting for duty, sir!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lilatha SAY_END2');
INSERT INTO `script_texts` VALUES ('-1000146', 'Liatha, get someone to look at those injuries. Thank you for bringing her back safely.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lilatha CAPTAIN_ANSWER');
INSERT INTO `script_texts` VALUES ('-1000147', 'I remember well the sting of defeat at the conclusion of the Third War. I have waited far too long for my revenge. Now the shadow of the Legion falls over this world. It is only a matter of time until all of your failed creation... is undone.', null, null, null, null, null, null, null, null, '11332', '1', '0', '0', 'kazzak SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1000148', 'The Legion will conquer all!', null, null, null, null, null, null, null, null, '11333', '1', '0', '0', 'kazzak SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1000149', 'All mortals will perish!', null, null, null, null, null, null, null, null, '11334', '1', '0', '0', 'kazzak SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1000150', 'All life must be eradicated!', null, null, null, null, null, null, null, null, '11335', '1', '0', '0', 'kazzak SAY_SURPREME1');
INSERT INTO `script_texts` VALUES ('-1000151', 'I\'ll rip the flesh from your bones!', null, null, null, null, null, null, null, null, '11336', '1', '0', '0', 'kazzak SAY_SURPREME2');
INSERT INTO `script_texts` VALUES ('-1000152', 'Kirel Narak!', null, null, null, null, null, null, null, null, '11337', '1', '0', '0', 'kazzak SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1000153', 'Contemptible wretch!', null, null, null, null, null, null, null, null, '11338', '1', '0', '0', 'kazzak SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1000154', 'The universe will be remade.', null, null, null, null, null, null, null, null, '11339', '1', '0', '0', 'kazzak SAY_KILL3');
INSERT INTO `script_texts` VALUES ('-1000155', 'The Legion... will never... fall.', null, null, null, null, null, null, null, null, '11340', '1', '0', '0', 'kazzak SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1000156', 'REUSE ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE ME');
INSERT INTO `script_texts` VALUES ('-1000157', 'Invaders, you dangle upon the precipice of oblivion! The Burning Legion comes and with it comes your end.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'kazzak SAY_RAND1');
INSERT INTO `script_texts` VALUES ('-1000158', 'Impudent whelps, you only delay the inevitable. Where one has fallen, ten shall rise. Such is the will of Kazzak...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'kazzak SAY_RAND2');
INSERT INTO `script_texts` VALUES ('-1000159', 'Do not proceed. You will be eliminated!', null, null, null, null, null, null, null, null, '11344', '1', '0', '0', 'doomwalker SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000160', 'Tectonic disruption commencing.', null, null, null, null, null, null, null, null, '11345', '1', '0', '0', 'doomwalker SAY_EARTHQUAKE_1');
INSERT INTO `script_texts` VALUES ('-1000161', 'Magnitude set. Release.', null, null, null, null, null, null, null, null, '11346', '1', '0', '0', 'doomwalker SAY_EARTHQUAKE_2');
INSERT INTO `script_texts` VALUES ('-1000162', 'Trajectory locked.', null, null, null, null, null, null, null, null, '11347', '1', '0', '0', 'doomwalker SAY_OVERRUN_1');
INSERT INTO `script_texts` VALUES ('-1000163', 'Engage maximum speed.', null, null, null, null, null, null, null, null, '11348', '1', '0', '0', 'doomwalker SAY_OVERRUN_2');
INSERT INTO `script_texts` VALUES ('-1000164', 'Threat level zero.', null, null, null, null, null, null, null, null, '11349', '1', '0', '0', 'doomwalker SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1000165', 'Directive accomplished.', null, null, null, null, null, null, null, null, '11350', '1', '0', '0', 'doomwalker SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1000166', 'Target exterminated.', null, null, null, null, null, null, null, null, '11351', '1', '0', '0', 'doomwalker SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1000167', 'System failure in five, f-o-u-r...', null, null, null, null, null, null, null, null, '11352', '1', '0', '0', 'doomwalker SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1000168', 'Who dares awaken Aquementas?', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'aquementas AGGRO_YELL_AQUE');
INSERT INTO `script_texts` VALUES ('-1000169', 'Muahahahaha! You fool! You\'ve released me from my banishment in the interstices between space and time!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nether_drake SAY_NIHIL_1');
INSERT INTO `script_texts` VALUES ('-1000170', 'All of Draenor shall quick beneath my feet! I will destroy this world and reshape it in my image!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nether_drake SAY_NIHIL_2');
INSERT INTO `script_texts` VALUES ('-1000171', 'Where shall I begin? I cannot bother myself with a worm such as yourself. There is a world to be conquered!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nether_drake SAY_NIHIL_3');
INSERT INTO `script_texts` VALUES ('-1000172', 'No doubt the fools that banished me are long dead. I shall take wing survey my demense. Pray to whatever gods you hold dear that we do not meet again.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nether_drake SAY_NIHIL_4');
INSERT INTO `script_texts` VALUES ('-1000173', 'NOOOOooooooo!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nether_drake SAY_NIHIL_INTERRUPT');
INSERT INTO `script_texts` VALUES ('-1000174', 'Good $N, you are under the spell\'s influence. I must analyze it quickly, then we can talk.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'daranelle SAY_SPELL_INFLUENCE');
INSERT INTO `script_texts` VALUES ('-1000175', 'Thank you, mortal.', null, null, null, null, null, null, null, null, '0', '0', '11', '0', ' SAY_JUST_EATEN');
INSERT INTO `script_texts` VALUES ('-1000176', 'The last thing I remember is the ship falling and us getting into the pods. I\'ll go see how I can help. Thank you!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HEAL1');
INSERT INTO `script_texts` VALUES ('-1000177', '$C, Where am I? Who are you? Oh no! What happened to the ship?', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HEAL2');
INSERT INTO `script_texts` VALUES ('-1000178', '$C You saved me! I owe you a debt that I can never repay. I\'ll go see if I can help the others.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HEAL3');
INSERT INTO `script_texts` VALUES ('-1000179', 'Ugh... what is this place? Is that all that\'s left of the ship over there?', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HEAL4');
INSERT INTO `script_texts` VALUES ('-1000180', 'Oh, the pain...', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HELP1');
INSERT INTO `script_texts` VALUES ('-1000181', 'Everything hurts, Please make it stop...', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HELP2');
INSERT INTO `script_texts` VALUES ('-1000182', 'Ughhh... I hurt. Can you help me?', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HELP3');
INSERT INTO `script_texts` VALUES ('-1000183', 'I don\'t know if I can make it, please help me...', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'draenei_survivor SAY_HELP4');
INSERT INTO `script_texts` VALUES ('-1000184', 'Yes Master, all goes along as planned.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'engineer_spark SAY_TEXT');
INSERT INTO `script_texts` VALUES ('-1000185', '%s puts the shell to his ear.', null, null, null, null, null, null, null, null, '0', '2', '7', '0', 'engineer_spark EMOTE_SHELL');
INSERT INTO `script_texts` VALUES ('-1000186', 'Now I cut you!', null, null, null, null, null, null, null, null, '0', '1', '7', '0', 'engineer_spark SAY_ATTACK');
INSERT INTO `script_texts` VALUES ('-1000187', 'Thank you, dear $C, you just saved my life.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'faulk SAY_HEAL');
INSERT INTO `script_texts` VALUES ('-1000188', 'Deployment sucessful. Trespassers will be neutralized.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'converted_sentry SAY_CONVERTED_1');
INSERT INTO `script_texts` VALUES ('-1000189', 'Objective acquired. Initiating security routines.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'converted_sentry SAY_CONVERTED_2');
INSERT INTO `script_texts` VALUES ('-1000190', 'In Nagrand, food hunt ogre!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', ' SAY_LUMP_0');
INSERT INTO `script_texts` VALUES ('-1000191', 'You taste good with maybe a little salt and pepper.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', ' SAY_LUMP_1');
INSERT INTO `script_texts` VALUES ('-1000192', 'OK, OK! Lump give up!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', ' SAY_LUMP_DEFEAT');
INSERT INTO `script_texts` VALUES ('-1000193', 'Thank you, dear $C, you just saved my life.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'stillblade SAY_HEAL');
INSERT INTO `script_texts` VALUES ('-1000194', 'I give up! Please don\'t kill me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unkor SAY_SUBMIT');
INSERT INTO `script_texts` VALUES ('-1000195', 'REUSE ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE ME');
INSERT INTO `script_texts` VALUES ('-1000196', 'Belore...', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lady_sylvanas SAY_LAMENT_END');
INSERT INTO `script_texts` VALUES ('-1000197', '%s kneels down and pick up the amulet.', null, null, null, null, null, null, null, null, '0', '2', '1', '0', 'lady_sylvanas EMOTE_LAMENT_END');
INSERT INTO `script_texts` VALUES ('-1000198', 'Taste blade, mongrel!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_GUARD_SIL_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1000199', 'Please tell me that you didn\'t just do what I think you just did. Please tell me that I\'m not going to have to hurt you...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_GUARD_SIL_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1000200', 'As if we don\'t have enough problems, you go and create more!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_GUARD_SIL_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1000201', 'I\'m saved! Thank you, doctor!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'injured_patient SAY_DOC1');
INSERT INTO `script_texts` VALUES ('-1000202', 'HOORAY! I AM SAVED!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'injured_patient SAY_DOC2');
INSERT INTO `script_texts` VALUES ('-1000203', 'Sweet, sweet embrace... take me...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'injured_patient SAY_DOC3');
INSERT INTO `script_texts` VALUES ('-1000204', '%s looks up at you quizzically. Maybe you should inspect it?', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'cluck EMOTE_A_HELLO');
INSERT INTO `script_texts` VALUES ('-1000205', '%s looks at you unexpectadly.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'cluck EMOTE_H_HELLO');
INSERT INTO `script_texts` VALUES ('-1000206', '%s starts pecking at the feed.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'cluck EMOTE_CLUCK_TEXT2');
INSERT INTO `script_texts` VALUES ('-1000207', 'You have my blessing', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ashyen_and_keleth SAY_REWARD_BLESS');
INSERT INTO `script_texts` VALUES ('-1000208', 'REUSE ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE ME');
INSERT INTO `script_texts` VALUES ('-1000209', 'Very well. Let\'s see what you have to show me, $N.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'anvilward SAY_ANVIL1');
INSERT INTO `script_texts` VALUES ('-1000210', 'What manner of trick is this, $R? If you seek to ambush me, I warn you I will not go down quietly!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'anvilward SAY_ANVIL2');
INSERT INTO `script_texts` VALUES ('-1000211', 'Warning! %s emergency shutdown process initiated by $N. Shutdown will complete in two minutes.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'manaforge_control EMOTE_START');
INSERT INTO `script_texts` VALUES ('-1000212', 'Emergency shutdown will complete in one minute.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'manaforge_control EMOTE_60');
INSERT INTO `script_texts` VALUES ('-1000213', 'Emergency shutdown will complete in thirty seconds.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'manaforge_control EMOTE_30');
INSERT INTO `script_texts` VALUES ('-1000214', 'Emergency shutdown will complete in ten seconds.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'manaforge_control EMOTE_10');
INSERT INTO `script_texts` VALUES ('-1000215', 'Emergency shutdown complete.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'manaforge_control EMOTE_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000216', 'Emergency shutdown aborted.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'manaforge_control EMOTE_ABORT');
INSERT INTO `script_texts` VALUES ('-1000217', 'Greetings, $N. I will guide you through the cavern. Please try and keep up.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_1');
INSERT INTO `script_texts` VALUES ('-1000218', 'We do not know if the Caverns of Time have always been accessible to mortals. Truly, it is impossible to tell as the Timeless One is in perpetual motion, changing our timeways as he sees fit. What you see now may very well not exist tomorrow. You may wake up and have no memory of this place.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_2');
INSERT INTO `script_texts` VALUES ('-1000219', 'It is strange, I know... Most mortals cannot actually comprehend what they see here, as often, what they see is not anchored within their own perception of reality.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_3');
INSERT INTO `script_texts` VALUES ('-1000220', 'Follow me, please.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_4');
INSERT INTO `script_texts` VALUES ('-1000221', 'There are only two truths to be found here: First, that time is chaotic, always in flux, and completely malleable and second, perception does not dictate reality.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_5');
INSERT INTO `script_texts` VALUES ('-1000222', 'As custodians of time, we watch over and care for Nozdormu\'s realm. The master is away at the moment, which means that attempts are being made to dramatically alter time. The master never meddles in the affairs of mortals but instead corrects the alterations made to time by others. He is reactionary in this regard.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_6');
INSERT INTO `script_texts` VALUES ('-1000223', 'For normal maintenance of time, the Keepers of Time are sufficient caretakers. We are able to deal with most ordinary disturbances. I speak of little things, such as rogue mages changing something in the past to elevate their status or wealth in the present.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_7');
INSERT INTO `script_texts` VALUES ('-1000224', 'These tunnels that you see are called timeways. They are infinite in number. The ones that currently exist in your reality are what the master has deemed as \'trouble spots.\' These trouble spots may differ completely in theme but they always share a cause. That is, their existence is a result of the same temporal disturbance. Remember that should you venture inside one...', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_8');
INSERT INTO `script_texts` VALUES ('-1000225', 'This timeway is in great disarray! We have agents inside right now attempting to restore order. What information I have indicates that Thrall\'s freedom is in jeopardy. A malevolent organization known as the Infinite Dragonflight is trying to prevent his escape. I fear without outside assistance, all will be lost.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_9');
INSERT INTO `script_texts` VALUES ('-1000226', 'We have very little information on this timeway. Sa\'at has been dispatched and is currently inside. The data we have gathered from his correspondence is that the Infinite Dragonflight are once again attempting to alter time. Could it be that the opening of the Dark Portal is being targeted for sabotage? Let us hope not...', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_10');
INSERT INTO `script_texts` VALUES ('-1000227', 'This timeway is currently collapsing. What that may hold for the past, present and future is currently unknown...', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_11');
INSERT INTO `script_texts` VALUES ('-1000228', 'The timeways are currently ranked in order from least catastrophic to most catastrophic. Note that they are all classified as catastrophic, meaning that any single one of these timeways collapsing would mean that your world would end. We only classify them in such a way so that the heroes and adventurers that are sent here know which timeway best suits their abilities.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_12');
INSERT INTO `script_texts` VALUES ('-1000229', 'All we know of this timeway is that it leads to Mount Hyjal. The Infinite Dragonflight have gone to great lengths to prevent our involvement. We know next to nothing, mortal. Soridormi is currently attempting to break through the timeway\'s defenses but has thus far been unsuccessful. You might be our only hope of breaking through and resolving the conflict.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_13');
INSERT INTO `script_texts` VALUES ('-1000230', 'Our time is at an end $N. I would wish you luck, if such a thing existed.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'WHISPER_CUSTODIAN_14');
INSERT INTO `script_texts` VALUES ('-1000231', 'Ah, $GPriest:Priestess; you came along just in time. I appreciate it.', null, null, null, null, null, null, null, null, '0', '0', '0', '20', 'garments SAY_COMMON_HEALED');
INSERT INTO `script_texts` VALUES ('-1000232', 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those gnolls with your power to back me!', null, null, null, null, null, null, null, null, '0', '0', '1', '4', 'garments SAY_DG_KEL_THANKS');
INSERT INTO `script_texts` VALUES ('-1000233', 'Farewell to you, and may shadow always protect you!', null, null, null, null, null, null, null, null, '0', '0', '1', '3', 'garments SAY_DG_KEL_GOODBYE');
INSERT INTO `script_texts` VALUES ('-1000234', 'Follow me, stranger. This won\'t take long.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_SERV_0');
INSERT INTO `script_texts` VALUES ('-1000235', 'Shattrath was once the draenei capital of this world. Its name means \"dwelling of light.\"', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_1');
INSERT INTO `script_texts` VALUES ('-1000236', 'When the Burning Legion turned the orcs against the draenei, the fiercest battle was fought here. The draenei fought tooth and nail, but in the end the city fell.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_2');
INSERT INTO `script_texts` VALUES ('-1000237', 'The city was left in ruins and darkness... until the Sha\'tar arrived.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_3');
INSERT INTO `script_texts` VALUES ('-1000238', 'Let us go into the Lower City. I will warn you that as one of the only safe havens in Outland, Shattrath has attracted droves of refugees from all wars, current and past.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_4');
INSERT INTO `script_texts` VALUES ('-1000239', 'The Sha\'tar, or \"born from light\" are the naaru that came to Outland to fight the demons of the Burning Legion.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_5');
INSERT INTO `script_texts` VALUES ('-1000240', 'They were drawn to the ruins of Shattrath City where a small remnant of the draenei priesthood conducted its rites inside a ruined temple on this very spot.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_6');
INSERT INTO `script_texts` VALUES ('-1000241', 'The priesthood, known as the Aldor, quickly regained its strength as word spread that the naaru had returned and reconstruction soon began. The ruined temple is now used as an infirmary for injured refugees.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_7');
INSERT INTO `script_texts` VALUES ('-1000242', 'It wouldn\'t be long, however, before the city came under attack once again. This time, the attack came from Illidan\'s armies. A large regiment of blood elves had been sent by Illidan\'s ally, Kael\'thas Sunstrider, to lay waste to the city.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_8');
INSERT INTO `script_texts` VALUES ('-1000243', 'As the regiment of blood elves crossed this very bridge, the Aldor\'s exarchs and vindicators lined up to defend the Terrace of Light. But then the unexpected happened.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_9');
INSERT INTO `script_texts` VALUES ('-1000244', 'The blood elves laid down their weapons in front of the city\'s defenders; their leader, a blood elf elder known as Voren\'thal, stormed into the Terrace of Light and demanded to speak to A\'dal.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_10');
INSERT INTO `script_texts` VALUES ('-1000245', 'As the naaru approached him, Voren\'thal kneeled before him and uttered the following words: \"I\'ve seen you in a vision, naaru. My race\'s only hope for survival lies with you. My followers and I are here to serve you.\"', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_11');
INSERT INTO `script_texts` VALUES ('-1000246', 'The defection of Voren\'thal and his followers was the largest loss ever incurred by Kael\'s forces. And these weren\'t just any blood elves. Many of the best and brightest amongst Kael\'s scholars and magisters had been swayed by Voren\'thal\'s influence.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_12');
INSERT INTO `script_texts` VALUES ('-1000247', 'The naaru accepted the defectors, who would become known as the Scryers; their dwelling lies in the platform above. Only those initiated with the Scryers are allowed there.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_13');
INSERT INTO `script_texts` VALUES ('-1000248', 'The Aldor are followers of the Light and forgiveness and redemption are values they understand. However, they found hard to forget the deeds of the blood elves while under Kael\'s command.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_14');
INSERT INTO `script_texts` VALUES ('-1000249', 'Many of the priesthood had been slain by the same magisters who now vowed to serve the naaru. They were not happy to share the city with their former enemies.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_15');
INSERT INTO `script_texts` VALUES ('-1000250', 'The Aldor\'s most holy temple and its surrounding dwellings lie on the terrace above. As a holy site, only the initiated are welcome inside.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_16');
INSERT INTO `script_texts` VALUES ('-1000251', 'The attacks against Shattrath continued, but the city did not fall, as you can see. On the contrary, the naaru known as Xi\'ri led a successful incursion into Shadowmoon Valley - Illidan\'s doorstep.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_17');
INSERT INTO `script_texts` VALUES ('-1000252', 'There he continues to wage war on Illidan with the assistance of the Aldor and the Scryers. The two factions have not given up on their old feuds, though.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_18');
INSERT INTO `script_texts` VALUES ('-1000253', 'Such is their animosity that they vie for the honor of being sent to assist the naaru there. Each day, that decision is made here by A\'dal. The armies gather here to receive A\'dal\'s blessing before heading to Shadowmoon.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_19');
INSERT INTO `script_texts` VALUES ('-1000254', 'Khadgar should be ready to see you again. Just remember that to serve the Sha\'tar you will most likely have to ally with the Aldor or the Scryers. And seeking the favor of one group will cause the others\' dislike.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_20');
INSERT INTO `script_texts` VALUES ('-1000255', 'Good luck stranger, and welcome to Shattrath City.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'SAY_KHAD_SERV_21');
INSERT INTO `script_texts` VALUES ('-1000256', 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those murlocs with the Light on my side!', null, null, null, null, null, null, null, null, '0', '0', '7', '4', 'garments SAY_ROBERTS_THANKS');
INSERT INTO `script_texts` VALUES ('-1000257', 'Farewell to you, and may the Light be with you always.', null, null, null, null, null, null, null, null, '0', '0', '7', '3', 'garments SAY_ROBERTS_GOODBYE');
INSERT INTO `script_texts` VALUES ('-1000258', 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those humans with your power to back me!', null, null, null, null, null, null, null, null, '0', '0', '1', '4', 'garments SAY_KORJA_THANKS');
INSERT INTO `script_texts` VALUES ('-1000259', 'Farewell to you, and may our ancestors be with you always!', null, null, null, null, null, null, null, null, '0', '0', '1', '3', 'garments SAY_KORJA_GOODBYE');
INSERT INTO `script_texts` VALUES ('-1000260', 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those wendigo with the Light on my side!', null, null, null, null, null, null, null, null, '0', '0', '7', '4', 'garments SAY_DOLF_THANKS');
INSERT INTO `script_texts` VALUES ('-1000261', 'Farewell to you, and may the Light be with you always.', null, null, null, null, null, null, null, null, '0', '0', '7', '3', 'garments SAY_DOLF_GOODBYE');
INSERT INTO `script_texts` VALUES ('-1000262', 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those corrupt timberlings with Elune\'s power behind me!', null, null, null, null, null, null, null, null, '0', '0', '2', '4', 'garments SAY_SHAYA_THANKS');
INSERT INTO `script_texts` VALUES ('-1000263', 'Farewell to you, and may Elune be with you always.', null, null, null, null, null, null, null, null, '0', '0', '2', '3', 'garments SAY_SHAYA_GOODBYE');
INSERT INTO `script_texts` VALUES ('-1000264', 'Ok, $N. Follow me to the cave where I\'ll attempt to harness the power of the rune stone into these goggles.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'phizzlethorpe SAY_PROGRESS_1');
INSERT INTO `script_texts` VALUES ('-1000265', 'I discovered this cave on our first day here. I believe the energy in the stone can be used to our advantage.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'phizzlethorpe SAY_PROGRESS_2');
INSERT INTO `script_texts` VALUES ('-1000266', 'I\'ll begin drawing energy from the stone. Your job, $N, is to defend me. This place is cursed... trust me.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'phizzlethorpe SAY_PROGRESS_3');
INSERT INTO `script_texts` VALUES ('-1000267', '%s begins tinkering with the goggles before the stone.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'phizzlethorpe EMOTE_PROGRESS_4');
INSERT INTO `script_texts` VALUES ('-1000268', 'Help!!! Get these things off me so I can get my work done!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'phizzlethorpe SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000269', 'Almost done! Just a little longer!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'phizzlethorpe SAY_PROGRESS_5');
INSERT INTO `script_texts` VALUES ('-1000270', 'I\'ve done it! I have harnessed the power of the stone into the goggles! Let\'s get out of here!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'phizzlethorpe SAY_PROGRESS_6');
INSERT INTO `script_texts` VALUES ('-1000271', 'Phew! Glad to be back from that creepy cave.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'phizzlethorpe SAY_PROGRESS_7');
INSERT INTO `script_texts` VALUES ('-1000272', '%s hands one glowing goggles over to Doctor Draxlegauge.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'phizzlethorpe EMOTE_PROGRESS_8');
INSERT INTO `script_texts` VALUES ('-1000273', 'Doctor Draxlegauge will give you further instructions, $N. Many thanks for your help!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'phizzlethorpe SAY_PROGRESS_9');
INSERT INTO `script_texts` VALUES ('-1000274', 'Time to teach you a lesson in manners, little $Gboy:girl;!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'larry SAY_START');
INSERT INTO `script_texts` VALUES ('-1000275', 'Now I\'m gonna give you to the count of \'3\' to get out of here before I sick the dogs on you.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'larry SAY_COUNT');
INSERT INTO `script_texts` VALUES ('-1000276', '1...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'larry SAY_COUNT_1');
INSERT INTO `script_texts` VALUES ('-1000277', '2...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'larry SAY_COUNT_2');
INSERT INTO `script_texts` VALUES ('-1000278', 'Time to meet your maker!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'larry SAY_ATTACK_5');
INSERT INTO `script_texts` VALUES ('-1000279', 'Alright, we give up! Don\'t hurt us!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'larry SAY_GIVEUP');
INSERT INTO `script_texts` VALUES ('-1000280', 'A shadowy, sinister presence has invaded the Emerald Dream. Its power is poised to spill over into our world, $N. We must oppose it! That\'s why I cannot accompany you in person.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'clintar SAY_START');
INSERT INTO `script_texts` VALUES ('-1000281', 'The Emerald Dream will never be yours!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'clintar SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1000282', 'Begone from this place!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'clintar SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1000283', 'That\'s the first relic, but there are still two more. Follow me, $N.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'clintar SAY_RELIC1');
INSERT INTO `script_texts` VALUES ('-1000284', 'I\'ve recovered the second relic. Take a moment to rest, and then we\'ll continue to the last reliquary.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'clintar SAY_RELIC2');
INSERT INTO `script_texts` VALUES ('-1000285', 'We have all three of the relics, but my energy is rapidly fading. We must make our way back to Dreamwarden Lurosa! He will let you know what to do next.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'clintar SAY_RELIC3');
INSERT INTO `script_texts` VALUES ('-1000286', 'Lurosa, I am entrusting the Relics of Aviana to $N, who will take them to Morthis Whisperwing. I must return completely to the Emerald Dream now. Do not let $N fail!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'clintar SAY_END');
INSERT INTO `script_texts` VALUES ('-1000287', 'Emergency power activated! Initializing ambulanory motor! CLUCK!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'oox SAY_OOX_START');
INSERT INTO `script_texts` VALUES ('-1000288', 'Physical threat detected! Evasive action! CLUCK!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'oox SAY_OOX_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1000289', 'Thread analyzed! Activating combat plan beta! CLUCK!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'oox SAY_OOX_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1000290', 'CLUCK! Sensors detect spatial anomaly - danger imminent! CLUCK!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'oox SAY_OOX_AMBUSH');
INSERT INTO `script_texts` VALUES ('-1000291', 'No one challanges the Wastewander nomads - not even robotic chickens! ATTACK!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'oox SAY_OOX17_AMBUSH_REPLY');
INSERT INTO `script_texts` VALUES ('-1000292', 'Cloaking systems online! CLUCK! Engaging cloak for transport to Booty Bay!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'oox SAY_OOX_END');
INSERT INTO `script_texts` VALUES ('-1000293', 'To the house! Stay close to me, no matter what! I have my gun and ammo there!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'stilwell SAY_DS_START');
INSERT INTO `script_texts` VALUES ('-1000294', 'We showed that one!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'stilwell SAY_DS_DOWN_1');
INSERT INTO `script_texts` VALUES ('-1000295', 'One more down!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'stilwell SAY_DS_DOWN_2');
INSERT INTO `script_texts` VALUES ('-1000296', 'We\'ve done it! We won!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'stilwell SAY_DS_DOWN_3');
INSERT INTO `script_texts` VALUES ('-1000297', 'Meet me down by the orchard--I just need to put my gun away.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'stilwell SAY_DS_PROLOGUE');
INSERT INTO `script_texts` VALUES ('-1000298', 'Alright, alright I think I can figure out how to operate this thing...', null, null, null, null, null, null, null, null, '0', '0', '0', '393', 'wizzlecrank SAY_START');
INSERT INTO `script_texts` VALUES ('-1000299', 'Arrrgh! This isn\'t right!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wizzlecrank SAY_STARTUP1');
INSERT INTO `script_texts` VALUES ('-1000300', 'Okay, I think I\'ve got it, now. Follow me, $n!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'wizzlecrank SAY_STARTUP2');
INSERT INTO `script_texts` VALUES ('-1000301', 'There\'s the stolen shredder! Stop it or Lugwizzle will have our hides!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'wizzlecrank SAY_MERCENARY');
INSERT INTO `script_texts` VALUES ('-1000302', 'Looks like we\'re out of woods, eh? Wonder what this does...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wizzlecrank SAY_PROGRESS_1');
INSERT INTO `script_texts` VALUES ('-1000303', 'Come on, don\'t break down on me now!', null, null, null, null, null, null, null, null, '0', '0', '0', '393', 'wizzlecrank SAY_PROGRESS_2');
INSERT INTO `script_texts` VALUES ('-1000304', 'That was a close one! Well, let\'s get going, it\'s still a ways to Ratchet!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wizzlecrank SAY_PROGRESS_3');
INSERT INTO `script_texts` VALUES ('-1000305', 'Hmm... I don\'t think this blinking red light is a good thing...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wizzlecrank SAY_END');
INSERT INTO `script_texts` VALUES ('-1000306', 'Let\'s get to the others, and keep an eye open for those wolves cutside...', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'erland SAY_START_1');
INSERT INTO `script_texts` VALUES ('-1000307', 'Be careful, $N. Those wolves like to hide among the trees.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'erland SAY_START_2');
INSERT INTO `script_texts` VALUES ('-1000308', 'A $C attacks!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'erland SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1000309', 'Beware! I am under attack!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'erland SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1000310', 'Oh no! A $C is upon us!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'erland SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1000311', 'We\'re almost there!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'erland SAY_PROGRESS');
INSERT INTO `script_texts` VALUES ('-1000312', 'We made it! Thanks, $N. I couldn\'t have gotten without you.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'erland SAY_END');
INSERT INTO `script_texts` VALUES ('-1000313', 'It\'s good to see you again, Erland. What is your report?', null, null, null, null, null, null, null, null, '0', '0', '33', '1', 'erland SAY_RANE');
INSERT INTO `script_texts` VALUES ('-1000314', 'Masses of wolves are to the east, and whoever lived at Malden\'s Orchard is gone.', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'erland SAY_RANE_REPLY');
INSERT INTO `script_texts` VALUES ('-1000315', 'If I am excused, then I\'d like to check on Quinn...', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'erland SAY_CHECK_NEXT');
INSERT INTO `script_texts` VALUES ('-1000316', 'Hello, Quinn. How are you faring?', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'erland SAY_QUINN');
INSERT INTO `script_texts` VALUES ('-1000317', 'I\'ve been better. Ivar the Foul got the better of me...', null, null, null, null, null, null, null, null, '0', '0', '33', '1', 'erland SAY_QUINN_REPLY');
INSERT INTO `script_texts` VALUES ('-1000318', 'Try to take better care of yourself, Quinn. You were lucky this time.', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'erland SAY_BYE');
INSERT INTO `script_texts` VALUES ('-1000319', 'Let the trial begin, Bloodwrath, attack!', null, null, null, null, null, null, null, null, '0', '1', '1', '0', 'kelerun SayId1');
INSERT INTO `script_texts` VALUES ('-1000320', 'Champion Lightrend, make me proud!', null, null, null, null, null, null, null, null, '0', '1', '1', '0', 'kelerun SayId2');
INSERT INTO `script_texts` VALUES ('-1000321', 'Show this upstart how a real Blood Knight fights, Swiftblade!', null, null, null, null, null, null, null, null, '0', '1', '1', '0', 'kelerun SayId3');
INSERT INTO `script_texts` VALUES ('-1000322', 'Show $n the meaning of pain, Sunstriker!', null, null, null, null, null, null, null, null, '0', '1', '1', '0', 'kelerun SayId4');
INSERT INTO `script_texts` VALUES ('-1000323', 'Mist! I feared I would never see you again! Yes, I am well, do not worry for me. You must rest and recover your health.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'mist SAY_AT_HOME');
INSERT INTO `script_texts` VALUES ('-1000324', '%s growls in acknowledgement before straightening and making her way off into the forest.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'mist EMOTE_AT_HOME');
INSERT INTO `script_texts` VALUES ('-1000325', '\"Threshwackonator First Mate unit prepared to follow\"', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'threshwackonator EMOTE_START');
INSERT INTO `script_texts` VALUES ('-1000326', 'YARRR! Swabie, what have ye done?! He\'s gone mad! Baton him down the hatches! Hoist the mast! ARRRR! Every man for hi\'self!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'threshwackonator SAY_AT_CLOSE');
INSERT INTO `script_texts` VALUES ('-1000327', 'Ok, $n, let\'s go find where I left that mysterious fossil. Follow me!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_START');
INSERT INTO `script_texts` VALUES ('-1000328', 'Now where did I put that mysterious fossil? Ah, maybe up there...', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_RAMP1_1');
INSERT INTO `script_texts` VALUES ('-1000329', 'Hrm, nothing up here.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_RAMP1_2');
INSERT INTO `script_texts` VALUES ('-1000330', 'No mysterious fossil here... Ah, but my copy of Green Hills of Stranglethorn. What a good book!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_BOOK');
INSERT INTO `script_texts` VALUES ('-1000331', 'I bet you I left it in the tent!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_TENT1_1');
INSERT INTO `script_texts` VALUES ('-1000332', 'Oh wait, that\'s Hollee\'s tent... and it\'s empty.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_TENT1_2');
INSERT INTO `script_texts` VALUES ('-1000333', 'Interesting... I hadn\'t noticed this earlier...', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_MOSS');
INSERT INTO `script_texts` VALUES ('-1000334', '%s inspects the ancient, mossy stone.', null, null, null, null, null, null, null, null, '0', '2', '7', '0', 'remtravel EMOTE_REM_MOSS');
INSERT INTO `script_texts` VALUES ('-1000335', 'Oh wait! I\'m supposed to be looking for that mysterious fossil!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_MOSS_PROGRESS');
INSERT INTO `script_texts` VALUES ('-1000336', 'Nope. didn\'t leave the fossil back here!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_PROGRESS');
INSERT INTO `script_texts` VALUES ('-1000337', 'Ah. I remember now! I gave the mysterious fossil to Hollee! Check with her.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_REMEMBER');
INSERT INTO `script_texts` VALUES ('-1000338', '%s goes back to work, oblivious to everything around him.', null, null, null, null, null, null, null, null, '0', '2', '7', '0', 'remtravel EMOTE_REM_END');
INSERT INTO `script_texts` VALUES ('-1000339', 'Something tells me this $r wants the mysterious fossil too. Help!', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'remtravel SAY_REM_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000340', '%s howls in delight at the sight of his lunch!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kyle EMOTE_SEE_LUNCH');
INSERT INTO `script_texts` VALUES ('-1000341', '%s eats his lunch.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kyle EMOTE_EAT_LUNCH');
INSERT INTO `script_texts` VALUES ('-1000342', '%s thanks you with a special dance.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kyle EMOTE_DANCE');
INSERT INTO `script_texts` VALUES ('-1000343', 'Is the way clear? Let\'s get out while we can, $N.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kayra SAY_START');
INSERT INTO `script_texts` VALUES ('-1000344', 'Looks like we won\'t get away so easy. Get ready!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kayra SAY_AMBUSH1');
INSERT INTO `script_texts` VALUES ('-1000345', 'Let\'s keep moving. We\'re not safe here!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kayra SAY_PROGRESS');
INSERT INTO `script_texts` VALUES ('-1000346', 'Look out, $N! Enemies ahead!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kayra SAY_AMBUSH2');
INSERT INTO `script_texts` VALUES ('-1000347', 'We\'re almost to the refuge! Let\'s go.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kayra SAY_END');
INSERT INTO `script_texts` VALUES ('-1000348', 'Ah...the wondrous sound of kodos. I love the way they make the ground shake... inspect the beast for me.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kodo round SAY_SMEED_HOME_1');
INSERT INTO `script_texts` VALUES ('-1000349', 'Hey, look out with that kodo! You had better inspect that beast before i give you credit!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kodo round SAY_SMEED_HOME_2');
INSERT INTO `script_texts` VALUES ('-1000350', 'That kodo sure is a beauty. Wait a minute, where are my bifocals? Perhaps you should inspect the beast for me.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kodo round SAY_SMEED_HOME_3');
INSERT INTO `script_texts` VALUES ('-1000351', 'You, there! Hand over that moonstone and nobody gets hurt!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sprysprocket SAY_START');
INSERT INTO `script_texts` VALUES ('-1000352', '%s takes the Southfury moonstone and escapes into the river. Follow her!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'sprysprocket EMOTE_START');
INSERT INTO `script_texts` VALUES ('-1000353', 'Just chill!', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'sprysprocket SAY_WHISPER_CHILL');
INSERT INTO `script_texts` VALUES ('-1000354', 'Stupid grenade picked a fine time to backfire! So much for high quality goblin engineering!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sprysprocket SAY_GRENADE_FAIL');
INSERT INTO `script_texts` VALUES ('-1000355', 'All right, you win! I surrender! Just don\'t hurt me!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sprysprocket SAY_END');
INSERT INTO `script_texts` VALUES ('-1000356', 'Okay, okay... gimme a minute to rest now. You gone and beat me up good.', null, null, null, null, null, null, null, null, '0', '0', '1', '14', 'calvin SAY_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000357', 'Let\'s go before they find out I\'m free!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'KAYA_SAY_START');
INSERT INTO `script_texts` VALUES ('-1000358', 'Look out! We\'re under attack!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'KAYA_AMBUSH');
INSERT INTO `script_texts` VALUES ('-1000359', 'Thank you for helping me. I know my way back from here.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'KAYA_END');
INSERT INTO `script_texts` VALUES ('-1000360', 'The strands of LIFE have been severed! The Dreamers must be avenged!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', ' ysondre SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000361', 'Come forth, ye Dreamers - and claim your vengeance!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', ' ysondre SAY_SUMMONDRUIDS');
INSERT INTO `script_texts` VALUES ('-1000362', 'Let\'s go $N. I am ready to reach Whitereach Post.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'paoka SAY_START');
INSERT INTO `script_texts` VALUES ('-1000363', 'Now this looks familiar. If we keep heading east, I think we can... Ahh, Wyvern on the attack!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'paoka SAY_WYVERN');
INSERT INTO `script_texts` VALUES ('-1000364', 'Thanks a bunch... I can find my way back to Whitereach Post from here. Be sure to talk with Motega Firemane; perhaps you can keep him from sending me home.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'paoka SAY_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000365', 'Be on guard... Arnak has some strange power over the Grimtotem... they will not be happy to see me escape.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lakota SAY_LAKO_START');
INSERT INTO `script_texts` VALUES ('-1000366', 'Look out, the Grimtotem are upon us!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lakota SAY_LAKO_LOOK_OUT');
INSERT INTO `script_texts` VALUES ('-1000367', 'Here they come.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lakota SAY_LAKO_HERE_COME');
INSERT INTO `script_texts` VALUES ('-1000368', 'More Grimtotems are coming this way!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lakota SAY_LAKO_MORE');
INSERT INTO `script_texts` VALUES ('-1000369', 'Finally, free at last... I must be going now, thanks for helping me escape. I can get back to Freewind Post by myself.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'lakota SAY_LAKO_END');
INSERT INTO `script_texts` VALUES ('-1000370', 'Stay close, $n. I\'ll need all the help I can get to break out of here. Let\'s go!', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'gilthares SAY_GIL_START');
INSERT INTO `script_texts` VALUES ('-1000371', 'At last! Free from Northwatch Hold! I need a moment to catch my breath...', null, null, null, null, null, null, null, null, '0', '0', '1', '5', 'gilthares SAY_GIL_AT_LAST');
INSERT INTO `script_texts` VALUES ('-1000372', 'Now i feel better. Let\'s get back to Ratchet. Come on, $n.', null, null, null, null, null, null, null, null, '0', '0', '1', '23', 'gilthares SAY_GIL_PROCEED');
INSERT INTO `script_texts` VALUES ('-1000373', 'Looks like the Southsea Freeboters are heavily entrenched on the coast. This could get rough.', null, null, null, null, null, null, null, null, '0', '0', '1', '25', 'gilthares SAY_GIL_FREEBOOTERS');
INSERT INTO `script_texts` VALUES ('-1000374', 'Help! $C attacking!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'gilthares SAY_GIL_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1000375', '$C heading this way fast! Time for revenge!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'gilthares SAY_GIL_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1000376', '$C coming right at us!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'gilthares SAY_GIL_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1000377', 'Get this $C off of me!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'gilthares SAY_GIL_AGGRO_4');
INSERT INTO `script_texts` VALUES ('-1000378', 'Almost back to Ratchet! Let\'s keep up the pace...', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'gilthares SAY_GIL_ALMOST');
INSERT INTO `script_texts` VALUES ('-1000379', 'Ah, the sweet salt air of Ratchet.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'gilthares SAY_GIL_SWEET');
INSERT INTO `script_texts` VALUES ('-1000380', 'Captain Brightsun, $N here has freed me! $N, i am certain the Captain will reward your bravery.', null, null, null, null, null, null, null, null, '0', '0', '1', '66', 'gilthares SAY_GIL_FREED');
INSERT INTO `script_texts` VALUES ('-1000381', 'I sense the tortured spirits, $n. They are this way, come quickly!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'wilda SAY_WIL_START');
INSERT INTO `script_texts` VALUES ('-1000382', 'Watch out!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1000383', 'Naga attackers! Defend yourself!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1000384', 'Grant me protection $n, i must break trough their foul magic!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_PROGRESS1');
INSERT INTO `script_texts` VALUES ('-1000385', 'The naga of Coilskar are exceptionally cruel to their prisoners. It is a miracle that I survived inside that watery prison for as long as I did. Earthmother be praised.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_PROGRESS2');
INSERT INTO `script_texts` VALUES ('-1000386', 'Now we must find the exit.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_FIND_EXIT');
INSERT INTO `script_texts` VALUES ('-1000387', 'Lady Vashj must answer for these atrocities. She must be brought to justice!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_PROGRESS4');
INSERT INTO `script_texts` VALUES ('-1000388', 'The tumultuous nature of the great waterways of Azeroth and Draenor are a direct result of tormented water spirits.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_PROGRESS5');
INSERT INTO `script_texts` VALUES ('-1000389', 'It shouldn\'t be much further, $n. The exit is just up ahead.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_JUST_AHEAD');
INSERT INTO `script_texts` VALUES ('-1000390', 'Thank you, $n. Please return to my brethren at the Altar of Damnation, near the Hand of Gul\'dan, and tell them that Wilda is safe. May the Earthmother watch over you...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'wilda SAY_WIL_END');
INSERT INTO `script_texts` VALUES ('-1000391', 'I\'m Thirsty.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TOOG_THIRST');
INSERT INTO `script_texts` VALUES ('-1000392', 'Torta must be so worried.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TOOG_WORRIED');
INSERT INTO `script_texts` VALUES ('-1000393', 'Torta, my love! I have returned at long last.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TOOG_POST_1');
INSERT INTO `script_texts` VALUES ('-1000394', 'You have any idea how long I\'ve been waiting here? And where\'s dinner? All that time gone and nothing to show for it?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TORT_POST_2');
INSERT INTO `script_texts` VALUES ('-1000395', 'My dearest Torta. I have been gone for so long. Finally we are reunited. At long last our love can blossom again.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TOOG_POST_3');
INSERT INTO `script_texts` VALUES ('-1000396', 'Enough with the rambling. I am starving! Now, get your dusty shell into that ocean and bring momma some grub.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TORT_POST_4');
INSERT INTO `script_texts` VALUES ('-1000397', 'Yes Torta. Whatever your heart desires...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TOOG_POST_5');
INSERT INTO `script_texts` VALUES ('-1000398', 'And try not to get lost this time...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tooga SAY_TORT_POST_6');
INSERT INTO `script_texts` VALUES ('-1000399', 'Peace is but a fleeting dream! Let the NIGHTMARE reign!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'taerar SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000400', 'Children of Madness - I release you upon this world!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'taerar SAY_SUMMONSHADE');
INSERT INTO `script_texts` VALUES ('-1000401', 'Hope is a DISEASE of the soul! This land shall wither and die!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'emeriss SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000402', 'Taste your world\'s corruption!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'emeriss SAY_CASTCORRUPTION');
INSERT INTO `script_texts` VALUES ('-1000403', 'Rin\'ji is free!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_RIN_FREE');
INSERT INTO `script_texts` VALUES ('-1000404', 'Attack my sisters! The troll must not escape!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_RIN_BY_OUTRUNNER');
INSERT INTO `script_texts` VALUES ('-1000405', 'Rin\'ji needs help!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'SAY_RIN_HELP_1');
INSERT INTO `script_texts` VALUES ('-1000406', 'Rin\'ji is being attacked!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'SAY_RIN_HELP_2');
INSERT INTO `script_texts` VALUES ('-1000407', 'Rin\'ji can see road now, $n. Rin\'ji knows the way home.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'SAY_RIN_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000408', 'Rin\'ji will tell you secret now... $n, should go to the Overlook Cliffs. Rin\'ji hid something on island  there', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'SAY_RIN_PROGRESS_1');
INSERT INTO `script_texts` VALUES ('-1000409', 'You find it, you keep it! Don\'t tell no one that Rin\'ji talked to you!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'SAY_RIN_PROGRESS_2');
INSERT INTO `script_texts` VALUES ('-1000410', 'Here they come! Defend yourself!', null, null, null, null, null, null, null, null, '0', '0', '1', '5', 'kanati SAY_KAN_START');
INSERT INTO `script_texts` VALUES ('-1000411', 'Why don\'t we deal with you now, Hendel? Lady Proudmoore will speak for you back in the tower.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'hendel SAY_PROGRESS_1_TER');
INSERT INTO `script_texts` VALUES ('-1000412', 'Please... please... Miss Proudmore. I didn\'t mean to...', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'hendel SAY_PROGRESS_2_HEN');
INSERT INTO `script_texts` VALUES ('-1000413', 'I apologize for taking so long to get here. I wanted Lady Proudmoore to be present also.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'hendel SAY_PROGRESS_3_TER');
INSERT INTO `script_texts` VALUES ('-1000414', 'We can only stay a few moments before returning to the tower. If you wish to speak to us more you may find us there.', null, null, null, null, null, null, null, null, '0', '0', '7', '0', 'hendel SAY_PROGRESS_4_TER');
INSERT INTO `script_texts` VALUES ('-1000415', '%s, too injured, gives up the chase.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'hendel EMOTE_SURRENDER');
INSERT INTO `script_texts` VALUES ('-1000416', 'Well, I\'m not sure how far I\'ll make it in this state... I\'m feeling kind of faint...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_RIN_START_1');
INSERT INTO `script_texts` VALUES ('-1000417', 'Remember, if I faint again, the water that Spraggle gave you will revive me.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_RIN_START_2');
INSERT INTO `script_texts` VALUES ('-1000418', 'The heat... I can\'t take it...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_FAINT_1');
INSERT INTO `script_texts` VALUES ('-1000419', 'Maybe... you could carry me?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_FAINT_2');
INSERT INTO `script_texts` VALUES ('-1000420', 'Uuuuuuggggghhhhh....', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_FAINT_3');
INSERT INTO `script_texts` VALUES ('-1000421', 'I\'m not feeling so well...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_FAINT_4');
INSERT INTO `script_texts` VALUES ('-1000422', 'Where... Where am I?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_WAKE_1');
INSERT INTO `script_texts` VALUES ('-1000423', 'I am feeling a little better now, thank you.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_WAKE_2');
INSERT INTO `script_texts` VALUES ('-1000424', 'Yes, I must go on.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_WAKE_3');
INSERT INTO `script_texts` VALUES ('-1000425', 'How am I feeling? Quite soaked, thank you.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_WAKE_4');
INSERT INTO `script_texts` VALUES ('-1000426', 'Spraggle! I didn\'t think I\'d make it back!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_RIN_END_1');
INSERT INTO `script_texts` VALUES ('-1000427', 'Ringo! You\'re okay!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_SPR_END_2');
INSERT INTO `script_texts` VALUES ('-1000428', 'Oh... I\'m feeling faint...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_RIN_END_3');
INSERT INTO `script_texts` VALUES ('-1000429', '%s collapses onto the ground.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ringo EMOTE_RIN_END_4');
INSERT INTO `script_texts` VALUES ('-1000430', '%s stands up after a short pause.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ringo EMOTE_RIN_END_5');
INSERT INTO `script_texts` VALUES ('-1000431', 'Ugh.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_RIN_END_6');
INSERT INTO `script_texts` VALUES ('-1000432', 'Ringo? Wake up! Don\'t worry, I\'ll take care of you.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ringo SAY_SPR_END_7');
INSERT INTO `script_texts` VALUES ('-1000433', '%s fades away after a long pause.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ringo EMOTE_RIN_END_8');
INSERT INTO `script_texts` VALUES ('-1000434', 'Liladris has been waiting for me at Maestra\'s Post, so we should make haste, $N.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_START');
INSERT INTO `script_texts` VALUES ('-1000435', '%s looks very sleepy...', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kerlonian EMOTE_KER_SLEEP_1');
INSERT INTO `script_texts` VALUES ('-1000436', '%s suddenly falls asleep', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kerlonian EMOTE_KER_SLEEP_2');
INSERT INTO `script_texts` VALUES ('-1000437', '%s begins to drift off...', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kerlonian EMOTE_KER_SLEEP_3');
INSERT INTO `script_texts` VALUES ('-1000438', 'This looks like the perfect place for a nap...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_SLEEP_1');
INSERT INTO `script_texts` VALUES ('-1000439', 'Yaaaaawwwwwnnnn...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_SLEEP_2');
INSERT INTO `script_texts` VALUES ('-1000440', 'Oh, I am so tired...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_SLEEP_3');
INSERT INTO `script_texts` VALUES ('-1000441', 'You don\'t mind if I stop here for a moment, do you?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_SLEEP_4');
INSERT INTO `script_texts` VALUES ('-1000442', 'Be on the alert! The Blackwood furbolgs are numerous in the area...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_ALERT_1');
INSERT INTO `script_texts` VALUES ('-1000443', 'It\'s quiet... Too quiet...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_ALERT_2');
INSERT INTO `script_texts` VALUES ('-1000444', 'Oh, I can see Liladris from here... Tell her I\'m here, won\'t you?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'kerlonian SAY_KER_END');
INSERT INTO `script_texts` VALUES ('-1000445', '%s wakes up!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kerlonian EMOTE_KER_AWAKEN');
INSERT INTO `script_texts` VALUES ('-1000446', 'A-Me good. Good, A-Me. Follow... follow A-Me. Home. A-Me go home.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ame01 SAY_AME_START');
INSERT INTO `script_texts` VALUES ('-1000447', 'Good... good, A-Me. A-Me good. Home. Find home.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ame01 SAY_AME_PROGRESS');
INSERT INTO `script_texts` VALUES ('-1000448', 'A-Me home! A-Me good! Good A-Me. Home. Home. Home.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ame01 SAY_AME_END');
INSERT INTO `script_texts` VALUES ('-1000449', '$c, no hurt A-Me. A-Me good.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ame01 SAY_AME_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1000450', 'Danger. Danger! $c try hurt A-Me.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ame01 SAY_AME_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1000451', 'Bad, $c. $c, bad!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ame01 SAY_AME_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1000452', 'I noticed some fire on that island over there. A human, too. Let\'s go check it out, $n.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'ogron SAY_OGR_START');
INSERT INTO `script_texts` VALUES ('-1000453', 'That\'s Reethe alright. Let\'s go see what he has to say, yeah?', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'ogron SAY_OGR_SPOT');
INSERT INTO `script_texts` VALUES ('-1000454', 'W-what do you want? Just leave me alone...', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'ogron SAY_OGR_RET_WHAT');
INSERT INTO `script_texts` VALUES ('-1000455', 'I swear. I didn\'t steal anything from you! Here, take some of my supplies, just go away!', null, null, null, null, null, null, null, null, '0', '0', '0', '27', 'ogron SAY_OGR_RET_SWEAR');
INSERT INTO `script_texts` VALUES ('-1000456', 'Just tell us what you know about the Shady Rest Inn, and I won\'t bash your skull in.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'ogron SAY_OGR_REPLY_RET');
INSERT INTO `script_texts` VALUES ('-1000457', 'I... Well, I may of taken a little thing or two from the inn... but what would an ogre care about that?', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'ogron SAY_OGR_RET_TAKEN');
INSERT INTO `script_texts` VALUES ('-1000458', 'Look here, if you don\'t tell me about the fire--', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'ogron SAY_OGR_TELL_FIRE');
INSERT INTO `script_texts` VALUES ('-1000459', 'Not one step closer, ogre!', null, null, null, null, null, null, null, null, '0', '0', '0', '27', 'ogron SAY_OGR_RET_NOCLOSER');
INSERT INTO `script_texts` VALUES ('-1000460', 'And I don\'t know anything about this fire of yours...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ogron SAY_OGR_RET_NOFIRE');
INSERT INTO `script_texts` VALUES ('-1000461', 'What was that? Did you hear something?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ogron SAY_OGR_RET_HEAR');
INSERT INTO `script_texts` VALUES ('-1000462', 'Paval Reethe! Found you at last. And consorting with ogres now? No fear, even deserters and traitors are afforded some mercy.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ogron SAY_OGR_CAL_FOUND');
INSERT INTO `script_texts` VALUES ('-1000463', 'Private, show Lieutenant Reethe some mercy.', null, null, null, null, null, null, null, null, '0', '0', '0', '29', 'ogron SAY_OGR_CAL_MERCY');
INSERT INTO `script_texts` VALUES ('-1000464', 'Gladly, sir.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ogron SAY_OGR_HALL_GLAD');
INSERT INTO `script_texts` VALUES ('-1000465', '%s staggers backwards as the arrow lodges itself deeply in his chest.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ogron EMOTE_OGR_RET_ARROW');
INSERT INTO `script_texts` VALUES ('-1000466', 'Ugh... Hallan, didn\'t think you had it in you...', null, null, null, null, null, null, null, null, '0', '0', '0', '34', 'ogron SAY_OGR_RET_ARROW');
INSERT INTO `script_texts` VALUES ('-1000467', 'Now, let\'s clean up the rest of the trash, men!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ogron SAY_OGR_CAL_CLEANUP');
INSERT INTO `script_texts` VALUES ('-1000468', 'Damn it! You\'d better not die on me, human!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'ogron SAY_OGR_NODIE');
INSERT INTO `script_texts` VALUES ('-1000469', 'Still with us, Reethe?', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'ogron SAY_OGR_SURVIVE');
INSERT INTO `script_texts` VALUES ('-1000470', 'Must be your lucky day. Alright, I\'ll talk. Just leave me alone. Look, you\'re not going to believe me, but it wa... oh, Light, looks like the girl could shoot...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ogron SAY_OGR_RET_LUCKY');
INSERT INTO `script_texts` VALUES ('-1000471', 'By the way, thanks for watching my back.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'ogron SAY_OGR_THANKS');
INSERT INTO `script_texts` VALUES ('-1000472', '1...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'mana bomb SAY_COUNT_1');
INSERT INTO `script_texts` VALUES ('-1000473', '2...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'mana bomb SAY_COUNT_2');
INSERT INTO `script_texts` VALUES ('-1000474', '3...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'mana bomb SAY_COUNT_3');
INSERT INTO `script_texts` VALUES ('-1000475', '4...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'mana bomb SAY_COUNT_4');
INSERT INTO `script_texts` VALUES ('-1000476', '5...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'mana bomb SAY_COUNT_5');
INSERT INTO `script_texts` VALUES ('-1000477', 'Let us leave this place. I\'ve had enough of these madmen!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'akuno SAY_AKU_START');
INSERT INTO `script_texts` VALUES ('-1000478', 'You\'ll go nowhere, fool!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'akuno SAY_AKU_AMBUSH_A');
INSERT INTO `script_texts` VALUES ('-1000479', 'Beware! More cultists come!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'akuno SAY_AKU_AMBUSH_B');
INSERT INTO `script_texts` VALUES ('-1000480', 'You will not escape us so easily!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'akuno SAY_AKU_AMBUSH_B_REPLY');
INSERT INTO `script_texts` VALUES ('-1000481', 'I can find my way from here. My friend Mekeda will reward you for your kind actions.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'akuno SAY_AKU_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000482', 'Look out!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maghar captive SAY_MAG_START');
INSERT INTO `script_texts` VALUES ('-1000483', 'Don\'t let them escape! Kill the strong one first!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maghar captive SAY_MAG_NO_ESCAPE');
INSERT INTO `script_texts` VALUES ('-1000484', 'More of them coming! Watch out!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maghar captive SAY_MAG_MORE');
INSERT INTO `script_texts` VALUES ('-1000485', 'Where do you think you\'re going? Kill them all!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maghar captive SAY_MAG_MORE_REPLY');
INSERT INTO `script_texts` VALUES ('-1000486', 'Ride the lightning, filth!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maghar captive SAY_MAG_LIGHTNING');
INSERT INTO `script_texts` VALUES ('-1000487', 'FROST SHOCK!!!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maghar captive SAY_MAG_SHOCK');
INSERT INTO `script_texts` VALUES ('-1000488', 'It is best that we split up now, in case they send more after us. Hopefully one of us will make it back to Garrosh. Farewell stranger.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maghar captive SAY_MAG_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000489', 'Show our guest around Shattrath, will you? Keep an eye out for pickpockets in the lower city.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_START');
INSERT INTO `script_texts` VALUES ('-1000490', 'A newcomer to Shattrath! Make sure to drop by later. We can always use a hand with the injured.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_INJURED');
INSERT INTO `script_texts` VALUES ('-1000491', 'Be mindful of what you say, this one\'s being shown around by Khadgar\'s pet.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_MIND_YOU');
INSERT INTO `script_texts` VALUES ('-1000492', 'Are you joking? I\'m a Scryer, I always watch what i say. More enemies than allies in this city, it seems.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_MIND_ALWAYS');
INSERT INTO `script_texts` VALUES ('-1000493', 'Light be with you, $n. And welcome to Shattrath.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_ALDOR_GREET');
INSERT INTO `script_texts` VALUES ('-1000494', 'We\'re rather selective of who we befriend, $n. You think you have what it takes?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_SCRYER_GREET');
INSERT INTO `script_texts` VALUES ('-1000495', 'Khadgar himself is showing you around? You must have made a good impression, $n.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_KHAD_HAGGARD');
INSERT INTO `script_texts` VALUES ('-1000496', '%s lifts its head into the air, as if listening for something.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ancestral wolf EMOTE_WOLF_LIFT_HEAD');
INSERT INTO `script_texts` VALUES ('-1000497', '%s lets out a howl that rings across the mountains to the north and motions for you to follow.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ancestral wolf EMOTE_WOLF_HOWL');
INSERT INTO `script_texts` VALUES ('-1000498', 'Welcome, kind spirit. What has brought you to us?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ancestral wolf SAY_WOLF_WELCOME');
INSERT INTO `script_texts` VALUES ('-1000499', 'Puny $r wanna fight %s? Me beat you! Me boss here!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'morokk SAY_MOR_CHALLENGE');
INSERT INTO `script_texts` VALUES ('-1000500', 'Me scared! Me run now!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'morokk SAY_MOR_SCARED');
INSERT INTO `script_texts` VALUES ('-1000501', 'Are you sure that you are ready? If we do not have a group of your allies to aid us, we will surely fail.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_START1');
INSERT INTO `script_texts` VALUES ('-1000502', 'This will be a though fight, $n. Follow me closely.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_START2');
INSERT INTO `script_texts` VALUES ('-1000503', 'This is the brazier, $n. Put it out. Vorsha is a beast, worthy of praise from no one!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_BRAZIER');
INSERT INTO `script_texts` VALUES ('-1000504', 'Now we must wait. It won\'t be long before the naga realize what we have done.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_BRAZIER_WAIT');
INSERT INTO `script_texts` VALUES ('-1000505', 'Be on your guard, $n!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_ON_GUARD');
INSERT INTO `script_texts` VALUES ('-1000506', 'Perhaps we will get a moment to rest. But i will not give up until we have faced off against Vorsha!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_REST');
INSERT INTO `script_texts` VALUES ('-1000507', 'We have done it!', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_DONE');
INSERT INTO `script_texts` VALUES ('-1000508', 'You have my deepest gratitude. I thank you.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_GRATITUDE');
INSERT INTO `script_texts` VALUES ('-1000509', 'I am going to patrol the area for a while longer and ensure that things are truly safe.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_PATROL');
INSERT INTO `script_texts` VALUES ('-1000510', 'Please return to Zoram\'gar and report our success to the Warsong runner.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'muglash SAY_MUG_RETURN');
INSERT INTO `script_texts` VALUES ('-1000511', 'Aright, listen up! Form a circle around me and move out!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_START');
INSERT INTO `script_texts` VALUES ('-1000512', 'Aright, $r, just keep us safe from harm while we work. We\'ll pay you when we return.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_KEEP_SAFE');
INSERT INTO `script_texts` VALUES ('-1000513', 'The dig site is just north of here.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_NORTH');
INSERT INTO `script_texts` VALUES ('-1000514', 'We\'re here! Start diggin\'!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_ARRIVE');
INSERT INTO `script_texts` VALUES ('-1000515', 'I think there\'s somethin\' buried here, beneath the sand!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_BURIED');
INSERT INTO `script_texts` VALUES ('-1000516', 'Almost got it!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_ALMOST');
INSERT INTO `script_texts` VALUES ('-1000517', 'By brann\'s brittle bananas! What is it!? It... It looks like a drum.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_DRUM');
INSERT INTO `script_texts` VALUES ('-1000518', 'Wow... a drum.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_DRUM_REPLY');
INSERT INTO `script_texts` VALUES ('-1000519', 'This discovery will surely rock the foundation of modern archaeology.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_DISCOVERY');
INSERT INTO `script_texts` VALUES ('-1000520', 'Yea, great. Can we leave now? This desert is giving me hives.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_DISCOVERY_REPLY');
INSERT INTO `script_texts` VALUES ('-1000521', 'Have ye gone mad? You expect me to leave behind a drum without first beatin\' on it? Not this son of Ironforge! No sir!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_NO_LEAVE');
INSERT INTO `script_texts` VALUES ('-1000522', 'This reminds me of that one time where you made us search Silithus for evidence of sand gnomes.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_NO_LEAVE_REPLY1');
INSERT INTO `script_texts` VALUES ('-1000523', 'Or that time when you told us that you\'d discovered the cure for the plague of the 20th century. What is that even? 20th century?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_NO_LEAVE_REPLY2');
INSERT INTO `script_texts` VALUES ('-1000524', 'I don\'t think it can top the one time where he told us that he\'d heard that Artha\'s \"cousin\'s\" skeleton was frozen beneath a glacier in Winterspring. I\'ll never forgive you for that one, Letoll. I mean honestly... Artha\'s cousin?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_NO_LEAVE_REPLY3');
INSERT INTO `script_texts` VALUES ('-1000525', 'I dunno. It can\'t possibly beat the time he tried to convince us that we\'re all actually a figment of some being\'s imagination and that they only use us for their own personal amusement. That went over well during dinner with the family.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_NO_LEAVE_REPLY4');
INSERT INTO `script_texts` VALUES ('-1000526', 'Shut yer yaps! I\'m gonna bang on this drum and that\'s that!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_SHUT');
INSERT INTO `script_texts` VALUES ('-1000527', 'Say, do you guys hear that?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_REPLY_HEAR');
INSERT INTO `script_texts` VALUES ('-1000528', 'IN YOUR FACE! I told you there was somethin\' here!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_IN_YOUR_FACE');
INSERT INTO `script_texts` VALUES ('-1000529', 'Don\'t just stand there! Help him out!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_HELP_HIM');
INSERT INTO `script_texts` VALUES ('-1000530', '%s picks up the drum.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'letoll EMOTE_LE_PICK_UP');
INSERT INTO `script_texts` VALUES ('-1000531', 'You\'ve been a tremendous help, $r! Let\'s get out of here before more of those things show up! I\'ll let Dwarfowitz know you did the job asked of ya\' admirably.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'letoll SAY_LE_THANKS');
INSERT INTO `script_texts` VALUES ('-1000532', 'At your command, my liege...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'torloth TORLOTH_DIALOGUE1');
INSERT INTO `script_texts` VALUES ('-1000533', 'As you desire, Lord Illidan.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'torloth TORLOTH_DIALOGUE2');
INSERT INTO `script_texts` VALUES ('-1000534', 'Yes, Lord Illidan, I would sacrifice to you this magnificent physique. On this day you will fall - another victim of Torloth...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'torloth TORLOTH_DIALOGUE3');
INSERT INTO `script_texts` VALUES ('-1000535', 'Destroy them, Torloth. Let lose their blood like a river upon this hallowed ground.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'lordillidan ILLIDAN_DIALOGUE');
INSERT INTO `script_texts` VALUES ('-1000536', 'What manner of fool dares stand before Illidan Stormrage? Soldiers, destroy these insects!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'lordillidan ILLIDAN_SUMMON1');
INSERT INTO `script_texts` VALUES ('-1000537', 'You are no challenge for the Crimson Sigil. Mind breakers, end this nonsense.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'lordillidan ILLIDAN_SUMMON2');
INSERT INTO `script_texts` VALUES ('-1000538', 'Run while you still can. The highlords come soon...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'lordillidan ILLIDAN_SUMMON3');
INSERT INTO `script_texts` VALUES ('-1000539', 'Torloth your master calls!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'lordillidan ILLIDAN_SUMMON4');
INSERT INTO `script_texts` VALUES ('-1000540', 'So you have defeated the Crimson Sigil. You now seek to challenge my rule? Not even Arthas could defeat me, yet you dare to even harbor such thoughts? Then I say to you, come! Come $N! The Black Temple awaits...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'lordillidan EVENT_COMPLETED');
INSERT INTO `script_texts` VALUES ('-1000541', '%s jumps into the moonwell and goes underwater...', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kitten EMOTE_SAB_JUMP');
INSERT INTO `script_texts` VALUES ('-1000542', '%s follows $n obediertly.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'kitten EMOTE_SAB_FOLLOW');
INSERT INTO `script_texts` VALUES ('-1000543', 'Why have you come here, outsider? You will only find pain! Our fate will be yours...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_1');
INSERT INTO `script_texts` VALUES ('-1000544', 'It was ... terrible... the demon...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_2');
INSERT INTO `script_texts` VALUES ('-1000545', 'The darkness... the corruption... they came too quickly for anyone to know...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_3');
INSERT INTO `script_texts` VALUES ('-1000546', 'The darkness will consume all... all the living...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_4');
INSERT INTO `script_texts` VALUES ('-1000547', 'It is too late for us, living one. Take yourself and your friend away from here before you both are... claimed...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_5');
INSERT INTO `script_texts` VALUES ('-1000548', 'It is too late for Jarl... its hold is too strong...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_6');
INSERT INTO `script_texts` VALUES ('-1000549', 'Go away, whoever you are! Witch Hill is mine... mine!', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_7');
INSERT INTO `script_texts` VALUES ('-1000550', 'The manor... someone else... will soon be consumed...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'restless app SAY_RAND_8');
INSERT INTO `script_texts` VALUES ('-1000551', 'The %s is angered by your request and attacks!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'woodlands EMOTE_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000552', 'Breaking off a piece of its bark, the %s hands it to you before departing.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'woodlands EMOTE_CREATE');
INSERT INTO `script_texts` VALUES ('-1000553', 'Be ready, $N. I hear the council returning. Prepare to ambush!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'deathstalker_faerleia SAY_START');
INSERT INTO `script_texts` VALUES ('-1000554', 'Well done. A blow to Arugal no doubt!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'deathstalker_faerleia SAY_END');
INSERT INTO `script_texts` VALUES ('-1000555', 'Back... to work...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'exhausted vrykul SAY_RAND_WORK1');
INSERT INTO `script_texts` VALUES ('-1000556', 'You treat us worse than animals!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'exhausted vrykul SAY_RAND_WORK2');
INSERT INTO `script_texts` VALUES ('-1000557', 'We will have revenge...some day.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'exhausted vrykul SAY_RAND_WORK3');
INSERT INTO `script_texts` VALUES ('-1000558', 'Curse you! You will not treat me like a beast!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'exhausted vrykul SAY_RAND_ATTACK1');
INSERT INTO `script_texts` VALUES ('-1000559', 'I\'d rather die fighting than live like a slave.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'exhausted vrykul SAY_RAND_ATTACK2');
INSERT INTO `script_texts` VALUES ('-1000560', 'Enough! I will teach you some manners, wench!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'exhausted vrykul SAY_RAND_ATTACK3');
INSERT INTO `script_texts` VALUES ('-1000561', 'My wounds are grave. Forgive my slow pace but my injuries won\'t allow me to walk any faster.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_CORPORAL_KEESHAN_1');
INSERT INTO `script_texts` VALUES ('-1000562', 'Ah, fresh air, at last! I need a moment to rest.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_CORPORAL_KEESHAN_2');
INSERT INTO `script_texts` VALUES ('-1000563', 'The Blackrock infestation is thick in these parts. I will do my best to keep the pace. Let\'s go!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_CORPORAL_KEESHAN_3');
INSERT INTO `script_texts` VALUES ('-1000564', 'Marshal Marris, sir. Corporal Keeshan of the 12th Sabre Regiment returned from battle and reporting for duty!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_CORPORAL_KEESHAN_4');
INSERT INTO `script_texts` VALUES ('-1000565', 'Brave adventurer, thank you for rescuing me! I am sure Marshal Marris will reward your kind deed.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_CORPORAL_KEESHAN_5');
INSERT INTO `script_texts` VALUES ('-1000566', 'Stand back! Stand clear! The infernal will need to be given a wide berth!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_NIBY_1');
INSERT INTO `script_texts` VALUES ('-1000567', 'BOW DOWN TO THE ALMIGHTY! BOW DOWN BEFORE MY INFERNAL DESTRO... chicken?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_NIBY_2');
INSERT INTO `script_texts` VALUES ('-1000568', '%s rolls on the floor laughing.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_IMPSY_1');
INSERT INTO `script_texts` VALUES ('-1000569', 'Niby, you\' re an idiot.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_IMPSY_1');
INSERT INTO `script_texts` VALUES ('-1000570', 'Silence, servant! Vengeance will be mine! Death to Stormwind! Death by chicken!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_NIBY_3');
INSERT INTO `script_texts` VALUES ('-1000571', 'Help! I\'ve only one hand to defend myself with.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_MIRAN_1');
INSERT INTO `script_texts` VALUES ('-1000572', 'Feel the power of the Dark Iron Dwarves!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_DARK_IRON_DWARF');
INSERT INTO `script_texts` VALUES ('-1000573', 'Send them on! I\'m not afraid of some scrawny beasts!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_MIRAN_2');
INSERT INTO `script_texts` VALUES ('-1000574', 'Ah, here at last! It\'s going to feel so good to get rid of these barrels.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_MIRAN_3');
INSERT INTO `script_texts` VALUES ('-1000575', 'Together we will fight our way out of here. Are you ready?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Lurgglbr - SAY_START_1');
INSERT INTO `script_texts` VALUES ('-1000576', 'Then we leave.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Lurgglbr - SAY_START_2');
INSERT INTO `script_texts` VALUES ('-1000577', 'This is far enough. I can make it on my own from here.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Lurgglbr - SAY_END_1');
INSERT INTO `script_texts` VALUES ('-1000578', 'Thank you for helping me $r. Please tell the king I am back.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Lurgglbr - SAY_END_2');
INSERT INTO `script_texts` VALUES ('-1000579', 'Insolent fool! You thought to steal Zelemar\'s blood? You shall pay with your own!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'Zelemar the Wrathful - Aggro');
INSERT INTO `script_texts` VALUES ('-1000580', 'Sleep now, young one ...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Raelorasz SAY_SLEEP');
INSERT INTO `script_texts` VALUES ('-1000581', 'A wonderful specimen.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Raeloarsz SAY_SPECIMEN');
INSERT INTO `script_texts` VALUES ('-1000582', 'Help! Please, You must help me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Galen - periodic say');
INSERT INTO `script_texts` VALUES ('-1000583', 'Let us leave this place.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Galen - quest accepted');
INSERT INTO `script_texts` VALUES ('-1000584', 'Look out! The $c attacks!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Galen - aggro 1');
INSERT INTO `script_texts` VALUES ('-1000585', 'Help! I\'m under attack!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Galen - aggro 2');
INSERT INTO `script_texts` VALUES ('-1000586', 'Thank you $N. I will remember you always. You can find my strongbox in my camp, north of Stonard.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Galen - quest complete');
INSERT INTO `script_texts` VALUES ('-1000587', '%s whispers to $N the secret to opening his strongbox.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'Galen - emote whisper');
INSERT INTO `script_texts` VALUES ('-1000588', '%s disappears into the swamp.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'Galen - emote disapper');
INSERT INTO `script_texts` VALUES ('-1000589', 'Kroshius live? Kroshius crush!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'SAY_KROSHIUS_REVIVE');
INSERT INTO `script_texts` VALUES ('-1000590', 'Woot!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Captive Child SAY_THANKS_1');
INSERT INTO `script_texts` VALUES ('-1000591', 'I think those weird bird guys were going to eat us. Gross!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Captive Child SAY_THANKS_2');
INSERT INTO `script_texts` VALUES ('-1000592', 'Yay! We\'re free!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Captive Child SAY_THANKS_3');
INSERT INTO `script_texts` VALUES ('-1000593', 'Gross!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Captive Child SAY_THANKS_4');
INSERT INTO `script_texts` VALUES ('-1000594', 'At last... now I can rest.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hero spirit SAY_BLESS_1');
INSERT INTO `script_texts` VALUES ('-1000595', 'I\'m so tired. Just let me rest for a moment.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hero spirit SAY_BLESS_2');
INSERT INTO `script_texts` VALUES ('-1000596', 'I can\'t hear the screams anymore. Is this the end?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hero spirit SAY_BLESS_3');
INSERT INTO `script_texts` VALUES ('-1000597', 'My nightmare, is it finally over?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hero spirit SAY_BLESS_4');
INSERT INTO `script_texts` VALUES ('-1000598', 'It was awful... I dreamt I was fighting against my friends.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hero spirit SAY_BLESS_5');
INSERT INTO `script_texts` VALUES ('-1000599', 'It\'s a miracle! The beast skinned itself!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'nesingwary trapper SAY_PHRASE_1');
INSERT INTO `script_texts` VALUES ('-1000600', 'Jackpot!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'nesingwary trapper SAY_PHRASE_2');
INSERT INTO `script_texts` VALUES ('-1000601', 'This is the last one i need for that set of Nesingwary steak knives!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'nesingwary trapper SAY_PHRASE_3');
INSERT INTO `script_texts` VALUES ('-1000602', 'Silly beasts!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'nesingwary trapper SAY_PHRASE_4');
INSERT INTO `script_texts` VALUES ('-1000603', 'Do not test me, scurvy dog! I\'m trained in the way of the Blood Knights!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'silvermoon harry SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000604', 'I\'ll pay! I\'ll pay! Eeeek! Please don\'t hurt me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'silvermoon harry SAY_BEATEN');
INSERT INTO `script_texts` VALUES ('-1000605', 'We wait until you ready.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'rainspeaker SAY_ACCEPT');
INSERT INTO `script_texts` VALUES ('-1000606', 'Home time!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'rainspeaker SAY_START');
INSERT INTO `script_texts` VALUES ('-1000607', 'Thanks!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'rainspeaker SAY_END_1');
INSERT INTO `script_texts` VALUES ('-1000608', 'Oh no! Some puppy-men followed!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'rainspeaker SAY_END_2');
INSERT INTO `script_texts` VALUES ('-1000609', 'Dumb big-tongue lover! You not friend of Frenzyheart no more. Frenzyheart will get you good.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'rainspeaker SAY_TRACKER');
INSERT INTO `script_texts` VALUES ('-1000610', 'The mosswalker victim groans in pain.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'mosswalker victim EMOTE_PAIN');
INSERT INTO `script_texts` VALUES ('-1000611', 'Maybe you make weather better too?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_RESCUE_1');
INSERT INTO `script_texts` VALUES ('-1000612', 'We saved. You nice, dryskin.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_RESCUE_2');
INSERT INTO `script_texts` VALUES ('-1000613', 'You save us! Yay for you!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_RESCUE_3');
INSERT INTO `script_texts` VALUES ('-1000614', 'Thank you! You good!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_RESCUE_4');
INSERT INTO `script_texts` VALUES ('-1000615', 'Use my shinies...make weather good again...make undead things go away.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_DIE_1');
INSERT INTO `script_texts` VALUES ('-1000616', 'We gave shinies to shrine... we not greedy... why this happen?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_DIE_2');
INSERT INTO `script_texts` VALUES ('-1000617', 'I do something bad? I sorry....', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_DIE_3');
INSERT INTO `script_texts` VALUES ('-1000618', 'We not do anything... to them... I no understand.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_DIE_4');
INSERT INTO `script_texts` VALUES ('-1000619', 'Thank...you.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_DIE_5');
INSERT INTO `script_texts` VALUES ('-1000620', 'Please take... my shinies. All done...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'mosswalker victim SAY_DIE_6');
INSERT INTO `script_texts` VALUES ('-1000621', 'All systems on-line.  Prepare yourself, we leave shortly.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maxx SAY_START');
INSERT INTO `script_texts` VALUES ('-1000622', 'Be careful in there and come back in one piece!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maxx SAY_ALLEY_FAREWELL');
INSERT INTO `script_texts` VALUES ('-1000623', 'Proceed.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maxx SAY_CONTINUE');
INSERT INTO `script_texts` VALUES ('-1000624', 'You\'re back!  Were you able to get all of the machines?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maxx SAY_ALLEY_FINISH');
INSERT INTO `script_texts` VALUES ('-1000625', '%s gathers the warp chaser\'s blood.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'zeppit EMOTE_GATHER_BLOOD');
INSERT INTO `script_texts` VALUES ('-1000626', 'Intiating energy collection.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'depleted golem SAY_GOLEM_CHARGE');
INSERT INTO `script_texts` VALUES ('-1000627', 'Energy collection complete.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'depleted golem SAY_GOLEM_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000628', '%s feeds on the freshly-killed warp chaser.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'hungry ray EMOTE_FEED');
INSERT INTO `script_texts` VALUES ('-1000629', '<cough> <cough> Damsel in distress over here!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'isla starmane - SAY_ISLA_PERIODIC_1');
INSERT INTO `script_texts` VALUES ('-1000630', 'Hello? Help?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'isla starmane - SAY_ISLA_PERIODIC_2');
INSERT INTO `script_texts` VALUES ('-1000631', 'Don\'t leave me in here! Cause if you do I will find you!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'isla starmane - SAY_ISLA_PERIODIC_3');
INSERT INTO `script_texts` VALUES ('-1000632', 'Ok, let\'s get out of here!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'isla starmane - SAY_ISLA_START');
INSERT INTO `script_texts` VALUES ('-1000633', 'You sure you\'re ready? Take a moment.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'isla starmane - SAY_ISLA_WAITING');
INSERT INTO `script_texts` VALUES ('-1000634', 'Alright, let\'s do this!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'isla starmane - SAY_ISLA_LEAVE_BUILDING');
INSERT INTO `script_texts` VALUES ('-1000635', 'So then we too are cursed?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ancient vrykul SAY_VRYKUL_CURSED');
INSERT INTO `script_texts` VALUES ('-1000636', '%s points to the infant.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ancient vrykul EMOTE_VRYKUL_POINT');
INSERT INTO `script_texts` VALUES ('-1000637', '%s sobs.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'ancient vrykul EMOTE_VRYKUL_SOB');
INSERT INTO `script_texts` VALUES ('-1000638', 'The gods have forsaken us! We must dispose of it before Ymiron is notified!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ancient vrykul SAY_VRYKUL_DISPOSE');
INSERT INTO `script_texts` VALUES ('-1000639', 'NO! You cannot! I beg of you! It is our child!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ancient vrykul SAY_VRYKUL_BEG');
INSERT INTO `script_texts` VALUES ('-1000640', 'Then what are we to do, wife? The others cannot find out. Should they learn of this aberration, we will all be executed.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ancient vrykul SAY_VRYKUL_WHAT');
INSERT INTO `script_texts` VALUES ('-1000641', 'I... I will hide it. I will hide it until I find it a home, far away from here...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ancient vrykul SAY_VRYKUL_HIDE');
INSERT INTO `script_texts` VALUES ('-1000642', 'It\'s a female.', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'leopard icepaw SAY_ITS_FEMALE');
INSERT INTO `script_texts` VALUES ('-1000643', 'It\'s an angry male!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'leopard icepaw SAY_ITS_MALE');
INSERT INTO `script_texts` VALUES ('-1000644', 'Ouch! That\'s it, I quit the target business!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_LUCKY_HIT_1');
INSERT INTO `script_texts` VALUES ('-1000645', 'My ear! You grazed my ear!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_LUCKY_HIT_2');
INSERT INTO `script_texts` VALUES ('-1000646', 'Not the \'stache! Now I\'m asymmetrical!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'SAY_LUCKY_HIT_3');
INSERT INTO `script_texts` VALUES ('-1000647', 'Good shot!', null, null, null, null, null, null, null, null, '0', '0', '0', '4', 'SAY_LUCKY_HIT_APPLE');
INSERT INTO `script_texts` VALUES ('-1000648', 'Stop whining. You\'ve still got your luck.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_DROSTAN_GOT_LUCKY_1');
INSERT INTO `script_texts` VALUES ('-1000649', 'Bah, it\'s an improvement.', null, null, null, null, null, null, null, null, '0', '0', '0', '11', 'SAY_DROSTAN_GOT_LUCKY_2');
INSERT INTO `script_texts` VALUES ('-1000650', 'Calm down lad, it\'s just a birdshot!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_DROSTAN_HIT_BIRD_1');
INSERT INTO `script_texts` VALUES ('-1000651', 'The only thing hurt is your pride, lad! Buck up!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_DROSTAN_HIT_BIRD_2');
INSERT INTO `script_texts` VALUES ('-1000652', 'Me so hungry! YUM!', null, null, null, null, null, null, null, null, '0', '0', '0', '71', 'dragonmaw peon SAY_PEON_1');
INSERT INTO `script_texts` VALUES ('-1000653', 'Hey... me not feel so good.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dragonmaw peon SAY_PEON_2');
INSERT INTO `script_texts` VALUES ('-1000654', 'You is bad orc... baaad... or... argh!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dragonmaw peon SAY_PEON_3');
INSERT INTO `script_texts` VALUES ('-1000655', 'Time for eating!?', null, null, null, null, null, null, null, null, '0', '0', '0', '71', 'dragonmaw peon SAY_PEON_4');
INSERT INTO `script_texts` VALUES ('-1000656', 'It put the mutton in the stomach!', null, null, null, null, null, null, null, null, '0', '0', '0', '71', 'dragonmaw peon SAY_PEON_5');
INSERT INTO `script_texts` VALUES ('-1000657', 'Let\'s get the hell out of here.', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'helice SAY_HELICE_ACCEPT');
INSERT INTO `script_texts` VALUES ('-1000658', 'Listen up, Venture Company goons! Rule #1: Never keep the prisoner near the explosives.', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'helice SAY_HELICE_EXPLOSIVES_1');
INSERT INTO `script_texts` VALUES ('-1000659', 'Or THIS is what you get.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'helice SAY_HELICE_EXPLODE_1');
INSERT INTO `script_texts` VALUES ('-1000660', 'It\'s getting a little hot over here. Shall we move on?', null, null, null, null, null, null, null, null, '0', '0', '0', '11', 'helice SAY_HELICE_MOVE_ON');
INSERT INTO `script_texts` VALUES ('-1000661', 'Oh, look, it\'s another cartload of explosives! Let\'s help them dispose of it.', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'helice SAY_HELICE_EXPLOSIVES_2');
INSERT INTO `script_texts` VALUES ('-1000662', 'You really shouldn\'t play with this stuff. Someone could get hurt.', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'helice SAY_HELICE_EXPLODE_2');
INSERT INTO `script_texts` VALUES ('-1000663', 'We made it! Thank you for getting me out of that hell hole. Tell Hemet to expect me!', null, null, null, null, null, null, null, null, '0', '0', '0', '4', 'helice SAY_HELICE_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1000664', 'The Destructive Ward gains in power.', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'destructive ward SAY_WARD_POWERUP');
INSERT INTO `script_texts` VALUES ('-1000665', 'The Destructive Ward is fully charged!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'destructive ward SAY_WARD_CHARGED');
INSERT INTO `script_texts` VALUES ('-1000666', 'I can sense the SHADOW on your hearts. There can be no rest for the wicked!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'lethon SAY_LETHON_AGGRO');
INSERT INTO `script_texts` VALUES ('-1000667', 'Your wicked souls shall feed my power!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'lethon SAY_LETHON_SHADE');
INSERT INTO `script_texts` VALUES ('-1000668', '%s releases the last of its energies into the nearby runestone, successfully reactivating it.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'infused crystal SAY_DEFENSE_FINISH');
INSERT INTO `script_texts` VALUES ('-1000669', 'We will locate the origin of the Nightmare through the fragments you collected, $N. From there, we will pull Eranikus through a rift in the Dream. Steel yourself, $C. We are inviting the embodiment of the Nightmare into our world.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1000670', 'To Nighthaven! Keep your army close, champion. ', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1000671', 'The rift will be opened there, above the Lake Elun\'ara. Prepare yourself, $N. Eranikus entry into our world will be wrought with chaos and strife.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1000672', 'He will stop at nothing to get to Malfurion\'s physical manifistation. That must not happen... We must keep the beast occupied long enough for Tyrande to arrive.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1000673', 'Defend Nightaven, hero...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_INTRO_5');
INSERT INTO `script_texts` VALUES ('-1000674', '%s has entered our world', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'eranikus EMOTE_SUMMON_ERANIKUS');
INSERT INTO `script_texts` VALUES ('-1000675', 'Pitful predictable mortals... You know not what you have done! The master\'s will fulfilled. The Moonglade shall be destroyed and Malfurion along with it!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_SPAWN');
INSERT INTO `script_texts` VALUES ('-1000676', 'Fiend! Face the might of Cenarius!', null, null, null, null, null, null, null, null, '0', '1', '0', '1', 'remulos SAY_REMULOS_TAUNT_1');
INSERT INTO `script_texts` VALUES ('-1000677', '%s lets loose a sinister laugh.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'eranikus EMOTE_ERANIKUS_LAUGH');
INSERT INTO `script_texts` VALUES ('-1000678', 'You are certanly not your father, insect. Should it interest me, I would crush you with but a swipe of my claws. Turn Shan\'do Stormrage over to me and your pitiful life will be spared along with the lives of your people.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_TAUNT_2');
INSERT INTO `script_texts` VALUES ('-1000679', 'Who is the predictable one, beast? Surely you did not think that we would summon you on top of Malfurion? Your redemption comes, Eranikus. You will be cleansed of this madness - this corruption.', null, null, null, null, null, null, null, null, '0', '1', '0', '1', 'remulos SAY_REMULOS_TAUNT_3');
INSERT INTO `script_texts` VALUES ('-1000680', 'My redemption? You are bold, little one. My redemption comes by the will of my god.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_TAUNT_4');
INSERT INTO `script_texts` VALUES ('-1000681', '%s roars furiously.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'eranikus EMOTE_ERANIKUS_ATTACK');
INSERT INTO `script_texts` VALUES ('-1000682', 'Hurry, $N! We must find protective cover!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_DEFEND_1');
INSERT INTO `script_texts` VALUES ('-1000683', 'Please, champion, protect our people.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'remulos SAY_REMULOS_DEFEND_2');
INSERT INTO `script_texts` VALUES ('-1000684', 'Rise, servants of the Nightmare! Rise and destroy this world! Let there be no survivors...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_SHADOWS');
INSERT INTO `script_texts` VALUES ('-1000685', 'We will battle these fiends, together! Nighthaven\'s Defenders are also among us. They will fight to the death if asked. Now, quickly, we must drive these aberations back to the Nightmare. Destroy them all!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'remulos SAY_REMULOS_DEFEND_3');
INSERT INTO `script_texts` VALUES ('-1000686', 'Where is your savior? How long can you hold out against my attacks?', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_ATTACK_1');
INSERT INTO `script_texts` VALUES ('-1000687', 'Defeated my minions? Then face me, mortals!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_ATTACK_2');
INSERT INTO `script_texts` VALUES ('-1000688', 'Remulos, look how easy they fall before me? You can stop this, fool. Turn the druid over to me and it will all be over...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_ATTACK_3');
INSERT INTO `script_texts` VALUES ('-1000689', 'Elune, hear my prayers. Grant us serenity! Watch over our fallen...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'tyrande SAY_TYRANDE_APPEAR');
INSERT INTO `script_texts` VALUES ('-1000690', 'Tend to the injuries of the wounded, sisters!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tyrande SAY_TYRANDE_HEAL');
INSERT INTO `script_texts` VALUES ('-1000691', 'Seek absolution, Eranikus. All will be forgiven...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'tyrande SAY_TYRANDE_FORGIVEN_1');
INSERT INTO `script_texts` VALUES ('-1000692', 'You will be forgiven, Eranikus. Elune will always love you. Break free of the bonds that command you!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'tyrande SAY_TYRANDE_FORGIVEN_2');
INSERT INTO `script_texts` VALUES ('-1000693', 'The grasp of the Old Gods is unmoving. He is consumed by their dark thoughts... I... I... I cannot... cannot channel much longer... Elune aide me.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'tyrande SAY_TYRANDE_FORGIVEN_3');
INSERT INTO `script_texts` VALUES ('-1000694', 'IT BURNS! THE PAIN.. SEARING...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_DEFEAT_1');
INSERT INTO `script_texts` VALUES ('-1000695', 'WHY? Why did this happen to... to me? Where were you Tyrande? Where were you when I fell from the grace of Elune?', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_DEFEAT_2');
INSERT INTO `script_texts` VALUES ('-1000696', 'I... I feel... I feel the touch of Elune upon my being once more... She smiles upon me... Yes... I...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'eranikus SAY_ERANIKUS_DEFEAT_3');
INSERT INTO `script_texts` VALUES ('-1000697', '%s is wholly consumed by the Light of Elune. Tranquility sets in over the Moonglade', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'eranikus EMOTE_ERANIKUS_REDEEM');
INSERT INTO `script_texts` VALUES ('-1000698', '%s falls to one knee.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'tyrande EMOTE_TYRANDE_KNEEL');
INSERT INTO `script_texts` VALUES ('-1000699', 'Praise be to Elune... Eranikus is redeemed.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'tyrande SAY_TYRANDE_REDEEMED');
INSERT INTO `script_texts` VALUES ('-1000700', 'For so long, I was lost... The Nightmare\'s corruption had consumed me... And now, you... all of you.. you have saved me. Released me from its grasp.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'eranikus SAY_REDEEMED_1');
INSERT INTO `script_texts` VALUES ('-1000701', 'But... Malfurion, Cenarius, Ysera... They still fight. They need me. I must return to the Dream at once.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'eranikus SAY_REDEEMED_2');
INSERT INTO `script_texts` VALUES ('-1000702', 'My lady, I am unworthy of your prayer. Truly, you are an angel of light. Please, assist me in returning to the barrow den so that I may return to the Dream. I like Malfurion, also have a love awaiting me... I must return to her... to protect her...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'eranikus SAY_REDEEMED_3');
INSERT INTO `script_texts` VALUES ('-1000703', 'And heroes... I hold that which you seek. May it once more see the evil dissolved. Remulos, see to it that our champion receives the shard of the Green Flight.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'eranikus SAY_REDEEMED_4');
INSERT INTO `script_texts` VALUES ('-1000704', 'It will be done, Eranikus. Be well, ancient one.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1000705', 'Let us leave Nighthave, hero. Seek me out at the grove.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'remulos SAY_REMULOS_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1000706', 'Your world shall suffer an unmerciful end. The Nightmare comes for you!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'eranikus SAY_ERANIKUS_KILL');
INSERT INTO `script_texts` VALUES ('-1000707', 'This blue light... It\'s strange. What do you think it means?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_ENTER_OWL_THICKET');
INSERT INTO `script_texts` VALUES ('-1000708', 'We\'ve found it!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_REACH_TORCH_1');
INSERT INTO `script_texts` VALUES ('-1000709', 'Please, light this while I am channeling', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_REACH_TORCH_2');
INSERT INTO `script_texts` VALUES ('-1000710', 'This is the place. Let\'s light it.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_REACH_TORCH_3');
INSERT INTO `script_texts` VALUES ('-1000711', 'Let\'s find the next one.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_AFTER_TORCH_1');
INSERT INTO `script_texts` VALUES ('-1000712', 'We must continue on now.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_AFTER_TORCH_2');
INSERT INTO `script_texts` VALUES ('-1000713', 'It is time for the final step; we must activate the altar.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_REACH_ALTAR_1');
INSERT INTO `script_texts` VALUES ('-1000714', 'I will read the words carved into the stone, and you must find a way to light it.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_REACH_ALTAR_2');
INSERT INTO `script_texts` VALUES ('-1000715', 'The altar is glowing! We have done it!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_RANSHALLA_ALTAR_1');
INSERT INTO `script_texts` VALUES ('-1000716', 'What is happening? Look!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_RANSHALLA_ALTAR_2');
INSERT INTO `script_texts` VALUES ('-1000717', 'It has been many years...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_3');
INSERT INTO `script_texts` VALUES ('-1000718', 'Who has disturbed the altar of the goddess?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_4');
INSERT INTO `script_texts` VALUES ('-1000719', 'Please, priestesses, forgive us for our intrusion. We do not wish any harm here.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_RANSHALLA_ALTAR_5');
INSERT INTO `script_texts` VALUES ('-1000720', 'We only wish to know why the wildkin guard this area...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_RANSHALLA_ALTAR_6');
INSERT INTO `script_texts` VALUES ('-1000721', 'Enu thora\'serador. This is a sacred place.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_7');
INSERT INTO `script_texts` VALUES ('-1000722', 'We will show you...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_8');
INSERT INTO `script_texts` VALUES ('-1000723', 'Look above you; thara dormil dorah...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_9');
INSERT INTO `script_texts` VALUES ('-1000724', 'This gem once allowed direct communication with Elune, herself.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_10');
INSERT INTO `script_texts` VALUES ('-1000725', 'Through the gem, Elune channeled her infinite wisdom...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_11');
INSERT INTO `script_texts` VALUES ('-1000726', 'Realizing that the gem needed to be protected, we turned to the goddess herself.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_12');
INSERT INTO `script_texts` VALUES ('-1000727', 'Soon after, we began to have visions of a creature... A creature with the feathers of an owl, but the will and might of a bear...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_13');
INSERT INTO `script_texts` VALUES ('-1000728', 'It was on that day that the wildkin were given to us. Fierce guardians, the goddess assigned the wildkin to protect all of her sacred places.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_14');
INSERT INTO `script_texts` VALUES ('-1000729', 'Anu\'dorini Talah, Ru shallora enudoril.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Voice of Elune SAY_VOICE_ALTAR_15');
INSERT INTO `script_texts` VALUES ('-1000730', 'But now, many years later, the wildkin have grown more feral, and without the guidance of the goddess, they are confused...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_16');
INSERT INTO `script_texts` VALUES ('-1000731', 'Without a purpose, they wander... But many find their way back to the sacred areas that they once were sworn to protect.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_17');
INSERT INTO `script_texts` VALUES ('-1000732', 'Wildkin are inherently magical; this power was bestowed upon them by the goddess.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_18');
INSERT INTO `script_texts` VALUES ('-1000733', 'Know that wherever you might find them in the world, they are protecting something of importance, as they were entrusted to do so long ago.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_19');
INSERT INTO `script_texts` VALUES ('-1000734', 'Please, remember what we have shown you...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_20');
INSERT INTO `script_texts` VALUES ('-1000735', 'Farewell.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Priestess of Elune SAY_PRIESTESS_ALTAR_21');
INSERT INTO `script_texts` VALUES ('-1000736', 'Thank you for you help, $n. I wish you well in your adventures.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_QUEST_END_1');
INSERT INTO `script_texts` VALUES ('-1000737', 'I want to stay here and reflect on what we have seen. Please see Erelas and tell him what we have learned.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_QUEST_END_2');
INSERT INTO `script_texts` VALUES ('-1000738', '%s begins chanting a strange spell...', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'Ranshalla EMOTE_CHANT_SPELL');
INSERT INTO `script_texts` VALUES ('-1000739', 'Remember, I need your help to properly channel. I will ask you to aid me several times in our path, so please be ready.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Ranshalla SAY_QUEST_START');
INSERT INTO `script_texts` VALUES ('-1000740', 'We must act quickly or shall be lost!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_ANACHRONOS_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1000741', 'My forces cannot overcome the Qiraji defenses. We will not be able to get close enough to place our precious barrier, dragon.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_FANDRAL_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1000742', 'There is a way...', null, null, null, null, null, null, null, null, '0', '0', '0', '22', 'SAY_MERITHRA_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1000743', '%s nods knowingly.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_ARYGOS_NOD');
INSERT INTO `script_texts` VALUES ('-1000744', 'Aye, Fandral, remember these words: Let not your grief guide your faith. These thoughts you hold... dark places you go, night elf.Absolution cannot be had through misguided vengeance.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_CAELESTRASZ_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1000745', '%s glances at her compatriots.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_MERITHRA_GLANCE');
INSERT INTO `script_texts` VALUES ('-1000746', 'We will push him back, Anachronos. This is wow. Uphold your end of this task. Let not your hands falter as you seal our fates behind the barrier.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_MERITHRA_INTRO_5');
INSERT INTO `script_texts` VALUES ('-1000747', 'Succumb to the endless dream, little ones. Let it comsume you!', null, null, null, null, null, null, null, null, '0', '1', '0', '22', 'SAY_MERITHRA_ATTACK_1');
INSERT INTO `script_texts` VALUES ('-1000748', 'Anachronos, the diversion will give you an the young druid time enough to seal the gate. Do not falter. Now, let us see how they deal with chaotic magic.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_ARYGOS_ATTACK_2');
INSERT INTO `script_texts` VALUES ('-1000749', 'Let them feelt the wrath of the blue flight! May Malygos protect me!', null, null, null, null, null, null, null, null, '0', '1', '0', '22', 'SAY_ARYGOS_ATTACK_3');
INSERT INTO `script_texts` VALUES ('-1000750', 'Do not forget sacrifices made on this day, night elf. We have all suffered immensely at the hands of these beasts.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_CAELESTRASZ_ATTACK_4');
INSERT INTO `script_texts` VALUES ('-1000751', 'Alexstrasza, give me the resolve to drive your enemies back.', null, null, null, null, null, null, null, null, '0', '1', '0', '22', 'SAY_CAELESTRASZ_ATTACK_5');
INSERT INTO `script_texts` VALUES ('-1000752', 'NOW,STAGHELM! WE GO NOW! Prepare your magic!', null, null, null, null, null, null, null, null, '0', '0', '0', '22', 'SAY_ANACHRONOS_SEAL_1');
INSERT INTO `script_texts` VALUES ('-1000753', 'It is done, dragon. Lead the way!', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'SAY_FANDRAL_SEAL_2');
INSERT INTO `script_texts` VALUES ('-1000754', 'Stay close.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_ANACHRONOS_SEAL_3');
INSERT INTO `script_texts` VALUES ('-1000755', 'The sands of time will halt, but only for a moment! I will now conjure the barrier.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_ANACHRONOS_SEAL_4');
INSERT INTO `script_texts` VALUES ('-1000756', 'FINISH THE SPELL, STAGHELM! I CANNOT HOLD THE GLYPHS OF WARDING IN PLACE MUCH LONGER! CALL FORTH THE ROOTS!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_ANACHRONOS_SEAL_5');
INSERT INTO `script_texts` VALUES ('-1000757', 'Ancient ones guide my hand... Wake from your slumber! WAKE AND SEAL THIS CURSED PLACE!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_FANDRAL_SEAL_6');
INSERT INTO `script_texts` VALUES ('-1000758', '%s falls to one knee - exhausted.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_FANDRAL_EXHAUSTED');
INSERT INTO `script_texts` VALUES ('-1000759', 'It... It is over, Lord Staghelm. We are victorious. Albeit the cost for this victory was great.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_ANACHRONOS_EPILOGUE_1');
INSERT INTO `script_texts` VALUES ('-1000760', 'There is but one duty that remains', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_ANACHRONOS_EPILOGUE_2');
INSERT INTO `script_texts` VALUES ('-1000761', 'Before I leave this place, I make one final offering for you, Lord Staghelm. Should a time arise in which you must gain entry to this accursed fortress, use the scepter of the shifting sands on the sacred gong. The magic holding the barrier together will dissipate an the horrors of the Ahn\'Qiraj will be unleashed upon the world once more.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_ANACHRONOS_EPILOGUE_3');
INSERT INTO `script_texts` VALUES ('-1000762', '%s hands the Scepter of the Shifting Sands to $N.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_ANACHRONOS_SCEPTER');
INSERT INTO `script_texts` VALUES ('-1000763', 'After the savagery that my people have witnessed and felt, you expect me to accept another burden, dragon? Surely you are mad.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_FANDRAL_EPILOGUE_4');
INSERT INTO `script_texts` VALUES ('-1000764', 'I want nothing to do with Silithus, the Qiraji and least of all, any damed dragons!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_FANDRAL_EPILOGUE_5');
INSERT INTO `script_texts` VALUES ('-1000765', '%s hurls the Scepter of the Shifting Sands into the barrier, shattering it.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_FANDRAL_SHATTER');
INSERT INTO `script_texts` VALUES ('-1000766', 'Lord Staghelm, where are you going? You would shatter our bond for the sake of pride?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_ANACHRONOS_EPILOGUE_6');
INSERT INTO `script_texts` VALUES ('-1000767', 'My son\'s soul will find no comfort in this hollow victory, dragon! I will have him back. Though it takes a millenia. I WILL have my son back!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'SAY_FANDRAL_EPILOGUE_7');
INSERT INTO `script_texts` VALUES ('-1000768', '%s shakes his head in disappointment.', null, null, null, null, null, null, null, null, '0', '2', '0', '25', 'EMOTE_ANACHRONOS_DISPPOINTED');
INSERT INTO `script_texts` VALUES ('-1000769', '%s kneels down to pickup the fragments of the shattered scepter.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'EMOTE_ANACHRONOS_PICKUP');
INSERT INTO `script_texts` VALUES ('-1000770', 'And now you know all that there is to know, mortal', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_ANACHRONOS_EPILOGUE_8');
INSERT INTO `script_texts` VALUES ('-1000771', 'Let\'s go $N!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_QUEST_START');
INSERT INTO `script_texts` VALUES ('-1000772', 'It looks like we\'re in trouble. Look lively, here they come!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_FIRST_AMBUSH_START');
INSERT INTO `script_texts` VALUES ('-1000773', 'Assassins from that cult you found... Let\'s get moving before someone else finds us out here.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_FIRST_AMBUSH_END');
INSERT INTO `script_texts` VALUES ('-1000774', 'Hold! I sense an evil presence... Undead!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_SECOND_AMBUSH_START');
INSERT INTO `script_texts` VALUES ('-1000775', 'A $C! Slaying him would please the master. Attack!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Forsaken Scout SAY_SCOUT_SECOND_AMBUSH');
INSERT INTO `script_texts` VALUES ('-1000776', 'They\'re coming out of the woodwork today. Let\'s keep moving or we may find more things that want me dead.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_SECOND_AMBUSH_END');
INSERT INTO `script_texts` VALUES ('-1000777', 'These three again?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_FINAL_AMBUSH_START');
INSERT INTO `script_texts` VALUES ('-1000778', 'Not quite so sure of yourself without the Purifier, hm?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Balizar the Umbrage SAY_BALIZAR_FINAL_AMBUSH');
INSERT INTO `script_texts` VALUES ('-1000779', 'I\'ll finish you off for good this time!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_FINAL_AMBUSH_ATTACK');
INSERT INTO `script_texts` VALUES ('-1000780', 'Well done! I should be fine on my own from here. Remember to talk to Delgren when you return to Maestra\'s Post in Ashenvale.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Feero Ironhand SAY_QUEST_END');
INSERT INTO `script_texts` VALUES ('-1000781', 'I knew Lurielle would send help! Thank you, friend, and give Lurielle my thanks as well!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Chill Nymph SAY_FREE_1');
INSERT INTO `script_texts` VALUES ('-1000782', 'Where am I? What happend to me? You... you freed me?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Chill Nymph SAY_FREE_2');
INSERT INTO `script_texts` VALUES ('-1000783', 'Thank you. I thought I would die without seeing my sisters again!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Chill Nymph SAY_FREE_3');
INSERT INTO `script_texts` VALUES ('-1000784', 'Thanks $N. Now let\'s get out of here!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'melizza SAY_MELIZZA_START');
INSERT INTO `script_texts` VALUES ('-1000785', 'We made it! Thanks again! I\'m going to run ahead!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'melizza SAY_MELIZZA_FINISH');
INSERT INTO `script_texts` VALUES ('-1000786', 'Hey Hornizz! I\'m back! And there are some people behind me who helped me out of a jam.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'melizza SAY_MELIZZA_1');
INSERT INTO `script_texts` VALUES ('-1000787', 'We\'re going to have to scratch the Maraudines off our list. Too hard to work with...', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'melizza SAY_MELIZZA_2');
INSERT INTO `script_texts` VALUES ('-1000788', 'Well, I\'m off to the Gelkis. They\'re not as dumb as the Maraudines, but they\'re more reasonable.', null, null, null, null, null, null, null, null, '0', '0', '0', '3', 'melizza SAY_MELIZZA_3');
INSERT INTO `script_texts` VALUES ('-1000789', 'Well, now or never I suppose. Remember, once we get to the road safety, return to Terenthis to let him know we escaped.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'volcor SAY_START');
INSERT INTO `script_texts` VALUES ('-1000790', 'We made it, My friend. Remember to find Terenthis and let him know we\'re safe. Thank you again.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'volcor SAY_END');
INSERT INTO `script_texts` VALUES ('-1000791', 'Here they come.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'volcor SAY_FIRST_AMBUSH');
INSERT INTO `script_texts` VALUES ('-1000792', 'We can overcome these foul creatures.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'volcor SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1000793', 'We shall earn our deaths at the very least!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'volcor SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1000794', 'Don\'t give up! Fight, to the death!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'volcor SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1000795', 'OK boss, I get back to tree hitting.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'lazy peon SAY_AWAKE_1');
INSERT INTO `script_texts` VALUES ('-1000796', 'Sleepy... so sleepy...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'lazy peon SAY_AWAKE_2');
INSERT INTO `script_texts` VALUES ('-1033000', 'Follow me and I\'ll open the courtyard door for you.', null, null, null, null, null, null, null, null, '0', '0', '7', '1', 'prisoner ashcrombe SAY_FREE_AS');
INSERT INTO `script_texts` VALUES ('-1033001', 'I have just the spell to get this door open. Too bad the cell doors weren\'t locked so haphazardly.', null, null, null, null, null, null, null, null, '0', '0', '7', '1', 'prisoner ashcrombe SAY_OPEN_DOOR_AS');
INSERT INTO `script_texts` VALUES ('-1033002', 'There it is! Wide open. Good luck to you conquering what lies beyond. I must report back to the Kirin Tor at once!', null, null, null, null, null, null, null, null, '0', '0', '7', '1', 'prisoner ashcrombe SAY_POST_DOOR_AS');
INSERT INTO `script_texts` VALUES ('-1033003', 'Free from this wretched cell at last! Let me show you to the courtyard....', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'prisoner adamant SAY_FREE_AD');
INSERT INTO `script_texts` VALUES ('-1033004', 'You are indeed courageous for wanting to brave the horrors that lie beyond this door.', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'prisoner adamant SAY_OPEN_DOOR_AD');
INSERT INTO `script_texts` VALUES ('-1033005', 'There we go!', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'prisoner adamant SAY_POST1_DOOR_AD');
INSERT INTO `script_texts` VALUES ('-1033006', 'Good luck with Arugal. I must hurry back to Hadrec now.', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'prisoner adamant SAY_POST2_DOOR_AD');
INSERT INTO `script_texts` VALUES ('-1033007', 'About time someone killed the wretch.', null, null, null, null, null, null, null, null, '0', '0', '1', '1', 'prisoner adamant SAY_BOSS_DIE_AD');
INSERT INTO `script_texts` VALUES ('-1033008', 'For once I agree with you... scum.', null, null, null, null, null, null, null, null, '0', '0', '7', '1', 'prisoner ashcrombe SAY_BOSS_DIE_AS');
INSERT INTO `script_texts` VALUES ('-1033009', 'I have changed my mind loyal servants, you do not need to bring the prisoner all the way to my study, I will deal with him here and now.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'arugal SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1033010', 'Vincent!  You and your pathetic ilk will find no more success in routing my sons and I than those beggardly remnants of the Kirin Tor.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'arugal SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1033011', 'If you will not serve my Master with your sword and knowledge of his enemies...', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'arugal SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1033012', 'Your moldering remains will serve ME as a testament to what happens when one is foolish enough to trespass in my domain!\n', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'arugal SAY_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1033013', 'Who dares interfere with the Sons of Arugal?', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'boss_arugal YELL_FENRUS');
INSERT INTO `script_texts` VALUES ('-1033014', '%s vanishes.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'prisoner ashcrombe EMOTE_VANISH_AS');
INSERT INTO `script_texts` VALUES ('-1033015', '%s fumbles with the rusty lock on the courtyard door.', null, null, null, null, null, null, null, null, '0', '2', '0', '432', 'prisoner adamant EMOTE_UNLOCK_DOOR_AD');
INSERT INTO `script_texts` VALUES ('-1033016', 'Arrrgh!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'deathstalker vincent SAY_VINCENT_DIE');
INSERT INTO `script_texts` VALUES ('-1033017', 'You, too, shall serve!', null, null, null, null, null, null, null, null, '5793', '1', '0', '0', 'boss_arugal YELL_AGGRO');
INSERT INTO `script_texts` VALUES ('-1033018', 'Another Falls!', null, null, null, null, null, null, null, null, '5795', '1', '0', '0', 'boss_arugal YELL_KILLED_PLAYER');
INSERT INTO `script_texts` VALUES ('-1033019', 'Release your rage!', null, null, null, null, null, null, null, null, '5797', '1', '0', '0', 'boss_arugal YELL_COMBAT');
INSERT INTO `script_texts` VALUES ('-1033020', 'Did they bother to tell you who I am and why I am doing this?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hummel SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1033021', '...or are they just using you like they do everybody else?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hummel SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1033022', 'But what does it matter. It is time for this to end.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hummel SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1033023', 'Baxter! Get in there and help! NOW!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hummel SAY_CALL_BAXTER');
INSERT INTO `script_texts` VALUES ('-1033024', 'It is time, Frye! Attack!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hummel SAY_CALL_FRYE');
INSERT INTO `script_texts` VALUES ('-1033025', '...please don\'t think less of me.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'hummel SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1036000', 'You there! Check out that noise.', null, null, null, null, null, null, null, null, '5775', '6', '7', '0', 'smite INST_SAY_ALARM1');
INSERT INTO `script_texts` VALUES ('-1036001', 'We\'re under attack!  A vast, ye swabs! Repel the invaders!', null, null, null, null, null, null, null, null, '5777', '6', '7', '0', 'smite INST_SAY_ALARM2');
INSERT INTO `script_texts` VALUES ('-1036002', 'You land lubbers are tougher than I thought! I\'ll have to improvise!', null, null, null, null, null, null, null, null, '5778', '0', '0', '21', 'smite SAY_PHASE_2');
INSERT INTO `script_texts` VALUES ('-1036003', 'D\'ah! Now you\'re making me angry!', null, null, null, null, null, null, null, null, '5779', '0', '0', '15', 'smite SAY_PHASE_3');
INSERT INTO `script_texts` VALUES ('-1043000', 'At last! Naralex can be awakened! Come aid me, brave adventurers!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'Disciple of Naralex - SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1043001', 'I must make the necessary preparations before the awakening ritual can begin. You must protect me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'SAY_PREPARE');
INSERT INTO `script_texts` VALUES ('-1043002', 'These caverns were once a temple of promise for regrowth in the Barrens. Now, they are the halls of nightmares.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_FIRST_CORNER');
INSERT INTO `script_texts` VALUES ('-1043003', 'Come. We must continue. There is much to be done before we can pull Naralex from his nightmare.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_CONTINUE');
INSERT INTO `script_texts` VALUES ('-1043004', 'Within this circle of fire I must cast the spell to banish the spirits of the slain Fanglords.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_CIRCLE_BANISH');
INSERT INTO `script_texts` VALUES ('-1043005', 'The caverns have been purified. To Naralex\'s chamber we go!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_PURIFIED');
INSERT INTO `script_texts` VALUES ('-1043006', 'Beyond this corridor, Naralex lies in fitful sleep. Let us go awaken him before it is too late.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_NARALEX_CHAMBER');
INSERT INTO `script_texts` VALUES ('-1043007', 'Protect me brave souls as I delve into the Emerald Dream to rescue Naralex and put an end to this corruption!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'Disciple of Naralex - SAY_BEGIN_RITUAL');
INSERT INTO `script_texts` VALUES ('-1043008', '%s begins to perform the awakening ritual on Naralex.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'Disciple of Naralex - EMOTE_RITUAL_BEGIN');
INSERT INTO `script_texts` VALUES ('-1043009', '%s tosses fitfully in troubled sleep.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'Naralex - EMOTE_NARALEX_AWAKE');
INSERT INTO `script_texts` VALUES ('-1043010', '%s writhes in agony. The Disciple seems to be breaking through.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'Naralex - EMOTE_BREAK_THROUGH');
INSERT INTO `script_texts` VALUES ('-1043011', '%s dreams up a horrendous vision. Something stirs beneath the murky waters.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'Naralex - EMOTE_VISION');
INSERT INTO `script_texts` VALUES ('-1043012', 'This $N is a minion from Naralex\'s nightmare no doubt!.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_MUTANUS');
INSERT INTO `script_texts` VALUES ('-1043013', 'I AM AWAKE, AT LAST!', null, null, null, null, null, null, null, null, '5789', '1', '0', '0', 'Naralex - SAY_NARALEX_AWAKE');
INSERT INTO `script_texts` VALUES ('-1043014', 'At last! Naralex awakes from the nightmare.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_AWAKE');
INSERT INTO `script_texts` VALUES ('-1043015', 'Ah, to be pulled from the dreaded nightmare! I thank you, my loyal Disciple, along with your brave companions.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Naralex - SAY_NARALEX_THANKYOU');
INSERT INTO `script_texts` VALUES ('-1043016', 'We must go and gather with the other Disciplies. There is much work to be done before I can make another attempt to restore the Barrens. Farewell, brave souls!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Naralex - SAY_FAREWELL');
INSERT INTO `script_texts` VALUES ('-1043017', 'Attacked! Help get this $N off of me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1043018', 'Help!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1043019', 'Deal with this $N! I need to prepare to awake Naralex!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'Disciple of Naralex - SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1047000', 'Woo hoo! Finally getting out of here. It\'s going to be rough though. Keep your eyes peeled for trouble.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_READY');
INSERT INTO `script_texts` VALUES ('-1047001', 'Up there is where Charlga Razorflank resides. Blasted old crone.', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'willix SAY_1');
INSERT INTO `script_texts` VALUES ('-1047002', 'There\'s blueleaf tuber in this trench! It\'s like gold waiting to be mined I tell you!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_2');
INSERT INTO `script_texts` VALUES ('-1047003', 'There could be danger around every corner here.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_3');
INSERT INTO `script_texts` VALUES ('-1047004', 'I don\'t see how these foul animals live in this place... sheesh it smells!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_4');
INSERT INTO `script_texts` VALUES ('-1047005', 'I think I see a way for us to get out of this big twisted mess of a bramble.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_5');
INSERT INTO `script_texts` VALUES ('-1047006', 'Glad to be out of that wretched trench. Not much nicer up here though!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_6');
INSERT INTO `script_texts` VALUES ('-1047007', 'Finally! I\'ll be glad to get out of this place.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_7');
INSERT INTO `script_texts` VALUES ('-1047008', 'I think I\'ll rest a moment and catch my breath before heading back to Ratchet. Thanks for all the help!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_END');
INSERT INTO `script_texts` VALUES ('-1047009', '$N heading this way fast! To arms!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1047010', 'Eek! $N coming right at us!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1047011', 'Egads! $N on me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1047012', 'Help! Get this $N off of me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'willix SAY_AGGRO_4');
INSERT INTO `script_texts` VALUES ('-1070000', 'REUSE ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE ME');
INSERT INTO `script_texts` VALUES ('-1070001', 'Who dares awaken Archaedas? Who dares the wrath of the makers!', null, null, null, null, null, null, null, null, '5855', '1', '0', '0', 'archaedas SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1070002', 'Awake ye servants, defend the discs!', null, null, null, null, null, null, null, null, '5856', '1', '0', '0', 'archaedas SAY_AWAKE_GUARDIANS');
INSERT INTO `script_texts` VALUES ('-1070003', 'To my side, brothers. For the makers!', null, null, null, null, null, null, null, null, '5857', '1', '0', '0', 'archaedas SAY_AWAKE_WARDERS');
INSERT INTO `script_texts` VALUES ('-1070004', 'Reckless mortal.', null, null, null, null, null, null, null, null, '5858', '1', '0', '0', 'archaedas SAY_UNIT_SLAIN');
INSERT INTO `script_texts` VALUES ('-1090000', 'With your help, I can evaluate these tunnels.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'emi shortfuse SAY_START');
INSERT INTO `script_texts` VALUES ('-1090001', 'Let\'s see if we can find out where these Troggs are coming from.... and put a stop to the invasion!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'emi shortfuse SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1090002', 'Such devastation... what a horrible mess...', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'emi shortfuse SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1090003', 'It\'s quiet here....', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'emi shortfuse SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1090004', '...too quiet.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'emi shortfuse SAY_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1090005', 'Look! Over there at the tunnel wall!', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'emi shortfuse SAY_LOOK_1');
INSERT INTO `script_texts` VALUES ('-1090006', 'Trogg incursion! Defend me while I blast the hole closed!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'emi shortfuse SAY_HEAR_1');
INSERT INTO `script_texts` VALUES ('-1090007', 'Get this, $n off of me!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'emi shortfuse SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1090008', 'I don\'t think one charge is going to cut it. Keep fending them off!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'emi shortfuse SAY_CHARGE_1');
INSERT INTO `script_texts` VALUES ('-1090009', 'The charges are set. Get back before they blow!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'emi shortfuse SAY_CHARGE_2');
INSERT INTO `script_texts` VALUES ('-1090010', 'Incoming blast in 10 seconds!', null, null, null, null, null, null, null, null, '0', '1', '0', '5', 'emi shortfuse SAY_BLOW_1_10');
INSERT INTO `script_texts` VALUES ('-1090011', 'Incoming blast in 5 seconds. Clear the tunnel! Stay back!', null, null, null, null, null, null, null, null, '0', '1', '0', '5', 'emi shortfuse SAY_BLOW_1_5');
INSERT INTO `script_texts` VALUES ('-1090012', 'FIRE IN THE HOLE!', null, null, null, null, null, null, null, null, '0', '1', '0', '25', 'emi shortfuse SAY_BLOW_1');
INSERT INTO `script_texts` VALUES ('-1090013', 'Well done! Without your help I would have never been able to thwart that wave of troggs.', null, null, null, null, null, null, null, null, '0', '0', '0', '4', 'emi shortfuse SAY_FINISH_1');
INSERT INTO `script_texts` VALUES ('-1090014', 'Did you hear something?', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'emi shortfuse SAY_LOOK_2');
INSERT INTO `script_texts` VALUES ('-1090015', 'I heard something over there.', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'emi shortfuse SAY_HEAR_2');
INSERT INTO `script_texts` VALUES ('-1090016', 'More troggs! Ward them off as I prepare the explosives!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'emi shortfuse SAY_CHARGE_3');
INSERT INTO `script_texts` VALUES ('-1090017', 'The final charge is set. Stand back!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'emi shortfuse SAY_CHARGE_4');
INSERT INTO `script_texts` VALUES ('-1090018', '10 seconds to blast! Stand back!!!', null, null, null, null, null, null, null, null, '0', '1', '0', '5', 'emi shortfuse SAY_BLOW_2_10');
INSERT INTO `script_texts` VALUES ('-1090019', '5 seconds until detonation!!!!!', null, null, null, null, null, null, null, null, '0', '1', '0', '5', 'emi shortfuse SAY_BLOW_2_5');
INSERT INTO `script_texts` VALUES ('-1090020', 'Nice work! I\'ll set off the charges to prevent any more troggs from making it to the surface.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'emi shortfuse SAY_BLOW_SOON');
INSERT INTO `script_texts` VALUES ('-1090021', 'FIRE IN THE HOLE!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'emi shortfuse SAY_BLOW_2');
INSERT INTO `script_texts` VALUES ('-1090022', 'Superb! Because of your help, my people stand a chance of re-taking our beloved city. Three cheers to you!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'emi shortfuse SAY_FINISH_2');
INSERT INTO `script_texts` VALUES ('-1090023', 'We come from below! You can never stop us!', null, null, null, null, null, null, null, null, '0', '1', '0', '1', 'grubbis SAY_GRUBBIS_SPAWN');
INSERT INTO `script_texts` VALUES ('-1090024', 'Usurpers! Gnomeregan is mine!', null, null, null, null, null, null, null, null, '5807', '1', '0', '0', 'thermaplugg SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1090025', 'My machines are the future! They\'ll destroy you all!', null, null, null, null, null, null, null, null, '5808', '1', '0', '0', 'thermaplugg  SAY_PHASE');
INSERT INTO `script_texts` VALUES ('-1090026', 'Explosions! MORE explosions! I\'ve got to have more explosions!', null, null, null, null, null, null, null, null, '5809', '1', '0', '0', 'thermaplugg  SAY_BOMB');
INSERT INTO `script_texts` VALUES ('-1090027', '...and stay dead! He got served', null, null, null, null, null, null, null, null, '5810', '1', '0', '0', 'thermaplugg  SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1090028', '$n attacking! Help!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'emi shortfuse SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1109000', 'The walls of the chamber tremble. Something is happening...', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'malfurion stormrage EMOTE_MALFURION');
INSERT INTO `script_texts` VALUES ('-1109001', 'Be steadfast, champion. I know why it is that you are here and I know what it is that you seek. Eranikus will not give up the shard freely. He has been twisted... twisted by the same force that you seek to destroy.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'malfurion stormrge SAY_MALFURION1');
INSERT INTO `script_texts` VALUES ('-1109002', 'Are you really surprised? Is it hard to believe that the power of an Old God could reach even inside the Dream? It is true - Eranikus, Tyrant of the Dream, wages a battle against us all. The Nightmare follows in his wake of destruction.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'malfurion stormrge SAY_MALFURION2');
INSERT INTO `script_texts` VALUES ('-1109003', 'Understand this, Eranikus wants nothing more than to be brought to Azeroth from the Dream. Once he is out, he will stop at nothing to destroy my physical manifestation. This, however, is the only way in which you could recover the scepter shard.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'malfurion stormrge SAY_MAFLURION3');
INSERT INTO `script_texts` VALUES ('-1109004', 'You will bring him back into this world, champion.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'malfurion Stormrge SAY_MALFURION4');
INSERT INTO `script_texts` VALUES ('-1109005', 'The shield be down! Rise up Atal\'ai! Rise up!', null, null, null, null, null, null, null, null, '5861', '6', '0', '0', 'jammalan SAY_JAMMALAN_INTRO');
INSERT INTO `script_texts` VALUES ('-1109006', 'HAKKAR LIVES!', null, null, null, null, null, null, null, null, '5870', '1', '0', '0', 'avatar SAY_AVATAR_BRAZIER_1');
INSERT INTO `script_texts` VALUES ('-1109007', 'I TASTE THE BLOOD OF LIFE!', null, null, null, null, null, null, null, null, '5868', '1', '0', '0', 'avatar SAY_AVATAR_BRAZIER_2');
INSERT INTO `script_texts` VALUES ('-1109008', 'I DRAW CLOSER TO YOUR WORLD!', null, null, null, null, null, null, null, null, '5867', '1', '0', '0', 'avatar SAY_AVATAR_BRAZIER_3');
INSERT INTO `script_texts` VALUES ('-1109009', 'I AM NEAR!', null, null, null, null, null, null, null, null, '5869', '1', '0', '0', 'avatar SAY_AVATAR_BRAZIER_4');
INSERT INTO `script_texts` VALUES ('-1109010', 'I AM HERE!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'avatar SAY_AVATAR_SPAWN');
INSERT INTO `script_texts` VALUES ('-1129000', 'You\'ll never leave this place... alive.', null, null, null, null, null, null, null, null, '5825', '1', '0', '0', 'amnennar SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1129001', 'To me, my servants!', null, null, null, null, null, null, null, null, '5828', '1', '0', '0', 'amnennar SAY_SUMMON60');
INSERT INTO `script_texts` VALUES ('-1129002', 'Come, spirits, attend your master!', null, null, null, null, null, null, null, null, '5829', '1', '0', '0', 'amnennar SAY_SUMMON30');
INSERT INTO `script_texts` VALUES ('-1129003', 'I am the hand of the Lich King!', null, null, null, null, null, null, null, null, '5827', '1', '0', '0', 'amnennar SAY_HP');
INSERT INTO `script_texts` VALUES ('-1129004', 'Too...easy!', null, null, null, null, null, null, null, null, '5826', '1', '0', '0', 'amnennar SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1129005', 'All right, stay close. These fiends will jump right out of the shadows at you if you let your guard down.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'belnistrasz SAY_READY');
INSERT INTO `script_texts` VALUES ('-1129006', 'Okay, here we go. It\'s going to take about five minutes to shut this thing down through the ritual. Once I start, keep the vermin off of me or it will be the end of us all!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'belnistrasz SAY_START_RIT');
INSERT INTO `script_texts` VALUES ('-1129007', 'You\'ll rue the day you crossed me, $N', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'belnistrasz SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1129008', 'Incoming $N - look sharp, friends!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'belnistrasz SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1129009', 'Three minutes left -- I can feel the energy starting to build! Keep up the solid defense!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'belnistrasz SAY_3_MIN');
INSERT INTO `script_texts` VALUES ('-1129010', 'Just two minutes to go! We\'re half way there, but don\'t let your guard down!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'belnistrasz SAY_2_MIN');
INSERT INTO `script_texts` VALUES ('-1129011', 'One more minute! Hold on now, the ritual is about to take hold!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'belnistrasz SAY_1_MIN');
INSERT INTO `script_texts` VALUES ('-1129012', 'That\'s it -- we made it! The ritual is set in motion, and idol fires are about to go out for good! You truly are the heroes I thought you would be!', null, null, null, null, null, null, null, null, '0', '1', '0', '4', 'belnistrasz SAY_FINISH');
INSERT INTO `script_texts` VALUES ('-1189000', 'Ah, I have been waiting for a real challenge!', null, null, null, null, null, null, null, null, '5830', '1', '0', '0', 'herod SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1189001', 'Blades of Light!', null, null, null, null, null, null, null, null, '5832', '1', '0', '0', 'herod SAY_WHIRLWIND');
INSERT INTO `script_texts` VALUES ('-1189002', 'Light, give me strength!', null, null, null, null, null, null, null, null, '5833', '1', '0', '0', 'herod SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1189003', 'Hah, is that all?', null, null, null, null, null, null, null, null, '5831', '1', '0', '0', 'herod SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1189004', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1189005', 'Infidels! They must be purified!', null, null, null, null, null, null, null, null, '5835', '1', '0', '0', 'mograine SAY_MO_AGGRO');
INSERT INTO `script_texts` VALUES ('-1189006', 'Unworthy!', null, null, null, null, null, null, null, null, '5836', '1', '0', '0', 'mograine SAY_MO_KILL');
INSERT INTO `script_texts` VALUES ('-1189007', 'At your side, milady!', null, null, null, null, null, null, null, null, '5837', '1', '0', '0', 'mograine SAY_MO_RESSURECTED');
INSERT INTO `script_texts` VALUES ('-1189008', 'What, Mograine has fallen? You shall pay for this treachery!', null, null, null, null, null, null, null, null, '5838', '1', '0', '0', 'whitemane SAY_WH_INTRO');
INSERT INTO `script_texts` VALUES ('-1189009', 'The Light has spoken!', null, null, null, null, null, null, null, null, '5839', '1', '0', '0', 'whitemane SAY_WH_KILL');
INSERT INTO `script_texts` VALUES ('-1189010', 'Arise, my champion!', null, null, null, null, null, null, null, null, '5840', '1', '0', '0', 'whitemane SAY_WH_RESSURECT');
INSERT INTO `script_texts` VALUES ('-1189011', 'Tell me... tell me everything!', null, null, null, null, null, null, null, null, '5847', '1', '0', '0', 'vishas SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1189012', 'Naughty secrets!', null, null, null, null, null, null, null, null, '5849', '1', '0', '0', 'vishas SAY_HEALTH1');
INSERT INTO `script_texts` VALUES ('-1189013', 'I\'ll rip the secrets from your flesh!', null, null, null, null, null, null, null, null, '5850', '1', '0', '0', 'vishas SAY_HEALTH2');
INSERT INTO `script_texts` VALUES ('-1189014', 'Purged by pain!', null, null, null, null, null, null, null, null, '5848', '1', '0', '0', 'vishas SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1189015', 'The monster got what he deserved.', null, null, null, null, null, null, null, null, '0', '0', '1', '0', 'vishas SAY_TRIGGER_VORREL');
INSERT INTO `script_texts` VALUES ('-1189016', 'We hunger for vengeance.', null, null, null, null, null, null, null, null, '5844', '1', '0', '0', 'thalnos SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1189017', 'No rest, for the angry dead.', null, null, null, null, null, null, null, null, '5846', '1', '0', '0', 'thalnos SAY_HEALTH');
INSERT INTO `script_texts` VALUES ('-1189018', 'More... More souls.', null, null, null, null, null, null, null, null, '5845', '1', '0', '0', 'thalnos SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1189019', 'You will not defile these mysteries!', null, null, null, null, null, null, null, null, '5842', '1', '0', '0', 'doan SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1189020', 'Burn in righteous fire!', null, null, null, null, null, null, null, null, '5843', '1', '0', '0', 'doan SAY_SPECIALAE');
INSERT INTO `script_texts` VALUES ('-1189021', 'Release the hounds!', null, null, null, null, null, null, null, null, '5841', '1', '0', '0', 'loksey SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1189022', 'It is over, your search is done! Let fate choose now, the righteous one.', null, null, null, null, null, null, null, null, '11961', '1', '0', '0', 'horseman SAY_ENTRANCE');
INSERT INTO `script_texts` VALUES ('-1189023', 'Here\'s my body, fit and pure! Now, your blackened souls I\'ll cure!', null, null, null, null, null, null, null, null, '12567', '1', '0', '0', 'horseman SAY_REJOINED');
INSERT INTO `script_texts` VALUES ('-1189024', 'So eager you are for my blood to spill, yet to vanquish me this my head you must kill!', null, null, null, null, null, null, null, null, '11969', '1', '0', '0', 'horseman SAY_BODY_DEFEAT');
INSERT INTO `script_texts` VALUES ('-1189025', 'Over here, you idiot!', null, null, null, null, null, null, null, null, '12569', '1', '0', '0', 'horseman SAY_LOST_HEAD');
INSERT INTO `script_texts` VALUES ('-1189026', 'Harken, cur! Tis you I spurn! Now, $N, feel the burn!', null, null, null, null, null, null, null, null, '12573', '1', '0', '0', 'horseman SAY_CONFLAGRATION');
INSERT INTO `script_texts` VALUES ('-1189027', 'Soldiers arise, stand and fight! Bring victory at last to this fallen knight!', null, null, null, null, null, null, null, null, '11963', '1', '0', '0', 'horseman SAY_SPROUTING_PUMPKINS');
INSERT INTO `script_texts` VALUES ('-1189028', 'Your body lies beaten, battered and broken. Let my curse be your own, fate has spoken.', null, null, null, null, null, null, null, null, '11962', '1', '0', '0', 'horseman SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1189029', 'This end have I reached before. What new adventure lies in store?', null, null, null, null, null, null, null, null, '11964', '1', '0', '0', 'horseman SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1189030', '%s laughs.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'horseman EMOTE_LAUGH');
INSERT INTO `script_texts` VALUES ('-1189031', 'Horseman rise...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'horseman SAY_PLAYER1');
INSERT INTO `script_texts` VALUES ('-1189032', 'Your time is night...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'horseman SAY_PLAYER2');
INSERT INTO `script_texts` VALUES ('-1189033', 'You felt death once...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'horseman SAY_PLAYER3');
INSERT INTO `script_texts` VALUES ('-1189034', 'Now, know demise!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'horseman SAY_PLAYER4');
INSERT INTO `script_texts` VALUES ('-1189035', 'The master has fallen! Avenge him my brethren!', null, null, null, null, null, null, null, null, '5834', '1', '0', '0', 'trainee SAY_TRAINEE_SPAWN');
INSERT INTO `script_texts` VALUES ('-1229000', '%s begins to regain its strength!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'pyroguard EMOTE_BEGIN');
INSERT INTO `script_texts` VALUES ('-1229001', '%s is nearly at full strength!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'pyroguard EMOTE_NEAR');
INSERT INTO `script_texts` VALUES ('-1229002', '%s regains its power and breaks free of its bonds!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'pyroguard EMOTE_FULL');
INSERT INTO `script_texts` VALUES ('-1229003', 'Ha! Ha! Ha! Thank you for freeing me, fools. Now let me repay you by charring the flesh from your bones.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'pyroguard SAY_FREE');
INSERT INTO `script_texts` VALUES ('-1229004', 'Excellent... it would appear as if the meddlesome insects have arrived just in time to feed my legion. Welcome, mortals!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1229005', 'Let not even a drop of their blood remain upon the arena floor, my children. Feast on their souls!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1229006', 'Foolsss...Kill the one in the dress!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_ATTACK_1');
INSERT INTO `script_texts` VALUES ('-1229007', 'Sire, let me join the fray! I shall tear their spines out with my bare hands!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'rend SAY_REND_JOIN');
INSERT INTO `script_texts` VALUES ('-1229008', 'Concentrate your attacks upon the healer!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_ATTACK_2');
INSERT INTO `script_texts` VALUES ('-1229009', 'Inconceivable!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_ATTACK_3');
INSERT INTO `script_texts` VALUES ('-1229010', 'Do not force my hand, children! I shall use your hides to line my boots.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_ATTACK_4');
INSERT INTO `script_texts` VALUES ('-1229011', 'Defilers!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'rend SAY_LOSE_1');
INSERT INTO `script_texts` VALUES ('-1229012', 'Impossible!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'rend SAY_LOSE_2');
INSERT INTO `script_texts` VALUES ('-1229013', 'Your efforts will prove fruitless. None shall stand in our way!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_LOSE_3');
INSERT INTO `script_texts` VALUES ('-1229014', 'THIS CANNOT BE!!! Rend, deal with these insects.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_LOSE_4');
INSERT INTO `script_texts` VALUES ('-1229015', 'With pleasure...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'rend SAY_REND_ATTACK');
INSERT INTO `script_texts` VALUES ('-1229016', 'The Warchief shall make quick work of you, mortals. Prepare yourselves!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_WARCHIEF');
INSERT INTO `script_texts` VALUES ('-1229017', 'Taste in my power!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_BUFF_GYTH');
INSERT INTO `script_texts` VALUES ('-1229018', 'Your victory shall be short lived. The days of both the Alliance and Horde are coming to an end. The next time we meet shall be the last.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarius SAY_VICTORY');
INSERT INTO `script_texts` VALUES ('-1230000', 'Ah, hits the spot!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'rocknot SAY_GOT_BEER');
INSERT INTO `script_texts` VALUES ('-1230001', 'Come to aid the Throne!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'dagran SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1230002', 'Hail to the king, baby!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'dagran SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1230003', 'You have challenged the Seven, and now you will die!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'doomrel SAY_DOOMREL_START_EVENT');
INSERT INTO `script_texts` VALUES ('-1230004', 'The Sons of Thaurissan shall watch you perish in the Ring of the Law!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'grimstone SAY_START_1');
INSERT INTO `script_texts` VALUES ('-1230005', 'You have been sentenced to death for crimes against the Dark Iron Nation!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'grimstone SAY_START_2');
INSERT INTO `script_texts` VALUES ('-1230006', 'Unleash the fury and let it be done!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'grimstone SAY_OPEN_EAST_GATE');
INSERT INTO `script_texts` VALUES ('-1230007', 'But your real punishment lies ahead.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'grimstone SAY_SUMMON_BOSS_1');
INSERT INTO `script_texts` VALUES ('-1230008', 'Haha! I bet you thought you were done!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'grimstone SAY_SUMMON_BOSS_2');
INSERT INTO `script_texts` VALUES ('-1230009', 'Good Riddance!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'grimstone SAY_OPEN_NORTH_GATE');
INSERT INTO `script_texts` VALUES ('-1249000', 'How fortuitous. Usually, I must leave my lair to feed.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'onyxia SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1249001', 'Learn your place mortal!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'onyxia SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1249002', 'This meaningless exertion bores me. I\'ll incinerate you all from above!', null, null, null, null, null, null, null, null, '0', '1', '0', '254', 'onyxia SAY_PHASE_2_TRANS');
INSERT INTO `script_texts` VALUES ('-1249003', 'It seems you\'ll need another lesson, mortals!', null, null, null, null, null, null, null, null, '0', '1', '0', '293', 'onyxia SAY_PHASE_3_TRANS');
INSERT INTO `script_texts` VALUES ('-1249004', '%s takes in a deep breath...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'onyxia EMOTE_BREATH');
INSERT INTO `script_texts` VALUES ('-1269000', 'Why do you persist? Surely you can see the futility of it all. It is not too late! You may still leave with your lives ...', null, null, null, null, null, null, null, null, '10442', '1', '0', '0', 'temporus SAY_ENTER');
INSERT INTO `script_texts` VALUES ('-1269001', 'So be it ... you have been warned.', null, null, null, null, null, null, null, null, '10444', '1', '0', '0', 'temporus SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1269002', 'Time... sands of time is run out for you.', null, null, null, null, null, null, null, null, '10443', '1', '0', '0', 'temporus SAY_BANISH');
INSERT INTO `script_texts` VALUES ('-1269003', 'You should have left when you had the chance.', null, null, null, null, null, null, null, null, '10445', '1', '0', '0', 'temporus SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1269004', 'Your days are done.', null, null, null, null, null, null, null, null, '10446', '1', '0', '0', 'temporus SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1269005', 'My death means ... little.', null, null, null, null, null, null, null, null, '10447', '1', '0', '0', 'temporus SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1269006', 'Why do you aid the Magus? Just think of how many lives could be saved if the portal is never opened, if the resulting wars could be erased ...', null, null, null, null, null, null, null, null, '10412', '1', '0', '0', 'chrono_lord_deja SAY_ENTER');
INSERT INTO `script_texts` VALUES ('-1269007', 'If you will not cease this foolish quest, then you will die!', null, null, null, null, null, null, null, null, '10414', '1', '0', '0', 'chrono_lord_deja SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1269008', 'You have outstayed your welcome, Timekeeper. Begone!', null, null, null, null, null, null, null, null, '10413', '1', '0', '0', 'chrono_lord_deja SAY_BANISH');
INSERT INTO `script_texts` VALUES ('-1269009', 'I told you it was a fool\'s quest!', null, null, null, null, null, null, null, null, '10415', '1', '0', '0', 'chrono_lord_deja SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1269010', 'Leaving so soon?', null, null, null, null, null, null, null, null, '10416', '1', '0', '0', 'chrono_lord_deja SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1269011', 'Time ... is on our side.', null, null, null, null, null, null, null, null, '10417', '1', '0', '0', 'chrono_lord_deja SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1269012', 'The time has come to shatter this clockwork universe forever! Let us no longer be slaves of the hourglass! I warn you: those who do not embrace the greater path shall become victims of its passing!', null, null, null, null, null, null, null, null, '10400', '1', '0', '0', 'aeonus SAY_ENTER');
INSERT INTO `script_texts` VALUES ('-1269013', 'Let us see what fate lays in store...', null, null, null, null, null, null, null, null, '10402', '1', '0', '0', 'aeonus SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1269014', 'Your time is up, slave of the past!', null, null, null, null, null, null, null, null, '10401', '1', '0', '0', 'aeonus SAY_BANISH');
INSERT INTO `script_texts` VALUES ('-1269015', 'One less obstacle in our way!', null, null, null, null, null, null, null, null, '10403', '1', '0', '0', 'aeonus SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1269016', 'No one can stop us! No one!', null, null, null, null, null, null, null, null, '10404', '1', '0', '0', 'aeonus SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1269017', 'It is only a matter...of time.', null, null, null, null, null, null, null, null, '10405', '1', '0', '0', 'aeonus SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1269018', 'REUSE ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE ME');
INSERT INTO `script_texts` VALUES ('-1269019', 'Stop! Do not go further, mortals. You are ill-prepared to face the forces of the Infinite Dragonflight. Come, let me help you.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'saat SAY_SAAT_WELCOME');
INSERT INTO `script_texts` VALUES ('-1269020', 'The time has come! Gul\'dan, order your warlocks to double their efforts! Moments from now the gateway will open, and your Horde will be released upon this ripe, unsuspecting world!', null, null, null, null, null, null, null, null, '10435', '1', '0', '0', 'medivh SAY_ENTER');
INSERT INTO `script_texts` VALUES ('-1269021', 'What is this? Champions, coming to my aid? I sense the hand of the dark one in this. Truly this sacred event bears his blessing?', null, null, null, null, null, null, null, null, '10436', '1', '0', '0', 'medivh SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1269022', 'Champions, my shield grows weak!', null, null, null, null, null, null, null, null, '10437', '1', '0', '0', 'medivh SAY_WEAK75');
INSERT INTO `script_texts` VALUES ('-1269023', 'My powers must be concentrated on the portal! I do not have time to hold the shield!', null, null, null, null, null, null, null, null, '10438', '1', '0', '0', 'medivh SAY_WEAK50');
INSERT INTO `script_texts` VALUES ('-1269024', 'The shield is nearly gone! All that I have worked for is in danger!', null, null, null, null, null, null, null, null, '10439', '1', '0', '0', 'medivh SAY_WEAK25');
INSERT INTO `script_texts` VALUES ('-1269025', 'No... damn this feeble mortal coil...', null, null, null, null, null, null, null, null, '10441', '1', '0', '0', 'medivh SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1269026', 'I am grateful for your aid, champions. Now, Gul\'dan\'s Horde will sweep across this world, like a locust swarm, and all my designs, all my carefully laid plans will at last fall into place.', null, null, null, null, null, null, null, null, '10440', '1', '0', '0', 'medivh SAY_WIN');
INSERT INTO `script_texts` VALUES ('-1269027', 'Orcs of the Horde! This portalis the gateway to your new destiny! Azeroth lies before you, ripe for the taking!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'medivh SAY_ORCS_ENTER');
INSERT INTO `script_texts` VALUES ('-1269028', 'Gul\'dan speaks the truth! We should return at once to tell our brothers of the news! Retreat back trought the portal!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'medivh SAY_ORCS_ANSWER');
INSERT INTO `script_texts` VALUES ('-1289000', 'School is in session!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'gandling SAY_GANDLING_SPAWN');
INSERT INTO `script_texts` VALUES ('-1309000', 'Let the coils of hate unfurl!', null, null, null, null, null, null, null, null, '8421', '1', '0', '0', 'venoxis SAY_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1309001', 'Ssserenity..at lassst!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'venoxis SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1309002', 'Lord Hir\'eek, grant me wings of vengance!', null, null, null, null, null, null, null, null, '8417', '1', '0', '0', 'jeklik SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1309003', 'I command you to rain fire down upon these invaders!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'jeklik SAY_RAIN_FIRE');
INSERT INTO `script_texts` VALUES ('-1309004', 'Finally ...death. Curse you Hakkar! Curse you!', null, null, null, null, null, null, null, null, '8422', '1', '0', '0', 'jeklik SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1309005', 'Draw me to your web mistress Shadra. Unleash your venom!', null, null, null, null, null, null, null, null, '8418', '1', '0', '0', 'marli SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1309006', 'Shadra, make of me your avatar!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'marli SAY_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1309007', 'Aid me my brood!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'marli SAY_SPIDER_SPAWN');
INSERT INTO `script_texts` VALUES ('-1309008', 'Bless you mortal for this release. Hakkar controls me no longer...', null, null, null, null, null, null, null, null, '8423', '1', '0', '0', 'marli SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1309009', 'Shirvallah, fill me with your RAGE!', null, null, null, null, null, null, null, null, '8419', '1', '0', '0', 'thekal SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1309010', 'Hakkar binds me no more! Peace at last!', null, null, null, null, null, null, null, null, '8424', '1', '0', '0', 'thekal SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1309011', 'Bethekk, your priestess calls upon your might!', null, null, null, null, null, null, null, null, '8416', '1', '0', '0', 'arlokk SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1309012', 'Feast on $n, my pretties!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'arlokk SAY_FEAST_PANTHER');
INSERT INTO `script_texts` VALUES ('-1309013', 'At last, I am free of the Soulflayer!', null, null, null, null, null, null, null, null, '8412', '1', '0', '0', 'arlokk SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1309014', 'Welcome to da great show friends! Step right up to die!', null, null, null, null, null, null, null, null, '8425', '1', '0', '0', 'jindo SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1309015', 'I\'ll feed your souls to Hakkar himself!', null, null, null, null, null, null, null, null, '8413', '1', '0', '0', 'mandokir SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1309016', 'DING!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'mandokir SAY_DING_KILL');
INSERT INTO `script_texts` VALUES ('-1309017', 'GRATS!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'mandokir SAY_GRATS_JINDO');
INSERT INTO `script_texts` VALUES ('-1309018', '$N! I\'m watching you!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'mandokir SAY_WATCH');
INSERT INTO `script_texts` VALUES ('-1309019', 'Don\'t make me angry. You won\'t like it when I\'m angry.', null, null, null, null, null, null, null, null, '0', '4', '0', '0', 'mandokir SAY_WATCH_WHISPER');
INSERT INTO `script_texts` VALUES ('-1309020', 'PRIDE HERALDS THE END OF YOUR WORLD. COME, MORTALS! FACE THE WRATH OF THE SOULFLAYER!', null, null, null, null, null, null, null, null, '8414', '1', '0', '0', 'hakkar SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1309021', 'Fleeing will do you no good, mortals!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'hakkar SAY_FLEEING');
INSERT INTO `script_texts` VALUES ('-1309022', 'You dare set foot upon Hakkari holy ground? Minions of Hakkar, destroy the infidels!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'hakkar SAY_MINION_DESTROY');
INSERT INTO `script_texts` VALUES ('-1309023', 'Minions of Hakkar, hear your God. The sanctity of this temple has been compromised. Invaders encroach upon holy ground! The Altar of Blood must be protected. Kill them all!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'hakkar SAY_PROTECT_ALTAR');
INSERT INTO `script_texts` VALUES ('-1309024', '%s goes into a rage after seeing his raptor fall in battle!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'mandokir EMOTE_RAGE');
INSERT INTO `script_texts` VALUES ('-1329000', 'Thanks to Egan', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'freed_soul SAY_ZAPPED0');
INSERT INTO `script_texts` VALUES ('-1329001', 'Rivendare must die', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'freed_soul SAY_ZAPPED1');
INSERT INTO `script_texts` VALUES ('-1329002', 'Who you gonna call?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'freed_soul SAY_ZAPPED2');
INSERT INTO `script_texts` VALUES ('-1329003', 'Don\'t cross those beams!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'freed_soul SAY_ZAPPED3');
INSERT INTO `script_texts` VALUES ('-1329004', 'An Ash\'ari Crystal has fallen! Stay true to the Lich King, my brethren, and attempt to resummon it.', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'thuzadin acolyte SAY_ANNOUNCE_ZIGGURAT_1');
INSERT INTO `script_texts` VALUES ('-1329005', 'One of the Ash\'ari Crystals has been destroyed! Slay the intruders!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'thuzadin acolyte SAY_ANNOUNCE_ZIGGURAT_2');
INSERT INTO `script_texts` VALUES ('-1329006', 'An Ash\'ari Crystal has been toppled! Restore the ziggurat before the Necropolis is vulnerable!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'thuzadin acolyte SAY_ANNOUNCE_ZIGGURAT_3');
INSERT INTO `script_texts` VALUES ('-1329007', 'The Ash\'ari Crystals have been destroyed! The Slaughterhouse is vulnerable!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'baron rivendare SAY_ANNOUNCE_RIVENDARE');
INSERT INTO `script_texts` VALUES ('-1329008', 'Intruders at the Service Gate! Lord Rivendare must be warned!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'barthilas SAY_WARN_BARON');
INSERT INTO `script_texts` VALUES ('-1329009', 'Intruders! More pawns of the Argent Dawn, no doubt. I already count one of their number among my prisoners. Withdraw from my domain before she is executed!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'baron rivendare SAY_ANNOUNCE_RUN_START');
INSERT INTO `script_texts` VALUES ('-1329010', 'You\'re still here? Your foolishness is amusing! The Argent Dawn wench needn\'t suffer in vain. Leave at once and she shall be spared!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'baron rivendare SAY_ANNOUNCE_RUN_10_MIN');
INSERT INTO `script_texts` VALUES ('-1329011', 'I shall take great pleasure in taking this poor wretch\'s life! It\'s not too late, she needn\'t suffer in vain. Turn back and her death shall be merciful!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'baron rivendare SAY_ANNOUNCE_RUN_5_MIN');
INSERT INTO `script_texts` VALUES ('-1329012', 'May this prisoner\'s death serve as a warning. None shall defy the Scourge and live!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'baron rivendare SAY_ANNOUNCE_RUN_FAIL');
INSERT INTO `script_texts` VALUES ('-1329013', 'So you see fit to toy with the Lich King\'s creations? Ramstein, be sure to give the intruders a proper greeting.', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'baron rivendare SAY_ANNOUNCE_RAMSTEIN');
INSERT INTO `script_texts` VALUES ('-1329014', 'Time to take matters into my own hands. Come. Enter my domain and challenge the might of the Scourge!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'baron rivendare SAY_UNDEAD_DEFEAT');
INSERT INTO `script_texts` VALUES ('-1329015', 'You did it... you\'ve slain Baron Rivendare! The Argent Dawn shall hear of your valiant deeds!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'ysida SAY_EPILOGUE');
INSERT INTO `script_texts` VALUES ('-1329016', 'Today you have unmade what took me years to create! For this you shall all die by my hand!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'dathrohan SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1329017', 'You fools think you can defeat me so easily? Face the true might of the Nathrezim!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'dathrohan SAY_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1329018', 'Damn you mortals! All my plans of revenge, all my hate... all burned to ash...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dathrohan SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1409000', '%s performs one last service for Ragnaros.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'geddon EMOTE_SERVICE');
INSERT INTO `script_texts` VALUES ('-1409001', 'REUSE ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE ME');
INSERT INTO `script_texts` VALUES ('-1409002', '%s refuses to die while its master is in trouble.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'core rager EMOTE_LOWHP');
INSERT INTO `script_texts` VALUES ('-1409003', 'Reckless mortals, none may challenge the sons of the living flame!', null, null, null, null, null, null, null, null, '8035', '1', '0', '0', 'majordomo SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1409004', 'The runes of warding have been destroyed! Hunt down the infedels my bretheren.', null, null, null, null, null, null, null, null, '8039', '6', '0', '0', 'majordomo SAY_SPAWN');
INSERT INTO `script_texts` VALUES ('-1409005', 'Ashes to Ashes!', null, null, null, null, null, null, null, null, '8037', '1', '0', '0', 'majordomo SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1409006', 'Burn mortals! Burn for this transgression!', null, null, null, null, null, null, null, null, '8036', '1', '0', '0', 'majordomo SAY_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1409007', 'Impossible! Stay your attack mortals! I submitt! I submitt!', null, null, null, null, null, null, null, null, '8038', '1', '0', '0', 'majordomo SAY_DEFEAT_1');
INSERT INTO `script_texts` VALUES ('-1409008', 'Behold Ragnaros, the Firelord! He who was ancient when this world was young! Bow before him, mortals! Bow before your ending!', null, null, null, null, null, null, null, null, '8040', '1', '0', '0', 'ragnaros SAY_SUMMON_MAJ');
INSERT INTO `script_texts` VALUES ('-1409009', 'TOO SOON! YOU HAVE AWAKENED ME TOO SOON, EXECUTUS! WHAT IS THE MEANING OF THIS INTRUSION?', null, null, null, null, null, null, null, null, '8043', '1', '0', '0', 'ragnaros SAY_ARRIVAL1_RAG');
INSERT INTO `script_texts` VALUES ('-1409010', 'These mortal infidels, my lord! They have invaded your sanctum, and seek to steal your secrets!', null, null, null, null, null, null, null, null, '8041', '1', '0', '0', 'ragnaros SAY_ARRIVAL2_MAJ');
INSERT INTO `script_texts` VALUES ('-1409011', 'FOOL! YOU ALLOWED THESE INSECTS TO RUN RAMPANT THROUGH THE HALLOWED CORE, AND NOW YOU LEAD THEM TO MY VERY LAIR? YOU HAVE FAILED ME, EXECUTUS! JUSTICE SHALL BE MET, INDEED!', null, null, null, null, null, null, null, null, '8044', '1', '0', '0', 'ragnaros SAY_ARRIVAL3_RAG');
INSERT INTO `script_texts` VALUES ('-1409012', 'NOW FOR YOU, INSECTS. BOLDLY YOU SAUGHT THE POWER OF RAGNAROS NOW YOU SHALL SEE IT FIRST HAND.', null, null, null, null, null, null, null, null, '8045', '1', '0', '0', 'ragnaros SAY_ARRIVAL5_RAG');
INSERT INTO `script_texts` VALUES ('-1409013', 'COME FORTH, MY SERVANTS! DEFEND YOUR MASTER!', null, null, null, null, null, null, null, null, '8049', '1', '0', '0', 'ragnaros SAY_REINFORCEMENTS1');
INSERT INTO `script_texts` VALUES ('-1409014', 'YOU CANNOT DEFEAT THE LIVING FLAME! COME YOU MINIONS OF FIRE! COME FORTH YOU CREATURES OF HATE! YOUR MASTER CALLS!', null, null, null, null, null, null, null, null, '8050', '1', '0', '0', 'ragnaros SAY_REINFORCEMENTS2');
INSERT INTO `script_texts` VALUES ('-1409015', 'BY FIRE BE PURGED!', null, null, null, null, null, null, null, null, '8046', '1', '0', '0', 'ragnaros SAY_HAND');
INSERT INTO `script_texts` VALUES ('-1409016', 'TASTE THE FLAMES OF SULFURON!', null, null, null, null, null, null, null, null, '8047', '1', '0', '0', 'ragnaros SAY_WRATH');
INSERT INTO `script_texts` VALUES ('-1409017', 'DIE INSECT!', null, null, null, null, null, null, null, null, '8051', '1', '0', '0', 'ragnaros SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1409018', 'MY PATIENCE IS DWINDILING! COME NATS TO YOUR DEATH!', null, null, null, null, null, null, null, null, '8048', '1', '0', '0', 'ragnaros SAY_MAGMABURST');
INSERT INTO `script_texts` VALUES ('-1409019', 'You think you\'ve won already? Perhaps you\'ll need another lesson in pain!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'majordomo SAY_LAST_ADD');
INSERT INTO `script_texts` VALUES ('-1409020', 'Brashly you have come to rest the secrets of the living flame. You will soon regret the recklessness of your quest.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'majordomo SAY_DEFEAT_2');
INSERT INTO `script_texts` VALUES ('-1409021', 'I go now to summon the lord whos house this is. Should you seek an audiance with him your paltry lives will surly be forfit. Nevertheless seek out his lair if you dare!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'majordomo SAY_DEFEAT_3');
INSERT INTO `script_texts` VALUES ('-1409022', 'My flame! Please don\'t take away my flame... ', null, null, null, null, null, null, null, null, '8042', '1', '0', '0', 'ragnaros SAY_ARRIVAL4_MAJ');
INSERT INTO `script_texts` VALUES ('-1409023', 'Very well, $N.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'majordomo SAY_SUMMON_0');
INSERT INTO `script_texts` VALUES ('-1409024', 'Impudent whelps! You\'ve rushed headlong to your own deaths! See now, the master stirs!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'majordomo SAY_SUMMON_1');
INSERT INTO `script_texts` VALUES ('-1429000', 'The demon is loose! Quickly we must restrain him!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'highborne summoner SAY_FREE_IMMOLTHAR');
INSERT INTO `script_texts` VALUES ('-1429001', 'Who dares disrupt the sanctity of Eldre\'Thalas? Face me, cowards!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'prince tortheldrin SAY_KILL_IMMOLTHAR');
INSERT INTO `script_texts` VALUES ('-1429002', 'At last... Freed from his cursed grasp!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'old ironbark SAY_IRONBARK_REDEEM');
INSERT INTO `script_texts` VALUES ('-1469000', 'None of your kind should be here! You\'ve doomed only yourselves!', null, null, null, null, null, null, null, null, '8286', '1', '0', '0', 'broodlord SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1469001', 'Clever Mortals but I am not so easily lured away from my sanctum!', null, null, null, null, null, null, null, null, '8287', '1', '0', '0', 'broodlord SAY_LEASH');
INSERT INTO `script_texts` VALUES ('-1469002', 'Run! They are coming!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'vaelastrasz blackwing tech SAY_INTRO_TECH');
INSERT INTO `script_texts` VALUES ('-1469004', 'In this world where time is your enemy, it is my greatest ally. This grand game of life that you think you play in fact plays you. To that I say...', null, null, null, null, null, null, null, null, '0', '1', '0', '1', 'victor_nefarius SAY_GAMESBEGIN_1');
INSERT INTO `script_texts` VALUES ('-1469005', 'Let the games begin!', null, null, null, null, null, null, null, null, '8280', '1', '0', '22', 'victor_nefarius SAY_GAMESBEGIN_2');
INSERT INTO `script_texts` VALUES ('-1469006', 'Ah...the heroes. You are persistent, aren\'t you? Your ally here attempted to match his power against mine - and paid the price. Now he shall serve me...by slaughtering you.', null, null, null, null, null, null, null, null, '8279', '1', '0', '23', 'victor_nefarius SAY_NEFARIUS_CORRUPT');
INSERT INTO `script_texts` VALUES ('-1469007', 'Well done, my minions. The mortals\' courage begins to wane! Now, let\'s see how they contend with the true Lord of Blackrock Spire!', null, null, null, null, null, null, null, null, '8288', '1', '0', '0', 'nefarian SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1469008', 'Enough! Now you vermin shall feel the force of my birthright, the fury of the earth itself.', null, null, null, null, null, null, null, null, '8289', '1', '0', '0', 'nefarian SAY_XHEALTH');
INSERT INTO `script_texts` VALUES ('-1469009', 'BURN! You wretches! BURN!', null, null, null, null, null, null, null, null, '8290', '1', '0', '0', 'nefarian SAY_SHADOWFLAME');
INSERT INTO `script_texts` VALUES ('-1469010', 'Impossible! Rise my minions! Serve your master once more!', null, null, null, null, null, null, null, null, '8291', '1', '0', '0', 'nefarian SAY_RAISE_SKELETONS');
INSERT INTO `script_texts` VALUES ('-1469011', 'Worthless $N! Your friends will join you soon enough!', null, null, null, null, null, null, null, null, '8293', '1', '0', '0', 'nefarian SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1469012', 'This cannot be!  I am the master here!  You mortals are nothing to my kind!  Do you hear me? Nothing!', null, null, null, null, null, null, null, null, '8292', '1', '0', '0', 'nefarian SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1469013', 'Mages too? You should be more careful when you play with magic...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_MAGE');
INSERT INTO `script_texts` VALUES ('-1469014', 'Warriors, I know you can hit harder than that! Let\'s see it!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_WARRIOR');
INSERT INTO `script_texts` VALUES ('-1469015', 'Druids and your silly shapeshifting. Let\'s see it in action!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_DRUID');
INSERT INTO `script_texts` VALUES ('-1469016', 'Priests! If you\'re going to keep healing like that, we might as well make it a little more interesting!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_PRIEST');
INSERT INTO `script_texts` VALUES ('-1469017', 'Paladins, I\'ve heard you have many lives. Show me.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_PALADIN');
INSERT INTO `script_texts` VALUES ('-1469018', 'Shamans, show me what your totems can do!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_SHAMAN');
INSERT INTO `script_texts` VALUES ('-1469019', 'Warlocks, you shouldn\'t be playing with magic you don\'t understand. See what happens?', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_WARLOCK');
INSERT INTO `script_texts` VALUES ('-1469020', 'Hunters and your annoying pea-shooters!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_HUNTER');
INSERT INTO `script_texts` VALUES ('-1469021', 'Rogues? Stop hiding and face me!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_ROGUE');
INSERT INTO `script_texts` VALUES ('-1469022', 'You\'ll pay for forcing me to do this.', null, null, null, null, null, null, null, null, '8275', '1', '0', '0', 'razorgore SAY_EGGS_BROKEN1');
INSERT INTO `script_texts` VALUES ('-1469023', 'Fools! These eggs are more precious than you know!', null, null, null, null, null, null, null, null, '8276', '1', '0', '0', 'razorgore SAY_EGGS_BROKEN2');
INSERT INTO `script_texts` VALUES ('-1469024', 'No - not another one! I\'ll have your heads for this atrocity!', null, null, null, null, null, null, null, null, '8277', '1', '0', '0', 'razorgore SAY_EGGS_BROKEN3');
INSERT INTO `script_texts` VALUES ('-1469025', 'If I fall into the abyss I\'ll take all of you mortals with me...', null, null, null, null, null, null, null, null, '8278', '1', '0', '0', 'razorgore SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1469026', 'Too late, friends! Nefarius\' corruption has taken hold...I cannot...control myself.', null, null, null, null, null, null, null, null, '8281', '1', '0', '1', 'vaelastrasz SAY_LINE1');
INSERT INTO `script_texts` VALUES ('-1469027', 'I beg you, mortals - FLEE! Flee before I lose all sense of control! The black fire rages within my heart! I MUST- release it!', null, null, null, null, null, null, null, null, '8282', '1', '0', '1', 'vaelastrasz SAY_LINE2');
INSERT INTO `script_texts` VALUES ('-1469028', 'FLAME! DEATH! DESTRUCTION! Cower, mortals before the wrath of Lord...NO - I MUST fight this! Alexstrasza help me, I MUST fight it!', null, null, null, null, null, null, null, null, '8283', '1', '0', '1', 'vaelastrasz SAY_LINE3');
INSERT INTO `script_texts` VALUES ('-1469029', 'Nefarius\' hate has made me stronger than ever before! You should have fled while you could, mortals! The fury of Blackrock courses through my veins!', null, null, null, null, null, null, null, null, '8285', '1', '0', '0', 'vaelastrasz SAY_HALFLIFE');
INSERT INTO `script_texts` VALUES ('-1469030', 'Forgive me, $N! Your death only adds to my failure!', null, null, null, null, null, null, null, null, '8284', '1', '0', '0', 'vaelastrasz SAY_KILLTARGET');
INSERT INTO `script_texts` VALUES ('-1469031', 'Death Knights, get over here!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'nefarian SAY_DEATH_KNIGHT');
INSERT INTO `script_texts` VALUES ('-1469032', 'Get up, little red wyrm...and destroy them!', null, null, null, null, null, null, null, null, '0', '1', '0', '1', 'victor_nefarius SAY_NEFARIUS_CORRUPT_2');
INSERT INTO `script_texts` VALUES ('-1469033', '%s flee as the controlling power of the orb is drained.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'razorgore EMOTE_TROOPS_FLEE');
INSERT INTO `script_texts` VALUES ('-1469034', 'Run! They are coming.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'blackwing technician SAY_TECHNICIAN_RUN');
INSERT INTO `script_texts` VALUES ('-1509000', '%s senses your fear.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'moam EMOTE_AGGRO');
INSERT INTO `script_texts` VALUES ('-1509001', '%s bristles with energy!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'moan EMOTE_MANA_FULL');
INSERT INTO `script_texts` VALUES ('-1509028', '%s drains your mana and turns to stone.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'moam EMOTE_ENERGIZING');
INSERT INTO `script_texts` VALUES ('-1509002', '%s sets eyes on $N!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'buru EMOTE_TARGET');
INSERT INTO `script_texts` VALUES ('-1509003', 'They come now. Try not to get yourself killed, young blood.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'andorov SAY_ANDOROV_INTRO');
INSERT INTO `script_texts` VALUES ('-1509004', 'Remember, Rajaxx, when I said I\'d kill you last? I lied...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'andorov SAY_ANDOROV_ATTACK');
INSERT INTO `script_texts` VALUES ('-1509005', 'The time of our retribution is at hand! Let darkness reign in the hearts of our enemies!', null, null, null, null, null, null, null, null, '8612', '1', '0', '0', 'rajaxx SAY_WAVE3');
INSERT INTO `script_texts` VALUES ('-1509006', 'No longer will we wait behind barred doors and walls of stone! No longer will our vengeance be denied! The dragons themselves will tremble before our wrath!', null, null, null, null, null, null, null, null, '8610', '1', '0', '0', 'rajaxx SAY_WAVE4');
INSERT INTO `script_texts` VALUES ('-1509007', 'Fear is for the enemy! Fear and death!', null, null, null, null, null, null, null, null, '8608', '1', '0', '0', 'rajaxx SAY_WAVE5');
INSERT INTO `script_texts` VALUES ('-1509008', 'Staghelm will whimper and beg for his life, just as his whelp of a son did! One thousand years of injustice will end this day!', null, null, null, null, null, null, null, null, '8611', '1', '0', '0', 'rajaxx SAY_WAVE6');
INSERT INTO `script_texts` VALUES ('-1509009', 'Fandral! Your time has come! Go and hide in the Emerald Dream and pray we never find you!', null, null, null, null, null, null, null, null, '8607', '1', '0', '0', 'rajaxx SAY_WAVE7');
INSERT INTO `script_texts` VALUES ('-1509010', 'Impudent fool! I will kill you myself!', null, null, null, null, null, null, null, null, '8609', '1', '0', '0', 'rajaxx SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1509011', 'Attack and make them pay dearly!', null, null, null, null, null, null, null, null, '8603', '1', '0', '0', 'rajaxx SAY_UNK1');
INSERT INTO `script_texts` VALUES ('-1509012', 'Crush them! Drive them out!', null, null, null, null, null, null, null, null, '8605', '1', '0', '0', 'rajaxx SAY_UNK2');
INSERT INTO `script_texts` VALUES ('-1509013', 'Do not hesitate! Destroy them!', null, null, null, null, null, null, null, null, '8606', '1', '0', '0', 'rajaxx SAY_UNK3');
INSERT INTO `script_texts` VALUES ('-1509014', 'Warriors! Captains! Continue the fight!', null, null, null, null, null, null, null, null, '8613', '1', '0', '0', 'rajaxx SAY_UNK4');
INSERT INTO `script_texts` VALUES ('-1509015', 'You are not worth my time $N!', null, null, null, null, null, null, null, null, '8614', '1', '0', '0', 'rajaxx SAY_DEAGGRO');
INSERT INTO `script_texts` VALUES ('-1509016', 'Breath your last!', null, null, null, null, null, null, null, null, '8604', '1', '0', '0', 'rajaxx SAY_KILLS_ANDOROV');
INSERT INTO `script_texts` VALUES ('-1509017', 'Soon you will know the price of your meddling, mortals... The master is nearly whole... And when he rises, your world will be cease!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'rajaxx SAY_COMPLETE_QUEST');
INSERT INTO `script_texts` VALUES ('-1509018', 'I am rejuvinated!', null, null, null, null, null, null, null, null, '8593', '1', '0', '0', 'ossirian SAY_SURPREME1');
INSERT INTO `script_texts` VALUES ('-1509019', 'My powers are renewed!', null, null, null, null, null, null, null, null, '8595', '1', '0', '0', 'ossirian SAY_SURPREME2');
INSERT INTO `script_texts` VALUES ('-1509020', 'My powers return!', null, null, null, null, null, null, null, null, '8596', '1', '0', '0', 'ossirian SAY_SURPREME3');
INSERT INTO `script_texts` VALUES ('-1509021', 'Protect the city at all costs!', null, null, null, null, null, null, null, null, '8597', '1', '0', '0', 'ossirian SAY_RAND_INTRO1');
INSERT INTO `script_texts` VALUES ('-1509022', 'The walls have been breached!', null, null, null, null, null, null, null, null, '8599', '6', '0', '0', 'ossirian SAY_RAND_INTRO2');
INSERT INTO `script_texts` VALUES ('-1509023', 'To your posts. Defend the city.', null, null, null, null, null, null, null, null, '8600', '1', '0', '0', 'ossirian SAY_RAND_INTRO3');
INSERT INTO `script_texts` VALUES ('-1509024', 'Tresspassers will be terminated.', null, null, null, null, null, null, null, null, '8601', '1', '0', '0', 'ossirian SAY_RAND_INTRO4');
INSERT INTO `script_texts` VALUES ('-1509025', 'Sands of the desert rise and block out the sun!', null, null, null, null, null, null, null, null, '8598', '1', '0', '0', 'ossirian SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1509026', 'You are terminated.', null, null, null, null, null, null, null, null, '8602', '1', '0', '0', 'ossirian SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1509027', 'I...have...failed.', null, null, null, null, null, null, null, null, '8594', '1', '0', '0', 'ossirian SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1531000', 'Are you so eager to die? I would be happy to accomodate you.', null, null, null, null, null, null, null, null, '8615', '1', '0', '0', 'skeram SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1531001', 'Cower mortals! The age of darkness is at hand.', null, null, null, null, null, null, null, null, '8616', '1', '0', '0', 'skeram SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1531002', 'Tremble! The end is upon you.', null, null, null, null, null, null, null, null, '8621', '1', '0', '0', 'skeram SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1531003', 'Let your death serve as an example!', null, null, null, null, null, null, null, null, '8617', '1', '0', '0', 'skeram SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1531004', 'Spineless wretches! You will drown in rivers of blood!', null, null, null, null, null, null, null, null, '8619', '1', '0', '0', 'skeram SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1531005', 'The screams of the dying will fill the air. A symphony of terror is about to begin!', null, null, null, null, null, null, null, null, '8620', '1', '0', '0', 'skeram SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1531006', 'Prepare for the return of the ancient ones!', null, null, null, null, null, null, null, null, '8618', '1', '0', '0', 'skeram SAY_SPLIT');
INSERT INTO `script_texts` VALUES ('-1531007', 'You only delay... the inevetable.', null, null, null, null, null, null, null, null, '8622', '1', '0', '0', 'skeram SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1531008', 'You will be judged for defiling these sacred grounds! The laws of the Ancients will not be challenged! Trespassers will be annihilated!', null, null, null, null, null, null, null, null, '8646', '1', '0', '0', 'sartura SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1531009', 'I sentence you to death!', null, null, null, null, null, null, null, null, '8647', '1', '0', '0', 'sartura SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1531010', 'I serve to the last!', null, null, null, null, null, null, null, null, '8648', '1', '0', '0', 'sartura SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1531011', '%s is weakened!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'cthun EMOTE_WEAKENED');
INSERT INTO `script_texts` VALUES ('-1532000', 'Well done Midnight!', null, null, null, null, null, null, null, null, '9173', '1', '0', '0', 'attumen SAY_MIDNIGHT_KILL');
INSERT INTO `script_texts` VALUES ('-1532001', 'Cowards! Wretches!', null, null, null, null, null, null, null, null, '9167', '1', '0', '0', 'attumen SAY_APPEAR1');
INSERT INTO `script_texts` VALUES ('-1532002', 'Who dares attack the steed of the Huntsman?', null, null, null, null, null, null, null, null, '9298', '1', '0', '0', 'attumen SAY_APPEAR2');
INSERT INTO `script_texts` VALUES ('-1532003', 'Perhaps you would rather test yourselves against a more formidable opponent?!', null, null, null, null, null, null, null, null, '9299', '1', '0', '0', 'attumen SAY_APPEAR3');
INSERT INTO `script_texts` VALUES ('-1532004', 'Come, Midnight, let\'s disperse this petty rabble!', null, null, null, null, null, null, null, null, '9168', '1', '0', '0', 'attumen SAY_MOUNT');
INSERT INTO `script_texts` VALUES ('-1532005', 'It was... inevitable.', null, null, null, null, null, null, null, null, '9169', '1', '0', '0', 'attumen SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1532006', 'Another trophy to add to my collection!', null, null, null, null, null, null, null, null, '9300', '1', '0', '0', 'attumen SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1532007', 'Weapons are merely a convenience for a warrior of my skill!', null, null, null, null, null, null, null, null, '9166', '1', '0', '0', 'attumen SAY_DISARMED');
INSERT INTO `script_texts` VALUES ('-1532008', 'I always knew... someday I would become... the hunted.', null, null, null, null, null, null, null, null, '9165', '1', '0', '0', 'attumen SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1532009', 'Such easy sport.', null, null, null, null, null, null, null, null, '9170', '1', '0', '0', 'attumen SAY_RANDOM1');
INSERT INTO `script_texts` VALUES ('-1532010', 'Amateurs! Do not think you can best me! I kill for a living.', null, null, null, null, null, null, null, null, '9304', '1', '0', '0', 'attumen SAY_RANDOM2');
INSERT INTO `script_texts` VALUES ('-1532011', 'Hmm, unannounced visitors? Preparations must be made.', null, null, null, null, null, null, null, null, '9211', '1', '0', '0', 'moroes SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532012', 'Now, where was I? Oh yes...', null, null, null, null, null, null, null, null, '9215', '1', '0', '0', 'moroes SAY_SPECIAL_1');
INSERT INTO `script_texts` VALUES ('-1532013', 'You rang?', null, null, null, null, null, null, null, null, '9316', '1', '0', '0', 'moroes SAY_SPECIAL_2');
INSERT INTO `script_texts` VALUES ('-1532014', 'One more for dinner this evening.', null, null, null, null, null, null, null, null, '9214', '1', '0', '0', 'moroes SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1532015', 'Time... Never enough time.', null, null, null, null, null, null, null, null, '9314', '1', '0', '0', 'moroes SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1532016', 'I\'ve gone and made a mess.', null, null, null, null, null, null, null, null, '9315', '1', '0', '0', 'moroes SAY_KILL_3');
INSERT INTO `script_texts` VALUES ('-1532017', 'How terribly clumsy of me...', null, null, null, null, null, null, null, null, '9213', '1', '0', '0', 'moroes SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1532018', 'Your behavior will not be tolerated!', null, null, null, null, null, null, null, null, '9204', '1', '0', '0', 'maiden SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532019', 'Ah ah ah...', null, null, null, null, null, null, null, null, '9207', '1', '0', '0', 'maiden SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1532020', 'This is for the best.', null, null, null, null, null, null, null, null, '9312', '1', '0', '0', 'maiden SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1532021', 'Impure thoughts lead to profane actions.', null, null, null, null, null, null, null, null, '9311', '1', '0', '0', 'maiden SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1532022', 'Cast out your corrupt thoughts.', null, null, null, null, null, null, null, null, '9313', '1', '0', '0', 'maiden SAY_REPENTANCE1');
INSERT INTO `script_texts` VALUES ('-1532023', 'Your impurity must be cleansed.', null, null, null, null, null, null, null, null, '9208', '1', '0', '0', 'maiden SAY_REPENTANCE2');
INSERT INTO `script_texts` VALUES ('-1532024', 'Death comes. Will your conscience be clear?', null, null, null, null, null, null, null, null, '9206', '1', '0', '0', 'maiden SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1532025', 'Oh at last, at last. I can go home.', null, null, null, null, null, null, null, null, '9190', '1', '0', '0', 'dorothee SAY_DOROTHEE_DEATH');
INSERT INTO `script_texts` VALUES ('-1532026', 'Don\'t let them hurt us, Tito! Oh, you won\'t, will you?', null, null, null, null, null, null, null, null, '9191', '1', '0', '0', 'dorothee SAY_DOROTHEE_SUMMON');
INSERT INTO `script_texts` VALUES ('-1532027', 'Tito, oh Tito, no!', null, null, null, null, null, null, null, null, '9192', '1', '0', '0', 'dorothee SAY_DOROTHEE_TITO_DEATH');
INSERT INTO `script_texts` VALUES ('-1532028', 'Oh dear, we simply must find a way home! The old wizard could be our only hope! Strawman, Roar, Tinhead, will you... wait! Oh golly, look! We have visitors!', null, null, null, null, null, null, null, null, '9195', '1', '0', '0', 'dorothee SAY_DOROTHEE_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532029', 'Wanna fight? Huh? Do ya? C\'mon, I\'ll fight you with both claws behind my back!', null, null, null, null, null, null, null, null, '9227', '1', '0', '0', 'roar SAY_ROAR_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532030', 'You didn\'t have to go and do that.', null, null, null, null, null, null, null, null, '9229', '1', '0', '0', 'roar SAY_ROAR_DEATH');
INSERT INTO `script_texts` VALUES ('-1532031', 'I think I\'m going to go take fourty winks.', null, null, null, null, null, null, null, null, '9230', '1', '0', '0', 'roar SAY_ROAR_SLAY');
INSERT INTO `script_texts` VALUES ('-1532032', 'Now what should I do with you? I simply can\'t make up my mind.', null, null, null, null, null, null, null, null, '9254', '1', '0', '0', 'strawman SAY_STRAWMAN_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532033', 'Don\'t let them make a mattress... out of me.', null, null, null, null, null, null, null, null, '9256', '1', '0', '0', 'strawman SAY_STRAWMAN_DEATH');
INSERT INTO `script_texts` VALUES ('-1532034', 'I guess I\'m not a failure after all.', null, null, null, null, null, null, null, null, '9257', '1', '0', '0', 'strawman SAY_STRAWMAN_SLAY');
INSERT INTO `script_texts` VALUES ('-1532035', 'I could really use a heart. Say, can I have yours?', null, null, null, null, null, null, null, null, '9268', '1', '0', '0', 'tinhead SAY_TINHEAD_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532036', 'Back to being an old rustbucket.', null, null, null, null, null, null, null, null, '9270', '1', '0', '0', 'tinhead SAY_TINHEAD_DEATH');
INSERT INTO `script_texts` VALUES ('-1532037', 'Guess I\'m not so rusty, after all.', null, null, null, null, null, null, null, null, '9271', '1', '0', '0', 'tinhead SAY_TINHEAD_SLAY');
INSERT INTO `script_texts` VALUES ('-1532038', '%s begins to rust.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'tinhead EMOTE_RUST');
INSERT INTO `script_texts` VALUES ('-1532039', 'Woe to each and every one of you my pretties! <cackles>', null, null, null, null, null, null, null, null, '9179', '1', '0', '0', 'crone SAY_CRONE_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532040', 'It will all be over soon! <cackles>', null, null, null, null, null, null, null, null, '9307', '1', '0', '0', 'crone SAY_CRONE_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1532041', 'How could you? What a cruel, cruel world!', null, null, null, null, null, null, null, null, '9178', '1', '0', '0', 'crone SAY_CRONE_DEATH');
INSERT INTO `script_texts` VALUES ('-1532042', 'Fixed you, didn\'t I? <cackles>', null, null, null, null, null, null, null, null, '9180', '1', '0', '0', 'crone SAY_CRONE_SLAY');
INSERT INTO `script_texts` VALUES ('-1532043', 'All the better to own you with!', null, null, null, null, null, null, null, null, '9276', '1', '0', '0', 'wolf SAY_WOLF_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532044', 'Mmmm... delicious.', null, null, null, null, null, null, null, null, '9277', '1', '0', '0', 'wolf SAY_WOLF_SLAY');
INSERT INTO `script_texts` VALUES ('-1532045', 'Run away little girl, run away!', null, null, null, null, null, null, null, null, '9278', '1', '0', '0', 'wolf SAY_WOLF_HOOD');
INSERT INTO `script_texts` VALUES ('-1532046', 'What devil art thou, that dost torment me thus?', null, null, null, null, null, null, null, null, '9196', '1', '0', '0', 'julianne SAY_JULIANNE_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532047', 'Where is my lord? Where is my Romulo?', null, null, null, null, null, null, null, null, '9199', '1', '0', '0', 'julianne SAY_JULIANNE_ENTER');
INSERT INTO `script_texts` VALUES ('-1532048', 'Romulo, I come! Oh... this do I drink to thee!', null, null, null, null, null, null, null, null, '9198', '1', '0', '0', 'julianne SAY_JULIANNE_DEATH01');
INSERT INTO `script_texts` VALUES ('-1532049', 'Where is my Lord? Where is my Romulo? Ohh, happy dagger! This is thy sheath! There rust, and let me die!', null, null, null, null, null, null, null, null, '9310', '1', '0', '0', 'julianne SAY_JULIANNE_DEATH02');
INSERT INTO `script_texts` VALUES ('-1532050', 'Come, gentle night; and give me back my Romulo!', null, null, null, null, null, null, null, null, '9200', '1', '0', '0', 'julianne SAY_JULIANNE_RESURRECT');
INSERT INTO `script_texts` VALUES ('-1532051', 'Parting is such sweet sorrow.', null, null, null, null, null, null, null, null, '9201', '1', '0', '0', 'julianne SAY_JULIANNE_SLAY');
INSERT INTO `script_texts` VALUES ('-1532052', 'Wilt thou provoke me? Then have at thee, boy!', null, null, null, null, null, null, null, null, '9233', '1', '0', '0', 'romulo SAY_ROMULO_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532053', 'Thou smilest... upon the stroke that... murders me.', null, null, null, null, null, null, null, null, '9235', '1', '0', '0', 'romulo SAY_ROMULO_DEATH');
INSERT INTO `script_texts` VALUES ('-1532054', 'This day\'s black fate on more days doth depend. This but begins the woe. Others must end.', null, null, null, null, null, null, null, null, '9236', '1', '0', '0', 'romulo SAY_ROMULO_ENTER');
INSERT INTO `script_texts` VALUES ('-1532055', 'Thou detestable maw, thou womb of death; I enforce thy rotten jaws to open!', null, null, null, null, null, null, null, null, '9237', '1', '0', '0', 'romulo SAY_ROMULO_RESURRECT');
INSERT INTO `script_texts` VALUES ('-1532056', 'How well my comfort is revived by this!', null, null, null, null, null, null, null, null, '9238', '1', '0', '0', 'romulo SAY_ROMULO_SLAY');
INSERT INTO `script_texts` VALUES ('-1532057', 'The Menagerie is for guests only.', null, null, null, null, null, null, null, null, '9183', '1', '0', '0', 'curator SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532058', 'Gallery rules will be strictly enforced.', null, null, null, null, null, null, null, null, '9188', '1', '0', '0', 'curator SAY_SUMMON1');
INSERT INTO `script_texts` VALUES ('-1532059', 'This curator is equipped for gallery protection.', null, null, null, null, null, null, null, null, '9309', '1', '0', '0', 'curator SAY_SUMMON2');
INSERT INTO `script_texts` VALUES ('-1532060', 'Your request cannot be processed.', null, null, null, null, null, null, null, null, '9186', '1', '0', '0', 'curator SAY_EVOCATE');
INSERT INTO `script_texts` VALUES ('-1532061', 'Failure to comply will result in offensive action.', null, null, null, null, null, null, null, null, '9185', '1', '0', '0', 'curator SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1532062', 'Do not touch the displays.', null, null, null, null, null, null, null, null, '9187', '1', '0', '0', 'curator SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1532063', 'You are not a guest.', null, null, null, null, null, null, null, null, '9308', '1', '0', '0', 'curator SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1532064', 'This Curator is no longer op... er... ation... al.', null, null, null, null, null, null, null, null, '9184', '1', '0', '0', 'curator SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1532065', 'Your blood will anoint my circle.', null, null, null, null, null, null, null, null, '9264', '1', '0', '0', 'terestian SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1532066', 'The great one will be pleased.', null, null, null, null, null, null, null, null, '9329', '1', '0', '0', 'terestian SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1532067', 'My life, is yours. Oh great one.', null, null, null, null, null, null, null, null, '9262', '1', '0', '0', 'terestian SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1532068', 'Ah, you\'re just in time. The rituals are about to begin.', null, null, null, null, null, null, null, null, '9260', '1', '0', '0', 'terestian SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532069', 'Please, accept this humble offering, oh great one.', null, null, null, null, null, null, null, null, '9263', '1', '0', '0', 'terestian SAY_SACRIFICE1');
INSERT INTO `script_texts` VALUES ('-1532070', 'Let the sacrifice serve his testament to my fealty.', null, null, null, null, null, null, null, null, '9330', '1', '0', '0', 'terestian SAY_SACRIFICE2');
INSERT INTO `script_texts` VALUES ('-1532071', 'Come, you dwellers in the dark. Rally to my call!', null, null, null, null, null, null, null, null, '9265', '1', '0', '0', 'terestian SAY_SUMMON1');
INSERT INTO `script_texts` VALUES ('-1532072', 'Gather, my pets. There is plenty for all.', null, null, null, null, null, null, null, null, '9331', '1', '0', '0', 'terestian SAY_SUMMON2');
INSERT INTO `script_texts` VALUES ('-1532073', 'Please, no more. My son... he\'s gone mad!', null, null, null, null, null, null, null, null, '9241', '1', '0', '0', 'aran SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1532074', 'I\'ll not be tortured again!', null, null, null, null, null, null, null, null, '9323', '1', '0', '0', 'aran SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1532075', 'Who are you? What do you want? Stay away from me!', null, null, null, null, null, null, null, null, '9324', '1', '0', '0', 'aran SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1532076', 'I\'ll show you this beaten dog still has some teeth!', null, null, null, null, null, null, null, null, '9245', '1', '0', '0', 'aran SAY_FLAMEWREATH1');
INSERT INTO `script_texts` VALUES ('-1532077', 'Burn you hellish fiends!', null, null, null, null, null, null, null, null, '9326', '1', '0', '0', 'aran SAY_FLAMEWREATH2');
INSERT INTO `script_texts` VALUES ('-1532078', 'I\'ll freeze you all!', null, null, null, null, null, null, null, null, '9246', '1', '0', '0', 'aran SAY_BLIZZARD1');
INSERT INTO `script_texts` VALUES ('-1532079', 'Back to the cold dark with you!', null, null, null, null, null, null, null, null, '9327', '1', '0', '0', 'aran SAY_BLIZZARD2');
INSERT INTO `script_texts` VALUES ('-1532080', 'Yes, yes, my son is quite powerful... but I have powers of my own!', null, null, null, null, null, null, null, null, '9242', '1', '0', '0', 'aran SAY_EXPLOSION1');
INSERT INTO `script_texts` VALUES ('-1532081', 'I am not some simple jester! I am Nielas Aran!', null, null, null, null, null, null, null, null, '9325', '1', '0', '0', 'aran SAY_EXPLOSION2');
INSERT INTO `script_texts` VALUES ('-1532082', 'Surely you would not deny an old man a replenishing drink? No, no I thought not.', null, null, null, null, null, null, null, null, '9248', '1', '0', '0', 'aran SAY_DRINK');
INSERT INTO `script_texts` VALUES ('-1532083', 'I\'m not finished yet! No, I have a few more tricks up me sleeve.', null, null, null, null, null, null, null, null, '9251', '1', '0', '0', 'aran SAY_ELEMENTALS');
INSERT INTO `script_texts` VALUES ('-1532084', 'I want this nightmare to be over!', null, null, null, null, null, null, null, null, '9250', '1', '0', '0', 'aran SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1532085', 'Torment me no more!', null, null, null, null, null, null, null, null, '9328', '1', '0', '0', 'aran SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1532086', 'You\'ve wasted enough of my time. Let these games be finished!', null, null, null, null, null, null, null, null, '9247', '1', '0', '0', 'aran SAY_TIMEOVER');
INSERT INTO `script_texts` VALUES ('-1532087', 'At last... The nightmare is.. over...', null, null, null, null, null, null, null, null, '9244', '1', '0', '0', 'aran SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1532088', 'Where did you get that?! Did HE send you?!', null, null, null, null, null, null, null, null, '9249', '1', '0', '0', 'aran SAY_ATIESH');
INSERT INTO `script_texts` VALUES ('-1532089', '%s cries out in withdrawal, opening gates to the warp.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'netherspite EMOTE_PHASE_PORTAL');
INSERT INTO `script_texts` VALUES ('-1532090', '%s goes into a nether-fed rage!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'netherspite EMOTE_PHASE_BANISH');
INSERT INTO `script_texts` VALUES ('-1532091', 'Madness has brought you here to me. I shall be your undoing!', null, null, null, null, null, null, null, null, '9218', '1', '0', '0', 'malchezaar SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1532092', 'Simple fools! Time is the fire in which you\'ll burn!', null, null, null, null, null, null, null, null, '9220', '1', '0', '0', 'malchezaar SAY_AXE_TOSS1');
INSERT INTO `script_texts` VALUES ('-1532093', 'I see the subtlety of conception is beyond primitives such as you.', null, null, null, null, null, null, null, null, '9317', '1', '0', '0', 'malchezaar SAY_AXE_TOSS2');
INSERT INTO `script_texts` VALUES ('-1532094', 'Who knows what secrets hide in the dark.', null, null, null, null, null, null, null, null, '9223', '1', '0', '0', 'malchezaar SAY_SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1532095', 'The cerestial forces are mine to manipulate.', null, null, null, null, null, null, null, null, '9320', '1', '0', '0', 'malchezaar SAY_SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1532096', 'How can you hope to withstand against such overwhelming power?', null, null, null, null, null, null, null, null, '9321', '1', '0', '0', 'malchezaar SAY_SPECIAL3');
INSERT INTO `script_texts` VALUES ('-1532097', 'Surely you did not think you could win.', null, null, null, null, null, null, null, null, '9222', '1', '0', '0', 'malchezaar SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1532098', 'Your greed, your foolishness has brought you to this end.', null, null, null, null, null, null, null, null, '9318', '1', '0', '0', 'malchezaar SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1532099', 'You are, but a plaything, unfit even to amuse.', null, null, null, null, null, null, null, null, '9319', '1', '0', '0', 'malchezaar SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1532100', 'All realities, all dimensions are open to me!', null, null, null, null, null, null, null, null, '9224', '1', '0', '0', 'malchezaar SAY_SUMMON1');
INSERT INTO `script_texts` VALUES ('-1532101', 'You face not Malchezaar alone, but the legions I command!', null, null, null, null, null, null, null, null, '9322', '1', '0', '0', 'malchezaar SAY_SUMMON2');
INSERT INTO `script_texts` VALUES ('-1532102', 'I refuse to concede defeat. I am a prince of the Eredar! I am...', null, null, null, null, null, null, null, null, '9221', '1', '0', '0', 'malchezaar SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1532103', 'Welcome Ladies and Gentlemen, to this evening\'s presentation!', null, null, null, null, null, null, null, null, '9174', '1', '0', '0', 'barnes OZ1');
INSERT INTO `script_texts` VALUES ('-1532104', 'Tonight we plumb the depths of the human soul as we join a lost, lonely girl trying desperately -- with the help of her loyal companions -- to find her way home!', null, null, null, null, null, null, null, null, '9338', '1', '0', '0', 'barnes OZ2');
INSERT INTO `script_texts` VALUES ('-1532105', 'But she is pursued... by a wicked malevolent crone!', null, null, null, null, null, null, null, null, '9339', '1', '0', '0', 'barnes OZ3');
INSERT INTO `script_texts` VALUES ('-1532106', 'Will she survive? Will she prevail? Only time will tell. And now ... on with the show!', null, null, null, null, null, null, null, null, '9340', '1', '0', '0', 'barnes OZ4');
INSERT INTO `script_texts` VALUES ('-1532107', 'Good evening, Ladies and Gentlemen! Welcome to this evening\'s presentation!', null, null, null, null, null, null, null, null, '9175', '1', '0', '0', 'barnes HOOD1');
INSERT INTO `script_texts` VALUES ('-1532108', 'Tonight, things are not what they seem. For tonight, your eyes may not be trusted', null, null, null, null, null, null, null, null, '9335', '1', '0', '0', 'barnes HOOD2');
INSERT INTO `script_texts` VALUES ('-1532109', 'Take for instance, this quiet, elderly woman, waiting for a visit from her granddaughter. Surely there is nothing to fear from this sweet, grey-haired, old lady.', null, null, null, null, null, null, null, null, '9336', '1', '0', '0', 'barnes HOOD3');
INSERT INTO `script_texts` VALUES ('-1532110', 'But don\'t let me pull the wool over your eyes. See for yourself what lies beneath those covers! And now... on with the show!', null, null, null, null, null, null, null, null, '9337', '1', '0', '0', 'barnes HOOD4');
INSERT INTO `script_texts` VALUES ('-1532111', 'Welcome, Ladies and Gentlemen, to this evening\'s presentation!', null, null, null, null, null, null, null, null, '9176', '1', '0', '0', 'barnes RAJ1');
INSERT INTO `script_texts` VALUES ('-1532112', 'Tonight, we explore a tale of forbidden love!', null, null, null, null, null, null, null, null, '9341', '1', '0', '0', 'barnes RAJ2');
INSERT INTO `script_texts` VALUES ('-1532113', 'But beware, for not all love stories end happily, as you may find out. Sometimes, love pricks like a thorn.', null, null, null, null, null, null, null, null, '9342', '1', '0', '0', 'barnes RAJ3');
INSERT INTO `script_texts` VALUES ('-1532114', 'But don\'t take it from me, see for yourself what tragedy lies ahead when the paths of star-crossed lovers meet. And now...on with the show!', null, null, null, null, null, null, null, null, '9343', '1', '0', '0', 'barnes RAJ4');
INSERT INTO `script_texts` VALUES ('-1533000', 'Ahh... welcome to my parlor.', null, null, null, null, null, null, null, null, '8788', '1', '0', '0', 'anubrekhan SAY_GREET');
INSERT INTO `script_texts` VALUES ('-1533001', 'Just a little taste...', null, null, null, null, null, null, null, null, '8785', '1', '0', '0', 'anubrekhan SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533002', 'There is no way out.', null, null, null, null, null, null, null, null, '8786', '1', '0', '0', 'anubrekhan SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533003', 'Yes, Run! It makes the blood pump faster!', null, null, null, null, null, null, null, null, '8787', '1', '0', '0', 'anubrekhan SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533004', 'I hear little hearts beating. Yesss... beating faster now. Soon the beating will stop.', null, null, null, null, null, null, null, null, '8790', '1', '0', '0', 'anubrekhan SAY_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1533005', 'Where to go? What to do? So many choices that all end in pain, end in death.', null, null, null, null, null, null, null, null, '8791', '1', '0', '0', 'anubrekhan SAY_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1533006', 'Which one shall I eat first? So difficult to choose... the all smell so delicious.', null, null, null, null, null, null, null, null, '8792', '1', '0', '0', 'anubrekhan SAY_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1533007', 'Closer now... tasty morsels. I\'ve been too long without food. Without blood to drink.', null, null, null, null, null, null, null, null, '8793', '1', '0', '0', 'anubrekhan SAY_TAUNT4');
INSERT INTO `script_texts` VALUES ('-1533008', 'Shh... it will all be over soon.', null, null, null, null, null, null, null, null, '8789', '1', '0', '0', 'anubrekhan SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1533009', 'Your old lives, your mortal desires, mean nothing. You are acolytes of the master now, and you will serve the cause without question! The greatest glory is to die in the master\'s service!', null, null, null, null, null, null, null, null, '8799', '1', '0', '0', 'faerlina SAY_GREET');
INSERT INTO `script_texts` VALUES ('-1533010', 'Slay them in the master\'s name!', null, null, null, null, null, null, null, null, '8794', '1', '0', '0', 'faerlina SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533011', 'You cannot hide from me!', null, null, null, null, null, null, null, null, '8795', '1', '0', '0', 'faerlina SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533012', 'Kneel before me, worm!', null, null, null, null, null, null, null, null, '8796', '1', '0', '0', 'faerlina SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533013', 'Run while you still can!', null, null, null, null, null, null, null, null, '8797', '1', '0', '0', 'faerlina SAY_AGGRO4');
INSERT INTO `script_texts` VALUES ('-1533014', 'You have failed!', null, null, null, null, null, null, null, null, '8800', '1', '0', '0', 'faerlina SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1533015', 'Pathetic wretch!', null, null, null, null, null, null, null, null, '8801', '1', '0', '0', 'faerlina SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1533016', 'The master... will avenge me!', null, null, null, null, null, null, null, null, '8798', '1', '0', '0', 'faerlina SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533017', 'Patchwerk want to play!', null, null, null, null, null, null, null, null, '8909', '1', '0', '0', 'patchwerk SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533018', 'Kel\'Thuzad make Patchwerk his Avatar of War!', null, null, null, null, null, null, null, null, '8910', '1', '0', '0', 'patchwerk SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533019', 'No more play?', null, null, null, null, null, null, null, null, '8912', '1', '0', '0', 'patchwerk SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1533020', 'What happened to... Patch...', null, null, null, null, null, null, null, null, '8911', '1', '0', '0', 'patchwerk SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533021', '%s sprays slime across the room!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'grobbulus EMOTE_SPRAY_SLIME');
INSERT INTO `script_texts` VALUES ('-1533022', '%s lifts off into the air!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'sapphiron EMOTE_FLY');
INSERT INTO `script_texts` VALUES ('-1533023', 'Stalagg crush you!', null, null, null, null, null, null, null, null, '8864', '1', '0', '0', 'stalagg SAY_STAL_AGGRO');
INSERT INTO `script_texts` VALUES ('-1533024', 'Stalagg kill!', null, null, null, null, null, null, null, null, '8866', '1', '0', '0', 'stalagg SAY_STAL_SLAY');
INSERT INTO `script_texts` VALUES ('-1533025', 'Master save me...', null, null, null, null, null, null, null, null, '8865', '1', '0', '0', 'stalagg SAY_STAL_DEATH');
INSERT INTO `script_texts` VALUES ('-1533026', 'Feed you to master!', null, null, null, null, null, null, null, null, '8802', '1', '0', '0', 'feugen SAY_FEUG_AGGRO');
INSERT INTO `script_texts` VALUES ('-1533027', 'Feugen make master happy!', null, null, null, null, null, null, null, null, '8804', '1', '0', '0', 'feugen SAY_FEUG_SLAY');
INSERT INTO `script_texts` VALUES ('-1533028', 'No... more... Feugen...', null, null, null, null, null, null, null, null, '8803', '1', '0', '0', 'feugen SAY_FEUG_DEATH');
INSERT INTO `script_texts` VALUES ('-1533029', 'You are too late... I... must... OBEY!', null, null, null, null, null, null, null, null, '8872', '1', '0', '0', 'thaddius SAY_GREET');
INSERT INTO `script_texts` VALUES ('-1533030', 'KILL!', null, null, null, null, null, null, null, null, '8867', '1', '0', '0', 'thaddius SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533031', 'EAT YOUR BONES!', null, null, null, null, null, null, null, null, '8868', '1', '0', '0', 'thaddius SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533032', 'BREAK YOU!', null, null, null, null, null, null, null, null, '8869', '1', '0', '0', 'thaddius SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533033', 'You die now!', null, null, null, null, null, null, null, null, '8877', '1', '0', '0', 'thaddius SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1533034', 'Now YOU feel pain!', null, null, null, null, null, null, null, null, '8871', '1', '0', '0', 'thaddius SAY_ELECT');
INSERT INTO `script_texts` VALUES ('-1533035', 'Thank... you...', null, null, null, null, null, null, null, null, '8870', '1', '0', '0', 'thaddius SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533036', 'Pleeease!', null, null, null, null, null, null, null, null, '8873', '1', '0', '0', 'thaddius SAY_SCREAM1');
INSERT INTO `script_texts` VALUES ('-1533037', 'Stop, make it stop!', null, null, null, null, null, null, null, null, '8874', '1', '0', '0', 'thaddius SAY_SCREAM2');
INSERT INTO `script_texts` VALUES ('-1533038', 'Help me! Save me!', null, null, null, null, null, null, null, null, '8875', '1', '0', '0', 'thaddius SAY_SCREAM3');
INSERT INTO `script_texts` VALUES ('-1533039', 'Please, nooo!', null, null, null, null, null, null, null, null, '8876', '1', '0', '0', 'thaddius SAY_SCREAM4');
INSERT INTO `script_texts` VALUES ('-1533040', 'Foolishly you have sought your own demise.', null, null, null, null, null, null, null, null, '8807', '1', '0', '0', 'gothik SAY_SPEECH_1');
INSERT INTO `script_texts` VALUES ('-1533041', 'Death is the only escape.', null, null, null, null, null, null, null, null, '8806', '1', '0', '0', 'gothik SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1533042', 'I... am... undone!', null, null, null, null, null, null, null, null, '8805', '1', '0', '0', 'gothik SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533043', 'I have waited long enough! Now, you face the harvester of souls!', null, null, null, null, null, null, null, null, '8808', '1', '0', '0', 'gothik SAY_TELEPORT');
INSERT INTO `script_texts` VALUES ('-1533044', 'Defend youself!', null, null, null, null, null, null, null, null, '8892', '1', '0', '0', 'blaumeux SAY_BLAU_AGGRO');
INSERT INTO `script_texts` VALUES ('-1533045', 'Come, Zeliek, do not drive them out. Not before we\'ve had our fun.', null, null, null, null, null, null, null, null, '8896', '1', '0', '0', 'blaumeux SAY_BLAU_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1533046', 'I do hope they stay alive long enough for me to... introduce myself.', null, null, null, null, null, null, null, null, '8897', '1', '0', '0', 'blaumeux SAY_BLAU_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1533047', 'The first kill goes to me! Anyone care to wager?', null, null, null, null, null, null, null, null, '8898', '1', '0', '0', 'blaumeux SAY_BLAU_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1533048', 'Your life is mine!', null, null, null, null, null, null, null, null, '8895', '1', '0', '0', 'blaumeux SAY_BLAU_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1533049', 'Who\'s next?', null, null, null, null, null, null, null, null, '8894', '1', '0', '0', 'blaumeux SAY_BLAU_SLAY');
INSERT INTO `script_texts` VALUES ('-1533050', 'Tou... che!', null, null, null, null, null, null, null, null, '8893', '1', '0', '0', 'blaumeux SAY_BLAU_DEATH');
INSERT INTO `script_texts` VALUES ('-1533051', 'Come out and fight, ye wee ninny!', null, null, null, null, null, null, null, null, '8899', '1', '0', '0', 'korthazz SAY_KORT_AGGRO');
INSERT INTO `script_texts` VALUES ('-1533052', 'To arms, ye roustabouts! We\'ve got company!', null, null, null, null, null, null, null, null, '8903', '1', '0', '0', 'korthazz SAY_KORT_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1533053', 'I heard about enough of yer sniveling. Shut yer fly trap \'afore I shut it for ye!', null, null, null, null, null, null, null, null, '8904', '1', '0', '0', 'korthazz SAY_KORT_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1533054', 'I\'m gonna enjoy killin\' these slack-jawed daffodils!', null, null, null, null, null, null, null, null, '8905', '1', '0', '0', 'korthazz SAY_KORT_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1533055', 'I like my meat extra crispy!', null, null, null, null, null, null, null, null, '8902', '1', '0', '0', 'korthazz SAY_KORT_SPECIAl');
INSERT INTO `script_texts` VALUES ('-1533056', 'Next time, bring more friends!', null, null, null, null, null, null, null, null, '8901', '1', '0', '0', 'korthazz SAY_KORT_SLAY');
INSERT INTO `script_texts` VALUES ('-1533057', 'What a bloody waste this is!', null, null, null, null, null, null, null, null, '8900', '1', '0', '0', 'korthazz SAY_KORT_DEATH');
INSERT INTO `script_texts` VALUES ('-1533058', 'Flee, before it\'s too late!', null, null, null, null, null, null, null, null, '8913', '1', '0', '0', 'zeliek SAY_ZELI_AGGRO');
INSERT INTO `script_texts` VALUES ('-1533059', 'Invaders, cease this foolish venture at once! Turn away while you still can!', null, null, null, null, null, null, null, null, '8917', '1', '0', '0', 'zeliek SAY_ZELI_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1533060', 'Perhaps they will come to their senses, and run away as fast as they can!', null, null, null, null, null, null, null, null, '8918', '1', '0', '0', 'zeliek SAY_ZELI_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1533061', 'Do not continue! Turn back while there\'s still time!', null, null, null, null, null, null, null, null, '8919', '1', '0', '0', 'zeliek SAY_ZELI_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1533062', 'I- I have no choice but to obey!', null, null, null, null, null, null, null, null, '8916', '1', '0', '0', 'zeliek SAY_ZELI_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1533063', 'Forgive me!', null, null, null, null, null, null, null, null, '8915', '1', '0', '0', 'zeliek SAY_ZELI_SLAY');
INSERT INTO `script_texts` VALUES ('-1533064', 'It is... as it should be.', null, null, null, null, null, null, null, null, '8914', '1', '0', '0', 'zeliek SAY_ZELI_DEATH');
INSERT INTO `script_texts` VALUES ('-1533065', 'You seek death?', null, null, null, null, null, null, null, null, '14571', '1', '0', '0', 'rivendare_naxx SAY_RIVE_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533066', 'None shall pass!', null, null, null, null, null, null, null, null, '14572', '1', '0', '0', 'rivendare_naxx SAY_RIVE_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533067', 'Be still!', null, null, null, null, null, null, null, null, '14573', '1', '0', '0', 'rivendare_naxx SAY_RIVE_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533068', 'You will find no peace in death.', null, null, null, null, null, null, null, null, '14574', '1', '0', '0', 'rivendare_naxx SAY_RIVE_SLAY1');
INSERT INTO `script_texts` VALUES ('-1533069', 'The master\'s will is done.', null, null, null, null, null, null, null, null, '14575', '1', '0', '0', 'rivendare_naxx SAY_RIVE_SLAY2');
INSERT INTO `script_texts` VALUES ('-1533070', 'Bow to the might of the scourge!', null, null, null, null, null, null, null, null, '14576', '1', '0', '0', 'rivendare_naxx SAY_RIVE_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1533071', 'Enough prattling. Let them come! We shall grind their bones to dust.', null, null, null, null, null, null, null, null, '14577', '1', '0', '0', 'rivendare_naxx SAY_RIVE_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1533072', 'Conserve your anger! Harness your rage! You will all have outlets for your frustration soon enough.', null, null, null, null, null, null, null, null, '14578', '1', '0', '0', 'rivendare_naxx SAY_RIVE_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1533073', 'Life is meaningless. It is in death that we are truly tested.', null, null, null, null, null, null, null, null, '14579', '1', '0', '0', 'rivendare_naxx SAY_RIVE_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1533074', 'Death... will not stop me...', null, null, null, null, null, null, null, null, '14580', '1', '0', '0', 'rivendare_naxx SAY_RIVE_DEATH');
INSERT INTO `script_texts` VALUES ('-1533075', 'Glory to the master!', null, null, null, null, null, null, null, null, '8845', '1', '0', '0', 'noth SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533076', 'Your life is forfeit!', null, null, null, null, null, null, null, null, '8846', '1', '0', '0', 'noth SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533077', 'Die, trespasser!', null, null, null, null, null, null, null, null, '8847', '1', '0', '0', 'noth SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533078', 'Rise, my soldiers! Rise and fight once more!', null, null, null, null, null, null, null, null, '8851', '1', '0', '0', 'noth SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1533079', 'My task is done!', null, null, null, null, null, null, null, null, '8849', '1', '0', '0', 'noth SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1533080', 'Breathe no more!', null, null, null, null, null, null, null, null, '8850', '1', '0', '0', 'noth SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1533081', 'I will serve the master... in... death!', null, null, null, null, null, null, null, null, '8848', '1', '0', '0', 'noth SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533082', '%s takes in a deep breath...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'sapphiron EMOTE_BREATH');
INSERT INTO `script_texts` VALUES ('-1533083', '%s resumes his attacks!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'sapphiron EMOTE_GROUND');
INSERT INTO `script_texts` VALUES ('-1533084', 'Your forces are nearly marshalled to strike back against your enemies, my liege.', null, null, null, null, null, null, null, null, '14467', '6', '0', '0', 'kelthuzad SAY_SAPP_DIALOG1');
INSERT INTO `script_texts` VALUES ('-1533085', 'Soon we will eradicate the Alliance and Horde, then the rest of Azeroth will fall before the might of my army.', null, null, null, null, null, null, null, null, '14768', '6', '0', '0', 'lich_king SAY_SAPP_DIALOG2_LICH');
INSERT INTO `script_texts` VALUES ('-1533086', 'Yes, Master. The time of their ultimate demise grows close...What is this?', null, null, null, null, null, null, null, null, '14468', '6', '0', '0', 'kelthuzad SAY_SAPP_DIALOG3');
INSERT INTO `script_texts` VALUES ('-1533087', 'Invaders...here?! DESTROY them, Kel\'Thuzad! Naxxramas must not fall!', null, null, null, null, null, null, null, null, '14769', '6', '0', '0', 'lich_king SAY_SAPP_DIALOG4_LICH');
INSERT INTO `script_texts` VALUES ('-1533088', 'As you command, Master!', null, null, null, null, null, null, null, null, '14469', '6', '0', '0', 'kelthuzad SAY_SAPP_DIALOG5');
INSERT INTO `script_texts` VALUES ('-1533089', 'No!!! A curse upon you, interlopers! The armies of the Lich King will hunt you down. You will not escape your fate...', null, null, null, null, null, null, null, null, '14484', '6', '0', '0', 'kelthuzad SAY_CAT_DIED');
INSERT INTO `script_texts` VALUES ('-1533090', 'Who dares violate the sanctity of my domain? Be warned, all who trespass here are doomed.', null, null, null, null, null, null, null, null, '14463', '6', '0', '0', 'kelthuzad SAY_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1533091', 'Fools, you think yourselves triumphant? You have only taken one step closer to the abyss! ', null, null, null, null, null, null, null, null, '14464', '6', '0', '0', 'kelthuzad SAY_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1533092', 'I grow tired of these games. Proceed, and I will banish your souls to oblivion!', null, null, null, null, null, null, null, null, '14465', '6', '0', '0', 'kelthuzad SAY_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1533093', 'You have no idea what horrors lie ahead. You have seen nothing! The frozen heart of Naxxramas awaits you!', null, null, null, null, null, null, null, null, '14466', '6', '0', '0', 'kelthuzad SAY_TAUNT4');
INSERT INTO `script_texts` VALUES ('-1533094', 'Pray for mercy!', null, null, null, null, null, null, null, null, '14475', '1', '0', '0', 'kelthuzad SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533095', 'Scream your dying breath!', null, null, null, null, null, null, null, null, '14476', '1', '0', '0', 'kelthuzad SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533096', 'The end is upon you!', null, null, null, null, null, null, null, null, '14477', '1', '0', '0', 'kelthuzad SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533097', 'The dark void awaits you!', null, null, null, null, null, null, null, null, '14478', '1', '0', '0', 'kelthuzad SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1533098', '<Kel\'Thuzad cackles maniacally!>', null, null, null, null, null, null, null, null, '14479', '1', '0', '0', 'kelthuzad SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1533099', 'AAAAGHHH!... Do not rejoice... your victory is a hollow one... for I shall return with powers beyond your imagining!', null, null, null, null, null, null, null, null, '14480', '1', '0', '0', 'kelthuzad SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533100', 'Your soul, is bound to me now!', null, null, null, null, null, null, null, null, '14472', '1', '0', '0', 'kelthuzad SAY_CHAIN1');
INSERT INTO `script_texts` VALUES ('-1533101', 'There will be no escape!', null, null, null, null, null, null, null, null, '14473', '1', '0', '0', 'kelthuzad SAY_CHAIN2');
INSERT INTO `script_texts` VALUES ('-1533102', 'I will freeze the blood in your veins!', null, null, null, null, null, null, null, null, '14474', '1', '0', '0', 'kelthuzad SAY_FROST_BLAST');
INSERT INTO `script_texts` VALUES ('-1533103', 'Master! I require aid! ', null, null, null, null, null, null, null, null, '14470', '1', '0', '0', 'kelthuzad SAY_REQUEST_AID');
INSERT INTO `script_texts` VALUES ('-1533104', 'Very well... warriors of the frozen wastes, rise up! I command you to fight, kill, and die for your master. Let none survive...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'kelthuzad SAY_ANSWER_REQUEST');
INSERT INTO `script_texts` VALUES ('-1533105', 'Minions, servants, soldiers of the cold dark, obey the call of Kel\'Thuzad!', null, null, null, null, null, null, null, null, '14471', '1', '0', '0', 'kelthuzad SAY_SUMMON_MINIONS');
INSERT INTO `script_texts` VALUES ('-1533106', 'Your petty magics are no challenge to the might of the Scourge! ', null, null, null, null, null, null, null, null, '14481', '1', '0', '0', 'kelthuzad SAY_SPECIAL1_MANA_DET');
INSERT INTO `script_texts` VALUES ('-1533107', 'Enough! I grow tired of these distractions! ', null, null, null, null, null, null, null, null, '14483', '1', '0', '0', 'kelthuzad SAY_SPECIAL3_MANA_DET');
INSERT INTO `script_texts` VALUES ('-1533108', 'Fools, you have spread your powers too thin. Be free, my minions!', null, null, null, null, null, null, null, null, '14482', '1', '0', '0', 'kelthuzad SAY_SPECIAL2_DISPELL');
INSERT INTO `script_texts` VALUES ('-1533109', 'You are mine now!', null, null, null, null, null, null, null, null, '8825', '1', '0', '0', 'heigan SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533110', 'I see you!', null, null, null, null, null, null, null, null, '8826', '1', '0', '0', 'heigan SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533111', 'You...are next!', null, null, null, null, null, null, null, null, '8827', '1', '0', '0', 'heigan SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533112', 'Close your eyes... sleep!', null, null, null, null, null, null, null, null, '8829', '1', '0', '0', 'heigan SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1533113', 'The races of the world will perish. It is only a matter of time.', null, null, null, null, null, null, null, null, '8830', '1', '0', '0', 'heigan SAY_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1533114', 'I see endless suffering, I see torment, I see rage. I see... everything!', null, null, null, null, null, null, null, null, '8831', '1', '0', '0', 'heigan SAY_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1533115', 'Soon... the world will tremble!', null, null, null, null, null, null, null, null, '8832', '1', '0', '0', 'heigan SAY_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1533116', 'The end is upon you.', null, null, null, null, null, null, null, null, '8833', '1', '0', '0', 'heigan SAY_CHANNELING');
INSERT INTO `script_texts` VALUES ('-1533117', 'Hungry worms will feast on your rotten flesh!', null, null, null, null, null, null, null, null, '8834', '1', '0', '0', 'heigan SAY_TAUNT4');
INSERT INTO `script_texts` VALUES ('-1533118', 'Noo... o...', null, null, null, null, null, null, null, null, '8828', '1', '0', '0', 'heigan SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533119', '%s spots a nearby Zombie to devour!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'gluth EMOTE_ZOMBIE');
INSERT INTO `script_texts` VALUES ('-1533120', 'Hah hah, I\'m just getting warmed up!', null, null, null, null, null, null, null, null, '8852', '1', '0', '0', 'razuvious SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1533121', 'Stand and fight!', null, null, null, null, null, null, null, null, '8853', '1', '0', '0', 'razuvious SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1533122', 'Show me what you\'ve got!', null, null, null, null, null, null, null, null, '8854', '1', '0', '0', 'razuvious SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1533123', 'Sweep the leg! Do you have a problem with that?', null, null, null, null, null, null, null, null, '8861', '1', '0', '0', 'razuvious SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1533124', 'You should have stayed home!', null, null, null, null, null, null, null, null, '8862', '1', '0', '0', 'razuvious SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1533125', 'Do as I taught you!', null, null, null, null, null, null, null, null, '8855', '1', '0', '0', 'razuvious SAY_COMMAND1');
INSERT INTO `script_texts` VALUES ('-1533126', 'Show them no mercy!', null, null, null, null, null, null, null, null, '8856', '1', '0', '0', 'razuvious SAY_COMMAND2');
INSERT INTO `script_texts` VALUES ('-1533127', 'You disappoint me, students!', null, null, null, null, null, null, null, null, '8858', '1', '0', '0', 'razuvious SAY_COMMAND3');
INSERT INTO `script_texts` VALUES ('-1533128', 'The time for practice is over! Show me what you\'ve learned!', null, null, null, null, null, null, null, null, '8859', '1', '0', '0', 'razuvious SAY_COMMAND4');
INSERT INTO `script_texts` VALUES ('-1533129', 'An honorable... death...', null, null, null, null, null, null, null, null, '8860', '1', '0', '0', 'razuvious SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1533130', '%s summons forth Skeletal Warriors!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'noth EMOTE_WARRIOR');
INSERT INTO `script_texts` VALUES ('-1533131', '%s raises more skeletons!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'noth EMOTE_SKELETON');
INSERT INTO `script_texts` VALUES ('-1533132', '%s teleports to the balcony above!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'noth EMOTE_TELEPORT');
INSERT INTO `script_texts` VALUES ('-1533133', '%s teleports back into the battle!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'noth EMOTE_TELEPORT_RETURN');
INSERT INTO `script_texts` VALUES ('-1533134', 'A Guardian of Icecrown enters the fight!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'kelthuzad EMOTE_GUARDIAN');
INSERT INTO `script_texts` VALUES ('-1533135', '%s strikes!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'kelthuzad EMOTE_PHASE2');
INSERT INTO `script_texts` VALUES ('-1533136', '%s teleports and begins to channel a spell!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'heigan EMOTE_TELEPORT');
INSERT INTO `script_texts` VALUES ('-1533137', '%s rushes to attack once more!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'heigan EMOTE_RETURN');
INSERT INTO `script_texts` VALUES ('-1533138', '%s teleports into the fray!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'gothik EMOTE_TO_FRAY');
INSERT INTO `script_texts` VALUES ('-1533139', 'The central gate opens!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'gothik EMOTE_GATE');
INSERT INTO `script_texts` VALUES ('-1533140', 'Brazenly you have disregarded powers beyond your understanding.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'gothik SAY_SPEECH_2');
INSERT INTO `script_texts` VALUES ('-1533141', 'You have fought hard to invade the realm of the harvester.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'gothik SAY_SPEECH_3');
INSERT INTO `script_texts` VALUES ('-1533142', 'Now there is only one way out - to walk the lonely path of the damned.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'gothik SAY_SPEECH_4');
INSERT INTO `script_texts` VALUES ('-1533143', 'An aura of necrotic energy blocks all healing!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'Loatheb EMOTE_AURA_BLOCKING');
INSERT INTO `script_texts` VALUES ('-1533144', 'The power of Necrotic Aura begins to wane!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'Loatheb EMOTE_AURA_WANE');
INSERT INTO `script_texts` VALUES ('-1533145', 'The aura fades away, allowing healing once more!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'Loatheb EMOTE_AURA_FADING');
INSERT INTO `script_texts` VALUES ('-1533146', '%s spins her web into a cocoon!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'maexxna EMOTE_SPIN_WEB');
INSERT INTO `script_texts` VALUES ('-1533147', 'Spiderlings appear on the web!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'maexxna EMOTE_SPIDERLING');
INSERT INTO `script_texts` VALUES ('-1533148', '%s sprays strands of web everywhere!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'maexxna EMOTE_SPRAY');
INSERT INTO `script_texts` VALUES ('-1533149', '%s loses its link!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'tesla_coil EMOTE_LOSING_LINK');
INSERT INTO `script_texts` VALUES ('-1533150', '%s overloads!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'tesla_coil EMOTE_TESLA_OVERLOAD');
INSERT INTO `script_texts` VALUES ('-1533151', 'The polarity has shifted!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'thaddius EMOTE_POLARITY_SHIFT');
INSERT INTO `script_texts` VALUES ('-1533152', '%s decimates all nearby flesh!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'gluth EMOTE_DECIMATE');
INSERT INTO `script_texts` VALUES ('-1533153', 'A %s joins the fight!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'crypt_guard EMOTE_CRYPT_GUARD');
INSERT INTO `script_texts` VALUES ('-1533154', '%s begins to unleash an insect swarm!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'anubrekhan EMOTE_INSECT_SWARM');
INSERT INTO `script_texts` VALUES ('-1533155', 'Corpse Scarabs appear from a Crypt Guard\'s corpse!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'anubrekhan EMOTE_CORPSE_SCARABS');
INSERT INTO `script_texts` VALUES ('-1533156', '%s casts Unyielding Pain on everyone!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'lady_blaumeux EMOTE_UNYIELDING_PAIN');
INSERT INTO `script_texts` VALUES ('-1533157', '%s casts Condemation on everyone!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'sir_zeliek EMOTE_CONDEMATION');
INSERT INTO `script_texts` VALUES ('-1533158', '%s injects you with a mutagen!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'grobbulus EMOTE_INJECTION');
INSERT INTO `script_texts` VALUES ('-1534000', 'I\'m in jeopardy, help me if you can!', null, null, null, null, null, null, null, null, '11007', '1', '0', '0', 'jaina hyjal ATTACKED 1');
INSERT INTO `script_texts` VALUES ('-1534001', 'They\'ve broken through!', null, null, null, null, null, null, null, null, '11049', '1', '0', '0', 'jaina hyjal ATTACKED 2');
INSERT INTO `script_texts` VALUES ('-1534002', 'Stay alert! Another wave approaches.', null, null, null, null, null, null, null, null, '11008', '1', '0', '0', 'jaina hyjal INCOMING');
INSERT INTO `script_texts` VALUES ('-1534003', 'Don\'t give up! We must prevail!', null, null, null, null, null, null, null, null, '11006', '1', '0', '0', 'jaina hyjal BEGIN');
INSERT INTO `script_texts` VALUES ('-1534004', 'Hold them back as long as possible.', null, null, null, null, null, null, null, null, '11050', '1', '0', '0', 'jaina hyjal RALLY 1');
INSERT INTO `script_texts` VALUES ('-1534005', 'We must hold strong!', null, null, null, null, null, null, null, null, '11051', '1', '0', '0', 'jaina hyjal RALLY 2');
INSERT INTO `script_texts` VALUES ('-1534006', 'We are lost. Fall back!', null, null, null, null, null, null, null, null, '11009', '1', '0', '0', 'jaina hyjal FAILURE');
INSERT INTO `script_texts` VALUES ('-1534007', 'We have won valuable time. Now we must pull back!', null, null, null, null, null, null, null, null, '11011', '1', '0', '0', 'jaina hyjal SUCCESS');
INSERT INTO `script_texts` VALUES ('-1534008', 'I did... my best.', null, null, null, null, null, null, null, null, '11010', '1', '0', '0', 'jaina hyjal DEATH');
INSERT INTO `script_texts` VALUES ('-1534009', 'I will lie down for no one!', null, null, null, null, null, null, null, null, '11031', '1', '0', '0', 'thrall hyjal ATTACKED 1');
INSERT INTO `script_texts` VALUES ('-1534010', 'Bring the fight to me and pay with your lives!', null, null, null, null, null, null, null, null, '11061', '1', '0', '0', 'thrall hyjal ATTACKED 2');
INSERT INTO `script_texts` VALUES ('-1534011', 'Make ready for another wave! LOK-TAR OGAR!', null, null, null, null, null, null, null, null, '11032', '1', '0', '0', 'thrall hyjal INCOMING');
INSERT INTO `script_texts` VALUES ('-1534012', 'Hold them back! Do not falter!', null, null, null, null, null, null, null, null, '11030', '1', '0', '0', 'thrall hyjal BEGIN');
INSERT INTO `script_texts` VALUES ('-1534013', 'Victory or death!', null, null, null, null, null, null, null, null, '11059', '1', '0', '0', 'thrall hyjal RALLY 1');
INSERT INTO `script_texts` VALUES ('-1534014', 'Do not give an inch of ground!', null, null, null, null, null, null, null, null, '11060', '1', '0', '0', 'thrall hyjal RALLY 2');
INSERT INTO `script_texts` VALUES ('-1534015', 'It is over. Withdraw! We have failed.', null, null, null, null, null, null, null, null, '11033', '1', '0', '0', 'thrall hyjal FAILURE');
INSERT INTO `script_texts` VALUES ('-1534016', 'We have played our part and done well. It is up to the others now.', null, null, null, null, null, null, null, null, '11035', '1', '0', '0', 'thrall hyjal SUCCESS');
INSERT INTO `script_texts` VALUES ('-1534017', 'Uraaa...', null, null, null, null, null, null, null, null, '11034', '1', '0', '0', 'thrall hyjal DEATH');
INSERT INTO `script_texts` VALUES ('-1534018', 'All of your efforts have been in vain, for the draining of the World Tree has already begun. Soon the heart of your world will beat no more.', null, null, null, null, null, null, null, null, '10986', '1', '0', '0', 'archimonde SAY_PRE_EVENTS_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1534019', 'Your resistance is insignificant.', null, null, null, null, null, null, null, null, '10987', '1', '0', '0', 'archimonde SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1534020', 'This world will burn!', null, null, null, null, null, null, null, null, '10990', '1', '0', '0', 'archimonde SAY_DOOMFIRE1');
INSERT INTO `script_texts` VALUES ('-1534021', 'Manach sheek-thrish!', null, null, null, null, null, null, null, null, '11041', '1', '0', '0', 'archimonde SAY_DOOMFIRE2');
INSERT INTO `script_texts` VALUES ('-1534022', 'A-kreesh!', null, null, null, null, null, null, null, null, '10989', '1', '0', '0', 'archimonde SAY_AIR_BURST1');
INSERT INTO `script_texts` VALUES ('-1534023', 'Away vermin!', null, null, null, null, null, null, null, null, '11043', '1', '0', '0', 'archimonde SAY_AIR_BURST2');
INSERT INTO `script_texts` VALUES ('-1534024', 'All creation will be devoured!', null, null, null, null, null, null, null, null, '11044', '1', '0', '0', 'archimonde SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1534025', 'Your soul will languish for eternity.', null, null, null, null, null, null, null, null, '10991', '1', '0', '0', 'archimonde SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1534026', 'I am the coming of the end!', null, null, null, null, null, null, null, null, '11045', '1', '0', '0', 'archimonde SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1534027', 'At last it is here. Mourn and lament the passing of all you have ever known and all that would have been! Akmin-kurai!', null, null, null, null, null, null, null, null, '10993', '1', '0', '0', 'archimonde SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1534028', 'No, it cannot be! Nooo!', null, null, null, null, null, null, null, null, '10992', '1', '0', '0', 'archimonde SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1534029', 'You are mine now.', null, null, null, null, null, null, null, null, '10988', '1', '0', '0', 'archimonde SAY_SOUL_CHARGE1');
INSERT INTO `script_texts` VALUES ('-1534030', 'Bow to my will.', null, null, null, null, null, null, null, null, '11042', '1', '0', '0', 'archimonde SAY_SOUL_CHARGE2');
INSERT INTO `script_texts` VALUES ('-1540000', 'You wish to fight us all at once? This should be amusing!', null, null, null, null, null, null, null, null, '10262', '1', '0', '0', 'nethekurse SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1540001', 'You can have that one. I no longer need him.', null, null, null, null, null, null, null, null, '10263', '1', '0', '0', 'nethekurse PEON_ATTACK_1');
INSERT INTO `script_texts` VALUES ('-1540002', 'Yes, beat him mercilessly. His skull is a thick as an ogres.', null, null, null, null, null, null, null, null, '10264', '1', '0', '0', 'nethekurse PEON_ATTACK_2');
INSERT INTO `script_texts` VALUES ('-1540003', 'Don\'t waste your time on that one. He\'s weak!', null, null, null, null, null, null, null, null, '10265', '1', '0', '0', 'nethekurse PEON_ATTACK_3');
INSERT INTO `script_texts` VALUES ('-1540004', 'You want him? Very well, take him!', null, null, null, null, null, null, null, null, '10266', '1', '0', '0', 'nethekurse PEON_ATTACK_4');
INSERT INTO `script_texts` VALUES ('-1540005', 'One pitiful wretch down. Go on, take another one.', null, null, null, null, null, null, null, null, '10267', '1', '0', '0', 'nethekurse PEON_DIE_1');
INSERT INTO `script_texts` VALUES ('-1540006', 'Ahh, what a waste... Next!', null, null, null, null, null, null, null, null, '10268', '1', '0', '0', 'nethekurse PEON_DIE_2');
INSERT INTO `script_texts` VALUES ('-1540007', 'I was going to kill him anyway!', null, null, null, null, null, null, null, null, '10269', '1', '0', '0', 'nethekurse PEON_DIE_3');
INSERT INTO `script_texts` VALUES ('-1540008', 'Thank you for saving me the trouble! Now it\'s my turn to have some fun...', null, null, null, null, null, null, null, null, '10270', '1', '0', '0', 'nethekurse PEON_DIE_4');
INSERT INTO `script_texts` VALUES ('-1540009', 'Beg for your pittyfull life!', null, null, null, null, null, null, null, null, '10259', '1', '0', '0', 'nethekurse SAY_TAUNT_1');
INSERT INTO `script_texts` VALUES ('-1540010', 'Run covad, ruun!', null, null, null, null, null, null, null, null, '10260', '1', '0', '0', 'nethekurse SAY_TAUNT_2');
INSERT INTO `script_texts` VALUES ('-1540011', 'Your pain amuses me.', null, null, null, null, null, null, null, null, '10261', '1', '0', '0', 'nethekurse SAY_TAUNT_3');
INSERT INTO `script_texts` VALUES ('-1540012', 'I\'m already bored.', null, null, null, null, null, null, null, null, '10271', '1', '0', '0', 'nethekurse SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1540013', 'Come on! ... Show me a real fight.', null, null, null, null, null, null, null, null, '10272', '1', '0', '0', 'nethekurse SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1540014', 'I had more fun torturing the peons.', null, null, null, null, null, null, null, null, '10273', '1', '0', '0', 'nethekurse SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1540015', 'You Loose.', null, null, null, null, null, null, null, null, '10274', '1', '0', '0', 'nethekurse SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1540016', 'Ohh! Just die.', null, null, null, null, null, null, null, null, '10275', '1', '0', '0', 'nethekurse SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1540017', 'What a ... a shame.', null, null, null, null, null, null, null, null, '10276', '1', '0', '0', 'nethekurse SAY_DIE');
INSERT INTO `script_texts` VALUES ('-1540018', 'Smash!', null, null, null, null, null, null, null, null, '10306', '1', '0', '0', 'omrogg GoCombat_1');
INSERT INTO `script_texts` VALUES ('-1540019', 'If you nice me let you live.', null, null, null, null, null, null, null, null, '10308', '1', '0', '0', 'omrogg GoCombat_2');
INSERT INTO `script_texts` VALUES ('-1540020', 'Me hungry!', null, null, null, null, null, null, null, null, '10309', '1', '0', '0', 'omrogg GoCombat_3');
INSERT INTO `script_texts` VALUES ('-1540021', 'Why don\'t you let me do the talking?', null, null, null, null, null, null, null, null, '10317', '1', '0', '0', 'omrogg GoCombatDelay_1');
INSERT INTO `script_texts` VALUES ('-1540022', 'No, we will NOT let you live!', null, null, null, null, null, null, null, null, '10318', '1', '0', '0', 'omrogg GoCombatDelay_2');
INSERT INTO `script_texts` VALUES ('-1540023', 'You always hungry. That why we so fat!', null, null, null, null, null, null, null, null, '10319', '1', '0', '0', 'omrogg GoCombatDelay_3');
INSERT INTO `script_texts` VALUES ('-1540024', 'You stay here. Me go kill someone else!', null, null, null, null, null, null, null, null, '10303', '1', '0', '0', 'omrogg Threat_1');
INSERT INTO `script_texts` VALUES ('-1540025', 'What are you doing!', null, null, null, null, null, null, null, null, '10315', '1', '0', '0', 'omrogg Threat_2');
INSERT INTO `script_texts` VALUES ('-1540026', 'Me kill someone else...', null, null, null, null, null, null, null, null, '10302', '1', '0', '0', 'omrogg Threat_3');
INSERT INTO `script_texts` VALUES ('-1540027', 'Me not like this one...', null, null, null, null, null, null, null, null, '10300', '1', '0', '0', 'omrogg Threat_4');
INSERT INTO `script_texts` VALUES ('-1540028', 'That\'s not funny!', null, null, null, null, null, null, null, null, '10314', '1', '0', '0', 'omrogg ThreatDelay1_1');
INSERT INTO `script_texts` VALUES ('-1540029', 'Me get bored...', null, null, null, null, null, null, null, null, '10305', '1', '0', '0', 'omrogg ThreatDelay1_2');
INSERT INTO `script_texts` VALUES ('-1540030', 'I\'m not done yet, idiot!', null, null, null, null, null, null, null, null, '10313', '1', '0', '0', 'omrogg ThreatDelay1_3');
INSERT INTO `script_texts` VALUES ('-1540031', 'Hey you numbskull!', null, null, null, null, null, null, null, null, '10312', '1', '0', '0', 'omrogg ThreatDelay1_4');
INSERT INTO `script_texts` VALUES ('-1540032', 'Ha ha ha.', null, null, null, null, null, null, null, null, '10304', '1', '0', '0', 'omrogg ThreatDelay2_1');
INSERT INTO `script_texts` VALUES ('-1540033', 'Whhy! He almost dead!', null, null, null, null, null, null, null, null, '10316', '1', '0', '0', 'omrogg ThreatDelay2_2');
INSERT INTO `script_texts` VALUES ('-1540034', 'H\'ey...', null, null, null, null, null, null, null, null, '10307', '1', '0', '0', 'omrogg ThreatDelay2_3');
INSERT INTO `script_texts` VALUES ('-1540035', 'We kill his friend!', null, null, null, null, null, null, null, null, '10301', '1', '0', '0', 'omrogg ThreatDelay2_4');
INSERT INTO `script_texts` VALUES ('-1540036', 'This one die easy!', null, null, null, null, null, null, null, null, '10310', '1', '0', '0', 'omrogg Killing_1');
INSERT INTO `script_texts` VALUES ('-1540037', 'I\'m tired. You kill next one!', null, null, null, null, null, null, null, null, '10320', '1', '0', '0', 'omrogg Killing_2');
INSERT INTO `script_texts` VALUES ('-1540038', 'That\'s because I do all the hard work!', null, null, null, null, null, null, null, null, '10321', '1', '0', '0', 'omrogg KillingDelay_1');
INSERT INTO `script_texts` VALUES ('-1540039', 'This all...your fault!', null, null, null, null, null, null, null, null, '10311', '1', '0', '0', 'omrogg YELL_DIE_L');
INSERT INTO `script_texts` VALUES ('-1540040', 'I...hate...you...', null, null, null, null, null, null, null, null, '10322', '1', '0', '0', 'omrogg YELL_DIE_R');
INSERT INTO `script_texts` VALUES ('-1540041', '%s enrages!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'omrogg EMOTE_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1540042', 'Ours is the true Horde! The only Horde!', null, null, null, null, null, null, null, null, '10323', '1', '0', '0', 'kargath SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1540043', 'I\'ll carve the meat from your bones!', null, null, null, null, null, null, null, null, '10324', '1', '0', '0', 'kargath SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1540044', 'I am called Bladefist for a reason, as you will see!', null, null, null, null, null, null, null, null, '10325', '1', '0', '0', 'kargath SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1540045', 'For the real Horde!', null, null, null, null, null, null, null, null, '10326', '1', '0', '0', 'kargath SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1540046', 'I am the only Warchief!', null, null, null, null, null, null, null, null, '10327', '1', '0', '0', 'kargath SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1540047', 'The true Horde... will.. prevail...', null, null, null, null, null, null, null, null, '10328', '1', '0', '0', 'kargath SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1540048', 'Cowards! You\'ll never pull me into the shadows!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'kargath SAY_EVADE');
INSERT INTO `script_texts` VALUES ('-1540049', 'The Alliance dares to intrude this far into my fortress? Bring out the Honor Hold prisoners and call for the executioner! They\'ll pay with their lives for this trespass!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'kargath SAY_EXECUTE_ALLY');
INSERT INTO `script_texts` VALUES ('-1540050', 'It looks like we have a ranking officer among our captives...how amusing. Execute the green-skinned dog at once!', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'kargath SAY_EXECUTE_HORDE');
INSERT INTO `script_texts` VALUES ('-1542000', 'Who dares interrupt... What is this? What have you done? You ruin everything!', null, null, null, null, null, null, null, null, '10164', '1', '0', '0', 'kelidan SAY_WAKE');
INSERT INTO `script_texts` VALUES ('-1542001', 'You mustn\'t let him loose!', null, null, null, null, null, null, null, null, '10166', '1', '0', '0', 'kelidan SAY_ADD_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1542002', 'Ignorant whelps!', null, null, null, null, null, null, null, null, '10167', '1', '0', '0', 'kelidan SAY_ADD_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1542003', 'You fools! He\'ll kill us all!', null, null, null, null, null, null, null, null, '10168', '1', '0', '0', 'kelidan SAY_ADD_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1542004', 'Just as you deserve!', null, null, null, null, null, null, null, null, '10169', '1', '0', '0', 'kelidan SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1542005', 'Your friends will soon be joining you.', null, null, null, null, null, null, null, null, '10170', '1', '0', '0', 'kelidan SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1542006', 'Closer... Come closer.. and burn!', null, null, null, null, null, null, null, null, '10165', '1', '0', '0', 'kelidan SAY_NOVA');
INSERT INTO `script_texts` VALUES ('-1542007', 'Good luck... you\'ll need it..', null, null, null, null, null, null, null, null, '10171', '1', '0', '0', 'kelidan SAY_DIE');
INSERT INTO `script_texts` VALUES ('-1542008', 'Come intruders....', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'broggok SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1542009', 'My work must not be interrupted.', null, null, null, null, null, null, null, null, '10286', '1', '0', '0', 'the_maker SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1542010', 'Perhaps I can find a use for you.', null, null, null, null, null, null, null, null, '10287', '1', '0', '0', 'the_maker SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1542011', 'Anger... Hate... These are tools I can use.', null, null, null, null, null, null, null, null, '10288', '1', '0', '0', 'the_maker SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1542012', 'Let\'s see what I can make of you.', null, null, null, null, null, null, null, null, '10289', '1', '0', '0', 'the_maker SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1542013', 'It is pointless to resist.', null, null, null, null, null, null, null, null, '10290', '1', '0', '0', 'the_maker SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1542014', 'Stay away from... me.', null, null, null, null, null, null, null, null, '10291', '1', '0', '0', 'the_maker SAY_DIE');
INSERT INTO `script_texts` VALUES ('-1542015', 'Kill them!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'broggok SAY_BROGGOK_INTRO');
INSERT INTO `script_texts` VALUES ('-1542016', 'How long do you beleive your pathetic sorcery can hold me?', null, null, null, null, null, null, null, null, '0', '6', '0', '0', 'magtheridon SAY_MAGTHERIDON_WARN');
INSERT INTO `script_texts` VALUES ('-1543000', 'Do you smell that? Fresh meat has somehow breached our citadel. Be wary of any intruders.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'gargolmar SAY_TAUNT');
INSERT INTO `script_texts` VALUES ('-1543001', 'Heal me! QUICKLY!', null, null, null, null, null, null, null, null, '10329', '1', '0', '0', 'gargolmar SAY_HEAL');
INSERT INTO `script_texts` VALUES ('-1543002', 'Back off, pup!', null, null, null, null, null, null, null, null, '10330', '1', '0', '0', 'gargolmar SAY_SURGE');
INSERT INTO `script_texts` VALUES ('-1543003', 'What have we here...?', null, null, null, null, null, null, null, null, '10331', '1', '0', '0', 'gargolmar SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1543004', 'Heh... this may hurt a little.', null, null, null, null, null, null, null, null, '10332', '1', '0', '0', 'gargolmar SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1543005', 'I\'m gonna enjoy this.', null, null, null, null, null, null, null, null, '10333', '1', '0', '0', 'gargolmar SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1543006', 'Say farewell!', null, null, null, null, null, null, null, null, '10334', '1', '0', '0', 'gargolmar SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1543007', 'Much too easy...', null, null, null, null, null, null, null, null, '10335', '1', '0', '0', 'gargolmar SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1543008', 'Hahah.. <cough> ..argh!', null, null, null, null, null, null, null, null, '10336', '1', '0', '0', 'gargolmar SAY_DIE');
INSERT INTO `script_texts` VALUES ('-1543009', 'You dare stand against me?!', null, null, null, null, null, null, null, null, '10280', '1', '0', '0', 'omor SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1543010', 'I will not be defeated!', null, null, null, null, null, null, null, null, '10279', '1', '0', '0', 'omor SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1543011', 'Your insolence will be your death.', null, null, null, null, null, null, null, null, '10281', '1', '0', '0', 'omor SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1543012', 'Achor-she-ki! Feast my pet! Eat your fill!', null, null, null, null, null, null, null, null, '10277', '1', '0', '0', 'omor SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1543013', 'A-Kreesh!', null, null, null, null, null, null, null, null, '10278', '1', '0', '0', 'omor SAY_CURSE');
INSERT INTO `script_texts` VALUES ('-1543014', 'Die, weakling!', null, null, null, null, null, null, null, null, '10282', '1', '0', '0', 'omor SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1543015', 'It is... not over.', null, null, null, null, null, null, null, null, '10284', '1', '0', '0', 'omor SAY_DIE');
INSERT INTO `script_texts` VALUES ('-1543016', 'I am victorious!', null, null, null, null, null, null, null, null, '10283', '1', '0', '0', 'omor SAY_WIPE');
INSERT INTO `script_texts` VALUES ('-1543017', 'You have faced many challenges, pity they were all in vain. Soon your people will kneel to my lord!', null, null, null, null, null, null, null, null, '10292', '1', '0', '0', 'vazruden SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1543018', 'Your time is running out!', null, null, null, null, null, null, null, null, '10294', '1', '0', '0', 'vazruden SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1543019', 'You are nothing, I answer a higher call!', null, null, null, null, null, null, null, null, '10295', '1', '0', '0', 'vazruden SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1543020', 'The Dark Lord laughs at you!', null, null, null, null, null, null, null, null, '10296', '1', '0', '0', 'vazruden SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1543021', 'Is there no one left to test me?', null, null, null, null, null, null, null, null, '10293', '1', '0', '0', 'vazruden SAY_TAUNT');
INSERT INTO `script_texts` VALUES ('-1543022', 'It is over. Finished!', null, null, null, null, null, null, null, null, '10297', '1', '0', '0', 'vazruden SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1543023', 'Your days are done!', null, null, null, null, null, null, null, null, '10298', '1', '0', '0', 'vazruden SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1543024', 'My lord will be the end you all...', null, null, null, null, null, null, null, null, '10299', '1', '0', '0', 'vazruden SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1543025', '%s descends from the sky.', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'vazruden EMOTE_DESCEND');
INSERT INTO `script_texts` VALUES ('-1544000', 'Wretched, meddling insects. Release me and perhaps i will grant you a merciful death!', null, null, null, null, null, null, null, null, '10247', '1', '0', '0', 'magtheridon SAY_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1544001', 'Vermin! Leeches! Take my blood and choke on it!', null, null, null, null, null, null, null, null, '10248', '1', '0', '0', 'magtheridon SAY_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1544002', 'Illidan is an arrogant fool. I will crush him and reclaim Outland as my own.', null, null, null, null, null, null, null, null, '10249', '1', '0', '0', 'magtheridon SAY_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1544003', 'Away, you mindless parasites. My blood is my own!', null, null, null, null, null, null, null, null, '10250', '1', '0', '0', 'magtheridon SAY_TAUNT4');
INSERT INTO `script_texts` VALUES ('-1544004', 'How long do you believe your pathetic sorcery can hold me?', null, null, null, null, null, null, null, null, '10251', '1', '0', '0', 'magtheridon SAY_TAUNT5');
INSERT INTO `script_texts` VALUES ('-1544005', 'My blood will be the end of you!', null, null, null, null, null, null, null, null, '10252', '1', '0', '0', 'magtheridon SAY_TAUNT6');
INSERT INTO `script_texts` VALUES ('-1544006', 'I...am...UNLEASHED!!!', null, null, null, null, null, null, null, null, '10253', '1', '0', '0', 'magtheridon SAY_FREED');
INSERT INTO `script_texts` VALUES ('-1544007', 'Thank you for releasing me. Now...die!', null, null, null, null, null, null, null, null, '10254', '1', '0', '0', 'magtheridon SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1544008', 'Not again...NOT AGAIN!', null, null, null, null, null, null, null, null, '10256', '1', '0', '0', 'magtheridon SAY_BANISH');
INSERT INTO `script_texts` VALUES ('-1544009', 'I will not be taken so easily. Let the walls of this prison tremble...and FALL!!!', null, null, null, null, null, null, null, null, '10257', '1', '0', '0', 'magtheridon SAY_CHAMBER_DESTROY');
INSERT INTO `script_texts` VALUES ('-1544010', 'Did you think me weak? Soft? Who is the weak one now?!', null, null, null, null, null, null, null, null, '10255', '1', '0', '0', 'magtheridon SAY_PLAYER_KILLED');
INSERT INTO `script_texts` VALUES ('-1544011', 'The Legion...will consume you...all...', null, null, null, null, null, null, null, null, '10258', '1', '0', '0', 'magtheridon SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1544012', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1544013', '%s begins to cast Blast Nova!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'magtheridon EMOTE_BLASTNOVA');
INSERT INTO `script_texts` VALUES ('-1544014', '%s\'s bonds begin to weaken!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'magtheridon EMOTE_BEGIN');
INSERT INTO `script_texts` VALUES ('-1544015', '%s breaks free!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'magtheridon EMOTE_FREED');
INSERT INTO `script_texts` VALUES ('-1545000', 'Surge forth my pets!', null, null, null, null, null, null, null, null, '10360', '1', '0', '0', 'thespia SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1545001', 'The depths will consume you!', null, null, null, null, null, null, null, null, '10361', '1', '0', '0', 'thespia SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1545002', 'Meet your doom, surface dwellers!', null, null, null, null, null, null, null, null, '10362', '1', '0', '0', 'thespia SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1545003', 'You will drown in blood!', null, null, null, null, null, null, null, null, '10363', '1', '0', '0', 'thespia SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1545004', 'To the depths of oblivion with you!', null, null, null, null, null, null, null, null, '10364', '1', '0', '0', 'thespia SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1545005', 'For my lady and master!', null, null, null, null, null, null, null, null, '10365', '1', '0', '0', 'thespia SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1545006', 'Our matron will be.. the end of.. you..', null, null, null, null, null, null, null, null, '10366', '1', '0', '0', 'thespia SAY_DEAD');
INSERT INTO `script_texts` VALUES ('-1545007', 'I\'m bringin\' the pain!', null, null, null, null, null, null, null, null, '10367', '1', '0', '0', 'mekgineer SAY_MECHANICS');
INSERT INTO `script_texts` VALUES ('-1545008', 'You\'re in for a world of hurt!', null, null, null, null, null, null, null, null, '10368', '1', '0', '0', 'mekgineer SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1545009', 'Eat hot metal, scumbag!', null, null, null, null, null, null, null, null, '10369', '1', '0', '0', 'mekgineer SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1545010', 'I\'ll come over there!', null, null, null, null, null, null, null, null, '10370', '1', '0', '0', 'mekgineer SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1545011', 'I\'m bringin\' the pain!', null, null, null, null, null, null, null, null, '10371', '1', '0', '0', 'mekgineer SAY_AGGRO_4');
INSERT INTO `script_texts` VALUES ('-1545012', 'You just got served, punk!', null, null, null, null, null, null, null, null, '10372', '1', '0', '0', 'mekgineer SOUND_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1545013', 'I own you!', null, null, null, null, null, null, null, null, '10373', '1', '0', '0', 'mekgineer SOUND_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1545014', 'Have fun dyin\', cupcake!', null, null, null, null, null, null, null, null, '10374', '1', '0', '0', 'mekgineer SOUND_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1545015', 'Mommy!', null, null, null, null, null, null, null, null, '10375', '1', '0', '0', 'mekgineer SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1545016', 'You deem yourselves worthy simply because you bested my guards? Our work here will not be compromised!', null, null, null, null, null, null, null, null, '10390', '1', '0', '0', 'kalithresh SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1545017', 'This is not nearly over...', null, null, null, null, null, null, null, null, '10391', '1', '0', '0', 'kalithresh SAY_REGEN');
INSERT INTO `script_texts` VALUES ('-1545018', 'Your head will roll!', null, null, null, null, null, null, null, null, '10392', '1', '0', '0', 'kalithresh SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1545019', 'I despise all of your kind!', null, null, null, null, null, null, null, null, '10393', '1', '0', '0', 'kalithresh SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1545020', 'Ba\'ahntha sol\'dorei!', null, null, null, null, null, null, null, null, '10394', '1', '0', '0', 'kalithresh SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1545021', 'Scram, surface filth!', null, null, null, null, null, null, null, null, '10395', '1', '0', '0', 'kalithresh SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1545022', 'Ah ha ha ha ha ha ha!', null, null, null, null, null, null, null, null, '10396', '1', '0', '0', 'kalithresh SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1545023', 'For her Excellency... for... Vashj!', null, null, null, null, null, null, null, null, '10397', '1', '0', '0', 'kalithresh SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1545024', 'Enjoy the storm, warm bloods!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'thespia SAY_CLOUD');
INSERT INTO `script_texts` VALUES ('-1548000', 'I cannot allow you to interfere!', null, null, null, null, null, null, null, null, '11289', '1', '0', '0', 'hydross SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1548001', 'Better, much better.', null, null, null, null, null, null, null, null, '11290', '1', '0', '0', 'hydross SAY_SWITCH_TO_CLEAN');
INSERT INTO `script_texts` VALUES ('-1548002', 'They have forced me to this...', null, null, null, null, null, null, null, null, '11291', '1', '0', '0', 'hydross SAY_CLEAN_SLAY1');
INSERT INTO `script_texts` VALUES ('-1548003', 'I have no choice.', null, null, null, null, null, null, null, null, '11292', '1', '0', '0', 'hydross SAY_CLEAN_SLAY2');
INSERT INTO `script_texts` VALUES ('-1548004', 'I am... released...', null, null, null, null, null, null, null, null, '11293', '1', '0', '0', 'hydross SAY_CLEAN_DEATH');
INSERT INTO `script_texts` VALUES ('-1548005', 'Aaghh, the poison...', null, null, null, null, null, null, null, null, '11297', '1', '0', '0', 'hydross SAY_SWITCH_TO_CORRUPT');
INSERT INTO `script_texts` VALUES ('-1548006', 'I will purge you from this place.', null, null, null, null, null, null, null, null, '11298', '1', '0', '0', 'hydross SAY_CORRUPT_SLAY1');
INSERT INTO `script_texts` VALUES ('-1548007', 'You are no better than they!', null, null, null, null, null, null, null, null, '11299', '1', '0', '0', 'hydross SAY_CORRUPT_SLAY2');
INSERT INTO `script_texts` VALUES ('-1548008', 'You are the disease, not I', null, null, null, null, null, null, null, null, '11300', '1', '0', '0', 'hydross SAY_CORRUPT_DEATH');
INSERT INTO `script_texts` VALUES ('-1548009', 'Finally, my banishment ends!', null, null, null, null, null, null, null, null, '11312', '1', '0', '0', 'leotheras SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1548010', 'Be gone, trifling elf.  I am in control now!', null, null, null, null, null, null, null, null, '11304', '1', '0', '0', 'leotheras SAY_SWITCH_TO_DEMON');
INSERT INTO `script_texts` VALUES ('-1548011', 'We all have our demons...', null, null, null, null, null, null, null, null, '11305', '1', '0', '0', 'leotheras SAY_INNER_DEMONS');
INSERT INTO `script_texts` VALUES ('-1548012', 'I have no equal.', null, null, null, null, null, null, null, null, '11306', '1', '0', '0', 'leotheras SAY_DEMON_SLAY1');
INSERT INTO `script_texts` VALUES ('-1548013', 'Perish, mortal.', null, null, null, null, null, null, null, null, '11307', '1', '0', '0', 'leotheras SAY_DEMON_SLAY2');
INSERT INTO `script_texts` VALUES ('-1548014', 'Yes, YES! Ahahah!', null, null, null, null, null, null, null, null, '11308', '1', '0', '0', 'leotheras SAY_DEMON_SLAY3');
INSERT INTO `script_texts` VALUES ('-1548015', 'Kill! KILL!', null, null, null, null, null, null, null, null, '11314', '1', '0', '0', 'leotheras SAY_NIGHTELF_SLAY1');
INSERT INTO `script_texts` VALUES ('-1548016', 'That\'s right! Yes!', null, null, null, null, null, null, null, null, '11315', '1', '0', '0', 'leotheras SAY_NIGHTELF_SLAY2');
INSERT INTO `script_texts` VALUES ('-1548017', 'Who\'s the master now?', null, null, null, null, null, null, null, null, '11316', '1', '0', '0', 'leotheras SAY_NIGHTELF_SLAY3');
INSERT INTO `script_texts` VALUES ('-1548018', 'No... no! What have you done? I am the master! Do you hear me? I am... aaggh! Can\'t... contain him...', null, null, null, null, null, null, null, null, '11313', '1', '0', '0', 'leotheras SAY_FINAL_FORM');
INSERT INTO `script_texts` VALUES ('-1548019', 'At last I am liberated. It has been too long since I have tasted true freedom!', null, null, null, null, null, null, null, null, '11309', '1', '0', '0', 'leotheras SAY_FREE');
INSERT INTO `script_texts` VALUES ('-1548020', 'You cannot kill me! Fools, I\'ll be back! I\'ll... aarghh...', null, null, null, null, null, null, null, null, '11317', '1', '0', '0', 'leotheras SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1548021', 'Guards, attention! We have visitors...', null, null, null, null, null, null, null, null, '11277', '1', '0', '0', 'karathress SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1548022', 'Your overconfidence will be your undoing! Guards, lend me your strength!', null, null, null, null, null, null, null, null, '11278', '1', '0', '0', 'karathress SAY_GAIN_BLESSING');
INSERT INTO `script_texts` VALUES ('-1548023', 'Go on, kill them! I\'ll be the better for it!', null, null, null, null, null, null, null, null, '11279', '1', '0', '0', 'karathress SAY_GAIN_ABILITY1');
INSERT INTO `script_texts` VALUES ('-1548024', 'I am more powerful than ever!', null, null, null, null, null, null, null, null, '11280', '1', '0', '0', 'karathress SAY_GAIN_ABILITY2');
INSERT INTO `script_texts` VALUES ('-1548025', 'More knowledge, more power!', null, null, null, null, null, null, null, null, '11281', '1', '0', '0', 'karathress SAY_GAIN_ABILITY3');
INSERT INTO `script_texts` VALUES ('-1548026', 'Land-dwelling scum!', null, null, null, null, null, null, null, null, '11282', '1', '0', '0', 'karathress SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1548027', 'Alana be\'lendor!', null, null, null, null, null, null, null, null, '11283', '1', '0', '0', 'karathress SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1548028', 'I am rid of you.', null, null, null, null, null, null, null, null, '11284', '1', '0', '0', 'karathress SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1548029', 'Her ... excellency ... awaits!', null, null, null, null, null, null, null, null, '11285', '1', '0', '0', 'karathress SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1548030', 'Flood of the deep, take you!', null, null, null, null, null, null, null, null, '11321', '1', '0', '0', 'morogrim SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1548031', 'By the Tides, kill them at once!', null, null, null, null, null, null, null, null, '11322', '1', '0', '0', 'morogrim SAY_SUMMON1');
INSERT INTO `script_texts` VALUES ('-1548032', 'Destroy them my subjects!', null, null, null, null, null, null, null, null, '11323', '1', '0', '0', 'morogrim SAY_SUMMON2');
INSERT INTO `script_texts` VALUES ('-1548033', 'There is nowhere to hide!', null, null, null, null, null, null, null, null, '11324', '1', '0', '0', 'morogrim SAY_SUMMON_BUBL1');
INSERT INTO `script_texts` VALUES ('-1548034', 'Soon it will be finished!', null, null, null, null, null, null, null, null, '11325', '1', '0', '0', 'morogrim SAY_SUMMON_BUBL2');
INSERT INTO `script_texts` VALUES ('-1548035', 'It is done!', null, null, null, null, null, null, null, null, '11326', '1', '0', '0', 'morogrim SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1548036', 'Strugging only makes it worse.', null, null, null, null, null, null, null, null, '11327', '1', '0', '0', 'morogrim SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1548037', 'Only the strong survive.', null, null, null, null, null, null, null, null, '11328', '1', '0', '0', 'morogrim SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1548038', 'Great... currents of... Ageon.', null, null, null, null, null, null, null, null, '11329', '1', '0', '0', 'morogrim SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1548039', '%s sends his enemies to their watery graves!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'morogrim EMOTE_WATERY_GRAVE');
INSERT INTO `script_texts` VALUES ('-1548040', 'The violent earthquake has alerted nearby murlocs!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'morogrim EMOTE_EARTHQUAKE');
INSERT INTO `script_texts` VALUES ('-1548041', '%s summons Watery Globules!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'morogrim EMOTE_WATERY_GLOBULES');
INSERT INTO `script_texts` VALUES ('-1548042', 'Water is life. It has become a rare commodity here in Outland. A commodity that we alone shall control. We are the Highborne, and the time has come at last for us to retake our rightful place in the world!', null, null, null, null, null, null, null, null, '11531', '1', '0', '0', 'vashj SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1548043', 'I\'ll split you from stem to stern!', null, null, null, null, null, null, null, null, '11532', '1', '0', '0', 'vashj SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1548044', 'Victory to Lord Illidan!', null, null, null, null, null, null, null, null, '11533', '1', '0', '0', 'vashj SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1548045', 'I spit on you, surface filth!', null, null, null, null, null, null, null, null, '11534', '1', '0', '0', 'vashj SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1548046', 'Death to the outsiders!', null, null, null, null, null, null, null, null, '11535', '1', '0', '0', 'vashj SAY_AGGRO4');
INSERT INTO `script_texts` VALUES ('-1548047', 'I did not wish to lower myself by engaging your kind, but you leave me little choice!', null, null, null, null, null, null, null, null, '11538', '1', '0', '0', 'vashj SAY_PHASE1');
INSERT INTO `script_texts` VALUES ('-1548048', 'The time is now! Leave none standing!', null, null, null, null, null, null, null, null, '11539', '1', '0', '0', 'vashj SAY_PHASE2');
INSERT INTO `script_texts` VALUES ('-1548049', 'You may want to take cover.', null, null, null, null, null, null, null, null, '11540', '1', '0', '0', 'vashj SAY_PHASE3');
INSERT INTO `script_texts` VALUES ('-1548050', 'Straight to the heart!', null, null, null, null, null, null, null, null, '11536', '1', '0', '0', 'vashj SAY_BOWSHOT1');
INSERT INTO `script_texts` VALUES ('-1548051', 'Seek your mark!', null, null, null, null, null, null, null, null, '11537', '1', '0', '0', 'vashj SAY_BOWSHOT2');
INSERT INTO `script_texts` VALUES ('-1548052', 'Your time ends now!', null, null, null, null, null, null, null, null, '11541', '1', '0', '0', 'vashj SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1548053', 'You have failed!', null, null, null, null, null, null, null, null, '11542', '1', '0', '0', 'vashj SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1548054', 'Be\'lamere an\'delay', null, null, null, null, null, null, null, null, '11543', '1', '0', '0', 'vashj SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1548055', 'Lord Illidan, I... I am... sorry.', null, null, null, null, null, null, null, null, '11544', '1', '0', '0', 'vashj SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1550000', 'Alert, you are marked for extermination!', null, null, null, null, null, null, null, null, '11213', '1', '0', '0', 'voidreaver SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1550001', 'Extermination, successful.', null, null, null, null, null, null, null, null, '11215', '1', '0', '0', 'voidreaver SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1550002', 'Imbecile life form, no longer functional.', null, null, null, null, null, null, null, null, '11216', '1', '0', '0', 'voidreaver SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1550003', 'Threat neutralized.', null, null, null, null, null, null, null, null, '11217', '1', '0', '0', 'voidreaver SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1550004', 'Systems... shutting... down...', null, null, null, null, null, null, null, null, '11214', '1', '0', '0', 'voidreaver SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1550005', 'Alternative measure commencing...', null, null, null, null, null, null, null, null, '11218', '1', '0', '0', 'voidreaver SAY_POUNDING1');
INSERT INTO `script_texts` VALUES ('-1550006', 'Calculating force parameters...', null, null, null, null, null, null, null, null, '11219', '1', '0', '0', 'voidreaver SAY_POUNDING2');
INSERT INTO `script_texts` VALUES ('-1550007', 'Tal anu\'men no Sin\'dorei!', null, null, null, null, null, null, null, null, '11134', '1', '0', '0', 'solarian SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1550008', 'Ha ha ha! You are hopelessly outmatched!', null, null, null, null, null, null, null, null, '11139', '1', '0', '0', 'solarian SAY_SUMMON1');
INSERT INTO `script_texts` VALUES ('-1550009', 'I will crush your delusions of grandeur!', null, null, null, null, null, null, null, null, '11140', '1', '0', '0', 'solarian SAY_SUMMON2');
INSERT INTO `script_texts` VALUES ('-1550010', 'Your soul belongs to the Abyss!', null, null, null, null, null, null, null, null, '11136', '1', '0', '0', 'solarian SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1550011', 'By the blood of the Highborne!', null, null, null, null, null, null, null, null, '11137', '1', '0', '0', 'solarian SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1550012', 'For the Sunwell!', null, null, null, null, null, null, null, null, '11138', '1', '0', '0', 'solarian SAY_KILL3');
INSERT INTO `script_texts` VALUES ('-1550013', 'The warmth of the sun... awaits.', null, null, null, null, null, null, null, null, '11135', '1', '0', '0', 'solarian SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1550014', 'Enough of this! Now I call upon the fury of the cosmos itself.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'solarian SAY_VOIDA');
INSERT INTO `script_texts` VALUES ('-1550015', 'I become ONE... with the VOID!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'solarian SAY_VOIDB');
INSERT INTO `script_texts` VALUES ('-1550016', 'Energy. Power. My people are addicted to it... a dependence made manifest after the Sunwell was destroyed. Welcome... to the future. A pity you are too late to stop it. No one can stop me now! Selama ashal\'anore!', null, null, null, null, null, null, null, null, '11256', '1', '0', '0', 'kaelthas SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1550017', 'Capernian will see to it that your stay here is a short one.', null, null, null, null, null, null, null, null, '11257', '1', '0', '0', 'kaelthas SAY_INTRO_CAPERNIAN');
INSERT INTO `script_texts` VALUES ('-1550018', 'Well done, you have proven worthy to test your skills against my master engineer, Telonicus.', null, null, null, null, null, null, null, null, '11258', '1', '0', '0', 'kaelthas SAY_INTRO_TELONICUS');
INSERT INTO `script_texts` VALUES ('-1550019', 'Let us see how your nerves hold up against the Darkener, Thaladred.', null, null, null, null, null, null, null, null, '11259', '1', '0', '0', 'kaelthas SAY_INTRO_THALADRED');
INSERT INTO `script_texts` VALUES ('-1550020', 'You have persevered against some of my best advisors... but none can withstand the might of the Blood Hammer. Behold, Lord Sanguinar!', null, null, null, null, null, null, null, null, '11260', '1', '0', '0', 'kaelthas SAY_INTRO_SANGUINAR');
INSERT INTO `script_texts` VALUES ('-1550021', 'As you see, I have many weapons in my arsenal...', null, null, null, null, null, null, null, null, '11261', '1', '0', '0', 'kaelthas SAY_PHASE2_WEAPON');
INSERT INTO `script_texts` VALUES ('-1550022', 'Perhaps I underestimated you. It would be unfair to make you fight all four advisors at once, but... fair treatment was never shown to my people. I\'m just returning the favor.', null, null, null, null, null, null, null, null, '11262', '1', '0', '0', 'kaelthas SAY_PHASE3_ADVANCE');
INSERT INTO `script_texts` VALUES ('-1550023', 'Alas, sometimes one must take matters into one\'s own hands. Balamore shanal!', null, null, null, null, null, null, null, null, '11263', '1', '0', '0', 'kaelthas SAY_PHASE4_INTRO2');
INSERT INTO `script_texts` VALUES ('-1550024', 'I have not come this far to be stopped! The future I have planned will not be jeopardized! Now you will taste true power!!', null, null, null, null, null, null, null, null, '11273', '1', '0', '0', 'kaelthas SAY_PHASE5_NUTS');
INSERT INTO `script_texts` VALUES ('-1550025', 'You will not prevail.', null, null, null, null, null, null, null, null, '11270', '1', '0', '0', 'kaelthas SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1550026', 'You gambled...and lost.', null, null, null, null, null, null, null, null, '11271', '1', '0', '0', 'kaelthas SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1550027', 'This was Child\'s play.', null, null, null, null, null, null, null, null, '11272', '1', '0', '0', 'kaelthas SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1550028', 'Obey me.', null, null, null, null, null, null, null, null, '11268', '1', '0', '0', 'kaelthas SAY_MINDCONTROL1');
INSERT INTO `script_texts` VALUES ('-1550029', 'Bow to my will.', null, null, null, null, null, null, null, null, '11269', '1', '0', '0', 'kaelthas SAY_MINDCONTROL2');
INSERT INTO `script_texts` VALUES ('-1550030', 'Let us see how you fare when your world is turned upside down.', null, null, null, null, null, null, null, null, '11264', '1', '0', '0', 'kaelthas SAY_GRAVITYLAPSE1');
INSERT INTO `script_texts` VALUES ('-1550031', 'Having trouble staying grounded?', null, null, null, null, null, null, null, null, '11265', '1', '0', '0', 'kaelthas SAY_GRAVITYLAPSE2');
INSERT INTO `script_texts` VALUES ('-1550032', 'Anara\'nel belore!', null, null, null, null, null, null, null, null, '11267', '1', '0', '0', 'kaelthas SAY_SUMMON_PHOENIX1');
INSERT INTO `script_texts` VALUES ('-1550033', 'By the power of the sun!', null, null, null, null, null, null, null, null, '11266', '1', '0', '0', 'kaelthas SAY_SUMMON_PHOENIX2');
INSERT INTO `script_texts` VALUES ('-1550034', 'For...Quel...thalas!', null, null, null, null, null, null, null, null, '11274', '1', '0', '0', 'kaelthas SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1550035', 'Prepare yourselves!', null, null, null, null, null, null, null, null, '11203', '1', '0', '0', 'thaladred SAY_THALADRED_AGGRO');
INSERT INTO `script_texts` VALUES ('-1550036', 'Forgive me, my prince! I have... failed.', null, null, null, null, null, null, null, null, '11204', '1', '0', '0', 'thaladred SAY_THALADRED_DEATH');
INSERT INTO `script_texts` VALUES ('-1550037', '%s sets his gaze on $N!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'thaladred EMOTE_THALADRED_GAZE');
INSERT INTO `script_texts` VALUES ('-1550038', 'Blood for blood!', null, null, null, null, null, null, null, null, '11152', '1', '0', '0', 'sanguinar SAY_SANGUINAR_AGGRO');
INSERT INTO `script_texts` VALUES ('-1550039', 'NO! I ...will... not...', null, null, null, null, null, null, null, null, '11153', '1', '0', '0', 'sanguinar SAY_SANGUINAR_DEATH');
INSERT INTO `script_texts` VALUES ('-1550040', 'The sin\'dore reign supreme!', null, null, null, null, null, null, null, null, '11117', '1', '0', '0', 'capernian SAY_CAPERNIAN_AGGRO');
INSERT INTO `script_texts` VALUES ('-1550041', 'This is not over!', null, null, null, null, null, null, null, null, '11118', '1', '0', '0', 'capernian SAY_CAPERNIAN_DEATH');
INSERT INTO `script_texts` VALUES ('-1550042', 'Anar\'alah belore!', null, null, null, null, null, null, null, null, '11157', '1', '0', '0', 'telonicus SAY_TELONICUS_AGGRO');
INSERT INTO `script_texts` VALUES ('-1550043', 'More perils... await', null, null, null, null, null, null, null, null, '11158', '1', '0', '0', 'telonicus SAY_TELONICUS_DEATH');
INSERT INTO `script_texts` VALUES ('-1552000', 'It is a small matter to control the mind of the weak... for I bear allegiance to powers untouched by time, unmoved by fate. No force on this world or beyond harbors the strength to bend our knee... not even the mighty Legion!', null, null, null, null, null, null, null, null, '11122', '1', '0', '0', 'skyriss SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1552001', 'Bear witness to the agent of your demise!', null, null, null, null, null, null, null, null, '11123', '1', '0', '0', 'skyriss SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1552002', 'Your fate is written!', null, null, null, null, null, null, null, null, '11124', '1', '0', '0', 'skyriss SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1552003', 'The chaos I have sown here is but a taste...', null, null, null, null, null, null, null, null, '11125', '1', '0', '0', 'skyriss SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1552004', 'You will do my bidding, weakling.', null, null, null, null, null, null, null, null, '11127', '1', '0', '0', 'skyriss SAY_MIND_1');
INSERT INTO `script_texts` VALUES ('-1552005', 'Your will is no longer your own.', null, null, null, null, null, null, null, null, '11128', '1', '0', '0', 'skyriss SAY_MIND_2');
INSERT INTO `script_texts` VALUES ('-1552006', 'Flee in terror!', null, null, null, null, null, null, null, null, '11129', '1', '0', '0', 'skyriss SAY_FEAR_1');
INSERT INTO `script_texts` VALUES ('-1552007', 'I will show you horrors undreamed of!', null, null, null, null, null, null, null, null, '11130', '1', '0', '0', 'skyriss SAY_FEAR_2');
INSERT INTO `script_texts` VALUES ('-1552008', 'We span the universe, as countless as the stars!', null, null, null, null, null, null, null, null, '11131', '1', '0', '0', 'skyriss SAY_IMAGE');
INSERT INTO `script_texts` VALUES ('-1552009', 'I am merely one of... infinite multitudes.', null, null, null, null, null, null, null, null, '11126', '1', '0', '0', 'skyriss SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1552010', 'Where in Bonzo\'s brass buttons am I? And who are-- yaaghh, that\'s one mother of a headache!', null, null, null, null, null, null, null, null, '11171', '1', '0', '0', 'millhouse SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1552011', '\"Lowly\"? I don\'t care who you are friend, no one refers to the mighty Millhouse Manastorm as \"Lowly\"! I have no idea what goes on here, but I will gladly join your fight against this impudent imbecile! Prepare to defend yourself, cretin!', null, null, null, null, null, null, null, null, '11172', '1', '0', '0', 'millhouse SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1552012', 'I just need to get some things ready first. You guys go ahead and get started. I need to summon up some water...', null, null, null, null, null, null, null, null, '11173', '1', '0', '0', 'millhouse SAY_WATER');
INSERT INTO `script_texts` VALUES ('-1552013', 'Fantastic! Next, some protective spells. Yes! Now we\'re cookin\'', null, null, null, null, null, null, null, null, '11174', '1', '0', '0', 'millhouse SAY_BUFFS');
INSERT INTO `script_texts` VALUES ('-1552014', 'And of course i\'ll need some mana. You guys are gonna love this, just wait.', null, null, null, null, null, null, null, null, '11175', '1', '0', '0', 'millhouse SAY_DRINK');
INSERT INTO `script_texts` VALUES ('-1552015', 'Aaalllriiiight!! Who ordered up an extra large can of whoop-ass?', null, null, null, null, null, null, null, null, '11176', '1', '0', '0', 'millhouse SAY_READY');
INSERT INTO `script_texts` VALUES ('-1552016', 'I didn\'t even break a sweat on that one.', null, null, null, null, null, null, null, null, '11177', '1', '0', '0', 'millhouse SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1552017', 'You guys, feel free to jump in anytime.', null, null, null, null, null, null, null, null, '11178', '1', '0', '0', 'millhouse SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1552018', 'I\'m gonna light you up, sweet cheeks!', null, null, null, null, null, null, null, null, '11179', '1', '0', '0', 'millhouse SAY_PYRO');
INSERT INTO `script_texts` VALUES ('-1552019', 'Ice, ice, baby!', null, null, null, null, null, null, null, null, '11180', '1', '0', '0', 'millhouse SAY_ICEBLOCK');
INSERT INTO `script_texts` VALUES ('-1552020', 'Heal me! Oh, for the love of all that is holy, HEAL me! I\'m dying!', null, null, null, null, null, null, null, null, '11181', '1', '0', '0', 'millhouse SAY_LOWHP');
INSERT INTO `script_texts` VALUES ('-1552021', 'You\'ll be hearing from my lawyer...', null, null, null, null, null, null, null, null, '11182', '1', '0', '0', 'millhouse SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1552022', 'Who\'s bad? Who\'s bad? That\'s right: we bad!', null, null, null, null, null, null, null, null, '11183', '1', '0', '0', 'millhouse SAY_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1552023', 'I knew the prince would be angry but, I... I have not been myself. I had to let them out! The great one speaks to me, you see. Wait--outsiders. Kael\'thas did not send you! Good... I\'ll just tell the prince you released the prisoners!', null, null, null, null, null, null, null, null, '11222', '1', '0', '0', 'mellichar YELL_INTRO1');
INSERT INTO `script_texts` VALUES ('-1552024', 'The naaru kept some of the most dangerous beings in existence here in these cells. Let me introduce you to another...', null, null, null, null, null, null, null, null, '11223', '1', '0', '0', 'mellichar YELL_INTRO2');
INSERT INTO `script_texts` VALUES ('-1552025', 'Yes, yes... another! Your will is mine!', null, null, null, null, null, null, null, null, '11224', '1', '0', '0', 'mellichar YELL_RELEASE1');
INSERT INTO `script_texts` VALUES ('-1552026', 'Behold another terrifying creature of incomprehensible power!', null, null, null, null, null, null, null, null, '11225', '1', '0', '0', 'mellichar YELL_RELEASE2A');
INSERT INTO `script_texts` VALUES ('-1552027', 'What is this? A lowly gnome? I will do better, O\'great one.', null, null, null, null, null, null, null, null, '11226', '1', '0', '0', 'mellichar YELL_RELEASE2B');
INSERT INTO `script_texts` VALUES ('-1552028', 'Anarchy! Bedlam! Oh, you are so wise! Yes, I see it now, of course!', null, null, null, null, null, null, null, null, '11227', '1', '0', '0', 'mellichar YELL_RELEASE3');
INSERT INTO `script_texts` VALUES ('-1552029', 'One final cell remains. Yes, O\'great one, right away!', null, null, null, null, null, null, null, null, '11228', '1', '0', '0', 'mellichar YELL_RELEASE4');
INSERT INTO `script_texts` VALUES ('-1552030', 'Welcome, O\'great one. I am your humble servant.', null, null, null, null, null, null, null, null, '11229', '1', '0', '0', 'mellichar YELL_WELCOME');
INSERT INTO `script_texts` VALUES ('-1553000', 'What are you doing? These specimens are very delicate!', null, null, null, null, null, null, null, null, '11144', '1', '0', '0', 'freywinn SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1553001', 'Your life cycle is now concluded!', null, null, null, null, null, null, null, null, '11145', '1', '0', '0', 'freywinn SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1553002', 'You will feed the worms.', null, null, null, null, null, null, null, null, '11146', '1', '0', '0', 'freywinn SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1553003', 'Endorel aluminor!', null, null, null, null, null, null, null, null, '11147', '1', '0', '0', 'freywinn SAY_TREE_1');
INSERT INTO `script_texts` VALUES ('-1553004', 'Nature bends to my will!', null, null, null, null, null, null, null, null, '11148', '1', '0', '0', 'freywinn SAY_TREE_2');
INSERT INTO `script_texts` VALUES ('-1553005', 'The specimens...must be preserved.', null, null, null, null, null, null, null, null, '11149', '1', '0', '0', 'freywinn SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1553006', '%s emits a strange noise.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'laj EMOTE_SUMMON');
INSERT INTO `script_texts` VALUES ('-1553007', 'Who disturbs this sanctuary?', null, null, null, null, null, null, null, null, '11230', '1', '0', '0', 'warp SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1553008', 'You must die! But wait: this does not--No, no... you must die!', null, null, null, null, null, null, null, null, '11231', '1', '0', '0', 'warp SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1553009', 'What am I doing? Why do I...', null, null, null, null, null, null, null, null, '11232', '1', '0', '0', 'warp SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1553010', 'Children, come to me!', null, null, null, null, null, null, null, null, '11233', '1', '0', '0', 'warp SAY_SUMMON_1');
INSERT INTO `script_texts` VALUES ('-1553011', 'Maybe this is not--No, we fight! Come to my aid.', null, null, null, null, null, null, null, null, '11234', '1', '0', '0', 'warp SAY_SUMMON_2');
INSERT INTO `script_texts` VALUES ('-1553012', 'So... confused. Do not... belong here!', null, null, null, null, null, null, null, null, '11235', '1', '0', '0', 'warp SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1554000', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1554001', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1554002', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1554003', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1554004', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1554005', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1554006', 'You have approximately five seconds to live.', null, null, null, null, null, null, null, null, '11109', '1', '0', '0', 'ironhand SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1554007', 'With the precise angle and velocity...', null, null, null, null, null, null, null, null, '11112', '1', '0', '0', 'ironhand SAY_HAMMER_1');
INSERT INTO `script_texts` VALUES ('-1554008', 'Low tech yet quiet effective!', null, null, null, null, null, null, null, null, '11113', '1', '0', '0', 'ironhand SAY_HAMMER_2');
INSERT INTO `script_texts` VALUES ('-1554009', 'A foregone conclusion.', null, null, null, null, null, null, null, null, '11110', '1', '0', '0', 'ironhand SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1554010', 'The processing will continue a schedule!', null, null, null, null, null, null, null, null, '11111', '1', '0', '0', 'ironhand SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1554011', 'My calculations did not...', null, null, null, null, null, null, null, null, '11114', '1', '0', '0', 'ironhand SAY_DEATH_1');
INSERT INTO `script_texts` VALUES ('-1554012', '%s raises his hammer menacingly...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'ironhand EMOTE_HAMMER');
INSERT INTO `script_texts` VALUES ('-1554013', 'Don\'t value your life very much, do you?', null, null, null, null, null, null, null, null, '11186', '1', '0', '0', 'sepethrea SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1554014', 'I am not alone.', null, null, null, null, null, null, null, null, '11191', '1', '0', '0', 'sepethrea SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1554015', 'Think you can take the heat?', null, null, null, null, null, null, null, null, '11189', '1', '0', '0', 'sepethrea SAY_DRAGONS_BREATH_1');
INSERT INTO `script_texts` VALUES ('-1554016', 'Anar\'endal dracon!', null, null, null, null, null, null, null, null, '11190', '1', '0', '0', 'sepethrea SAY_DRAGONS_BREATH_2');
INSERT INTO `script_texts` VALUES ('-1554017', 'And don\'t come back!', null, null, null, null, null, null, null, null, '11187', '1', '0', '0', 'sepethrea SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1554018', 'En\'dala finel el\'dal', null, null, null, null, null, null, null, null, '11188', '1', '0', '0', 'sepethrea SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1554019', 'Anu... bala belore...alon.', null, null, null, null, null, null, null, null, '11192', '1', '0', '0', 'sepethrea SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1554020', 'We are on a strict timetable. You will not interfere!', null, null, null, null, null, null, null, null, '11193', '1', '0', '0', 'pathaleon SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1554021', 'I\'m looking for a team player...', null, null, null, null, null, null, null, null, '11197', '1', '0', '0', 'pathaleon SAY_DOMINATION_1');
INSERT INTO `script_texts` VALUES ('-1554022', 'You work for me now!', null, null, null, null, null, null, null, null, '11198', '1', '0', '0', 'pathaleon SAY_DOMINATION_2');
INSERT INTO `script_texts` VALUES ('-1554023', 'Time to supplement my work force.', null, null, null, null, null, null, null, null, '11196', '1', '0', '0', 'pathaleon SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1554024', 'I prefeer to be hands-on...', null, null, null, null, null, null, null, null, '11199', '1', '0', '0', 'pathaleon SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1554025', 'A minor inconvenience.', null, null, null, null, null, null, null, null, '11194', '1', '0', '0', 'pathaleon SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1554026', 'Looks like you lose.', null, null, null, null, null, null, null, null, '11195', '1', '0', '0', 'pathaleon SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1554027', 'The project will... continue.', null, null, null, null, null, null, null, null, '11200', '1', '0', '0', 'pathaleon SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1555000', 'Infidels have invaded the sanctuary! Sniveling pests...You have yet to learn the true meaning of agony!', null, null, null, null, null, null, null, null, '10473', '1', '0', '0', 'hellmaw SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1555001', 'Pathetic mortals! You will pay dearly!', null, null, null, null, null, null, null, null, '10475', '1', '0', '0', 'hellmaw SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1555002', 'I will break you!', null, null, null, null, null, null, null, null, '10476', '1', '0', '0', 'hellmaw SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1555003', 'Finally! Something to relieve the tedium!', null, null, null, null, null, null, null, null, '10477', '1', '0', '0', 'hellmaw SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1555004', 'Aid me, you fools, before it\'s too late!', null, null, null, null, null, null, null, null, '10474', '1', '0', '0', 'hellmaw SAY_HELP');
INSERT INTO `script_texts` VALUES ('-1555005', 'Do you fear death?', null, null, null, null, null, null, null, null, '10478', '1', '0', '0', 'hellmaw SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1555006', 'This is the part I enjoy most.', null, null, null, null, null, null, null, null, '10479', '1', '0', '0', 'hellmaw SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1555007', 'Do not...grow...overconfident, mortal.', null, null, null, null, null, null, null, null, '10480', '1', '0', '0', 'hellmaw SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1555008', 'All flesh must burn.', null, null, null, null, null, null, null, null, '10482', '1', '0', '0', 'blackhearth SAY_INTRO1');
INSERT INTO `script_texts` VALUES ('-1555009', 'All creation must be unmade!', null, null, null, null, null, null, null, null, '10483', '1', '0', '0', 'blackhearth SAY_INTRO2');
INSERT INTO `script_texts` VALUES ('-1555010', 'Power will be yours!', null, null, null, null, null, null, null, null, '10484', '1', '0', '0', 'blackhearth SAY_INTRO3');
INSERT INTO `script_texts` VALUES ('-1555011', 'You\'ll be sorry!', null, null, null, null, null, null, null, null, '10486', '1', '0', '0', 'blackhearth SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1555012', 'Time for fun!', null, null, null, null, null, null, null, null, '10487', '1', '0', '0', 'blackhearth SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1555013', 'I see dead people!', null, null, null, null, null, null, null, null, '10488', '1', '0', '0', 'blackhearth SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1555014', 'No comin\' back for you!', null, null, null, null, null, null, null, null, '10489', '1', '0', '0', 'blackhearth SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1555015', 'Nice try!', null, null, null, null, null, null, null, null, '10490', '1', '0', '0', 'blackhearth SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1555016', 'Help us, hurry!', null, null, null, null, null, null, null, null, '10485', '1', '0', '0', 'blackhearth SAY_HELP');
INSERT INTO `script_texts` VALUES ('-1555017', 'This... no... good...', null, null, null, null, null, null, null, null, '10491', '1', '0', '0', 'blackhearth SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1555018', 'Be ready for Dark One\'s return.', null, null, null, null, null, null, null, null, '10492', '1', '0', '0', 'blackhearth SAY2_INTRO1');
INSERT INTO `script_texts` VALUES ('-1555019', 'So we have place in new universe.', null, null, null, null, null, null, null, null, '10493', '1', '0', '0', 'blackhearth SAY2_INTRO2');
INSERT INTO `script_texts` VALUES ('-1555020', 'Dark one promise!', null, null, null, null, null, null, null, null, '10494', '1', '0', '0', 'blackhearth SAY2_INTRO3');
INSERT INTO `script_texts` VALUES ('-1555021', 'You\'ll be sorry!', null, null, null, null, null, null, null, null, '10496', '1', '0', '0', 'blackhearth SAY2_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1555022', 'Time to kill!', null, null, null, null, null, null, null, null, '10497', '1', '0', '0', 'blackhearth SAY2_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1555023', 'You be dead people!', null, null, null, null, null, null, null, null, '10498', '1', '0', '0', 'blackhearth SAY2_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1555024', 'Now you gone for good.', null, null, null, null, null, null, null, null, '10499', '1', '0', '0', 'blackhearth SAY2_SLAY1');
INSERT INTO `script_texts` VALUES ('-1555025', 'You failed, haha haha', null, null, null, null, null, null, null, null, '10500', '1', '0', '0', 'blackhearth SAY2_SLAY2');
INSERT INTO `script_texts` VALUES ('-1555026', 'Help us, hurry!', null, null, null, null, null, null, null, null, '10495', '1', '0', '0', 'blackhearth SAY2_HELP');
INSERT INTO `script_texts` VALUES ('-1555027', 'Arrgh, aah...ahhh', null, null, null, null, null, null, null, null, '10501', '1', '0', '0', 'blackhearth SAY2_DEATH');
INSERT INTO `script_texts` VALUES ('-1555028', 'Keep your minds focused for the days of reckoning are close at hand. Soon, the destroyer of worlds will return to make good on his promise. Soon the destruction of all that is will begin!', null, null, null, null, null, null, null, null, '10522', '1', '0', '0', 'vorpil SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1555029', 'I\'ll make an offering of your blood!', null, null, null, null, null, null, null, null, '10524', '1', '0', '0', 'vorpil SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1555030', 'You\'ll be a fine example, for the others.', null, null, null, null, null, null, null, null, '10525', '1', '0', '0', 'vorpil SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1555031', 'Good, a worthy sacrifice.', null, null, null, null, null, null, null, null, '10526', '1', '0', '0', 'vorpil SAY_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1555032', 'Come to my aid, heed your master now!', null, null, null, null, null, null, null, null, '10523', '1', '0', '0', 'vorpil SAY_HELP');
INSERT INTO `script_texts` VALUES ('-1555033', 'I serve with pride.', null, null, null, null, null, null, null, null, '10527', '1', '0', '0', 'vorpil SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1555034', 'Your death is for the greater cause!', null, null, null, null, null, null, null, null, '10528', '1', '0', '0', 'vorpil SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1555035', 'I give my life... Gladly.', null, null, null, null, null, null, null, null, '10529', '1', '0', '0', 'vorpil SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1555036', '%s draws energy from the air.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'murmur EMOTE_SONIC_BOOM');
INSERT INTO `script_texts` VALUES ('-1556000', 'I have pets..<squawk>..of my own!', null, null, null, null, null, null, null, null, '10502', '1', '0', '0', 'syth SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1556001', 'Hrrmm.. Time to.. hrrm.. make my move.', null, null, null, null, null, null, null, null, '10503', '1', '0', '0', 'syth SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1556002', 'Nice pets..hrm.. Yes! <squawking>', null, null, null, null, null, null, null, null, '10504', '1', '0', '0', 'syth SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1556003', 'Nice pets have.. weapons. No so..<squawk>..nice.', null, null, null, null, null, null, null, null, '10505', '1', '0', '0', 'syth SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1556004', 'Death.. meeting life is.. <squawking>', null, null, null, null, null, null, null, null, '10506', '1', '0', '0', 'syth SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1556005', 'Uhn.. Be free..<squawk>', null, null, null, null, null, null, null, null, '10507', '1', '0', '0', 'syth SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1556006', 'No more life..hrm. No more pain. <squawks weakly>', null, null, null, null, null, null, null, null, '10508', '1', '0', '0', 'syth SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1556007', '<squawk>..Trinkets yes pretty Trinkets..<squawk>..power, great power.<squawk>..power in Trinkets..<squawk>', null, null, null, null, null, null, null, null, '10557', '1', '0', '0', 'ikiss SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1556008', 'You make war on Ikiss?..<squawk>', null, null, null, null, null, null, null, null, '10554', '1', '0', '0', 'ikiss SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1556009', 'Ikiss cut you pretty..<squawk>..slice you. Yes!', null, null, null, null, null, null, null, null, '10555', '1', '0', '0', 'ikiss SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1556010', 'No escape for..<squawk>..for you', null, null, null, null, null, null, null, null, '10556', '1', '0', '0', 'ikiss SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1556011', 'You die..<squawk>..stay away from Trinkets', null, null, null, null, null, null, null, null, '10558', '1', '0', '0', 'ikiss SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1556012', '<squawk>', null, null, null, null, null, null, null, null, '10559', '1', '0', '0', 'ikiss SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1556013', 'Ikiss will not..<squawk>..die', null, null, null, null, null, null, null, null, '10560', '1', '0', '0', 'ikiss SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1556015', '%s begins to channel arcane energy...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'ikiss EMOTE_ARCANE_EXP');
INSERT INTO `script_texts` VALUES ('-1557000', 'What is this? You must forgive me, but I was not expecting company. As you can see, we are somewhat preoccupied right now. But no matter. As I am a gracious host, I will tend to you... personally.', null, null, null, null, null, null, null, null, '10539', '1', '0', '0', 'shaffar SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1557001', 'We have not yet been properly introduced.', null, null, null, null, null, null, null, null, '10541', '1', '0', '0', 'shaffar SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1557002', 'An epic battle. How exciting!', null, null, null, null, null, null, null, null, '10542', '1', '0', '0', 'shaffar SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1557003', 'I have longed for a good adventure.', null, null, null, null, null, null, null, null, '10543', '1', '0', '0', 'shaffar SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1557004', 'It has been... entertaining.', null, null, null, null, null, null, null, null, '10544', '1', '0', '0', 'shaffar SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1557005', 'And now we part company.', null, null, null, null, null, null, null, null, '10545', '1', '0', '0', 'shaffar SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1557006', 'I have such fascinating things to show you.', null, null, null, null, null, null, null, null, '10540', '1', '0', '0', 'shaffar SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1557007', 'I must bid you... farewell.', null, null, null, null, null, null, null, null, '10546', '1', '0', '0', 'shaffar SAY_DEAD');
INSERT INTO `script_texts` VALUES ('-1557008', 'I will feed on your soul.', null, null, null, null, null, null, null, null, '10561', '1', '0', '0', 'pandemonius SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1557009', 'So... full of life!', null, null, null, null, null, null, null, null, '10562', '1', '0', '0', 'pandemonius SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1557010', 'Do not... resist.', null, null, null, null, null, null, null, null, '10563', '1', '0', '0', 'pandemonius SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1557011', 'Yes! I am... empowered!', null, null, null, null, null, null, null, null, '10564', '1', '0', '0', 'pandemonius SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1557012', 'More... I must have more!', null, null, null, null, null, null, null, null, '10565', '1', '0', '0', 'pandemonius SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1557013', 'To the void... once... more..', null, null, null, null, null, null, null, null, '10566', '1', '0', '0', 'pandemonius SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1557014', '%s shifts into the void...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'pandemonius EMOTE_DARK_SHELL');
INSERT INTO `script_texts` VALUES ('-1558000', 'You have defiled the resting place of our ancestors. For this offense, there can be but one punishment. It is fitting that you have come to a place of the dead... for you will soon be joining them.', null, null, null, null, null, null, null, null, '10509', '1', '0', '0', 'maladaar SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1558001', 'Rise my fallen brothers. Take form and fight!', null, null, null, null, null, null, null, null, '10512', '1', '0', '0', 'maladaar SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1558002', 'You will pay with your life!', null, null, null, null, null, null, null, null, '10513', '1', '0', '0', 'maladaar SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1558003', 'There\'s no turning back now!', null, null, null, null, null, null, null, null, '10514', '1', '0', '0', 'maladaar SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1558004', 'Serve your penitence!', null, null, null, null, null, null, null, null, '10515', '1', '0', '0', 'maladaar SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1558005', 'Let your mind be clouded.', null, null, null, null, null, null, null, null, '10510', '1', '0', '0', 'maladaar SAY_ROAR');
INSERT INTO `script_texts` VALUES ('-1558006', 'Stare into the darkness of your soul.', null, null, null, null, null, null, null, null, '10511', '1', '0', '0', 'maladaar SAY_SOUL_CLEAVE');
INSERT INTO `script_texts` VALUES ('-1558007', 'These walls will be your doom.', null, null, null, null, null, null, null, null, '10516', '1', '0', '0', 'maladaar SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1558008', '<laugh> Now, you\'ll stay for eternity!', null, null, null, null, null, null, null, null, '10517', '1', '0', '0', 'maladaar SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1558009', 'This is... where.. I belong...', null, null, null, null, null, null, null, null, '10518', '1', '0', '0', 'maladaar SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1558010', '%s focuses on $N', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'shirrak EMOTE_FOCUS');
INSERT INTO `script_texts` VALUES ('-1560000', 'Thrall! You didn\'t really think you would escape did you? You and your allies shall answer to Blackmoore - after I\'ve had my fun!', null, null, null, null, null, null, null, null, '10406', '1', '0', '0', 'skarloc SAY_ENTER');
INSERT INTO `script_texts` VALUES ('-1560001', 'You\'re a slave. That\'s all you\'ll ever be.', null, null, null, null, null, null, null, null, '10407', '1', '0', '0', 'skarloc SAY_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1560002', 'I don\'t know what Blackmoore sees in you. For my money, you\'re just another ignorant savage!', null, null, null, null, null, null, null, null, '10408', '1', '0', '0', 'skarloc SAY_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1560003', 'Thrall will never be free!', null, null, null, null, null, null, null, null, '10409', '1', '0', '0', 'skarloc SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1560004', 'Did you really think you would leave here alive?', null, null, null, null, null, null, null, null, '10410', '1', '0', '0', 'skarloc SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1560005', 'Guards! Urgh..Guards..!', null, null, null, null, null, null, null, null, '10411', '1', '0', '0', 'skarloc SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1560006', 'You there, fetch water quickly! Get these flames out before they spread to the rest of the keep! Hurry, damn you!', null, null, null, null, null, null, null, null, '10428', '1', '0', '0', 'lieutenant_drake SAY_ENTER');
INSERT INTO `script_texts` VALUES ('-1560007', 'I know what you\'re up to, and I mean to put an end to it, permanently!', null, null, null, null, null, null, null, null, '10429', '1', '0', '0', 'lieutenant_drake SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1560008', 'No more middling for you.', null, null, null, null, null, null, null, null, '10432', '1', '0', '0', 'lieutenant_drake SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1560009', 'You will not interfere!', null, null, null, null, null, null, null, null, '10433', '1', '0', '0', 'lieutenant_drake SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1560010', 'Time to bleed!', null, null, null, null, null, null, null, null, '10430', '1', '0', '0', 'lieutenant_drake SAY_MORTAL');
INSERT INTO `script_texts` VALUES ('-1560011', 'Run, you blasted cowards!', null, null, null, null, null, null, null, null, '10431', '1', '0', '0', 'lieutenant_drake SAY_SHOUT');
INSERT INTO `script_texts` VALUES ('-1560012', 'Thrall... must not... go free.', null, null, null, null, null, null, null, null, '10434', '1', '0', '0', 'lieutenant_drake SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1560013', 'Thrall! Come outside and face your fate!', null, null, null, null, null, null, null, null, '10418', '1', '0', '0', 'epoch SAY_ENTER1');
INSERT INTO `script_texts` VALUES ('-1560014', 'Taretha\'s life hangs in the balance. Surely you care for her. Surely you wish to save her...', null, null, null, null, null, null, null, null, '10419', '1', '0', '0', 'epoch SAY_ENTER2');
INSERT INTO `script_texts` VALUES ('-1560015', 'Ah, there you are. I had hoped to accomplish this with a bit of subtlety, but I suppose direct confrontation was inevitable. Your future, Thrall, must not come to pass and so...you and your troublesome friends must die!', null, null, null, null, null, null, null, null, '10420', '1', '0', '0', 'epoch SAY_ENTER3');
INSERT INTO `script_texts` VALUES ('-1560016', 'Enough! I will erase your very existence!', null, null, null, null, null, null, null, null, '10421', '1', '0', '0', 'epoch SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1560017', 'You cannot fight fate!', null, null, null, null, null, null, null, null, '10422', '1', '0', '0', 'epoch SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1560018', 'You are...irrelevant.', null, null, null, null, null, null, null, null, '10425', '1', '0', '0', 'epoch SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1560019', 'Thrall will remain a slave. Taretha will die. You have failed.', null, null, null, null, null, null, null, null, '10426', '1', '0', '0', 'epoch SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1560020', 'Not so fast!', null, null, null, null, null, null, null, null, '10423', '1', '0', '0', 'epoch SAY_BREATH1');
INSERT INTO `script_texts` VALUES ('-1560021', 'Struggle as much as you like!', null, null, null, null, null, null, null, null, '10424', '1', '0', '0', 'epoch SAY_BREATH2');
INSERT INTO `script_texts` VALUES ('-1560022', 'No!...The master... will not... be pleased.', null, null, null, null, null, null, null, null, '10427', '1', '0', '0', 'epoch SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1560023', 'Very well then. Let\'s go!', null, null, null, null, null, null, null, null, '10465', '0', '0', '0', 'thrall hillsbrad SAY_TH_START_EVENT_PART1');
INSERT INTO `script_texts` VALUES ('-1560024', 'As long as we\'re going with a new plan, I may aswell pick up a weapon and some armor.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'thrall hillsbrad SAY_TH_ARMORY');
INSERT INTO `script_texts` VALUES ('-1560025', 'A rider approaches!', null, null, null, null, null, null, null, null, '10466', '0', '0', '0', 'thrall hillsbrad SAY_TH_SKARLOC_MEET');
INSERT INTO `script_texts` VALUES ('-1560026', 'I\'ll never be chained again!', null, null, null, null, null, null, null, null, '10467', '1', '0', '0', 'thrall hillsbrad SAY_TH_SKARLOC_TAUNT');
INSERT INTO `script_texts` VALUES ('-1560027', 'Very well. Tarren Mill lies just west of here. Since time is of the essence...', null, null, null, null, null, null, null, null, '10468', '1', '0', '0', 'thrall hillsbrad SAY_TH_START_EVENT_PART2');
INSERT INTO `script_texts` VALUES ('-1560028', 'Let\'s ride!', null, null, null, null, null, null, null, null, '10469', '0', '0', '1', 'thrall hillsbrad SAY_TH_MOUNTS_UP');
INSERT INTO `script_texts` VALUES ('-1560029', 'Taretha must be in the inn. Let\'s go.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'thrall hillsbrad SAY_TH_CHURCH_END');
INSERT INTO `script_texts` VALUES ('-1560030', 'Taretha! What foul magic is this?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'thrall hillsbrad SAY_TH_MEET_TARETHA');
INSERT INTO `script_texts` VALUES ('-1560031', 'Who or what was that?', null, null, null, null, null, null, null, null, '10470', '0', '0', '1', 'thrall hillsbrad SAY_TH_EPOCH_WONDER');
INSERT INTO `script_texts` VALUES ('-1560032', 'No!', null, null, null, null, null, null, null, null, '10471', '0', '0', '5', 'thrall hillsbrad SAY_TH_EPOCH_KILL_TARETHA');
INSERT INTO `script_texts` VALUES ('-1560033', 'Goodbye, Taretha. I will never forget your kindness.', null, null, null, null, null, null, null, null, '10472', '0', '0', '0', 'thrall hillsbrad SAY_TH_EVENT_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1560034', 'Things are looking grim...', null, null, null, null, null, null, null, null, '10458', '1', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_LOW_HP1');
INSERT INTO `script_texts` VALUES ('-1560035', 'I will fight to the last!', null, null, null, null, null, null, null, null, '10459', '1', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_LOW_HP2');
INSERT INTO `script_texts` VALUES ('-1560036', 'Taretha...', null, null, null, null, null, null, null, null, '10460', '1', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_DIE1');
INSERT INTO `script_texts` VALUES ('-1560037', 'A good day...to die...', null, null, null, null, null, null, null, null, '10461', '1', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_DIE2');
INSERT INTO `script_texts` VALUES ('-1560038', 'I have earned my freedom!', null, null, null, null, null, null, null, null, '10448', '0', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1560039', 'This day is long overdue. Out of my way!', null, null, null, null, null, null, null, null, '10449', '0', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1560040', 'I am a slave no longer!', null, null, null, null, null, null, null, null, '10450', '0', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_AGGRO3');
INSERT INTO `script_texts` VALUES ('-1560041', 'Blackmoore has much to answer for!', null, null, null, null, null, null, null, null, '10451', '0', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_AGGRO4');
INSERT INTO `script_texts` VALUES ('-1560042', 'You have forced my hand!', null, null, null, null, null, null, null, null, '10452', '0', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_KILL1');
INSERT INTO `script_texts` VALUES ('-1560043', 'It should not have come to this!', null, null, null, null, null, null, null, null, '10453', '0', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_KILL2');
INSERT INTO `script_texts` VALUES ('-1560044', 'I did not ask for this!', null, null, null, null, null, null, null, null, '10454', '0', '0', '0', 'thrall hillsbrad SAY_TH_RANDOM_KILL3');
INSERT INTO `script_texts` VALUES ('-1560045', 'I am truly in your debt, strangers.', null, null, null, null, null, null, null, null, '10455', '0', '0', '0', 'thrall hillsbrad SAY_TH_LEAVE_COMBAT1');
INSERT INTO `script_texts` VALUES ('-1560046', 'Thank you, strangers. You have given me hope.', null, null, null, null, null, null, null, null, '10456', '0', '0', '0', 'thrall hillsbrad SAY_TH_LEAVE_COMBAT2');
INSERT INTO `script_texts` VALUES ('-1560047', 'I will not waste this chance. I will seek out my destiny.', null, null, null, null, null, null, null, null, '10457', '0', '0', '0', 'thrall hillsbrad SAY_TH_LEAVE_COMBAT3');
INSERT INTO `script_texts` VALUES ('-1560048', 'I\'m free! Thank you all!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'taretha SAY_TA_FREE');
INSERT INTO `script_texts` VALUES ('-1560049', 'Thrall, you escaped!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'taretha SAY_TA_ESCAPED');
INSERT INTO `script_texts` VALUES ('-1560050', 'That\'s enough out of him.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'thrall hillsbrad SAY_TH_KILL_ARMORER');
INSERT INTO `script_texts` VALUES ('-1560051', 'That spell should wipe their memories of us and what just happened. All they should remember now is what reality would be like without the attempted temporal interference. Well done. Thrall will journey on to find his destiny, and Taretha...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'erozion SAY_WIPE_MEMORY');
INSERT INTO `script_texts` VALUES ('-1560052', 'Her fate is regrettably unavoidable.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'erozion SAY_ABOUT_TARETHA');
INSERT INTO `script_texts` VALUES ('-1560053', 'They call you a monster. But they\'re the monsters, not you. Farewell Thrall.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'taretha SAY_TA_FAREWELL');
INSERT INTO `script_texts` VALUES ('-1560054', 'I\'m glad you\'re safe, Taretha. None of this would have been possible without your friends. They made all of this happen.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'thrall hillsbrad SAY_TR_GLAD_SAFE');
INSERT INTO `script_texts` VALUES ('-1560055', 'Thrall, I\'ve never met these people before in my life.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'taretha SAY_TA_NEVER_MET');
INSERT INTO `script_texts` VALUES ('-1560056', 'Then who are these people?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'thrall hillsbrad SAY_TR_THEN_WHO');
INSERT INTO `script_texts` VALUES ('-1560057', 'I believe I can explain everything to you two if you give me a moment of your time.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'erozion SAY_PRE_WIPE');
INSERT INTO `script_texts` VALUES ('-1560058', 'You have done a great thing. Alas, the young warchief\'s memory of these events must be as they originally were ... Andormu awaits you in the master\'s lair.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'erozion SAY_AFTER_WIPE');
INSERT INTO `script_texts` VALUES ('-1564000', 'You will die in the name of Lady Vashj!', null, null, null, null, null, null, null, null, '11450', '1', '0', '0', 'SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1564001', 'Stick around!', null, null, null, null, null, null, null, null, '11451', '1', '0', '0', 'SAY_NEEDLE1');
INSERT INTO `script_texts` VALUES ('-1564002', 'I\'ll deal with you later!', null, null, null, null, null, null, null, null, '11452', '1', '0', '0', 'SAY_NEEDLE2');
INSERT INTO `script_texts` VALUES ('-1564003', 'Your success was short lived!', null, null, null, null, null, null, null, null, '11455', '1', '0', '0', 'SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1564004', 'Time for you to go!', null, null, null, null, null, null, null, null, '11456', '1', '0', '0', 'SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1564005', 'Bel\'anen dal\'lorei!', null, null, null, null, null, null, null, null, '11453', '1', '0', '0', 'SAY_SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1564006', 'Blood will flow!', null, null, null, null, null, null, null, null, '11454', '1', '0', '0', 'SAY_SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1564007', 'Bal\'amer ch\'itah!', null, null, null, null, null, null, null, null, '11457', '1', '0', '0', 'SAY_ENRAGE1');
INSERT INTO `script_texts` VALUES ('-1564008', 'My patience has ran out! Die, DIE!', null, null, null, null, null, null, null, null, '11458', '1', '0', '0', 'SAY_ENRAGE2');
INSERT INTO `script_texts` VALUES ('-1564009', 'Lord Illidan will... crush you.', null, null, null, null, null, null, null, null, '11459', '1', '0', '0', 'SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1564010', '%s acquires a new target!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'supremus EMOTE_NEW_TARGET');
INSERT INTO `script_texts` VALUES ('-1564011', '%s punches the ground in anger!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'supremus EMOTE_PUNCH_GROUND');
INSERT INTO `script_texts` VALUES ('-1564012', 'The ground begins to crack open!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'supremus EMOTE_GROUND_CRACK');
INSERT INTO `script_texts` VALUES ('-1564013', 'No! Not yet...', null, null, null, null, null, null, null, null, '11385', '1', '0', '0', 'akama shade SAY_LOW_HEALTH');
INSERT INTO `script_texts` VALUES ('-1564014', 'I will not last much longer...', null, null, null, null, null, null, null, null, '11386', '1', '0', '0', 'akama shade SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1564015', 'Come out from the shadows! I\'ve returned to lead you against our true enemy! Shed your chains and raise your weapons against your Illidari masters!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'akama shade SAY_FREE');
INSERT INTO `script_texts` VALUES ('-1564016', 'Hail our leader! Hail Akama!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'akama shade broken SAY_BROKEN_FREE_01');
INSERT INTO `script_texts` VALUES ('-1564017', 'Hail Akama!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'akama shade broken SAY_BROKEN_FREE_02');
INSERT INTO `script_texts` VALUES ('-1564018', 'You play, you pay.', null, null, null, null, null, null, null, null, '11501', '1', '0', '0', 'shahraz SAY_TAUNT1');
INSERT INTO `script_texts` VALUES ('-1564019', 'I\'m not impressed.', null, null, null, null, null, null, null, null, '11502', '1', '0', '0', 'shahraz SAY_TAUNT2');
INSERT INTO `script_texts` VALUES ('-1564020', 'Enjoying yourselves?', null, null, null, null, null, null, null, null, '11503', '1', '0', '0', 'shahraz SAY_TAUNT3');
INSERT INTO `script_texts` VALUES ('-1564021', 'So... business or pleasure?', null, null, null, null, null, null, null, null, '11504', '1', '0', '0', 'shahraz SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1564022', 'You seem a little tense.', null, null, null, null, null, null, null, null, '11505', '1', '0', '0', 'shahraz SAY_SPELL1');
INSERT INTO `script_texts` VALUES ('-1564023', 'Don\'t be shy.', null, null, null, null, null, null, null, null, '11506', '1', '0', '0', 'shahraz SAY_SPELL2');
INSERT INTO `script_texts` VALUES ('-1564024', 'I\'m all... yours.', null, null, null, null, null, null, null, null, '11507', '1', '0', '0', 'shahraz SAY_SPELL3');
INSERT INTO `script_texts` VALUES ('-1564025', 'Easy come, easy go.', null, null, null, null, null, null, null, null, '11508', '1', '0', '0', 'shahraz SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1564026', 'So much for a happy ending.', null, null, null, null, null, null, null, null, '11509', '1', '0', '0', 'shahraz SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1564027', 'Stop toying with my emotions!', null, null, null, null, null, null, null, null, '11510', '1', '0', '0', 'shahraz SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1564028', 'I wasn\'t... finished.', null, null, null, null, null, null, null, null, '11511', '1', '0', '0', 'shahraz SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1564029', 'Horde will... crush you.', null, null, null, null, null, null, null, null, '11432', '1', '0', '0', 'bloodboil SOUND_AGGRO');
INSERT INTO `script_texts` VALUES ('-1564030', 'Time to feast!', null, null, null, null, null, null, null, null, '11433', '1', '0', '0', 'bloodboil SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1564031', 'More! I want more!', null, null, null, null, null, null, null, null, '11434', '1', '0', '0', 'bloodboil SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1564032', 'Drink your blood! Eat your flesh!', null, null, null, null, null, null, null, null, '11435', '1', '0', '0', 'bloodboil SAY_SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1564033', 'I hunger!', null, null, null, null, null, null, null, null, '11436', '1', '0', '0', 'bloodboil SAY_SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1564034', '<babbling>', null, null, null, null, null, null, null, null, '11437', '1', '0', '0', 'bloodboil SAY_ENRAGE1');
INSERT INTO `script_texts` VALUES ('-1564035', 'I\'ll rip the meat from your bones!', null, null, null, null, null, null, null, null, '11438', '1', '0', '0', 'bloodboil SAY_ENRAGE2');
INSERT INTO `script_texts` VALUES ('-1564036', 'Aaaahrg...', null, null, null, null, null, null, null, null, '11439', '1', '0', '0', 'bloodboil SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1564037', 'I was the first, you know. For me, the wheel of death has spun many times. <laughs> So much time has passed. I have a lot of catching up to do...', null, null, null, null, null, null, null, null, '11512', '1', '0', '0', 'teron SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1564038', 'Vengeance is mine!', null, null, null, null, null, null, null, null, '11513', '1', '0', '0', 'teron SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1564039', 'I have use for you!', null, null, null, null, null, null, null, null, '11514', '1', '0', '0', 'teron SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1564040', 'It gets worse...', null, null, null, null, null, null, null, null, '11515', '1', '0', '0', 'teron SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1564041', 'What are you afraid of?', null, null, null, null, null, null, null, null, '11517', '1', '0', '0', 'teron SAY_SPELL1');
INSERT INTO `script_texts` VALUES ('-1564042', 'Death... really isn\'t so bad.', null, null, null, null, null, null, null, null, '11516', '1', '0', '0', 'teron SAY_SPELL2');
INSERT INTO `script_texts` VALUES ('-1564043', 'Give in!', null, null, null, null, null, null, null, null, '11518', '1', '0', '0', 'teron SAY_SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1564044', 'I have something for you...', null, null, null, null, null, null, null, null, '11519', '1', '0', '0', 'teron SAY_SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1564045', 'YOU WILL SHOW THE PROPER RESPECT!', null, null, null, null, null, null, null, null, '11520', '1', '0', '0', 'teron SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1564046', 'The wheel...spins...again....', null, null, null, null, null, null, null, null, '11521', '1', '0', '0', 'teron SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1564047', 'Pain and suffering are all that await you!', null, null, null, null, null, null, null, null, '11415', '1', '0', '0', 'essence SUFF_SAY_FREED');
INSERT INTO `script_texts` VALUES ('-1564048', 'Don\'t leave me alone!', null, null, null, null, null, null, null, null, '11416', '1', '0', '0', 'essence SUFF_SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1564049', 'Look at what you make me do!', null, null, null, null, null, null, null, null, '11417', '1', '0', '0', 'essence SUFF_SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1564050', 'I didn\'t ask for this!', null, null, null, null, null, null, null, null, '11418', '1', '0', '0', 'essence SUFF_SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1564051', 'The pain is only beginning!', null, null, null, null, null, null, null, null, '11419', '1', '0', '0', 'essence SUFF_SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1564052', 'I don\'t want to go back!', null, null, null, null, null, null, null, null, '11420', '1', '0', '0', 'essence SUFF_SAY_RECAP');
INSERT INTO `script_texts` VALUES ('-1564053', 'Now what do I do?', null, null, null, null, null, null, null, null, '11421', '1', '0', '0', 'essence SUFF_SAY_AFTER');
INSERT INTO `script_texts` VALUES ('-1564054', 'REUSE_ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE_ME');
INSERT INTO `script_texts` VALUES ('-1564055', 'You can have anything you desire... for a price.', null, null, null, null, null, null, null, null, '11408', '1', '0', '0', 'essence DESI_SAY_FREED');
INSERT INTO `script_texts` VALUES ('-1564056', 'Fulfilment is at hand!', null, null, null, null, null, null, null, null, '11409', '1', '0', '0', 'essence DESI_SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1564057', 'Yes... you\'ll stay with us now...', null, null, null, null, null, null, null, null, '11410', '1', '0', '0', 'essence DESI_SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1564058', 'Your reach exceeds your grasp.', null, null, null, null, null, null, null, null, '11412', '1', '0', '0', 'essence DESI_SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1564059', 'Be careful what you wish for...', null, null, null, null, null, null, null, null, '11411', '1', '0', '0', 'essence DESI_SAY_SPEC');
INSERT INTO `script_texts` VALUES ('-1564060', 'I\'ll be waiting...', null, null, null, null, null, null, null, null, '11413', '1', '0', '0', 'essence DESI_SAY_RECAP');
INSERT INTO `script_texts` VALUES ('-1564061', 'I won\'t be far...', null, null, null, null, null, null, null, null, '11414', '1', '0', '0', 'essence DESI_SAY_AFTER');
INSERT INTO `script_texts` VALUES ('-1564062', 'Beware: I live!', null, null, null, null, null, null, null, null, '11399', '1', '0', '0', 'essence ANGER_SAY_FREED');
INSERT INTO `script_texts` VALUES ('-1564063', 'So... foolish.', null, null, null, null, null, null, null, null, '11400', '1', '0', '0', 'essence ANGER_SAY_FREED2');
INSERT INTO `script_texts` VALUES ('-1564064', '<maniacal cackle>', null, null, null, null, null, null, null, null, '11401', '1', '0', '0', 'essence ANGER_SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1564065', 'Enough. No more.', null, null, null, null, null, null, null, null, '11402', '1', '0', '0', 'essence ANGER_SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1564066', 'On your knees!', null, null, null, null, null, null, null, null, '11403', '1', '0', '0', 'essence ANGER_SAY_SPEC');
INSERT INTO `script_texts` VALUES ('-1564067', 'Beware, coward.', null, null, null, null, null, null, null, null, '11405', '1', '0', '0', 'essence ANGER_SAY_BEFORE');
INSERT INTO `script_texts` VALUES ('-1564068', 'I won\'t... be... ignored.', null, null, null, null, null, null, null, null, '11404', '1', '0', '0', 'essence ANGER_SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1564069', 'You wish to test me?', null, null, null, null, null, null, null, null, '11524', '1', '0', '0', 'council vera AGGRO');
INSERT INTO `script_texts` VALUES ('-1564070', 'I have better things to do...', null, null, null, null, null, null, null, null, '11422', '1', '0', '0', 'council gath AGGRO');
INSERT INTO `script_texts` VALUES ('-1564071', 'Flee or die!', null, null, null, null, null, null, null, null, '11482', '1', '0', '0', 'council mala AGGRO');
INSERT INTO `script_texts` VALUES ('-1564072', 'Common... such a crude language. Bandal!', null, null, null, null, null, null, null, null, '11440', '1', '0', '0', 'council zere AGGRO');
INSERT INTO `script_texts` VALUES ('-1564073', 'Enough games!', null, null, null, null, null, null, null, null, '11428', '1', '0', '0', 'council gath ENRAGE');
INSERT INTO `script_texts` VALUES ('-1564074', 'You wish to kill me? Hahaha, you first!', null, null, null, null, null, null, null, null, '11530', '1', '0', '0', 'council vera ENRAGE');
INSERT INTO `script_texts` VALUES ('-1564075', 'For Quel\'Thalas! For the Sunwell!', null, null, null, null, null, null, null, null, '11488', '1', '0', '0', 'council mala ENRAGE');
INSERT INTO `script_texts` VALUES ('-1564076', 'Sha\'amoor sine menoor!', null, null, null, null, null, null, null, null, '11446', '1', '0', '0', 'council zere ENRAGE');
INSERT INTO `script_texts` VALUES ('-1564077', 'Enjoy your final moments!', null, null, null, null, null, null, null, null, '11426', '1', '0', '0', 'council gath SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1564078', 'You\'re not caught up for this!', null, null, null, null, null, null, null, null, '11528', '1', '0', '0', 'council vera SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1564079', 'No second chances!', null, null, null, null, null, null, null, null, '11486', '1', '0', '0', 'council mala SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1564080', 'Diel fin\'al', null, null, null, null, null, null, null, null, '11444', '1', '0', '0', 'council zere SPECIAL1');
INSERT INTO `script_texts` VALUES ('-1564081', 'You are mine!', null, null, null, null, null, null, null, null, '11427', '1', '0', '0', 'council gath SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1564082', 'Anar\'alah belore!', null, null, null, null, null, null, null, null, '11529', '1', '0', '0', 'council vera SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1564083', 'I\'m full of surprises!', null, null, null, null, null, null, null, null, '11487', '1', '0', '0', 'council mala SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1564084', 'Sha\'amoor ara mashal?', null, null, null, null, null, null, null, null, '11445', '1', '0', '0', 'council zere SPECIAL2');
INSERT INTO `script_texts` VALUES ('-1564085', 'Selama am\'oronor!', null, null, null, null, null, null, null, null, '11423', '1', '0', '0', 'council gath SLAY');
INSERT INTO `script_texts` VALUES ('-1564086', 'Valiant effort!', null, null, null, null, null, null, null, null, '11525', '1', '0', '0', 'council vera SLAY');
INSERT INTO `script_texts` VALUES ('-1564087', 'My work is done.', null, null, null, null, null, null, null, null, '11483', '1', '0', '0', 'council mala SLAY');
INSERT INTO `script_texts` VALUES ('-1564088', 'Shorel\'aran.', null, null, null, null, null, null, null, null, '11441', '1', '0', '0', 'council zere SLAY');
INSERT INTO `script_texts` VALUES ('-1564089', 'Well done!', null, null, null, null, null, null, null, null, '11424', '1', '0', '0', 'council gath SLAY_COMT');
INSERT INTO `script_texts` VALUES ('-1564090', 'A glorious kill!', null, null, null, null, null, null, null, null, '11526', '1', '0', '0', 'council vera SLAY_COMT');
INSERT INTO `script_texts` VALUES ('-1564091', 'As it should be!', null, null, null, null, null, null, null, null, '11484', '1', '0', '0', 'council mala SLAY_COMT');
INSERT INTO `script_texts` VALUES ('-1564092', 'Belesa menoor!', null, null, null, null, null, null, null, null, '11442', '1', '0', '0', 'council zere SLAY_COMT');
INSERT INTO `script_texts` VALUES ('-1564093', 'Lord Illidan... I...', null, null, null, null, null, null, null, null, '11425', '1', '0', '0', 'council gath DEATH');
INSERT INTO `script_texts` VALUES ('-1564094', 'You got lucky!', null, null, null, null, null, null, null, null, '11527', '1', '0', '0', 'council vera DEATH');
INSERT INTO `script_texts` VALUES ('-1564095', 'Destiny... awaits.', null, null, null, null, null, null, null, null, '11485', '1', '0', '0', 'council mala DEATH');
INSERT INTO `script_texts` VALUES ('-1564096', 'Diel ma\'ahn... oreindel\'o', null, null, null, null, null, null, null, null, '11443', '1', '0', '0', 'council zere DEATH');
INSERT INTO `script_texts` VALUES ('-1564097', 'Akama... your duplicity is hardly surprising. I should have slaughtered you and your malformed brethren long ago.', null, null, null, null, null, null, null, null, '11463', '1', '0', '0', 'illidan SAY_CONVO_1');
INSERT INTO `script_texts` VALUES ('-1564098', 'We\'ve come to end your reign, Illidan. My people and all of Outland shall be free!', null, null, null, null, null, null, null, null, '11389', '1', '0', '25', 'illidan SAY_CONVO_2');
INSERT INTO `script_texts` VALUES ('-1564099', 'Boldly said. But I remain unconvinced.', null, null, null, null, null, null, null, null, '11464', '1', '0', '396', 'illidan SAY_CONVO_3');
INSERT INTO `script_texts` VALUES ('-1564100', 'The time has come! The moment is at hand!', null, null, null, null, null, null, null, null, '11380', '1', '0', '22', 'illidan SAY_CONVO_4');
INSERT INTO `script_texts` VALUES ('-1564101', 'You are not prepared!', null, null, null, null, null, null, null, null, '11466', '1', '0', '406', 'illidan SAY_CONVO_5');
INSERT INTO `script_texts` VALUES ('-1564102', 'Is this it, mortals? Is this all the fury you can muster?', null, null, null, null, null, null, null, null, '11476', '1', '0', '0', 'illidan SAY_CONVO_6');
INSERT INTO `script_texts` VALUES ('-1564103', 'Their fury pales before mine, Illidan. We have some unsettled business between us.', null, null, null, null, null, null, null, null, '11491', '1', '0', '5', 'illidan SAY_CONVO_7');
INSERT INTO `script_texts` VALUES ('-1564104', 'Maiev... How is this even possible?', null, null, null, null, null, null, null, null, '11477', '1', '0', '1', 'illidan SAY_CONVO_8');
INSERT INTO `script_texts` VALUES ('-1564105', 'Ah... my long hunt is finally over. Today, Justice will be done!', null, null, null, null, null, null, null, null, '11492', '1', '0', '15', 'illidan SAY_CONVO_9');
INSERT INTO `script_texts` VALUES ('-1564106', 'Feel the hatred of ten thousand years!', null, null, null, null, null, null, null, null, '11470', '1', '0', '0', 'illidan SAY_CONVO_10');
INSERT INTO `script_texts` VALUES ('-1564107', 'Ahh... It is finished. You are beaten.', null, null, null, null, null, null, null, null, '11496', '1', '0', '0', 'illidan SAY_CONVO_11');
INSERT INTO `script_texts` VALUES ('-1564108', 'You have won... Maiev...but the huntress... is nothing...without the hunt... you... are nothing... without me..', null, null, null, null, null, null, null, null, '11478', '1', '0', '65', 'illidan SAY_CONVO_12');
INSERT INTO `script_texts` VALUES ('-1564109', 'He is right. I feel nothing... I am nothing...', null, null, null, null, null, null, null, null, '11497', '1', '0', '0', 'illidan SAY_CONVO_13');
INSERT INTO `script_texts` VALUES ('-1564110', 'Farewell, champions.', null, null, null, null, null, null, null, null, '11498', '1', '0', '0', 'illidan SAY_CONVO_14');
INSERT INTO `script_texts` VALUES ('-1564111', 'The Light will fill these dismal halls once again. I swear it.', null, null, null, null, null, null, null, null, '11387', '1', '0', '0', 'illidan SAY_CONVO_15');
INSERT INTO `script_texts` VALUES ('-1564112', 'I can feel your hatred.', null, null, null, null, null, null, null, null, '11467', '1', '0', '0', 'illidan SAY_TAUNT_1');
INSERT INTO `script_texts` VALUES ('-1564113', 'Give in to your fear!', null, null, null, null, null, null, null, null, '11468', '1', '0', '0', 'illidan SAY_TAUNT_2');
INSERT INTO `script_texts` VALUES ('-1564114', 'You know nothing of power!', null, null, null, null, null, null, null, null, '11469', '1', '0', '0', 'illidan SAY_TAUNT_3');
INSERT INTO `script_texts` VALUES ('-1564115', 'Such... arrogance!', null, null, null, null, null, null, null, null, '11471', '1', '0', '0', 'illidan SAY_TAUNT_4');
INSERT INTO `script_texts` VALUES ('-1564116', 'That is for Naisha!', null, null, null, null, null, null, null, null, '11493', '1', '0', '0', 'illidan SAY_MAIEV_TAUNT_1');
INSERT INTO `script_texts` VALUES ('-1564117', 'Bleed as I have bled!', null, null, null, null, null, null, null, null, '11494', '1', '0', '0', 'illidan SAY_MAIEV_TAUNT_2');
INSERT INTO `script_texts` VALUES ('-1564118', 'There shall be no prison for you this time!', null, null, null, null, null, null, null, null, '11495', '1', '0', '0', 'illidan SAY_MAIEV_TAUNT_3');
INSERT INTO `script_texts` VALUES ('-1564119', 'Meet your end, demon!', null, null, null, null, null, null, null, null, '11500', '1', '0', '0', 'illidan SAY_MAIEV_TAUNT_4');
INSERT INTO `script_texts` VALUES ('-1564120', 'Be wary friends, The Betrayer meditates in the court just beyond.', null, null, null, null, null, null, null, null, '11388', '1', '0', '0', 'illidan SAY_AKAMA_BEWARE');
INSERT INTO `script_texts` VALUES ('-1564121', 'Come, my minions. Deal with this traitor as he deserves!', null, null, null, null, null, null, null, null, '11465', '1', '0', '0', 'illidan SAY_AKAMA_MINION');
INSERT INTO `script_texts` VALUES ('-1564122', 'I\'ll deal with these mongrels. Strike now, friends! Strike at the betrayer!', null, null, null, null, null, null, null, null, '11390', '1', '0', '0', 'illidan SAY_AKAMA_LEAVE');
INSERT INTO `script_texts` VALUES ('-1564123', 'Who shall be next to taste my blades?!', null, null, null, null, null, null, null, null, '11473', '1', '0', '0', 'illidan SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1564124', 'This is too easy!', null, null, null, null, null, null, null, null, '11472', '1', '0', '0', 'illidan SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1564125', 'I will not be touched by rabble such as you!', null, null, null, null, null, null, null, null, '11479', '1', '0', '254', 'illidan SAY_TAKEOFF');
INSERT INTO `script_texts` VALUES ('-1564126', 'Behold the flames of Azzinoth!', null, null, null, null, null, null, null, null, '11480', '1', '0', '0', 'illidan SAY_SUMMONFLAMES');
INSERT INTO `script_texts` VALUES ('-1564127', 'Stare into the eyes of the Betrayer!', null, null, null, null, null, null, null, null, '11481', '1', '0', '0', 'illidan SAY_EYE_BLAST');
INSERT INTO `script_texts` VALUES ('-1564128', 'Behold the power... of the demon within!', null, null, null, null, null, null, null, null, '11475', '1', '0', '0', 'illidan SAY_MORPH');
INSERT INTO `script_texts` VALUES ('-1564129', 'You\'ve wasted too much time mortals, now you shall fall!', null, null, null, null, null, null, null, null, '11474', '1', '0', '0', 'illidan SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1565000', 'Gronn are the real power in outland.', null, null, null, null, null, null, null, null, '11367', '1', '0', '0', 'maulgar SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1565001', 'You will not defeat the hand of Gruul!', null, null, null, null, null, null, null, null, '11368', '1', '0', '0', 'maulgar SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1565002', 'You won\'t kill next one so easy!', null, null, null, null, null, null, null, null, '11369', '1', '0', '0', 'maulgar SAY_OGRE_DEATH1');
INSERT INTO `script_texts` VALUES ('-1565003', 'Pah! Does not prove anything!', null, null, null, null, null, null, null, null, '11370', '1', '0', '0', 'maulgar SAY_OGRE_DEATH2');
INSERT INTO `script_texts` VALUES ('-1565004', 'I\'m not afraid of you.', null, null, null, null, null, null, null, null, '11371', '1', '0', '0', 'maulgar SAY_OGRE_DEATH3');
INSERT INTO `script_texts` VALUES ('-1565005', 'Good, now you fight me!', null, null, null, null, null, null, null, null, '11372', '1', '0', '0', 'maulgar SAY_OGRE_DEATH4');
INSERT INTO `script_texts` VALUES ('-1565006', 'You not so tough afterall!', null, null, null, null, null, null, null, null, '11373', '1', '0', '0', 'maulgar SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1565007', 'Aha-ha ha ha!', null, null, null, null, null, null, null, null, '11374', '1', '0', '0', 'maulgar SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1565008', 'Mulgar is king!', null, null, null, null, null, null, null, null, '11375', '1', '0', '0', 'maulgar SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1565009', 'Gruul... will crush you...', null, null, null, null, null, null, null, null, '11376', '1', '0', '0', 'maulgar SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1565010', 'Come... and die.', null, null, null, null, null, null, null, null, '11355', '1', '0', '0', 'gruul SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1565011', 'Scurry', null, null, null, null, null, null, null, null, '11356', '1', '0', '0', 'gruul SAY_SLAM1');
INSERT INTO `script_texts` VALUES ('-1565012', 'No escape', null, null, null, null, null, null, null, null, '11357', '1', '0', '0', 'gruul SAY_SLAM2');
INSERT INTO `script_texts` VALUES ('-1565013', 'Stay', null, null, null, null, null, null, null, null, '11358', '1', '0', '0', 'gruul SAY_SHATTER1');
INSERT INTO `script_texts` VALUES ('-1565014', 'Beg... for life', null, null, null, null, null, null, null, null, '11359', '1', '0', '0', 'gruul SAY_SHATTER2');
INSERT INTO `script_texts` VALUES ('-1565015', 'No more', null, null, null, null, null, null, null, null, '11360', '1', '0', '0', 'gruul SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1565016', 'Unworthy', null, null, null, null, null, null, null, null, '11361', '1', '0', '0', 'gruul SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1565017', 'Die', null, null, null, null, null, null, null, null, '11362', '1', '0', '0', 'gruul SAY_SLAY3');
INSERT INTO `script_texts` VALUES ('-1565018', 'Aaargh...', null, null, null, null, null, null, null, null, '11363', '1', '0', '0', 'gruul SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1565019', '%s grows in size!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'gruul EMOTE_GROW');
INSERT INTO `script_texts` VALUES ('-1568000', 'Spirits of da wind be your doom!', null, null, null, null, null, null, null, null, '12031', '1', '0', '0', 'janalai SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1568001', 'I burn ya now!', null, null, null, null, null, null, null, null, '12032', '1', '0', '0', 'janalai SAY_FIRE_BOMBS');
INSERT INTO `script_texts` VALUES ('-1568002', 'Where ma hatcha? Get to work on dem eggs!', null, null, null, null, null, null, null, null, '12033', '1', '0', '0', 'janalai SAY_SUMMON_HATCHER');
INSERT INTO `script_texts` VALUES ('-1568003', 'I show you strength... in numbers.', null, null, null, null, null, null, null, null, '12034', '1', '0', '0', 'janalai SAY_ALL_EGGS');
INSERT INTO `script_texts` VALUES ('-1568004', 'You done run outta time!', null, null, null, null, null, null, null, null, '12035', '1', '0', '0', 'janalai SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1568005', 'It all be over now, mon!', null, null, null, null, null, null, null, null, '12036', '1', '0', '0', 'janalai SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1568006', 'Tazaga-choo!', null, null, null, null, null, null, null, null, '12037', '1', '0', '0', 'janalai SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1568007', 'Zul\'jin... got a surprise for you...', null, null, null, null, null, null, null, null, '12038', '1', '0', '0', 'janalai SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1568008', 'Come, strangers. The spirit of the dragonhawk hot be hungry for worthy souls.', null, null, null, null, null, null, null, null, '12039', '1', '0', '0', 'janalai SAY_EVENT_STRANGERS');
INSERT INTO `script_texts` VALUES ('-1568009', 'Come, friends. Your bodies gonna feed ma hatchlings, and your souls are going to feed me with power!', null, null, null, null, null, null, null, null, '12040', '1', '0', '0', 'janalai SAY_EVENT_FRIENDS');
INSERT INTO `script_texts` VALUES ('-1568010', 'Get da move on, guards! It be killin\' time!', null, null, null, null, null, null, null, null, '12066', '1', '0', '0', 'nalorakk SAY_WAVE1_AGGRO');
INSERT INTO `script_texts` VALUES ('-1568011', 'Guards, go already! Who you more afraid of, dem... or me?', null, null, null, null, null, null, null, null, '12067', '1', '0', '0', 'nalorakk SAY_WAVE2_STAIR1');
INSERT INTO `script_texts` VALUES ('-1568012', 'Ride now! Ride out dere and bring me back some heads!', null, null, null, null, null, null, null, null, '12068', '1', '0', '0', 'nalorakk SAY_WAVE3_STAIR2');
INSERT INTO `script_texts` VALUES ('-1568013', 'I be losin\' me patience! Go on: make dem wish dey was never born!', null, null, null, null, null, null, null, null, '12069', '1', '0', '0', 'nalorakk SAY_WAVE4_PLATFORM');
INSERT INTO `script_texts` VALUES ('-1568014', 'What could be better than servin\' da bear spirit for eternity? Come closer now. Bring your souls to me!', null, null, null, null, null, null, null, null, '12078', '1', '0', '0', 'nalorakk SAY_EVENT1_SACRIFICE');
INSERT INTO `script_texts` VALUES ('-1568015', 'Don\'t be delayin\' your fate. Come to me now. I make your sacrifice quick.', null, null, null, null, null, null, null, null, '12079', '1', '0', '0', 'nalorakk SAY_EVENT2_SACRIFICE');
INSERT INTO `script_texts` VALUES ('-1568016', 'You be dead soon enough!', null, null, null, null, null, null, null, null, '12070', '1', '0', '0', 'nalorakk SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1568017', 'I bring da pain!', null, null, null, null, null, null, null, null, '12071', '1', '0', '0', 'nalorakk SAY_SURGE');
INSERT INTO `script_texts` VALUES ('-1568018', 'You call on da beast, you gonna get more dan you bargain for!', null, null, null, null, null, null, null, null, '12072', '1', '0', '0', 'nalorakk SAY_TOBEAR');
INSERT INTO `script_texts` VALUES ('-1568019', 'Make way for Nalorakk!', null, null, null, null, null, null, null, null, '12073', '1', '0', '0', 'nalorakk SAY_TOTROLL');
INSERT INTO `script_texts` VALUES ('-1568020', 'You had your chance, now it be too late!', null, null, null, null, null, null, null, null, '12074', '1', '0', '0', 'nalorakk SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1568021', 'Mua-ha-ha! Now whatchoo got to say?', null, null, null, null, null, null, null, null, '12075', '1', '0', '0', 'nalorakk SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1568022', 'Da Amani gonna rule again!', null, null, null, null, null, null, null, null, '12076', '1', '0', '0', 'nalorakk SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1568023', 'I... be waitin\' on da udda side....', null, null, null, null, null, null, null, null, '12077', '1', '0', '0', 'nalorakk SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1568024', 'Da eagles gonna bear your spirits to me. Your sacrifice is not gonna be in vein!', null, null, null, null, null, null, null, null, '12122', '1', '0', '0', 'akilzon SAY_EVENT1');
INSERT INTO `script_texts` VALUES ('-1568025', 'Your death gonna be quick, strangers. You shoulda never have come to this place...', null, null, null, null, null, null, null, null, '12123', '1', '0', '0', 'akilzon SAY_EVENT2');
INSERT INTO `script_texts` VALUES ('-1568026', 'I be da predator! You da prey...', null, null, null, null, null, null, null, null, '12013', '1', '0', '0', 'akilzon SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1568027', 'Feed, me bruddahs!', null, null, null, null, null, null, null, null, '12014', '1', '0', '0', 'akilzon SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1568028', 'Come, and join me bruddahs!', null, null, null, null, null, null, null, null, '12015', '1', '0', '0', 'akilzon SAY_SUMMON_ALT');
INSERT INTO `script_texts` VALUES ('-1568029', 'All you be doing is wasting my time!', null, null, null, null, null, null, null, null, '12016', '1', '0', '0', 'akilzon SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1568030', 'Ya got nothin\'!', null, null, null, null, null, null, null, null, '12017', '1', '0', '0', 'akilzon SAY_SLAY1');
INSERT INTO `script_texts` VALUES ('-1568031', 'Stop your cryin\'!', null, null, null, null, null, null, null, null, '12018', '1', '0', '0', 'akilzon SAY_SLAY2');
INSERT INTO `script_texts` VALUES ('-1568032', 'You can\'t... kill... me spirit!', null, null, null, null, null, null, null, null, '12019', '1', '0', '0', 'akilzon SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1568033', 'An Electrical Storm Appears!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'akilzon EMOTE_STORM');
INSERT INTO `script_texts` VALUES ('-1568034', 'Get on ya knees and bow.... to da fang and claw!', null, null, null, null, null, null, null, null, '12020', '1', '0', '0', 'halazzi SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1568035', 'I fight wit\' untamed spirit....', null, null, null, null, null, null, null, null, '12021', '1', '0', '0', 'halazzi SAY_SPLIT');
INSERT INTO `script_texts` VALUES ('-1568036', 'Spirit, come back to me!', null, null, null, null, null, null, null, null, '12022', '1', '0', '0', 'halazzi SAY_MERGE');
INSERT INTO `script_texts` VALUES ('-1568037', 'Me gonna carve ya now!', null, null, null, null, null, null, null, null, '12023', '1', '0', '0', 'halazzi SAY_SABERLASH1');
INSERT INTO `script_texts` VALUES ('-1568038', 'You gonna leave in pieces!', null, null, null, null, null, null, null, null, '12024', '1', '0', '0', 'halazzi SAY_SABERLASH2');
INSERT INTO `script_texts` VALUES ('-1568039', 'Whatch you be doing? Pissin\' yourselves...', null, null, null, null, null, null, null, null, '12025', '1', '0', '0', 'halazzi SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1568040', 'You cant fight the power!', null, null, null, null, null, null, null, null, '12026', '1', '0', '0', 'halazzi SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1568041', 'You gonna fail!', null, null, null, null, null, null, null, null, '12027', '1', '0', '0', 'halazzi SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1568042', 'Chaga... choka\'jinn.', null, null, null, null, null, null, null, null, '12028', '1', '0', '0', 'halazzi SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1568043', 'Come, fools. Fill ma empty cages...', null, null, null, null, null, null, null, null, '12029', '1', '0', '0', 'halazzi SAY_EVENT1');
INSERT INTO `script_texts` VALUES ('-1568044', 'I be waitin, strangers. Your deaths gonna make me stronger!', null, null, null, null, null, null, null, null, '12030', '1', '0', '0', 'halazzi SAY_EVENT2');
INSERT INTO `script_texts` VALUES ('-1568045', 'Da shadow gonna fall on you...', null, null, null, null, null, null, null, null, '12041', '1', '0', '0', 'malacrass SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1568046', 'Ya don\'t kill me yet, ya don\'t get another chance!', null, null, null, null, null, null, null, null, '12042', '1', '0', '0', 'malacrass SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1568047', 'Dis a nightmare ya don\' wake up from!', null, null, null, null, null, null, null, null, '12043', '1', '0', '0', 'malacrass SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1568048', 'Azzaga choogo zinn!', null, null, null, null, null, null, null, null, '12044', '1', '0', '0', 'malacrass SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1568049', 'Your will belong ta me now!', null, null, null, null, null, null, null, null, '12045', '1', '0', '0', 'malacrass SAY_SOUL_SIPHON');
INSERT INTO `script_texts` VALUES ('-1568050', 'Darkness comin\' for you...', null, null, null, null, null, null, null, null, '12046', '1', '0', '0', 'malacrass SAY_DRAIN_POWER');
INSERT INTO `script_texts` VALUES ('-1568051', 'Your soul gonna bleed!', null, null, null, null, null, null, null, null, '12047', '1', '0', '0', 'malacrass SAY_SPIRIT_BOLTS');
INSERT INTO `script_texts` VALUES ('-1568052', 'It not gonna make no difference.', null, null, null, null, null, null, null, null, '12048', '1', '0', '0', 'malacrass SAY_ADD_DIED1');
INSERT INTO `script_texts` VALUES ('-1568053', 'You gonna die worse dan him.', null, null, null, null, null, null, null, null, '12049', '1', '0', '0', 'malacrass SAY_ADD_DIED2');
INSERT INTO `script_texts` VALUES ('-1568054', 'Dat no bodda me.', null, null, null, null, null, null, null, null, '12050', '1', '0', '0', 'malacrass SAY_ADD_DIED3');
INSERT INTO `script_texts` VALUES ('-1568055', 'Dis not... da end of me...', null, null, null, null, null, null, null, null, '12051', '1', '0', '0', 'malacrass SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1568056', 'Everybody always wanna take from us. Now we gonna start takin\' back. Anybody who get in our way...gonna drown in dey own blood! Da Amani empire be back now...seekin\' vengeance. And we gonna start wit\' you.', null, null, null, null, null, null, null, null, '12090', '1', '0', '0', 'zuljin SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1568057', 'Nobody badduh dan me!', null, null, null, null, null, null, null, null, '12091', '1', '0', '0', 'zuljin SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1568058', 'Got me some new tricks... like me brudda bear....', null, null, null, null, null, null, null, null, '12092', '1', '0', '0', 'zuljin SAY_BEAR_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1568059', 'Dere be no hidin\' from da eagle!', null, null, null, null, null, null, null, null, '12093', '1', '0', '0', 'zuljin SAY_EAGLE_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1568060', 'Let me introduce you to me new bruddas: fang and claw!', null, null, null, null, null, null, null, null, '12094', '1', '0', '0', 'zuljin SAY_LYNX_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1568061', 'Ya don\' have to look to da sky to see da dragonhawk!', null, null, null, null, null, null, null, null, '12095', '1', '0', '0', 'zuljin SAY_DRAGONHAWK_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1568062', 'Fire kill you just as quick!', null, null, null, null, null, null, null, null, '12096', '1', '0', '0', 'zuljin SAY_FIRE_BREATH');
INSERT INTO `script_texts` VALUES ('-1568063', 'You too slow! Me too strong!', null, null, null, null, null, null, null, null, '12097', '1', '0', '0', 'zuljin SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1568064', 'Da Amani de chuka!', null, null, null, null, null, null, null, null, '12098', '1', '0', '0', 'zuljin SAY_KILL1');
INSERT INTO `script_texts` VALUES ('-1568065', 'Lot more gonna fall like you!', null, null, null, null, null, null, null, null, '12099', '1', '0', '0', 'zuljin SAY_KILL2');
INSERT INTO `script_texts` VALUES ('-1568066', 'Mebbe me fall...but da Amani empire...never gonna die...', null, null, null, null, null, null, null, null, '12100', '1', '0', '0', 'zuljin SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1568067', 'Zul\'jin got a surprise for ya...', null, null, null, null, null, null, null, null, '12052', '6', '0', '0', 'zulaman SAY_INST_RELEASE');
INSERT INTO `script_texts` VALUES ('-1568068', 'Da spirits gonna feast today! Begin da ceremonies, sacrifice da prisoners... make room for our new guests!', null, null, null, null, null, null, null, null, '12053', '6', '0', '0', 'zulaman SAY_INST_BEGIN');
INSERT INTO `script_texts` VALUES ('-1568069', 'Take your pick, trespassers! Any of ma priests be happy to accommodate ya.', null, null, null, null, null, null, null, null, '12054', '6', '0', '0', 'zulaman SAY_INST_PROGRESS_1');
INSERT INTO `script_texts` VALUES ('-1568070', 'Don\'t be shy. Thousands have come before you. Ya not be alone in your service.', null, null, null, null, null, null, null, null, '12055', '6', '0', '0', 'zulaman SAY_INST_PROGRESS_2');
INSERT INTO `script_texts` VALUES ('-1568071', 'Ya gonna fail, strangers. Many try before you, but dey only make us stronger!', null, null, null, null, null, null, null, null, '12056', '6', '0', '0', 'zulaman SAY_INST_PROGRESS_3');
INSERT INTO `script_texts` VALUES ('-1568072', 'Your efforts was in vain, trespassers. The rituals nearly be complete.', null, null, null, null, null, null, null, null, '12057', '6', '0', '0', 'zulaman SAY_INST_WARN_1');
INSERT INTO `script_texts` VALUES ('-1568073', 'Soon da cages gonna be empty, da sacrifices be complete, and you gonna take dere places.', null, null, null, null, null, null, null, null, '12058', '6', '0', '0', 'zulaman SAY_INST_WARN_2');
INSERT INTO `script_texts` VALUES ('-1568074', 'Time be running low, strangers. Soon you gonna join da souls of dem ya failed to save.', null, null, null, null, null, null, null, null, '12059', '6', '0', '0', 'zulaman SAY_INST_WARN_3');
INSERT INTO `script_texts` VALUES ('-1568075', 'Make haste, ma priests! Da rituals must not be interrupted!', null, null, null, null, null, null, null, null, '12060', '6', '0', '0', 'zulaman SAY_INST_WARN_4');
INSERT INTO `script_texts` VALUES ('-1568076', 'Ya make a good try... but now you gonna join da ones who already fall.', null, null, null, null, null, null, null, null, '12061', '6', '0', '0', 'zulaman SAY_INST_SACRIF1');
INSERT INTO `script_texts` VALUES ('-1568077', 'Ya not do too bad. Ya efforts [...] for a small time. Come to me now. Ya prove yourself worthy offerings.', null, null, null, null, null, null, null, null, '12062', '6', '0', '0', 'zulaman SAY_INST_SACRIF2');
INSERT INTO `script_texts` VALUES ('-1568078', 'Watch now. Every offering gonna strengthen our ties to da spirit world. Soon, we gonna be unstoppable!', null, null, null, null, null, null, null, null, '12065', '6', '0', '0', 'zulaman SAY_INST_COMPLETE');
INSERT INTO `script_texts` VALUES ('-1568079', 'Suit yourself. At least five of you must assist me if we\'re to get inside. Follow me.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'harrison SAY_START');
INSERT INTO `script_texts` VALUES ('-1568080', 'According to my calculations, if enough of us bang the gong at once the seal on these doors will break and we can enter.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'harrison SAY_AT_GONG');
INSERT INTO `script_texts` VALUES ('-1568081', 'I\'ve researched this site extensively and I won\'t allow any dim-witted treasure hunters to swoop in and steal what belongs to in a museum. I\'ll lead this charge.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'harrison SAY_OPEN_ENTRANCE');
INSERT INTO `script_texts` VALUES ('-1568082', '%s absorbs the essence of the bear spirit!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'zuljin EMOTE_BEAR_SPIRIT');
INSERT INTO `script_texts` VALUES ('-1568083', '%s absorbs the essence of the eagle spirit!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'zuljin EMOTE_EAGLE_SPIRIT');
INSERT INTO `script_texts` VALUES ('-1568084', '%s absorbs the essence of the lynx spirit!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'zuljin EMOTE_LYNX_SPIRIT');
INSERT INTO `script_texts` VALUES ('-1568085', '%s absorbs the essence of the dragonhawk spirit!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'zuljin EMOTE_DRAGONHAWK_SPIRIT');
INSERT INTO `script_texts` VALUES ('-1574000', 'Your blood is mine!', null, null, null, null, null, null, null, null, '13221', '1', '0', '0', 'keleseth SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1574001', 'Not so fast.', null, null, null, null, null, null, null, null, '13222', '1', '0', '0', 'keleseth SAY_FROSTTOMB');
INSERT INTO `script_texts` VALUES ('-1574002', 'Aranal, lidel! Their fate shall be yours!', null, null, null, null, null, null, null, null, '13224', '1', '0', '0', 'keleseth SAY_SKELETONS');
INSERT INTO `script_texts` VALUES ('-1574003', 'Darkness waits!', null, null, null, null, null, null, null, null, '13223', '1', '0', '0', 'keleseth SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1574004', 'I join... the night.', null, null, null, null, null, null, null, null, '13225', '1', '0', '0', 'keleseth SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1574005', 'I\'ll paint my face with your blood!', null, null, null, null, null, null, null, null, '13207', '1', '0', '0', 'ingvar SAY_AGGRO_FIRST');
INSERT INTO `script_texts` VALUES ('-1574006', 'I return! A second chance to carve out your skull!', null, null, null, null, null, null, null, null, '13209', '1', '0', '0', 'ingvar SAY_AGGRO_SECOND');
INSERT INTO `script_texts` VALUES ('-1574007', 'My life for the... death god!', null, null, null, null, null, null, null, null, '13213', '1', '0', '0', 'ingvar SAY_DEATH_FIRST');
INSERT INTO `script_texts` VALUES ('-1574008', 'No! I can do... better! I can...', null, null, null, null, null, null, null, null, '13211', '1', '0', '0', 'ingvar SAY_DEATH_SECOND');
INSERT INTO `script_texts` VALUES ('-1574009', 'Mjul orm agn gjor!', null, null, null, null, null, null, null, null, '13212', '1', '0', '0', 'ingvar SAY_KILL_FIRST');
INSERT INTO `script_texts` VALUES ('-1574010', 'I am a warrior born!', null, null, null, null, null, null, null, null, '13214', '1', '0', '0', 'ingvar SAY_KILL_SECOND');
INSERT INTO `script_texts` VALUES ('-1574011', 'Dalronn! See if you can muster the nerve to join my attack!', null, null, null, null, null, null, null, null, '13229', '1', '0', '0', 'skarvald SAY_SKA_AGGRO');
INSERT INTO `script_texts` VALUES ('-1574012', 'Not... over... yet.', null, null, null, null, null, null, null, null, '13230', '1', '0', '0', 'skarvald SAY_SKA_DEATH');
INSERT INTO `script_texts` VALUES ('-1574013', 'A warrior\'s death.', null, null, null, null, null, null, null, null, '13231', '1', '0', '0', 'skarvald SAY_SKA_DEATH_REAL');
INSERT INTO `script_texts` VALUES ('-1574014', '???', null, null, null, null, null, null, null, null, '13232', '1', '0', '0', 'skarvald SAY_SKA_KILL');
INSERT INTO `script_texts` VALUES ('-1574015', 'Pagh! What sort of necromancer lets death stop him? I knew you were worthless!', null, null, null, null, null, null, null, null, '13233', '1', '0', '0', 'skarvald SAY_SKA_DAL_DIES_REPLY');
INSERT INTO `script_texts` VALUES ('-1574016', 'By all means, don\'t assess the situation, you halfwit! Just jump into the fray!', null, null, null, null, null, null, null, null, '13199', '1', '0', '0', 'dalronn SAY_DAL_AGGRO_REPLY');
INSERT INTO `script_texts` VALUES ('-1574017', 'See... you... soon.', null, null, null, null, null, null, null, null, '13200', '1', '0', '0', 'dalronn SAY_DAL_DEATH');
INSERT INTO `script_texts` VALUES ('-1574018', 'There\'s no... greater... glory.', null, null, null, null, null, null, null, null, '13201', '1', '0', '0', 'dalronn SAY_DAL_DEATH_REAL');
INSERT INTO `script_texts` VALUES ('-1574019', 'You may serve me yet.', null, null, null, null, null, null, null, null, '13202', '1', '0', '0', 'dalronn SAY_DAL_KILL');
INSERT INTO `script_texts` VALUES ('-1574020', 'Skarvald, you incompetent slug! Return and make yourself useful!', null, null, null, null, null, null, null, null, '13203', '1', '0', '0', 'dalronn SAY_DAL_SKA_DIES_REPLY');
INSERT INTO `script_texts` VALUES ('-1574021', '%s casts Frost Tomb on $N', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'keleseth EMOTE_FROST_TOMB');
INSERT INTO `script_texts` VALUES ('-1574022', '%s roars!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'ingvar EMOTE_ROAR');
INSERT INTO `script_texts` VALUES ('-1574023', 'Ingvar! Your pathetic failure will serve as a warning to all... you are damned! Arise and carry out the masters will!', null, null, null, null, null, null, null, null, '13754', '1', '0', '0', 'annhylde REZZ');
INSERT INTO `script_texts` VALUES ('-1575000', 'My liege! I have done as you asked, and now beseech you for your blessing!', null, null, null, null, null, null, null, null, '13856', '1', '0', '0', 'svala SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1575001', 'Your sacrifice is a testament to your obedience. Indeed you are worthy of this charge. Arise, and forever be known as Svala Sorrowgrave!', null, null, null, null, null, null, null, null, '14732', '1', '0', '0', 'svala SAY_INTRO_2_ARTHAS');
INSERT INTO `script_texts` VALUES ('-1575002', 'The sensation is... beyond my imagining. I am yours to command, my king.', null, null, null, null, null, null, null, null, '13857', '1', '0', '0', 'svala SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1575003', 'Your first test awaits you. Destroy our uninvited guests.', null, null, null, null, null, null, null, null, '14733', '1', '0', '0', 'svala SAY_INTRO_4_ARTHAS');
INSERT INTO `script_texts` VALUES ('-1575004', 'I will be happy to slaughter them in your name! Come, enemies of the Scourge! I will show you the might of the Lich King!', null, null, null, null, null, null, null, null, '13858', '1', '0', '0', 'svala SAY_INTRO_5');
INSERT INTO `script_texts` VALUES ('-1575005', 'I will vanquish your soul!', null, null, null, null, null, null, null, null, '13842', '1', '0', '0', 'svala SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1575006', 'You were a fool to challenge the power of the Lich King!', null, null, null, null, null, null, null, null, '13845', '1', '0', '0', 'svala SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1575007', 'Your will is done, my king.', null, null, null, null, null, null, null, null, '13847', '1', '0', '0', 'svala SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1575008', 'Another soul for my master.', null, null, null, null, null, null, null, null, '13848', '1', '0', '0', 'svala SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1575009', 'Your death approaches.', null, null, null, null, null, null, null, null, '13850', '1', '0', '0', 'svala SAY_SACRIFICE_1');
INSERT INTO `script_texts` VALUES ('-1575010', 'Go now to my master.', null, null, null, null, null, null, null, null, '13851', '1', '0', '0', 'svala SAY_SACRIFICE_2');
INSERT INTO `script_texts` VALUES ('-1575011', 'Your end is inevitable.', null, null, null, null, null, null, null, null, '13852', '1', '0', '0', 'svala SAY_SACRIFICE_3');
INSERT INTO `script_texts` VALUES ('-1575012', 'Yor-guul mak!', null, null, null, null, null, null, null, null, '13853', '1', '0', '0', 'svala SAY_SACRIFICE_4');
INSERT INTO `script_texts` VALUES ('-1575013', 'Any last words?', null, null, null, null, null, null, null, null, '13854', '1', '0', '0', 'svala SAY_SACRIFICE_5');
INSERT INTO `script_texts` VALUES ('-1575014', 'Nooo! I did not come this far... to...', null, null, null, null, null, null, null, null, '13855', '1', '0', '0', 'svala SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1575015', 'What this place? I will destroy you!', null, null, null, null, null, null, null, null, '13464', '1', '0', '0', 'gortok SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1575016', 'You die! That what master wants!', null, null, null, null, null, null, null, null, '13465', '1', '0', '0', 'gortok SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1575017', 'An easy task!', null, null, null, null, null, null, null, null, '13466', '1', '0', '0', 'gortok SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1575018', ' ', null, null, null, null, null, null, null, null, '13467', '1', '0', '0', 'gortok SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1575019', 'What mongrels dare intrude here? Look alive, my brothers! A feast for the one that brings me their heads!', null, null, null, null, null, null, null, null, '13497', '1', '0', '0', 'skadi SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1575020', 'Sear them to the bone!', null, null, null, null, null, null, null, null, '13498', '1', '0', '0', 'skadi SAY_DRAKEBREATH_1');
INSERT INTO `script_texts` VALUES ('-1575021', 'Go now! Leave nothing but ash in your wake!', null, null, null, null, null, null, null, null, '13499', '1', '0', '0', 'skadi SAY_DRAKEBREATH_2');
INSERT INTO `script_texts` VALUES ('-1575022', 'Cleanse our sacred halls with flame!', null, null, null, null, null, null, null, null, '13500', '1', '0', '0', 'skadi SAY_DRAKEBREATH_3');
INSERT INTO `script_texts` VALUES ('-1575023', 'I ask for ... to kill them, yet all I get is feeble whelps! By Ye.. SLAUGHTER THEM!', null, null, null, null, null, null, null, null, '13501', '1', '0', '0', 'skadi SAY_DRAKE_HARPOON_1');
INSERT INTO `script_texts` VALUES ('-1575024', 'If one more harpoon touches my drake I\'ll flae my miserable heins.', null, null, null, null, null, null, null, null, '13502', '1', '0', '0', 'skadi SAY_DRAKE_HARPOON_2');
INSERT INTO `script_texts` VALUES ('-1575025', 'Mjor Na Ul Kaval!', null, null, null, null, null, null, null, null, '13503', '1', '0', '0', 'skadi SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1575026', 'Not so brash now, are you?', null, null, null, null, null, null, null, null, '13504', '1', '0', '0', 'skadi SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1575027', 'I\'ll mount your skull from the highest tower!', null, null, null, null, null, null, null, null, '13505', '1', '0', '0', 'skadi SAY_KILL_3');
INSERT INTO `script_texts` VALUES ('-1575028', 'ARGH! You call that... an attack? I\'ll... show... aghhhh...', null, null, null, null, null, null, null, null, '13506', '1', '0', '0', 'skadi SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1575029', 'You motherless knaves! Your corpses will make fine morsels for my new drake!', null, null, null, null, null, null, null, null, '13507', '1', '0', '0', 'skadi SAY_DRAKE_DEATH');
INSERT INTO `script_texts` VALUES ('-1575030', '%s is within range of the harpoon launchers!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'skadi EMOTE_HARPOON_RANGE');
INSERT INTO `script_texts` VALUES ('-1575031', 'You invade my home and then dare to challenge me? I will tear the hearts from your chests and offer them as gifts to the death god! Rualg nja gaborr!', null, null, null, null, null, null, null, null, '13609', '1', '0', '0', 'ymiron SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1575032', 'Bjorn of the Black Storm! Honor me now with your presence!', null, null, null, null, null, null, null, null, '13610', '1', '0', '0', 'ymiron SAY_SUMMON_BJORN');
INSERT INTO `script_texts` VALUES ('-1575033', 'Haldor of the rocky cliffs, grant me your strength!', null, null, null, null, null, null, null, null, '13611', '1', '0', '0', 'ymiron SAY_SUMMON_HALDOR');
INSERT INTO `script_texts` VALUES ('-1575034', 'Ranulf of the screaming abyss, snuff these maggots with darkest night!', null, null, null, null, null, null, null, null, '13612', '1', '0', '0', 'ymiron SAY_SUMMON_RANULF');
INSERT INTO `script_texts` VALUES ('-1575035', 'Tor of the Brutal Siege! Bestow your might upon me!', null, null, null, null, null, null, null, null, '13613', '1', '0', '0', 'ymiron SAY_SUMMON_TORGYN');
INSERT INTO `script_texts` VALUES ('-1575036', 'Your death is only the beginning!', null, null, null, null, null, null, null, null, '13614', '1', '0', '0', 'ymiron SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1575037', 'You have failed your people!', null, null, null, null, null, null, null, null, '13615', '1', '0', '0', 'ymiron SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1575038', 'There is a reason I am king!', null, null, null, null, null, null, null, null, '13616', '1', '0', '0', 'ymiron SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1575039', 'Bleed no more!', null, null, null, null, null, null, null, null, '13617', '1', '0', '0', 'ymiron SAY_SLAY_4');
INSERT INTO `script_texts` VALUES ('-1575040', 'What... awaits me... now?', null, null, null, null, null, null, null, null, '13618', '1', '0', '0', 'ymiron SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1576000', 'You know what they say about curiosity.', null, null, null, null, null, null, null, null, '13319', '1', '0', '0', 'telestra SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1576001', 'I\'ll give you more than you can handle.', null, null, null, null, null, null, null, null, '13321', '1', '0', '0', 'telestra SAY_SPLIT_1');
INSERT INTO `script_texts` VALUES ('-1576002', 'There\'s plenty of me to go around.', null, null, null, null, null, null, null, null, '13322', '1', '0', '0', 'telestra SAY_SPLIT_2');
INSERT INTO `script_texts` VALUES ('-1576003', 'Now to finish the job!', null, null, null, null, null, null, null, null, '13323', '1', '0', '0', 'telestra SAY_MERGE');
INSERT INTO `script_texts` VALUES ('-1576004', 'Death becomes you!', null, null, null, null, null, null, null, null, '13324', '1', '0', '0', 'telestra SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1576005', 'Damn the... luck.', null, null, null, null, null, null, null, null, '13320', '1', '0', '0', 'telestra SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1576006', 'Chaos beckons.', null, null, null, null, null, null, null, null, '13186', '1', '0', '0', 'anomalus SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1576007', 'Reality... unwoven.', null, null, null, null, null, null, null, null, '13188', '1', '0', '0', 'anomalus SAY_RIFT');
INSERT INTO `script_texts` VALUES ('-1576008', 'Indestructible.', null, null, null, null, null, null, null, null, '13189', '1', '0', '0', 'anomalus SAY_SHIELD');
INSERT INTO `script_texts` VALUES ('-1576009', 'Expiration... is necesarry.', null, null, null, null, null, null, null, null, '13274', '1', '0', '0', 'anomalus SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1576010', 'Of course.', null, null, null, null, null, null, null, null, '13187', '1', '0', '0', 'anomalus SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1576011', 'Noo!', null, null, null, null, null, null, null, null, '13328', '1', '0', '0', 'ormorok SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1576012', '???', null, null, null, null, null, null, null, null, '13329', '1', '0', '0', 'ormorok SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1576013', 'Baaack!', null, null, null, null, null, null, null, null, '13331', '1', '0', '0', 'ormorok SAY_REFLECT');
INSERT INTO `script_texts` VALUES ('-1576014', 'Bleeeed!', null, null, null, null, null, null, null, null, '13332', '1', '0', '0', 'ormorok SAY_ICESPIKE');
INSERT INTO `script_texts` VALUES ('-1576015', 'Aaggh!', null, null, null, null, null, null, null, null, '13330', '1', '0', '0', 'ormorok SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1576016', 'Preserve? Why? There\'s no truth in it. No no no... only in the taking! I see that now!', null, null, null, null, null, null, null, null, '13450', '1', '0', '0', 'keristrasza SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1576017', 'Stay. Enjoy your final moments.', null, null, null, null, null, null, null, null, '13451', '1', '0', '0', 'keristrasza SAY_CRYSTAL_NOVA');
INSERT INTO `script_texts` VALUES ('-1576018', 'Finish it! Finish it! Kill me, or I swear by the Dragonqueen you\'ll never see daylight again!', null, null, null, null, null, null, null, null, '13452', '1', '0', '0', 'keristrasza SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1576019', 'Now we\'ve come to the truth!', null, null, null, null, null, null, null, null, '13453', '1', '0', '0', 'keristrasza SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1576020', 'Dragonqueen... Life-Binder... preserve... me.', null, null, null, null, null, null, null, null, '13454', '1', '0', '0', 'keristrasza SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1576021', '%s opens a Chaotic Rift!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'anomalus EMOTE_OPEN_RIFT');
INSERT INTO `script_texts` VALUES ('-1576022', '%s shields himself and divert his power to the rifts!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'anomalus EMOTE_SHIELD');
INSERT INTO `script_texts` VALUES ('-1578000', 'What do we have here... those would defy the Spell-Weaver? Those without foresight or understanding. How could I make you see? Malygos is saving the world from itself! Bah! You are hardly worth my time!', null, null, null, null, null, null, null, null, '13635', '1', '0', '0', 'urom SAY_SUMMON_1');
INSERT INTO `script_texts` VALUES ('-1578001', 'Clearly my pets failed. Perhaps another demonstration is in order.', null, null, null, null, null, null, null, null, '13636', '1', '0', '0', 'urom SAY_SUMMON_2');
INSERT INTO `script_texts` VALUES ('-1578002', 'Still you fight. Still you cling to misguided principles. If you survive, you\'ll find me in the center ring.', null, null, null, null, null, null, null, null, '13637', '1', '0', '0', 'urom SAY_SUMMON_3');
INSERT INTO `script_texts` VALUES ('-1578003', 'Poor blind fools!', null, null, null, null, null, null, null, null, '13638', '1', '0', '0', 'urom SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1578004', 'A taste... just a small taste... of the Spell-Weaver\'s power!', null, null, null, null, null, null, null, null, '13639', '1', '0', '0', 'urom SAY_EXPLOSION_1');
INSERT INTO `script_texts` VALUES ('-1578005', 'So much unstable energy... but worth the risk to destroy you!', null, null, null, null, null, null, null, null, '13640', '1', '0', '0', 'urom SAY_EXPLOSION_2');
INSERT INTO `script_texts` VALUES ('-1578006', 'If only you understood!', null, null, null, null, null, null, null, null, '13641', '1', '0', '0', 'urom SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1578007', 'Now do you see? Do you?!', null, null, null, null, null, null, null, null, '13642', '1', '0', '0', 'urom SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1578008', 'Unfortunate, but necessary.', null, null, null, null, null, null, null, null, '13643', '1', '0', '0', 'urom SAY_KILL_3');
INSERT INTO `script_texts` VALUES ('-1578009', 'Everything I\'ve done... has been for Azeroth...', null, null, null, null, null, null, null, null, '13644', '1', '0', '0', 'urom SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1578010', 'Simpletons! You cannot comprehend the forces you have set in motion. The ley line conduit will not be disrupted! Your defeat shall be absolute!', null, null, null, null, null, null, null, null, '13622', '6', '0', '0', 'eregos SAY_SPAWN');
INSERT INTO `script_texts` VALUES ('-1578011', 'You brash interlopers are out of your element! I will ground you!', null, null, null, null, null, null, null, null, '13623', '1', '0', '0', 'eregos SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1578012', 'We command the arcane! It shall not be used against us.', null, null, null, null, null, null, null, null, '13626', '1', '0', '0', 'eregos SAY_ARCANE_SHIELD');
INSERT INTO `script_texts` VALUES ('-1578013', 'It is trivial to extinguish your fire!', null, null, null, null, null, null, null, null, '13627', '1', '0', '0', 'eregos SAY_FIRE_SHIELD');
INSERT INTO `script_texts` VALUES ('-1578014', 'No magic of nature will help you now!', null, null, null, null, null, null, null, null, '13625', '1', '0', '0', 'eregos SAY_NATURE_SHIELD');
INSERT INTO `script_texts` VALUES ('-1578015', 'Such insolence... such arrogance... must be PUNISHED!', null, null, null, null, null, null, null, null, '13624', '1', '0', '0', 'eregos SAY_FRENZY');
INSERT INTO `script_texts` VALUES ('-1578016', 'It\'s a long way down...', null, null, null, null, null, null, null, null, '13628', '1', '0', '0', 'eregos SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1578017', 'Back to the earth with you!', null, null, null, null, null, null, null, null, '13629', '1', '0', '0', 'eregos SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1578018', 'Enjoy the fall!', null, null, null, null, null, null, null, null, '13630', '1', '0', '0', 'eregos SAY_KILL_3');
INSERT INTO `script_texts` VALUES ('-1578019', 'Savor this small victory, foolish little creatures. You and your dragon allies have won this battle. But we will win... the Nexus War.', null, null, null, null, null, null, null, null, '13631', '1', '0', '0', 'eregos SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1578020', 'Intruders, your victory will be short-lived. I am Commander Varos Cloudstrider. My drakes control the skies and protect this conduit. I will see to it personally that the Oculus does not fall into your hands!', null, null, null, null, null, null, null, null, '13648', '6', '0', '0', 'varos SAY_VAROS_INTRO');
INSERT INTO `script_texts` VALUES ('-1578021', 'Thank you for freeing us, mortals. Beware, the Blue Flight is alerted to your presence. Even now, Malygos sends Varos Cloudstrider and his ring guardians to defend the Oculus. You will need our help to stand a chance.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'belgaristrasz SAY_BELGARISTRASZ_GREET');
INSERT INTO `script_texts` VALUES ('-1580000', 'Aggh! No longer will I be a slave to Malygos! Challenge me and you will be destroyed!', null, null, null, null, null, null, null, null, '12422', '1', '0', '0', 'kalecgos SAY_EVIL_AGGRO');
INSERT INTO `script_texts` VALUES ('-1580001', 'I will purge you!', null, null, null, null, null, null, null, null, '12423', '1', '0', '0', 'kalecgos SAY_EVIL_SPELL1');
INSERT INTO `script_texts` VALUES ('-1580002', 'Your pain has only begun!', null, null, null, null, null, null, null, null, '12424', '1', '0', '0', 'kalecgos SAY_EVIL_SPELL2');
INSERT INTO `script_texts` VALUES ('-1580003', 'In the name of Kil\'jaeden!', null, null, null, null, null, null, null, null, '12425', '1', '0', '0', 'kalecgos SAY_EVIL_SLAY1');
INSERT INTO `script_texts` VALUES ('-1580004', 'You were warned!', null, null, null, null, null, null, null, null, '12426', '1', '0', '0', 'kalecgos SAY_EVIL_SLAY2');
INSERT INTO `script_texts` VALUES ('-1580005', 'My awakening is complete! You shall all perish!', null, null, null, null, null, null, null, null, '12427', '1', '0', '0', 'kalecgos SAY_EVIL_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1580006', 'I need... your help... Cannot... resist him... much longer...', null, null, null, null, null, null, null, null, '12428', '1', '0', '0', 'kalecgos humanoid SAY_GOOD_AGGRO');
INSERT INTO `script_texts` VALUES ('-1580007', 'Aaahhh! Help me, before I lose my mind!', null, null, null, null, null, null, null, null, '12429', '1', '0', '0', 'kalecgos humanoid SAY_GOOD_NEAR_DEATH');
INSERT INTO `script_texts` VALUES ('-1580008', 'Hurry! There is not much of me left!', null, null, null, null, null, null, null, null, '12430', '1', '0', '0', 'kalecgos humanoid SAY_GOOD_NEAR_DEATH2');
INSERT INTO `script_texts` VALUES ('-1580009', 'I am forever in your debt. Once we have triumphed over Kil\'jaeden, this entire world will be in your debt as well.', null, null, null, null, null, null, null, null, '12431', '1', '0', '0', 'kalecgos humanoid SAY_GOOD_PLRWIN');
INSERT INTO `script_texts` VALUES ('-1580010', 'There will be no reprieve. My work here is nearly finished.', null, null, null, null, null, null, null, null, '12451', '1', '0', '0', 'sathrovarr SAY_SATH_AGGRO');
INSERT INTO `script_texts` VALUES ('-1580011', 'I\'m... never on... the losing... side...', null, null, null, null, null, null, null, null, '12452', '1', '0', '0', 'sathrovarr SAY_SATH_DEATH');
INSERT INTO `script_texts` VALUES ('-1580012', 'Your misery is my delight!', null, null, null, null, null, null, null, null, '12453', '1', '0', '0', 'sathrovarr SAY_SATH_SPELL1');
INSERT INTO `script_texts` VALUES ('-1580013', 'I will watch you bleed!', null, null, null, null, null, null, null, null, '12454', '1', '0', '0', 'sathrovarr SAY_SATH_SPELL2');
INSERT INTO `script_texts` VALUES ('-1580014', 'Pitious mortal!', null, null, null, null, null, null, null, null, '12455', '1', '0', '0', 'sathrovarr SAY_SATH_SLAY1');
INSERT INTO `script_texts` VALUES ('-1580015', 'Haven\'t you heard? I always win!', null, null, null, null, null, null, null, null, '12456', '1', '0', '0', 'sathrovarr SAY_SATH_SLAY2');
INSERT INTO `script_texts` VALUES ('-1580016', 'I have toyed with you long enough!', null, null, null, null, null, null, null, null, '12457', '1', '0', '0', 'sathrovarr SAY_SATH_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1580017', 'Puny lizard! Death is the only answer you\'ll find here!', null, null, null, null, null, null, null, null, '12458', '1', '0', '0', 'brutallus YELL_INTRO');
INSERT INTO `script_texts` VALUES ('-1580018', 'Grah! Your magic is weak!', null, null, null, null, null, null, null, null, '12459', '1', '0', '0', 'brutallus YELL_INTRO_BREAK_ICE');
INSERT INTO `script_texts` VALUES ('-1580019', 'I will crush you!', null, null, null, null, null, null, null, null, '12460', '1', '0', '0', 'brutallus YELL_INTRO_CHARGE');
INSERT INTO `script_texts` VALUES ('-1580020', 'That was fun, but I still await a true challenge!', null, null, null, null, null, null, null, null, '12461', '1', '0', '0', 'brutallus YELL_INTRO_KILL_MADRIGOSA');
INSERT INTO `script_texts` VALUES ('-1580021', 'Come, try your luck!', null, null, null, null, null, null, null, null, '12462', '1', '0', '0', 'brutallus YELL_INTRO_TAUNT');
INSERT INTO `script_texts` VALUES ('-1580022', 'Ahh! More lambs to the slaughter!', null, null, null, null, null, null, null, null, '12463', '1', '0', '0', 'brutallus YELL_AGGRO');
INSERT INTO `script_texts` VALUES ('-1580023', 'Perish, insect!', null, null, null, null, null, null, null, null, '12464', '1', '0', '0', 'brutallus YELL_KILL1');
INSERT INTO `script_texts` VALUES ('-1580024', 'You are meat!', null, null, null, null, null, null, null, null, '12465', '1', '0', '0', 'brutallus YELL_KILL2');
INSERT INTO `script_texts` VALUES ('-1580025', 'Too easy!', null, null, null, null, null, null, null, null, '12466', '1', '0', '0', 'brutallus YELL_KILL3');
INSERT INTO `script_texts` VALUES ('-1580026', 'Bring the fight to me!', null, null, null, null, null, null, null, null, '12467', '1', '0', '0', 'brutallus YELL_LOVE1');
INSERT INTO `script_texts` VALUES ('-1580027', 'Another day, another glorious battle!', null, null, null, null, null, null, null, null, '12468', '1', '0', '0', 'brutallus YELL_LOVE2');
INSERT INTO `script_texts` VALUES ('-1580028', 'I live for this!', null, null, null, null, null, null, null, null, '12469', '1', '0', '0', 'brutallus YELL_LOVE3');
INSERT INTO `script_texts` VALUES ('-1580029', 'So much for a real challenge... Die!', null, null, null, null, null, null, null, null, '12470', '1', '0', '0', 'brutallus YELL_BERSERK');
INSERT INTO `script_texts` VALUES ('-1580030', 'Gah! Well done... Now... this gets... interesting...', null, null, null, null, null, null, null, null, '12471', '1', '0', '0', 'brutallus YELL_DEATH');
INSERT INTO `script_texts` VALUES ('-1580031', 'Hold, friends! There is information to be had before this devil meets his fate!', null, null, null, null, null, null, null, null, '12472', '1', '0', '0', 'madrigosa YELL_MADR_ICE_BARRIER');
INSERT INTO `script_texts` VALUES ('-1580032', 'Where is Anveena, demon? What has become of Kalec?', null, null, null, null, null, null, null, null, '12473', '1', '0', '0', 'madrigosa YELL_MADR_INTRO');
INSERT INTO `script_texts` VALUES ('-1580033', 'You will tell me where they are!', null, null, null, null, null, null, null, null, '12474', '1', '0', '0', 'madrigosa YELL_MADR_ICE_BLOCK');
INSERT INTO `script_texts` VALUES ('-1580034', 'Speak, I grow weary of asking!', null, null, null, null, null, null, null, null, '12475', '1', '0', '0', 'madrigosa YELL_MADR_TRAP');
INSERT INTO `script_texts` VALUES ('-1580035', 'Malygos, my lord! I did my best!', null, null, null, null, null, null, null, null, '12476', '1', '0', '0', 'madrigosa YELL_MADR_DEATH');
INSERT INTO `script_texts` VALUES ('-1580036', 'Glory to Kil\'jaeden! Death to all who oppose!', null, null, null, null, null, null, null, null, '12477', '1', '0', '0', 'felmyst SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1580037', 'I kill for the master!', null, null, null, null, null, null, null, null, '12480', '1', '0', '0', 'felmyst SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1580038', 'The end has come! ', null, null, null, null, null, null, null, null, '12481', '1', '0', '0', 'felmyst SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1580039', 'Choke on your final breath! ', null, null, null, null, null, null, null, null, '12478', '1', '0', '0', 'felmyst SAY_BREATH');
INSERT INTO `script_texts` VALUES ('-1580040', 'I am stronger than ever before! ', null, null, null, null, null, null, null, null, '12479', '1', '0', '0', 'felmyst SAY_TAKEOFF');
INSERT INTO `script_texts` VALUES ('-1580041', 'No more hesitation! Your fates are written! ', null, null, null, null, null, null, null, null, '12482', '1', '0', '0', 'felmyst SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1580042', 'Kil\'jaeden... will... prevail... ', null, null, null, null, null, null, null, null, '12483', '1', '0', '0', 'felmyst SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1580043', 'Madrigosa deserved a far better fate. You did what had to be done, but this battle is far from over.', null, null, null, null, null, null, null, null, '12439', '1', '0', '0', 'kalecgos SAY_KALECGOS_OUTRO');
INSERT INTO `script_texts` VALUES ('-1580044', 'Misery...', null, null, null, null, null, null, null, null, '12484', '1', '0', '0', 'sacrolash SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1580045', 'Depravity...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'alythess SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1580046', 'Confusion...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sacrolash SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1580047', 'Hatred...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'alythess SAY_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1580048', 'Mistrust...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sacrolash SAY_INTRO_5');
INSERT INTO `script_texts` VALUES ('-1580049', 'Chaos...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'alythess SAY_INTRO_6');
INSERT INTO `script_texts` VALUES ('-1580050', 'These are the hallmarks...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sacrolash SAY_INTRO_7');
INSERT INTO `script_texts` VALUES ('-1580051', 'These are the pillars...', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'alythess SAY_INTRO_8');
INSERT INTO `script_texts` VALUES ('-1580052', 'Shadow to the aid of fire!', null, null, null, null, null, null, null, null, '12485', '1', '0', '0', 'sacrolash SAY_SACROLASH_SHADOW_NOVA');
INSERT INTO `script_texts` VALUES ('-1580053', 'Alythess! Your fire burns within me!', null, null, null, null, null, null, null, null, '12488', '1', '0', '0', 'sacrolash SAY_SACROLASH_EMPOWER');
INSERT INTO `script_texts` VALUES ('-1580054', 'Shadows, engulf!', null, null, null, null, null, null, null, null, '12486', '1', '0', '0', 'sacrolash SAY_SACROLASH_KILL_1');
INSERT INTO `script_texts` VALUES ('-1580055', 'Ee-nok Kryul!', null, null, null, null, null, null, null, null, '12487', '1', '0', '0', 'sacrolash SAY_SACROLASH_KILL_2');
INSERT INTO `script_texts` VALUES ('-1580056', 'I... fade.', null, null, null, null, null, null, null, null, '12399', '1', '0', '0', 'sacrolash SAY_SACROLASH_DEAD');
INSERT INTO `script_texts` VALUES ('-1580057', 'Time is a luxury you no longer possess!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sacrolash SAY_SACROLASH_BERSERK');
INSERT INTO `script_texts` VALUES ('-1580058', 'Fire to the aid of shadow!', null, null, null, null, null, null, null, null, '12489', '1', '0', '0', 'alythess SAY_ALYTHESS_CANFLAGRATION');
INSERT INTO `script_texts` VALUES ('-1580059', 'Sacrolash!', null, null, null, null, null, null, null, null, '12492', '1', '0', '0', 'alythess SAY_ALYTHESS_EMPOWER');
INSERT INTO `script_texts` VALUES ('-1580060', 'Fire, consume!', null, null, null, null, null, null, null, null, '12490', '1', '0', '0', 'alythess SAY_ALYTHESS_KILL_1');
INSERT INTO `script_texts` VALUES ('-1580061', 'Ed-ir Halach!', null, null, null, null, null, null, null, null, '12491', '1', '0', '0', 'alythess SAY_ALYTHESS_KILL_2');
INSERT INTO `script_texts` VALUES ('-1580062', 'De-ek Anur!', null, null, null, null, null, null, null, null, '12494', '1', '0', '0', 'alythess SAY_ALYTHESS_DEAD');
INSERT INTO `script_texts` VALUES ('-1580063', 'Your luck has run its course!', null, null, null, null, null, null, null, null, '12493', '1', '0', '0', 'alythess SAY_ALYTHESS_BERSERK');
INSERT INTO `script_texts` VALUES ('-1580064', 'All my plans have led to this!', null, null, null, null, null, null, null, null, '12495', '1', '0', '0', 'kiljaeden SAY_ORDER_1');
INSERT INTO `script_texts` VALUES ('-1580065', 'Stay on task! Do not waste time!', null, null, null, null, null, null, null, null, '12496', '1', '0', '0', 'kiljaeden SAY_ORDER_2');
INSERT INTO `script_texts` VALUES ('-1580066', 'I have waited long enough!', null, null, null, null, null, null, null, null, '12497', '1', '0', '0', 'kiljaeden SAY_ORDER_3');
INSERT INTO `script_texts` VALUES ('-1580067', 'Fail me and suffer for eternity!', null, null, null, null, null, null, null, null, '12498', '1', '0', '0', 'kiljaeden SAY_ORDER_4');
INSERT INTO `script_texts` VALUES ('-1580068', 'Drain the girl! Drain her power until there is nothing but a vacant shell!', null, null, null, null, null, null, null, null, '12499', '1', '0', '0', 'kiljaeden SAY_ORDER_5');
INSERT INTO `script_texts` VALUES ('-1580069', 'The expendible have perished... So be it! Now I shall succeed where Sargeras could not! I will bleed this wretched world and secure my place as the true master of the Burning Legion. The end has come! Let the unraveling of this world commence!', null, null, null, null, null, null, null, null, '12500', '1', '0', '0', 'kiljaeden SAY_EMERGE');
INSERT INTO `script_texts` VALUES ('-1580070', 'Another step towards destruction!', null, null, null, null, null, null, null, null, '12501', '1', '0', '0', 'kiljaeden SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1580071', 'Anukh-Kyrie!', null, null, null, null, null, null, null, null, '12502', '1', '0', '0', 'kiljaeden SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1580072', 'Who can you trust?', null, null, null, null, null, null, null, null, '12503', '1', '0', '0', 'kiljaeden SAY_REFLECTION_1');
INSERT INTO `script_texts` VALUES ('-1580073', 'The enemy is among you.', null, null, null, null, null, null, null, null, '12504', '1', '0', '0', 'kiljaeden SAY_REFLECTION_2');
INSERT INTO `script_texts` VALUES ('-1580074', 'Chaos!', null, null, null, null, null, null, null, null, '12505', '1', '0', '0', 'kiljaeden SAY_DARKNESS_1');
INSERT INTO `script_texts` VALUES ('-1580075', 'Destruction!', null, null, null, null, null, null, null, null, '12506', '1', '0', '0', 'kiljaeden SAY_DARKNESS_2');
INSERT INTO `script_texts` VALUES ('-1580076', 'Oblivion!', null, null, null, null, null, null, null, null, '12507', '1', '0', '0', 'kiljaeden SAY_DARKNESS_3');
INSERT INTO `script_texts` VALUES ('-1580077', 'I will not be denied! This world shall fall!', null, null, null, null, null, null, null, null, '12508', '1', '0', '0', 'kiljaeden SAY_PHASE_3');
INSERT INTO `script_texts` VALUES ('-1580078', 'Do not harbor false hope. You cannot win!', null, null, null, null, null, null, null, null, '12509', '1', '0', '0', 'kiljaeden SAY_PHASE_4');
INSERT INTO `script_texts` VALUES ('-1580079', 'Aggghh! The powers of the Sunwell... turn... against me! What have you done? What have you done???', null, null, null, null, null, null, null, null, '12510', '1', '0', '0', 'kiljaeden SAY_PHASE_5');
INSERT INTO `script_texts` VALUES ('-1580080', 'You are not alone. The Blue Dragonflight shall help you vanquish the Deceiver.', null, null, null, null, null, null, null, null, '12438', '1', '0', '0', 'kalecgos SAY_KALECGOS_INTRO');
INSERT INTO `script_texts` VALUES ('-1580081', 'Anveena, you must awaken, this world needs you!', null, null, null, null, null, null, null, null, '12445', '1', '0', '0', 'kalecgos SAY_KALECGOS_AWAKE_1');
INSERT INTO `script_texts` VALUES ('-1580082', 'I serve only the Master now.', null, null, null, null, null, null, null, null, '12511', '0', '0', '0', 'anveena SAY_ANVEENA_IMPRISONED');
INSERT INTO `script_texts` VALUES ('-1580083', 'You must let go! You must become what you were always meant to be! The time is now, Anveena!', null, null, null, null, null, null, null, null, '12446', '1', '0', '0', 'kalecgos SAY_KALECGOS_AWAKE_2');
INSERT INTO `script_texts` VALUES ('-1580084', 'But I\'m... lost. I cannot find my way back.', null, null, null, null, null, null, null, null, '12512', '0', '0', '0', 'anveena SAY_ANVEENA_LOST');
INSERT INTO `script_texts` VALUES ('-1580085', 'Anveena, I love you! Focus on my voice, come back for me now! Only you can cleanse the Sunwell!', null, null, null, null, null, null, null, null, '12447', '1', '0', '0', 'kalecgos SAY_KALECGOS_AWAKE_4');
INSERT INTO `script_texts` VALUES ('-1580086', 'Kalec... Kalec?', null, null, null, null, null, null, null, null, '12513', '0', '0', '0', 'anveena SAY_ANVEENA_AWAKE');
INSERT INTO `script_texts` VALUES ('-1580087', 'Yes, Anveena! Let fate embrace you now!', null, null, null, null, null, null, null, null, '12448', '1', '0', '0', 'kalecgos SAY_KALECGOS_AWAKE_5');
INSERT INTO `script_texts` VALUES ('-1580088', 'The nightmare is over, the spell is broken! Goodbye, Kalec, my love!', null, null, null, null, null, null, null, null, '12514', '0', '0', '0', 'anveena SAY_ANVEENA_SACRIFICE');
INSERT INTO `script_texts` VALUES ('-1580089', 'Goodbye, Anveena, my love. Few will remember your name, yet this day you change the course of destiny. What was once corrupt is now pure. Heroes, do not let her sacrifice be in vain.', null, null, null, null, null, null, null, null, '12450', '0', '0', '0', 'kalecgos SAY_KALECGOS_GOODBYE');
INSERT INTO `script_texts` VALUES ('-1580090', 'Strike now, heroes, while he is weakened! Vanquish the Deceiver!', null, null, null, null, null, null, null, null, '12449', '1', '0', '0', 'kalecgos SAY_KALECGOS_ENCOURAGE');
INSERT INTO `script_texts` VALUES ('-1580091', 'I will channel my power into the orbs, be ready!', null, null, null, null, null, null, null, null, '12440', '1', '0', '0', 'kalecgos SAY_KALECGOS_ORB_1');
INSERT INTO `script_texts` VALUES ('-1580092', 'I have empowered another orb! Use it quickly!', null, null, null, null, null, null, null, null, '12441', '1', '0', '0', 'kalecgos SAY_KALECGOS_ORB_2');
INSERT INTO `script_texts` VALUES ('-1580093', 'Another orb is ready! Make haste!', null, null, null, null, null, null, null, null, '12442', '1', '0', '0', 'kalecgos SAY_KALECGOS_ORB_3');
INSERT INTO `script_texts` VALUES ('-1580094', 'I have channeled all I can! The power is in your hands!', null, null, null, null, null, null, null, null, '12443', '1', '0', '0', 'kalecgos SAY_KALECGOS_ORB_4');
INSERT INTO `script_texts` VALUES ('-1580095', 'Mortal heroes - your victory here today was foretold long ago. My brother\'s anguished cry of defeat will echo across the universe - bringing renewed hope to all those who still stand against the Burning Crusade.', null, null, null, null, null, null, null, null, '12515', '0', '0', '1', 'velen SAY_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1580096', 'As the Legion\'s final defeat draws ever-nearer, stand proud in the knowledge that you have saved worlds without number from the flame.', null, null, null, null, null, null, null, null, '12516', '0', '0', '1', 'velen SAY_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1580097', 'Just as this day marks an ending, so too does it herald a new beginning...', null, null, null, null, null, null, null, null, '12517', '0', '0', '1', 'velen SAY_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1580098', 'The creature Entropius, whom you were forced to destroy, was once the noble naaru, M\'uru. In life, M\'uru channeled vast energies of LIGHT and HOPE. For a time, a misguided few sought to steal those energies...', null, null, null, null, null, null, null, null, '12518', '0', '0', '1', 'velen SAY_OUTRO_4');
INSERT INTO `script_texts` VALUES ('-1580099', 'Our arrogance was unpardonable. We damned one of the most noble beings of all. We may never atone for this sin.', null, null, null, null, null, null, null, null, '12524', '0', '0', '1', 'liadrin SAY_OUTRO_5');
INSERT INTO `script_texts` VALUES ('-1580100', 'Than fortunate it is, that I have reclaimed the noble naaru\'s spark from where it fell! Where faith dwells, hope is never lost, young blood elf.', null, null, null, null, null, null, null, null, '12519', '0', '0', '1', 'velen SAY_OUTRO_6');
INSERT INTO `script_texts` VALUES ('-1580101', 'Can it be ?', null, null, null, null, null, null, null, null, '12525', '0', '0', '1', 'liadrin SAY_OUTRO_7');
INSERT INTO `script_texts` VALUES ('-1580102', 'Gaz now, mortals - upon the HEART OF M\'URU! Umblemished. Bathed by the light of Creation - just as it was at the Dawn.', null, null, null, null, null, null, null, null, '12520', '0', '0', '1', 'velen SAY_OUTRO_8');
INSERT INTO `script_texts` VALUES ('-1580103', 'In time, the light and hope held within - will rebirth more than this mere fount of power... Mayhap, they will rebirth the soul of a nation.', null, null, null, null, null, null, null, null, '12521', '0', '0', '1', 'velen SAY_OUTRO_9');
INSERT INTO `script_texts` VALUES ('-1580104', 'Blessed ancestors! I feel it... so much love... so much grace... there are... no words... impossible to describe...', null, null, null, null, null, null, null, null, '12526', '0', '0', '1', 'liadrin SAY_OUTRO_10');
INSERT INTO `script_texts` VALUES ('-1580105', 'Salvation, young one. It waits for us all.', null, null, null, null, null, null, null, null, '12522', '0', '0', '1', 'velen SAY_OUTRO_11');
INSERT INTO `script_texts` VALUES ('-1580106', 'Farewell...!', null, null, null, null, null, null, null, null, '12523', '0', '0', '1', 'velen SAY_OUTRO_12');
INSERT INTO `script_texts` VALUES ('-1585000', 'You only waste my time!', null, null, null, null, null, null, null, null, '12378', '1', '0', '0', 'selin SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1585001', 'My hunger knows no bounds!', null, null, null, null, null, null, null, null, '12381', '1', '0', '0', 'selin SAY_ENERGY');
INSERT INTO `script_texts` VALUES ('-1585002', 'Yes! I am a god!', null, null, null, null, null, null, null, null, '12382', '1', '0', '0', 'selin SAY_EMPOWERED');
INSERT INTO `script_texts` VALUES ('-1585003', 'Enough distractions!', null, null, null, null, null, null, null, null, '12388', '1', '0', '0', 'selin SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1585004', 'I am invincible!', null, null, null, null, null, null, null, null, '12385', '1', '0', '0', 'selin SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1585005', 'No! More... I must have more!', null, null, null, null, null, null, null, null, '12383', '1', '0', '0', 'selin SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1585006', '%s begins to channel from the nearby Fel Crystal...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'selin EMOTE_CRYSTAL');
INSERT INTO `script_texts` VALUES ('-1585007', 'Drain...life!', null, null, null, null, null, null, null, null, '12389', '1', '0', '0', 'vexallus SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1585008', 'Un...con...tainable.', null, null, null, null, null, null, null, null, '12392', '1', '0', '0', 'vexallus SAY_ENERGY');
INSERT INTO `script_texts` VALUES ('-1585009', 'Un...leash...', null, null, null, null, null, null, null, null, '12390', '1', '0', '0', 'vexallus SAY_OVERLOAD');
INSERT INTO `script_texts` VALUES ('-1585010', 'Con...sume.', null, null, null, null, null, null, null, null, '12393', '1', '0', '0', 'vexallus SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1585011', '%s discharges pure energy!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'vexallus EMOTE_DISCHARGE_ENERGY');
INSERT INTO `script_texts` VALUES ('-1585012', 'Annihilate them!', null, null, null, null, null, null, null, null, '12395', '1', '0', '0', 'delrissa SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1585013', 'Oh, the horror.', null, null, null, null, null, null, null, null, '12398', '1', '0', '0', 'delrissa LackeyDeath1');
INSERT INTO `script_texts` VALUES ('-1585014', 'Well, aren\'t you lucky?', null, null, null, null, null, null, null, null, '12400', '1', '0', '0', 'delrissa LackeyDeath2');
INSERT INTO `script_texts` VALUES ('-1585015', 'Now I\'m getting annoyed.', null, null, null, null, null, null, null, null, '12401', '1', '0', '0', 'delrissa LackeyDeath3');
INSERT INTO `script_texts` VALUES ('-1585016', 'Lackies be damned! I\'ll finish you myself!', null, null, null, null, null, null, null, null, '12403', '1', '0', '0', 'delrissa LackeyDeath4');
INSERT INTO `script_texts` VALUES ('-1585017', 'I call that a good start.', null, null, null, null, null, null, null, null, '12405', '1', '0', '0', 'delrissa PlayerDeath1');
INSERT INTO `script_texts` VALUES ('-1585018', 'I could have sworn there were more of you.', null, null, null, null, null, null, null, null, '12407', '1', '0', '0', 'delrissa PlayerDeath2');
INSERT INTO `script_texts` VALUES ('-1585019', 'Not really much of a group, anymore, is it?', null, null, null, null, null, null, null, null, '12409', '1', '0', '0', 'delrissa PlayerDeath3');
INSERT INTO `script_texts` VALUES ('-1585020', 'One is such a lonely number.', null, null, null, null, null, null, null, null, '12410', '1', '0', '0', 'delrissa PlayerDeath4');
INSERT INTO `script_texts` VALUES ('-1585021', 'It\'s been a kick, really.', null, null, null, null, null, null, null, null, '12411', '1', '0', '0', 'delrissa PlayerDeath5');
INSERT INTO `script_texts` VALUES ('-1585022', 'Not what I had... planned...', null, null, null, null, null, null, null, null, '12397', '1', '0', '0', 'delrissa SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1585023', 'Don\'t look so smug! I know what you\'re thinking, but Tempest Keep was merely a set back. Did you honestly believe I would trust the future to some blind, half-night elf mongrel? Oh no, he was merely an instrument, a stepping stone to a much larger plan! It has all led to this, and this time, you will not interfere!', null, null, null, null, null, null, null, null, '12413', '1', '0', '0', 'kaelthas MT SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1585024', 'Vengeance burns!', null, null, null, null, null, null, null, null, '12415', '1', '0', '0', 'kaelthas MT SAY_PHOENIX');
INSERT INTO `script_texts` VALUES ('-1585025', 'Felomin ashal!', null, null, null, null, null, null, null, null, '12417', '1', '0', '0', 'kaelthas MT SAY_FLAMESTRIKE');
INSERT INTO `script_texts` VALUES ('-1585026', 'I\'ll turn your world... upside... down...', null, null, null, null, null, null, null, null, '12418', '1', '0', '0', 'kaelthas MT SAY_GRAVITY_LAPSE');
INSERT INTO `script_texts` VALUES ('-1585027', 'Master... grant me strength.', null, null, null, null, null, null, null, null, '12419', '1', '0', '0', 'kaelthas MT SAY_TIRED');
INSERT INTO `script_texts` VALUES ('-1585028', 'Do not... get too comfortable.', null, null, null, null, null, null, null, null, '12420', '1', '0', '0', 'kaelthas MT SAY_RECAST_GRAVITY');
INSERT INTO `script_texts` VALUES ('-1585029', 'My demise accomplishes nothing! The Master will have you! You will drown in your own blood! This world shall burn! Aaaghh!', null, null, null, null, null, null, null, null, '12421', '1', '0', '0', 'kaelthas MT SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1599000', 'Soft, vulnerable shells. Brief, fragile lives. You can not escape the curse of flesh!', null, null, null, null, null, null, null, null, '14180', '1', '0', '0', 'sjonnir SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1599001', '???', null, null, null, null, null, null, null, null, '14181', '1', '0', '0', 'sjonnir SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1599002', 'Flesh is no match for iron!', null, null, null, null, null, null, null, null, '14182', '1', '0', '0', 'sjonnir SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1599003', 'Armies of iron will smother the world!', null, null, null, null, null, null, null, null, '14183', '1', '0', '0', 'sjonnir SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1599004', 'Loken will not rest, until the forge is retaken. You changed nothing!', null, null, null, null, null, null, null, null, '14184', '1', '0', '0', 'sjonnir SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1599005', 'You shouldn\'t have come...now you will die!', null, null, null, null, null, null, null, null, '13487', '1', '0', '0', 'maiden SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1599006', 'Why must it be this way?', null, null, null, null, null, null, null, null, '13488', '1', '0', '0', 'maiden SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1599007', 'You had it coming!', null, null, null, null, null, null, null, null, '13489', '1', '0', '0', 'maiden SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1599008', 'My burden grows heavier.', null, null, null, null, null, null, null, null, '13490', '1', '0', '0', 'maiden SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1599009', 'This is your own fault!', null, null, null, null, null, null, null, null, '13491', '1', '0', '0', 'maiden SAY_SLAY_4');
INSERT INTO `script_texts` VALUES ('-1599010', 'So much lost time... that you\'ll never get back!', null, null, null, null, null, null, null, null, '13492', '1', '0', '0', 'maiden SAY_STUN');
INSERT INTO `script_texts` VALUES ('-1599011', 'I hope you all rot! I never...wanted...this.', null, null, null, null, null, null, null, null, '13493', '1', '0', '0', 'maiden SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1599012', 'Now that\'s owning your supper!', null, null, null, null, null, null, null, null, '14244', '1', '0', '0', 'brann SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1599013', 'Press on, that\'s the way!', null, null, null, null, null, null, null, null, '14245', '1', '0', '0', 'brann SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1599014', 'Keep it up now. Plenty of death-dealing for everyone!', null, null, null, null, null, null, null, null, '14246', '1', '0', '0', 'brann SAY_KILL_3');
INSERT INTO `script_texts` VALUES ('-1599015', 'I\'m all kinds of busted up. Might not... make it...', null, null, null, null, null, null, null, null, '14257', '1', '0', '0', 'brann SAY_LOW_HEALTH');
INSERT INTO `script_texts` VALUES ('-1599016', 'Not yet, not... yet-', null, null, null, null, null, null, null, null, '14258', '1', '0', '0', 'brann SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1599017', 'I\'m doing everything I can!', null, null, null, null, null, null, null, null, '14260', '1', '0', '0', 'brann SAY_PLAYER_DEATH_1');
INSERT INTO `script_texts` VALUES ('-1599018', 'Light preserve you!', null, null, null, null, null, null, null, null, '14261', '1', '0', '0', 'brann SAY_PLAYER_DEATH_2');
INSERT INTO `script_texts` VALUES ('-1599019', 'I hope this is all worth it!', null, null, null, null, null, null, null, null, '14262', '1', '0', '0', 'brann SAY_PLAYER_DEATH_3');
INSERT INTO `script_texts` VALUES ('-1599020', 'Time to get some answers! Let\'s get this show on the road!', null, null, null, null, null, null, null, null, '14259', '1', '0', '0', 'brann SAY_ESCORT_START');
INSERT INTO `script_texts` VALUES ('-1599021', 'Don\'t worry. Old Brann has got your back. Keep that metal monstrosity busy and I\'ll see if I can sweet talk this machine into helping you.', null, null, null, null, null, null, null, null, '14274', '1', '0', '0', 'brann SAY_SPAWN_DWARF');
INSERT INTO `script_texts` VALUES ('-1599022', 'This is a wee bit trickier that before... Oh, bloody--incomin\'!', null, null, null, null, null, null, null, null, '14275', '1', '0', '0', 'brann SAY_SPAWN_TROGG');
INSERT INTO `script_texts` VALUES ('-1599023', 'What in the name o\' Madoran did THAT do? Oh! Wait: I just about got it...', null, null, null, null, null, null, null, null, '14276', '1', '0', '0', 'brann SAY_SPAWN_OOZE');
INSERT INTO `script_texts` VALUES ('-1599024', 'Ha, that did it. Help\'s a-coming. Take this you glow-eying brute!', null, null, null, null, null, null, null, null, '14277', '1', '0', '0', 'brann SAY_SPAWN_EARTHEN');
INSERT INTO `script_texts` VALUES ('-1599025', 'Take a moment and relish this with me! Soon all will be revealed! Okay then, let\'s do this!', null, null, null, null, null, null, null, null, '14247', '1', '0', '0', 'brann SAY_EVENT_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1599026', 'Now keep an eye out! I\'ll have this licked in two shakes of a--', null, null, null, null, null, null, null, null, '14248', '1', '0', '0', 'brann SAY_EVENT_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1599027', 'Warning! Life form pattern not recognized. Archival processing terminated. Continued interference will result in targeted response.', null, null, null, null, null, null, null, null, '13765', '1', '0', '0', 'brann SAY_EVENT_INTRO_3_ABED');
INSERT INTO `script_texts` VALUES ('-1599028', 'Oh, that doesn\'t sound good. We might have a complication or two...', null, null, null, null, null, null, null, null, '14249', '1', '0', '0', 'brann SAY_EVENT_A_1');
INSERT INTO `script_texts` VALUES ('-1599029', 'Security breach in progress. Analysis of historical archives transferred to lower priority queue. Countermeasures engaged.', null, null, null, null, null, null, null, null, '13756', '1', '0', '0', 'brann SAY_EVENT_A_2_KADD');
INSERT INTO `script_texts` VALUES ('-1599030', 'Ah, you want to play hardball, eh? That\'s just my game!', null, null, null, null, null, null, null, null, '14250', '1', '0', '0', 'brann SAY_EVENT_A_3');
INSERT INTO `script_texts` VALUES ('-1599031', 'Couple more minutes and I\'ll--', null, null, null, null, null, null, null, null, '14251', '1', '0', '0', 'brann SAY_EVENT_B_1');
INSERT INTO `script_texts` VALUES ('-1599032', 'Threat index threshold exceeded. Celestial archive aborted. Security level heightened.', null, null, null, null, null, null, null, null, '13761', '1', '0', '0', 'brann SAY_EVENT_B_2_MARN');
INSERT INTO `script_texts` VALUES ('-1599033', 'Heightened? What\'s the good news?', null, null, null, null, null, null, null, null, '14252', '1', '0', '0', 'brann SAY_EVENT_B_3');
INSERT INTO `script_texts` VALUES ('-1599034', 'So that was the problem? Now I\'m makin\' progress...', null, null, null, null, null, null, null, null, '14253', '1', '0', '0', 'brann SAY_EVENT_C_1');
INSERT INTO `script_texts` VALUES ('-1599035', 'Critical threat index. Void analysis diverted. Initiating sanitization protocol.', null, null, null, null, null, null, null, null, '13767', '1', '0', '0', 'brann SAY_EVENT_C_2_ABED');
INSERT INTO `script_texts` VALUES ('-1599036', 'Hang on! Nobody\'s gonna\' be sanitized as long as I have a say in it!', null, null, null, null, null, null, null, null, '14254', '1', '0', '0', 'brann SAY_EVENT_C_3');
INSERT INTO `script_texts` VALUES ('-1599037', 'Ha! The old magic fingers finally won through! Now let\'s get down to-', null, null, null, null, null, null, null, null, '14255', '1', '0', '0', 'brann SAY_EVENT_D_1');
INSERT INTO `script_texts` VALUES ('-1599038', 'Alert! Security fail safes deactivated. Beginning memory purge...', null, null, null, null, null, null, null, null, '13768', '1', '0', '0', 'brann SAY_EVENT_D_2_ABED');
INSERT INTO `script_texts` VALUES ('-1599039', 'Purge? No no no no no! Where did I-- Aha, this should do the trick...', null, null, null, null, null, null, null, null, '14256', '1', '0', '0', 'brann SAY_EVENT_D_3');
INSERT INTO `script_texts` VALUES ('-1599040', 'System online. Life form pattern recognized. Welcome Branbronzan. Query?', null, null, null, null, null, null, null, null, '13769', '1', '0', '0', 'brann SAY_EVENT_D_4_ABED');
INSERT INTO `script_texts` VALUES ('-1599041', 'Query? What do you think I\'m here for? Tea and biscuits? Spill the beans already!', null, null, null, null, null, null, null, null, '14263', '1', '0', '0', 'brann SAY_EVENT_END_01');
INSERT INTO `script_texts` VALUES ('-1599042', 'Tell me how that dwarfs came to be! And start at the beginning!', null, null, null, null, null, null, null, null, '14264', '1', '0', '0', 'brann SAY_EVENT_END_02');
INSERT INTO `script_texts` VALUES ('-1599043', 'Accessing prehistoric data. Retrieved. In the beginning Earthen were created to-', null, null, null, null, null, null, null, null, '13770', '1', '0', '0', 'brann SAY_EVENT_END_03_ABED');
INSERT INTO `script_texts` VALUES ('-1599044', 'Right, right! I know that the Earthen were made of stone to shape the deep reaches of the world but what about the anomalies? Matrix non-stabilizing and whatnot.', null, null, null, null, null, null, null, null, '14265', '1', '0', '0', 'brann SAY_EVENT_END_04');
INSERT INTO `script_texts` VALUES ('-1599045', 'Accessing. In the early stages of its development cycle Azeroth suffered infection by parasitic, necrophotic symbiotes.', null, null, null, null, null, null, null, null, '13771', '1', '0', '0', 'brann SAY_EVENT_END_05_ABED');
INSERT INTO `script_texts` VALUES ('-1599046', 'Necro-what? Speak bloody common will ya?', null, null, null, null, null, null, null, null, '14266', '1', '0', '0', 'brann SAY_EVENT_END_06');
INSERT INTO `script_texts` VALUES ('-1599047', 'Designation: Old Gods. Old Gods rendered all systems, including Earthen defenseless in order to facilitate assimilation. This matrix destabilization has been termed the Curse of Flesh. Effects of destabilization increased over time.', null, null, null, null, null, null, null, null, '13772', '1', '0', '0', 'brann SAY_EVENT_END_07_ABED');
INSERT INTO `script_texts` VALUES ('-1599048', 'Old Gods eh? So they zapped the Earthen with this Curse of Flesh. And then what?', null, null, null, null, null, null, null, null, '14267', '1', '0', '0', 'brann SAY_EVENT_END_08');
INSERT INTO `script_texts` VALUES ('-1599049', 'Accessing. Creators arrived to extirpate symbiotic infection. Assessment revealed that Old God infestation had grown malignant. Excising parasites would result in loss of host.', null, null, null, null, null, null, null, null, '13757', '1', '0', '0', 'brann SAY_EVENT_END_09_KADD');
INSERT INTO `script_texts` VALUES ('-1599050', 'If they killed the Old Gods Azeroth would have been destroyed.', null, null, null, null, null, null, null, null, '14268', '1', '0', '0', 'brann SAY_EVENT_END_10');
INSERT INTO `script_texts` VALUES ('-1599051', 'Correct. Creators neutralized parasitic threat and contained it within the host. Forge of Wills and other systems were instituted to create new Earthen. Safeguards were implemented and protectors were appointed.', null, null, null, null, null, null, null, null, '13758', '1', '0', '0', 'brann SAY_EVENT_END_11_KADD');
INSERT INTO `script_texts` VALUES ('-1599052', 'What protectors?', null, null, null, null, null, null, null, null, '14269', '1', '0', '0', 'brann SAY_EVENT_END_12');
INSERT INTO `script_texts` VALUES ('-1599053', 'Designations: Aesir and Vanir or in common nomenclator Storm and Earth Giants. Sentinel Loken designated supreme. Dragon Aspects appointed to monitor evolution of Azeroth.', null, null, null, null, null, null, null, null, '13759', '1', '0', '0', 'brann SAY_EVENT_END_13_KADD');
INSERT INTO `script_texts` VALUES ('-1599054', 'Aesir and Vanir. Okay. So the Forge of Wills started to make new Earthen. But what happened to the old ones?', null, null, null, null, null, null, null, null, '14270', '1', '0', '0', 'brann SAY_EVENT_END_14');
INSERT INTO `script_texts` VALUES ('-1599055', 'Additional background is relevant to your query. Following global combat between-', null, null, null, null, null, null, null, null, '13762', '1', '0', '0', 'brann SAY_EVENT_END_15_MARN');
INSERT INTO `script_texts` VALUES ('-1599056', 'Hold everything! The Aesir and Vanir went to war? Why?', null, null, null, null, null, null, null, null, '14271', '1', '0', '0', 'brann SAY_EVENT_END_16');
INSERT INTO `script_texts` VALUES ('-1599057', 'Unknown. Data suggests that impetus for global combat originated with prime designate Loken who neutralized all remaining Aesir and Vanir affecting termination of conflict. Prime designate Loken then initiated stasis of several seed races including Earthen, Giant and Vrykul at designated holding facilities.', null, null, null, null, null, null, null, null, '13763', '1', '0', '0', 'brann SAY_EVENT_END_17_MARN');
INSERT INTO `script_texts` VALUES ('-1599058', 'This Loken sounds like a nasty character. Glad we don\'t have to worry about the likes of him anymore. So if I\'m understanding you lads the original Earthen eventually woke up from this statis. And by that time this destabily-whatever had turned them into our brother dwarfs. Or at least dwarf ancestors. Hm?', null, null, null, null, null, null, null, null, '14272', '1', '0', '0', 'brann SAY_EVENT_END_18');
INSERT INTO `script_texts` VALUES ('-1599059', 'Essentially that is correct.', null, null, null, null, null, null, null, null, '13764', '1', '0', '0', 'brann SAY_EVENT_END_19_MARN');
INSERT INTO `script_texts` VALUES ('-1599060', 'Well now. That\'s a lot to digest. I\'m gonna need some time to take all of this in. Thank you!', null, null, null, null, null, null, null, null, '14273', '1', '0', '0', 'brann SAY_EVENT_END_20');
INSERT INTO `script_texts` VALUES ('-1599061', 'Acknowledged Branbronzan. Session terminated.', null, null, null, null, null, null, null, null, '13773', '1', '0', '0', 'brann SAY_EVENT_END_21_ABED');
INSERT INTO `script_texts` VALUES ('-1599062', 'Loken?! That\'s downright bothersome... We might\'ve neutralized the iron dwarves, but I\'d lay odds there\'s another machine somewhere else churnin\' out a whole mess o\' these iron vrykul!', null, null, null, null, null, null, null, null, '14278', '1', '0', '0', 'brann SAY_VICTORY_SJONNIR_1');
INSERT INTO `script_texts` VALUES ('-1599063', 'I\'ll use the forge to make badtches o\' earthen to stand guard... But our greatest challenge still remains: find and stop Loken!', null, null, null, null, null, null, null, null, '14279', '1', '0', '0', 'brann SAY_VICTORY_SJONNIR_2');
INSERT INTO `script_texts` VALUES ('-1599064', 'I think it\'s time to see what\'s behind the door near the entrance. I\'m going to sneak over there, nice and quiet. Meet me at the door and I\'ll get us in.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'brann SAY_ENTRANCE_MEET');
INSERT INTO `script_texts` VALUES ('-1600000', 'More grunts, more glands, more FOOD!', null, null, null, null, null, null, null, null, '13181', '1', '0', '0', 'trollgore SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1600001', 'So hungry! Must feed!', null, null, null, null, null, null, null, null, '13182', '1', '0', '0', 'trollgore SAY_CONSUME');
INSERT INTO `script_texts` VALUES ('-1600002', 'Aaaargh...', null, null, null, null, null, null, null, null, '13183', '1', '0', '0', 'trollgore SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1600003', 'Corpse go boom!', null, null, null, null, null, null, null, null, '13184', '1', '0', '0', 'trollgore SAY_EXPLODE');
INSERT INTO `script_texts` VALUES ('-1600004', 'You have gone, me gonna eat you!', null, null, null, null, null, null, null, null, '13185', '1', '0', '0', 'trollgore SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1600005', 'The chill that you feel is the herald of your doom!', null, null, null, null, null, null, null, null, '13173', '1', '0', '0', 'novos SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1600006', 'Your efforts... are in vain.', null, null, null, null, null, null, null, null, '13174', '1', '0', '0', 'novos SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1600007', 'Such is the fate of all who oppose the Lich King.', null, null, null, null, null, null, null, null, '13175', '1', '0', '0', 'novos SAY_KILL');
INSERT INTO `script_texts` VALUES ('-1600008', 'Bolster my defenses! Hurry, curse you!', null, null, null, null, null, null, null, null, '13176', '1', '0', '0', 'novos SAY_ADDS');
INSERT INTO `script_texts` VALUES ('-1600009', 'Surely you can see the futility of it all!', null, null, null, null, null, null, null, null, '13177', '1', '0', '0', 'novos SAY_BUBBLE_1');
INSERT INTO `script_texts` VALUES ('-1600010', 'Just give up and die already!', null, null, null, null, null, null, null, null, '13178', '1', '0', '0', 'novos SAY_BUBBLE_2');
INSERT INTO `script_texts` VALUES ('-1600011', '%s calls for assistance.', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'novos EMOTE_ASSISTANCE');
INSERT INTO `script_texts` VALUES ('-1600012', 'Tharon\'ja sees all! The work of mortals shall not end the eternal dynasty!', null, null, null, null, null, null, null, null, '13862', '1', '0', '0', 'tharonja SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1600013', 'As Tharon\'ja predicted.', null, null, null, null, null, null, null, null, '13863', '1', '0', '0', 'tharonja SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1600014', 'As it was written.', null, null, null, null, null, null, null, null, '13864', '1', '0', '0', 'tharonja SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1600015', 'Your flesh serves Tharon\'ja now!', null, null, null, null, null, null, null, null, '13865', '1', '0', '0', 'tharonja SAY_FLESH_1');
INSERT INTO `script_texts` VALUES ('-1600016', 'Tharon\'ja has a use for your mortal shell!', null, null, null, null, null, null, null, null, '13866', '1', '0', '0', 'tharonja SAY_FLESH_2');
INSERT INTO `script_texts` VALUES ('-1600017', 'No! A taste... all too brief!', null, null, null, null, null, null, null, null, '13867', '1', '0', '0', 'tharonja SAY_SKELETON_1');
INSERT INTO `script_texts` VALUES ('-1600018', 'Tharon\'ja will have more!', null, null, null, null, null, null, null, null, '13868', '1', '0', '0', 'tharonja SAY_SKELETON_2');
INSERT INTO `script_texts` VALUES ('-1600019', 'Im... impossible! Tharon\'ja is eternal! Tharon\'ja... is...', null, null, null, null, null, null, null, null, '13869', '1', '0', '0', 'tharonja SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1601000', 'This kingdom belongs to the Scourge! Only the dead may enter.', null, null, null, null, null, null, null, null, '14075', '1', '0', '0', 'krikthir SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1601001', '???', null, null, null, null, null, null, null, null, '14076', '1', '0', '0', 'krikthir SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1601002', 'You were foolish to come.', null, null, null, null, null, null, null, null, '14077', '1', '0', '0', 'krikthir SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1601003', 'As Anub\'Arak commands!', null, null, null, null, null, null, null, null, '14078', '1', '0', '0', 'krikthir SAY_KILL_3');
INSERT INTO `script_texts` VALUES ('-1601004', 'We are besieged. Strike out and bring back their corpses!', null, null, null, null, null, null, null, null, '14079', '1', '0', '0', 'krikthir SAY_SEND_GROUP_1');
INSERT INTO `script_texts` VALUES ('-1601005', 'We must hold the gate. Attack! Tear them limb from limb!', null, null, null, null, null, null, null, null, '14080', '1', '0', '0', 'krikthir SAY_SEND_GROUP_2');
INSERT INTO `script_texts` VALUES ('-1601006', 'The gate must be protected at all costs. Rip them to shreds!', null, null, null, null, null, null, null, null, '14081', '1', '0', '0', 'krikthir SAY_SEND_GROUP_3');
INSERT INTO `script_texts` VALUES ('-1601007', 'Keep an eye on the tunnel. We must not let anyone through!', null, null, null, null, null, null, null, null, '14082', '1', '0', '0', 'krikthir SAY_PREFIGHT_1');
INSERT INTO `script_texts` VALUES ('-1601008', 'I hear footsteps. Be on your guard.', null, null, null, null, null, null, null, null, '14083', '1', '0', '0', 'krikthir SAY_PREFIGHT_2');
INSERT INTO `script_texts` VALUES ('-1601009', 'I sense the living. Be ready.', null, null, null, null, null, null, null, null, '14084', '1', '0', '0', 'krikthir SAY_PREFIGHT_3');
INSERT INTO `script_texts` VALUES ('-1601010', 'They hunger.', null, null, null, null, null, null, null, null, '14085', '1', '0', '0', 'krikthir SAY_SWARM_1');
INSERT INTO `script_texts` VALUES ('-1601011', 'Dinner time, my pets.', null, null, null, null, null, null, null, null, '14086', '1', '0', '0', 'krikthir SAY_SWARM_2');
INSERT INTO `script_texts` VALUES ('-1601012', 'I should be grateful. But I long ago lost the capacity.', null, null, null, null, null, null, null, null, '14087', '1', '0', '0', 'krikthir SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1601013', 'REUSE ME', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'REUSE ME');
INSERT INTO `script_texts` VALUES ('-1601014', 'I was king of this empire once, long ago. In life I stood as champion. In death I returned as conqueror. Now I protect the kingdom once more. Ironic, yes?', null, null, null, null, null, null, null, null, '14053', '1', '0', '0', 'anubarak SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1601015', 'Eternal agony awaits you!', null, null, null, null, null, null, null, null, '14054', '1', '0', '0', 'anubarak SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1601016', 'You shall experience my torment, first-hand!', null, null, null, null, null, null, null, null, '14055', '1', '0', '0', 'anubarak SAY_KILL_1');
INSERT INTO `script_texts` VALUES ('-1601017', 'You have made your choice.', null, null, null, null, null, null, null, null, '14056', '1', '0', '0', 'anubarak SAY_KILL_2');
INSERT INTO `script_texts` VALUES ('-1601018', 'Soon, the Master\'s voice will call to you.', null, null, null, null, null, null, null, null, '14057', '1', '0', '0', 'anubarak SAY_KILL_3');
INSERT INTO `script_texts` VALUES ('-1601019', 'Come forth, my brethren. Feast on their flesh!', null, null, null, null, null, null, null, null, '14059', '1', '0', '0', 'anubarak SAY_SUBMERGE_1');
INSERT INTO `script_texts` VALUES ('-1601020', 'Auum na-l ak-k-k-k, isshhh.', null, null, null, null, null, null, null, null, '14058', '1', '0', '0', 'anubarak SAY_SUBMERGE_2');
INSERT INTO `script_texts` VALUES ('-1601021', 'Your armor is useless against my locusts!', null, null, null, null, null, null, null, null, '14060', '1', '0', '0', 'anubarak SAY_LOCUST_1');
INSERT INTO `script_texts` VALUES ('-1601022', 'The pestilence upon you!', null, null, null, null, null, null, null, null, '14068', '1', '0', '0', 'anubarak SAY_LOCUST_2');
INSERT INTO `script_texts` VALUES ('-1601023', 'Uunak-hissss tik-k-k-k-k!', null, null, null, null, null, null, null, null, '14067', '1', '0', '0', 'anubarak SAY_LOCUST_3');
INSERT INTO `script_texts` VALUES ('-1601024', 'Ahhh... RAAAAAGH! Never thought... I would be free of him...', null, null, null, null, null, null, null, null, '14069', '1', '0', '0', 'anubarak SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1602000', 'I am the greatest of my father\'s sons! Your end has come!', null, null, null, null, null, null, null, null, '14149', '1', '0', '0', 'bjarngrim SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1602001', 'So ends your curse!', null, null, null, null, null, null, null, null, '14153', '1', '0', '0', 'bjarngrim SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1602002', 'Flesh... is... weak!', null, null, null, null, null, null, null, null, '14154', '1', '0', '0', 'bjarngrim SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1602003', '...', null, null, null, null, null, null, null, null, '14155', '1', '0', '0', 'bjarngrim SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1602004', 'How can it be...? Flesh is not... stronger!', null, null, null, null, null, null, null, null, '14156', '1', '0', '0', 'bjarngrim SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1602005', 'Defend yourself, for all the good it will do!', null, null, null, null, null, null, null, null, '14151', '1', '0', '0', 'bjarngrim SAY_BATTLE_STANCE');
INSERT INTO `script_texts` VALUES ('-1602006', '%s switches to Battle Stance!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'bjarngrim EMOTE_BATTLE_STANCE');
INSERT INTO `script_texts` VALUES ('-1602007', 'GRAAAAAH! Behold the fury of iron and steel!', null, null, null, null, null, null, null, null, '14152', '1', '0', '0', 'bjarngrim SAY_BERSEKER_STANCE');
INSERT INTO `script_texts` VALUES ('-1602008', '%s switches to Berserker Stance!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'bjarngrim EMOTE_BERSEKER_STANCE');
INSERT INTO `script_texts` VALUES ('-1602009', 'Give me your worst!', null, null, null, null, null, null, null, null, '14150', '1', '0', '0', 'bjarngrim SAY_DEFENSIVE_STANCE');
INSERT INTO `script_texts` VALUES ('-1602010', '%s switches to Defensive Stance!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'bjarngrim EMOTE_DEFENSIVE_STANCE');
INSERT INTO `script_texts` VALUES ('-1602011', 'You wish to confront the master? You must weather the storm!', null, null, null, null, null, null, null, null, '14453', '1', '0', '0', 'ionar SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1602012', 'Shocking ... I know!', null, null, null, null, null, null, null, null, '14456', '1', '0', '0', 'ionar SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1602013', 'You atempt the unpossible.', null, null, null, null, null, null, null, null, '14457', '1', '0', '0', 'ionar SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1602014', 'Your spark of light is ... extinguish.', null, null, null, null, null, null, null, null, '14458', '1', '0', '0', 'ionar SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1602015', 'Master... you have guests.', null, null, null, null, null, null, null, null, '14459', '1', '0', '0', 'ionar SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1602016', 'The slightest spark shall be your undoing.', null, null, null, null, null, null, null, null, '14454', '1', '0', '0', 'ionar SAY_SPLIT_1');
INSERT INTO `script_texts` VALUES ('-1602017', 'No one is safe!', null, null, null, null, null, null, null, null, '14455', '1', '0', '0', 'ionar SAY_SPLIT_2');
INSERT INTO `script_texts` VALUES ('-1602018', 'What hope is there for you? None!', null, null, null, null, null, null, null, null, '14162', '1', '0', '0', 'loken SAY_AGGRO0');
INSERT INTO `script_texts` VALUES ('-1602019', 'I have witnessed the rise and fall of empires. The birth and extinction of entire species. Over countless millennia the foolishness of mortals has remained beyond a constant. Your presence here confirms this.', null, null, null, null, null, null, null, null, '14160', '1', '0', '0', 'loken SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1602020', 'My master has shown me the future, and you have no place in it. Azeroth will be reborn in darkness. Yogg-Saron shall be released! The Pantheon shall fall!', null, null, null, null, null, null, null, null, '14162', '1', '0', '0', 'loken SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1602021', 'Only mortal...', null, null, null, null, null, null, null, null, '14166', '1', '0', '0', 'loken SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1602022', 'I... am... FOREVER!', null, null, null, null, null, null, null, null, '14167', '1', '0', '0', 'loken SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1602023', 'What little time you had, you wasted!', null, null, null, null, null, null, null, null, '14168', '1', '0', '0', 'loken SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1602024', 'My death... heralds the end of this world.', null, null, null, null, null, null, null, null, '14172', '1', '0', '0', 'loken SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1602025', 'You cannot hide from fate!', null, null, null, null, null, null, null, null, '14163', '1', '0', '0', 'loken SAY_NOVA_1');
INSERT INTO `script_texts` VALUES ('-1602026', 'Come closer. I will make it quick.', null, null, null, null, null, null, null, null, '14164', '1', '0', '0', 'loken SAY_NOVA_2');
INSERT INTO `script_texts` VALUES ('-1602027', 'Your flesh cannot hold out for long.', null, null, null, null, null, null, null, null, '14165', '1', '0', '0', 'loken SAY_NOVA_3');
INSERT INTO `script_texts` VALUES ('-1602028', 'You stare blindly into the abyss!', null, null, null, null, null, null, null, null, '14169', '1', '0', '0', 'loken SAY_75HEALTH');
INSERT INTO `script_texts` VALUES ('-1602029', 'Your ignorance is profound. Can you not see where this path leads?', null, null, null, null, null, null, null, null, '14170', '1', '0', '0', 'loken SAY_50HEALTH');
INSERT INTO `script_texts` VALUES ('-1602030', 'You cross the precipice of oblivion!', null, null, null, null, null, null, null, null, '14171', '1', '0', '0', 'loken SAY_25HEALTH');
INSERT INTO `script_texts` VALUES ('-1602031', '%s begins to cast Lightning Nova!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'loken EMOTE_NOVA');
INSERT INTO `script_texts` VALUES ('-1602032', 'It is you who have destroyed my children? You... shall... pay!', null, null, null, null, null, null, null, null, '13960', '1', '0', '0', 'volkhan SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1602033', 'The armies of iron will conquer all!', null, null, null, null, null, null, null, null, '13965', '1', '0', '0', 'volkhan SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1602034', 'Ha, pathetic!', null, null, null, null, null, null, null, null, '13966', '1', '0', '0', 'volkhan SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1602035', 'You have cost me too much work!', null, null, null, null, null, null, null, null, '13967', '1', '0', '0', 'volkhan SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1602036', 'The master was right... to be concerned.', null, null, null, null, null, null, null, null, '13968', '1', '0', '0', 'volkhan SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1602037', 'I will crush you beneath my boots!', null, null, null, null, null, null, null, null, '13963', '1', '0', '0', 'volkhan SAY_STOMP_1');
INSERT INTO `script_texts` VALUES ('-1602038', 'All my work... undone!', null, null, null, null, null, null, null, null, '13964', '1', '0', '0', 'volkhan SAY_STOMP_2');
INSERT INTO `script_texts` VALUES ('-1602039', 'Life from the lifelessness... death for you.', null, null, null, null, null, null, null, null, '13961', '1', '0', '0', 'volkhan SAY_FORGE_1');
INSERT INTO `script_texts` VALUES ('-1602040', 'Nothing is wasted in the process. You will see....', null, null, null, null, null, null, null, null, '13962', '1', '0', '0', 'volkhan SAY_FORGE_2');
INSERT INTO `script_texts` VALUES ('-1602041', '%s runs to his anvil!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'volkhan EMOTE_TO_ANVIL');
INSERT INTO `script_texts` VALUES ('-1602042', '%s prepares to shatter his Brittle Golems!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'volkhan EMOTE_SHATTER');
INSERT INTO `script_texts` VALUES ('-1603000', 'The Conservatory must be protected!', null, null, null, null, null, null, null, null, '15526', '1', '0', '0', 'freya SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603001', 'Elders, grant me your strength!', null, null, null, null, null, null, null, null, '15527', '1', '0', '0', 'freya SAY_AGGRO_HARD');
INSERT INTO `script_texts` VALUES ('-1603002', 'Eonar, your servant requires aid!', null, null, null, null, null, null, null, null, '15528', '1', '0', '0', 'freya SAY_ADDS_CONSERVATOR');
INSERT INTO `script_texts` VALUES ('-1603003', 'Children, assist me!', null, null, null, null, null, null, null, null, '15533', '1', '0', '0', 'freya SAY_ADDS_TRIO');
INSERT INTO `script_texts` VALUES ('-1603004', 'The swarm of the elements shall overtake you!', null, null, null, null, null, null, null, null, '15534', '1', '0', '0', 'freya SAY_ADDS_LASHER');
INSERT INTO `script_texts` VALUES ('-1603005', 'Forgive me.', null, null, null, null, null, null, null, null, '15529', '1', '0', '0', 'freya SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603006', 'From your death springs life anew!', null, null, null, null, null, null, null, null, '15530', '1', '0', '0', 'freya SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603007', 'His hold on me dissipates. I can see clearly once more. Thank you, heroes.', null, null, null, null, null, null, null, null, '15531', '1', '0', '0', 'freya SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603008', 'You have strayed too far, wasted too much time!', null, null, null, null, null, null, null, null, '15532', '1', '0', '0', 'freya SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603009', 'Eonar, your servant calls for your blessing!', null, null, null, null, null, null, null, null, '15535', '1', '0', '0', 'freya SAY_HELP_YOGG');
INSERT INTO `script_texts` VALUES ('-1603010', 'Allies of Nature have appeared!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'freya EMOTE_ALLIES_NATURE');
INSERT INTO `script_texts` VALUES ('-1603011', 'A Lifebinder\'s Gift begins to grow!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'freya EMOTE_LIFEBINDER');
INSERT INTO `script_texts` VALUES ('-1603012', 'Freya begins to cast Ground Tremor!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'freya EMOTE_TREMOR');
INSERT INTO `script_texts` VALUES ('-1603013', 'Freya casts Strenghtened Iron Roots!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'freya EMOTE_IRON_ROOTS');
INSERT INTO `script_texts` VALUES ('-1603014', 'Matron, the Conservatory has been breached!', null, null, null, null, null, null, null, null, '15483', '1', '0', '0', 'brightleaf SAY_AGGRO_BRIGHT');
INSERT INTO `script_texts` VALUES ('-1603015', 'Fertilizer.', null, null, null, null, null, null, null, null, '15485', '1', '0', '0', 'brightleaf SAY_SLAY_1_BRIGHT');
INSERT INTO `script_texts` VALUES ('-1603016', 'Your corpse will nourish the soil!', null, null, null, null, null, null, null, null, '15486', '1', '0', '0', 'brightleaf SAY_SLAY_2_BRIGHT');
INSERT INTO `script_texts` VALUES ('-1603017', 'Matron, one has fallen!', null, null, null, null, null, null, null, null, '15487', '1', '0', '0', 'brightleaf SAY_DEATH_BRIGHT');
INSERT INTO `script_texts` VALUES ('-1603018', 'Mortals have no place here!', null, null, null, null, null, null, null, null, '15493', '1', '0', '0', 'ironbranch SAY_AGGRO_IRON');
INSERT INTO `script_texts` VALUES ('-1603019', 'I return you whence you came!', null, null, null, null, null, null, null, null, '15494', '1', '0', '0', 'ironbranch SAY_SLAY_1_IRON');
INSERT INTO `script_texts` VALUES ('-1603020', 'BEGONE!', null, null, null, null, null, null, null, null, '15495', '1', '0', '0', 'ironbranch SAY_SLAY_2_IRON');
INSERT INTO `script_texts` VALUES ('-1603021', 'Freya! They come for you.', null, null, null, null, null, null, null, null, '15496', '1', '0', '0', 'ironbranch SAY_DEATH_IRON');
INSERT INTO `script_texts` VALUES ('-1603022', 'This place will serve as your graveyard.', null, null, null, null, null, null, null, null, '15500', '1', '0', '0', 'stonebark SAY_AGGRO_STONE');
INSERT INTO `script_texts` VALUES ('-1603023', '<Angry roar>', null, null, null, null, null, null, null, null, '15501', '1', '0', '0', 'stonebark SAY_SLAY_1_STONE');
INSERT INTO `script_texts` VALUES ('-1603024', 'Such a waste.', null, null, null, null, null, null, null, null, '15502', '1', '0', '0', 'stonebark SAY_SLAY_2_STONE');
INSERT INTO `script_texts` VALUES ('-1603025', 'Matron, flee! They are ruthless....', null, null, null, null, null, null, null, null, '15503', '1', '0', '0', 'stonebark SAY_DEATH_STONE');
INSERT INTO `script_texts` VALUES ('-1603026', 'Insolent whelps! Your blood will temper the weapons used to reclaim this world!', null, null, null, null, null, null, null, null, '15564', '1', '0', '0', 'ignis SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603027', 'Let the inferno consume you!', null, null, null, null, null, null, null, null, '15567', '1', '0', '0', 'ignis SAY_SCORCH_1');
INSERT INTO `script_texts` VALUES ('-1603028', 'BURN! Burn in the makers fire!', null, null, null, null, null, null, null, null, '15568', '1', '0', '0', 'ignis SAY_SCORCH_2');
INSERT INTO `script_texts` VALUES ('-1603029', 'I will burn away your impurities!', null, null, null, null, null, null, null, null, '15566', '1', '0', '0', 'ignis SAY_SLAGPOT');
INSERT INTO `script_texts` VALUES ('-1603030', 'Arise, soldiers of the Iron Crucible! The Makers\' will be done!', null, null, null, null, null, null, null, null, '15565', '1', '0', '0', 'ignis SAY_ADDS');
INSERT INTO `script_texts` VALUES ('-1603031', 'More scraps for the scrapheap!', null, null, null, null, null, null, null, null, '15569', '1', '0', '0', 'ignis SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603032', 'Your bones will serve as kindling!', null, null, null, null, null, null, null, null, '15570', '1', '0', '0', 'ignis SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603033', 'Let it be finished!', null, null, null, null, null, null, null, null, '15571', '1', '0', '0', 'ignis SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603034', 'I. Have. Failed.', null, null, null, null, null, null, null, null, '15572', '1', '0', '0', 'ignis SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603035', 'Ignis the Furnace Master begins to cast Flame Jets!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'ignis EMOTE_FLAME_JETS');
INSERT INTO `script_texts` VALUES ('-1603036', 'Welcome, champions! All of our attempts at grounding her have failed. We could use a hand in bring her down with these harpoon guns.', null, null, null, null, null, null, null, null, '15647', '0', '0', '0', 'razorscale SAY_INTRO_WELCOME');
INSERT INTO `script_texts` VALUES ('-1603037', 'Give us a moment to prepare to build the turrets.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'razorscale SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1603038', 'Be on the lookout! Mole machines will be surfacing soon with those nasty Iron dwarves aboard!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'razorscale SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1603039', 'Ready to move out, keep those dwarves off of our backs!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'razorscale SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1603040', 'Move! Quickly! She won\'t remain grounded for long.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'razorscale SAY_GROUNDED');
INSERT INTO `script_texts` VALUES ('-1603041', 'Razorscale takes a deep breath...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'razorscale EMOTE_BREATH');
INSERT INTO `script_texts` VALUES ('-1603042', 'Fires out! Let\'s rebuild those turrets!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'razorscale SAY_EXTINGUISH_FIRE');
INSERT INTO `script_texts` VALUES ('-1603043', 'Harpoon Turret is ready for use!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'razorscale EMOTE_HARPOON_READY');
INSERT INTO `script_texts` VALUES ('-1603044', 'Razorscale grounded permanently!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'razorscale EMOTE_GROUNDED');
INSERT INTO `script_texts` VALUES ('-1603045', 'New toys? For me? I promise I won\'t break them this time!', null, null, null, null, null, null, null, null, '15724', '1', '0', '0', 'xt-002 SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603046', 'I... I think I broke it.', null, null, null, null, null, null, null, null, '15728', '1', '0', '0', 'xt-002 SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603047', 'I guess it doesn\'t bend that way.', null, null, null, null, null, null, null, null, '15729', '1', '0', '0', 'xt-002 SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603048', 'I\'m tired of these toys. I don\'t want to play anymore!', null, null, null, null, null, null, null, null, '15730', '1', '0', '0', 'xt-002 SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603049', 'Time for a new game! My old toys will fight my new toys!', null, null, null, null, null, null, null, null, '15732', '1', '0', '0', 'xt-002 SAY_ADDS');
INSERT INTO `script_texts` VALUES ('-1603050', 'You are bad... Toys... Very... Baaaaad!', null, null, null, null, null, null, null, null, '15731', '1', '0', '0', 'xt-002 SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603051', 'So tired. I will rest for just a moment!', null, null, null, null, null, null, null, null, '15725', '1', '0', '0', 'xt-002 SAY_HEART_OPEN');
INSERT INTO `script_texts` VALUES ('-1603052', 'I\'m ready to play!', null, null, null, null, null, null, null, null, '15726', '1', '0', '0', 'xt-002 SAY_HEART_CLOSE');
INSERT INTO `script_texts` VALUES ('-1603053', 'NO! NO! NO! NO! NO!', null, null, null, null, null, null, null, null, '15727', '1', '0', '0', 'xt-002 SAY_TANCTRUM');
INSERT INTO `script_texts` VALUES ('-1603054', 'XT-002 Deconstructor\'s heart is exposed and leaking energy!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'xt-002 EMOTE_EXPOSE_HEART');
INSERT INTO `script_texts` VALUES ('-1603055', 'XT-002 Deconstructor consumes a scrapbot to repair himself.', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'xt-002 EMOTE_REPAIR');
INSERT INTO `script_texts` VALUES ('-1603056', 'Whether the world\'s greatest gnats or the world\'s greatest heroes, you\'re still only mortal.', null, null, null, null, null, null, null, null, '15684', '1', '0', '0', 'brundir SAY_BRUNDIR_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603057', 'Stand still and stare into the light!', null, null, null, null, null, null, null, null, '15687', '1', '0', '0', 'brundir SAY_BRUNDIR_WHIRL');
INSERT INTO `script_texts` VALUES ('-1603058', 'The power of the storm lives on...', null, null, null, null, null, null, null, null, '15689', '1', '0', '0', 'brundir SAY_BRUNDIR_DEATH_1');
INSERT INTO `script_texts` VALUES ('-1603059', 'You rush headlong into the maw of madness!', null, null, null, null, null, null, null, null, '15690', '1', '0', '0', 'brundir SAY_BRUNDIR_DEATH_2');
INSERT INTO `script_texts` VALUES ('-1603060', 'A merciful kill!', null, null, null, null, null, null, null, null, '15685', '1', '0', '0', 'brundir SAY_BRUNDIR_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603061', 'HAH!', null, null, null, null, null, null, null, null, '15686', '1', '0', '0', 'brundir SAY_BRUNDIR_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603062', 'This meeting of the Assembly of Iron is adjourned!', null, null, null, null, null, null, null, null, '15691', '1', '0', '0', 'brundir SAY_BRUNDIR_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603063', 'Let the storm clouds rise and rain down death from above!', null, null, null, null, null, null, null, null, '15688', '1', '0', '0', 'brundir SAY_BRUNDIR_FLY');
INSERT INTO `script_texts` VALUES ('-1603064', 'Nothing short of total decimation will suffice!', null, null, null, null, null, null, null, null, '15657', '1', '0', '0', 'molgeim SAY_MOLGEIM_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603065', 'The legacy of storms shall not be undone...', null, null, null, null, null, null, null, null, '15662', '1', '0', '0', 'molgeim SAY_MOLGEIM_DEATH_1');
INSERT INTO `script_texts` VALUES ('-1603066', 'What have you gained from my defeat? You are no less doomed, mortals...', null, null, null, null, null, null, null, null, '15663', '1', '0', '0', 'molgeim SAY_MOLGEIM_DEATH_2');
INSERT INTO `script_texts` VALUES ('-1603067', 'Decipher this!', null, null, null, null, null, null, null, null, '15660', '1', '0', '0', 'molgeim SAY_MOLGEIM_DEATH_RUNE');
INSERT INTO `script_texts` VALUES ('-1603068', 'Face the lightning surge!', null, null, null, null, null, null, null, null, '15661', '1', '0', '0', 'molgeim SAY_MOLGEIM_SURGE');
INSERT INTO `script_texts` VALUES ('-1603069', 'The world on suffers yet another insignificant loss!', null, null, null, null, null, null, null, null, '15658', '1', '0', '0', 'molgeim SAY_MOLGEIM_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603070', 'Death is the price of your arrogance.', null, null, null, null, null, null, null, null, '15659', '1', '0', '0', 'molgeim SAY_MOLGEIM_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603071', 'This meeting of the Assembly of Iron is adjourned!', null, null, null, null, null, null, null, null, '15664', '1', '0', '0', 'molgeim SAY_MOLGEIM_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603072', 'You will not defeat the Assembly of Iron so easily, invaders!', null, null, null, null, null, null, null, null, '15674', '1', '0', '0', 'steelbreaker SAY_STEEL_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603073', 'My death only serves to hasten your demise.', null, null, null, null, null, null, null, null, '15678', '1', '0', '0', 'steelbreaker SAY_STEEL_DEATH_1');
INSERT INTO `script_texts` VALUES ('-1603074', 'Impossible!', null, null, null, null, null, null, null, null, '15679', '1', '0', '0', 'steelbreaker SAY_STEEL_DEATH_2');
INSERT INTO `script_texts` VALUES ('-1603075', 'So fragile and weak!', null, null, null, null, null, null, null, null, '15675', '1', '0', '0', 'steelbreaker SAY_STEEL_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603076', 'Flesh... such a hindrance.', null, null, null, null, null, null, null, null, '15676', '1', '0', '0', 'steelbreaker SAY_STEEL_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603077', 'You seek the secrets of Ulduar? Then take them!', null, null, null, null, null, null, null, null, '15677', '1', '0', '0', 'steelbreaker SAY_STEEL_OVERWHELM');
INSERT INTO `script_texts` VALUES ('-1603078', 'This meeting of the Assembly of Iron is adjourned!', null, null, null, null, null, null, null, null, '15680', '1', '0', '0', 'steelbreaker SAY_STEEL_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603079', 'Some things are better left alone!', null, null, null, null, null, null, null, null, '15473', '1', '0', '0', 'auriaya SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603080', 'There is no escape!', null, null, null, null, null, null, null, null, '15475', '1', '0', '0', 'auriaya SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603081', 'The secret dies with you!', null, null, null, null, null, null, null, null, '15474', '1', '0', '0', 'auriaya SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603082', 'You waste my time!', null, null, null, null, null, null, null, null, '15477', '1', '0', '0', 'auriaya SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603083', 'Auriaya screams in agony.', null, null, null, null, null, null, null, null, '15476', '2', '0', '0', 'auriaya SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603084', 'Auriaya begins to cast Terrifying Screech.', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'auriaya EMOTE_SCREECH');
INSERT INTO `script_texts` VALUES ('-1603085', 'Auriaya begins to activate the Feral Defender!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'auriaya EMOTE_DEFENDER');
INSERT INTO `script_texts` VALUES ('-1603086', 'You will suffer for this trespass!', null, null, null, null, null, null, null, null, '15552', '1', '0', '0', 'hodir SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603087', 'Tragic. To come so far, only to fail.', null, null, null, null, null, null, null, null, '15553', '1', '0', '0', 'hodir SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603088', 'Welcome to the endless winter.', null, null, null, null, null, null, null, null, '15554', '1', '0', '0', 'hodir SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603089', 'Winds of the north consume you!', null, null, null, null, null, null, null, null, '15555', '1', '0', '0', 'hodir SAY_FLASH_FREEZE');
INSERT INTO `script_texts` VALUES ('-1603090', '<Furious Roar>', null, null, null, null, null, null, null, null, '15556', '2', '0', '0', 'hodir SAY_FROZEN_BLOWS');
INSERT INTO `script_texts` VALUES ('-1603091', 'I... I am released from his grasp... at last.', null, null, null, null, null, null, null, null, '15557', '1', '0', '0', 'hodir SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603092', 'Enough! This ends now!', null, null, null, null, null, null, null, null, '15558', '1', '0', '0', 'hodir SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603093', 'The veil of winter will protect you, champions!', null, null, null, null, null, null, null, null, '15559', '1', '0', '0', 'hodir SAY_HELP_YOGG');
INSERT INTO `script_texts` VALUES ('-1603094', 'Hodir begins to cast Flash Freeze!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'hodir EMOTE_FLASH_FREEZE');
INSERT INTO `script_texts` VALUES ('-1603095', 'Hodir gains Frozen Blows!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'hodir EMOTE_FROZEN_BLOWS');
INSERT INTO `script_texts` VALUES ('-1603096', 'Your destruction will herald a new age of suffering!', null, null, null, null, null, null, null, null, '15542', '1', '0', '0', 'vezax SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603097', 'You thought to stand before the legions of death... and survive?', null, null, null, null, null, null, null, null, '15543', '1', '0', '0', 'vezax SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603098', 'Defiance... a flaw of mortality.', null, null, null, null, null, null, null, null, '15589', '1', '0', '0', 'vezax SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603099', 'The black blood of Yogg-Saron courses through me! I. AM. UNSTOPPABLE!', null, null, null, null, null, null, null, null, '15545', '1', '0', '0', 'vezaz SAY_SURGE');
INSERT INTO `script_texts` VALUES ('-1603100', 'Oh, what horrors await....', null, null, null, null, null, null, null, null, '15546', '1', '0', '0', 'vezax SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603101', 'Your defeat was inevitable!', null, null, null, null, null, null, null, null, '15547', '1', '0', '0', 'vezax SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1603102', 'Behold, now! Terror, absolute!', null, null, null, null, null, null, null, null, '15548', '1', '0', '0', 'vezax SAY_HARD_MODE');
INSERT INTO `script_texts` VALUES ('-1603103', 'A cloud of saronite vapors coalesces nearby!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'vezax EMOTE_VAPOR');
INSERT INTO `script_texts` VALUES ('-1603104', 'General Vezax roars and surges with dark might!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'vezax EMOTE_SURGE');
INSERT INTO `script_texts` VALUES ('-1603105', 'The saronite vapors mass and swirl violently, merging into a monstrous form!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'vezax EMOTE_ANIMUS');
INSERT INTO `script_texts` VALUES ('-1603106', 'Trans-location complete. Commencing planetary analysis of Azeroth.', null, null, null, null, null, null, null, null, '15405', '1', '0', '0', 'algalon SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1603107', 'Stand back, mortals. I am not here to fight you.', null, null, null, null, null, null, null, null, '15406', '1', '0', '0', 'algalon SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1603108', 'It is in the universe\'s best interest to re-originate this planet should my analysis find systemic corruption. Do not interfere.', null, null, null, null, null, null, null, null, '15407', '1', '0', '0', 'algalon SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1603109', 'See your world through my eyes. A universe so vast as to be immeasurable. Incomprehensible even to your greatest minds.', null, null, null, null, null, null, null, null, '15390', '1', '0', '0', 'algalon SAY_ENGAGE');
INSERT INTO `script_texts` VALUES ('-1603110', 'Your actions are illogical. All possible results for this encounter have been calculated. The pantheon will receive the observer\'s message regardless outcome.', null, null, null, null, null, null, null, null, '15386', '1', '0', '0', 'algalon SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603111', 'Loss of life, unavoidable.', null, null, null, null, null, null, null, null, '15387', '1', '0', '0', 'algalon SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603112', 'I do what I must.', null, null, null, null, null, null, null, null, '15388', '1', '0', '0', 'algalon SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603113', 'The stars come to my aid.', null, null, null, null, null, null, null, null, '15392', '1', '0', '0', 'algalon SAY_SUMMON_STAR');
INSERT INTO `script_texts` VALUES ('-1603114', 'Witness the fury of cosmos!', null, null, null, null, null, null, null, null, '15396', '1', '0', '0', 'algalon SAY_BIG_BANG_1');
INSERT INTO `script_texts` VALUES ('-1603115', 'Behold the tools of creation!', null, null, null, null, null, null, null, null, '15397', '1', '0', '0', 'algalon SAY_BIG_BANG_2');
INSERT INTO `script_texts` VALUES ('-1603116', 'Beware!', null, null, null, null, null, null, null, null, '15391', '1', '0', '0', 'algalon SAY_PHASE_2');
INSERT INTO `script_texts` VALUES ('-1603117', 'You are... out of time.', null, null, null, null, null, null, null, null, '15394', '1', '0', '0', 'algalon SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603118', 'Analysis complete. There is partial corruption in the plane\'s life-support systems as well as complete corruption in most of the planet\'s defense mechanisms.', null, null, null, null, null, null, null, null, '15398', '1', '0', '0', 'algalon SAY_DESPAWN_1');
INSERT INTO `script_texts` VALUES ('-1603119', 'Begin uplink: Reply Code: \'Omega\'. Planetary re-origination requested.', null, null, null, null, null, null, null, null, '15399', '1', '0', '0', 'algalon SAY_DESPAWN_2');
INSERT INTO `script_texts` VALUES ('-1603120', 'Farewell, mortals. Your bravery is admirable, for such flawed creatures.', null, null, null, null, null, null, null, null, '15400', '1', '0', '0', 'algalon SAY_DESPAWN_3');
INSERT INTO `script_texts` VALUES ('-1603121', 'I have seen worlds bathed in the Makers\' flames. Their denizens fading without so much as a whimper. Entire planetary systems born and raised in the time that it takes your mortal hearts to beat once. Yet all throughout, my own heart, devoid of emotion... of empathy. I... have... felt... NOTHING! A million, million lives wasted. Had they all held within them your tenacity? Had they all loved life as you do?', null, null, null, null, null, null, null, null, '15393', '1', '0', '0', 'algalon SAY_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1603122', 'Perhaps it is your imperfection that which grants you free will. That allows you to persevere against cosmically calculated odds. You prevailed where the Titans\' own perfect creations have failed.', null, null, null, null, null, null, null, null, '15401', '1', '0', '0', 'algalon SAY_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1603123', 'I\'ve rearranged the reply code. Your planet will be spared. I cannot be certain of my own calculations anymore.', null, null, null, null, null, null, null, null, '15402', '1', '0', '0', 'algalon SAY_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1603124', 'I lack the strength to transmit this signal. You must hurry. Find a place of power, close to the skies.', null, null, null, null, null, null, null, null, '15403', '1', '0', '0', 'algalon SAY_OUTRO_4');
INSERT INTO `script_texts` VALUES ('-1603125', 'Do not worry about my fate $n. If the signal is not transmitted in time re-origination will proceed regardless. Save. Your. World.', null, null, null, null, null, null, null, null, '15404', '1', '0', '0', 'algalon SAY_OUTRO_5');
INSERT INTO `script_texts` VALUES ('-1603126', 'None shall pass!', null, null, null, null, null, null, null, null, '15586', '1', '0', '0', 'kologarn SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603127', 'OBLIVION!', null, null, null, null, null, null, null, null, '15591', '1', '0', '0', 'kologarn SAY_SHOCKWAVE');
INSERT INTO `script_texts` VALUES ('-1603128', 'I will squeeze the life from you!', null, null, null, null, null, null, null, null, '15592', '1', '0', '0', 'kologarn SAY_GRAB');
INSERT INTO `script_texts` VALUES ('-1603129', 'Just a scratch!', null, null, null, null, null, null, null, null, '15589', '1', '0', '0', 'kologarn SAY_ARM_LOST_LEFT');
INSERT INTO `script_texts` VALUES ('-1603130', 'Only a flesh wound!', null, null, null, null, null, null, null, null, '15590', '1', '0', '0', 'kologarn SAY_ARM_LOST_RIGHT');
INSERT INTO `script_texts` VALUES ('-1603131', 'KOL-THARISH!', null, null, null, null, null, null, null, null, '15587', '1', '0', '0', 'kologarn SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603132', 'YOU FAIL!', null, null, null, null, null, null, null, null, '15588', '1', '0', '0', 'kologarn SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603133', 'I am invincible!', null, null, null, null, null, null, null, null, '15594', '1', '0', '0', 'kologarn SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603134', 'Master, they come...', null, null, null, null, null, null, null, null, '15593', '1', '0', '0', 'kologarn SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603135', 'The Right Arm has regrown!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'kologarn EMOTE_ARM_RIGHT');
INSERT INTO `script_texts` VALUES ('-1603136', 'The Left Arm has regrown!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'kologarn EMOTE_ARM_LEFT');
INSERT INTO `script_texts` VALUES ('-1603137', 'Kologarn casts Stone Grip!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'kologarn EMOTE_STONE_GRIP');
INSERT INTO `script_texts` VALUES ('-1603138', 'Interlopers! You mortals who dare to interfere with my sport will pay... Wait--you...', null, null, null, null, null, null, null, null, '15733', '1', '0', '0', 'thorim SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1603139', 'I remember you... In the mountains... But you... what is this? Where am--', null, null, null, null, null, null, null, null, '15734', '1', '0', '0', 'thorim SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1603140', 'Behold the power of the storms and despair!', null, null, null, null, null, null, null, null, '15735', '1', '0', '0', 'thorim SAY_SPECIAL_1');
INSERT INTO `script_texts` VALUES ('-1603141', 'Do not hold back! Destroy them!', null, null, null, null, null, null, null, null, '15736', '1', '0', '0', 'thorim SAY_SPECIAL_2');
INSERT INTO `script_texts` VALUES ('-1603142', 'Have you begun to regret your intrusion?', null, null, null, null, null, null, null, null, '15737', '1', '0', '0', 'thorim SAY_SPECIAL_3');
INSERT INTO `script_texts` VALUES ('-1603143', 'Impertinent whelps! You dare challenge me atop my pedestal! I will crush you myself!', null, null, null, null, null, null, null, null, '15738', '1', '0', '0', 'thorim SAY_JUMP');
INSERT INTO `script_texts` VALUES ('-1603144', 'Can\'t you at least put up a fight!?', null, null, null, null, null, null, null, null, '15739', '1', '0', '0', 'thorim SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603145', 'Pathetic!', null, null, null, null, null, null, null, null, '15740', '1', '0', '0', 'thorim SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603146', 'My patience has reached its limit!', null, null, null, null, null, null, null, null, '15741', '1', '0', '0', 'thorim SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603147', 'Failures! Weaklings!', null, null, null, null, null, null, null, null, '15742', '1', '0', '0', 'thorim SAY_ARENA_WIPE');
INSERT INTO `script_texts` VALUES ('-1603148', 'Stay your arms! I yield!', null, null, null, null, null, null, null, null, '15743', '1', '0', '0', 'thorim SAY_DEFEATED');
INSERT INTO `script_texts` VALUES ('-1603149', 'I feel as though I am awakening from a nightmare, but the shadows in this place yet linger.', null, null, null, null, null, null, null, null, '15744', '1', '0', '0', 'thorim SAY_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1603150', 'Sif... was Sif here? Impossible--she died by my brother\'s hand. A dark nightmare indeed....', null, null, null, null, null, null, null, null, '15745', '1', '0', '0', 'thorim SAY_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1603151', 'I need time to reflect.... I will aid your cause if you should require it. I owe you at least that much. Farewell.', null, null, null, null, null, null, null, null, '15746', '1', '0', '0', 'thorim SAY_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1603152', 'You! Fiend! You are not my beloved! Be gone!', null, null, null, null, null, null, null, null, '15747', '1', '0', '0', 'thorim SAY_OUTRO_HARD_1');
INSERT INTO `script_texts` VALUES ('-1603153', 'Behold the hand behind all the evil that has befallen Ulduar! Left my kingdom in ruins, corrupted my brother and slain my wife!', null, null, null, null, null, null, null, null, '15748', '1', '0', '0', 'thorim SAY_OUTRO_HARD_2');
INSERT INTO `script_texts` VALUES ('-1603154', 'And now it falls to you, champions, to avenge us all! The task before you is great, but I will lend you my aid as I am able. You must prevail!', null, null, null, null, null, null, null, null, '15749', '1', '0', '0', 'thorim SAY_OUTRO_HARD_3');
INSERT INTO `script_texts` VALUES ('-1603155', 'Golganneth, lend me your strengh! Grant my mortal allies the power of thunder!', null, null, null, null, null, null, null, null, '15750', '1', '0', '0', 'thorim SAY_HELP_YOGG');
INSERT INTO `script_texts` VALUES ('-1603156', 'Thorim, my lord, why else would these invaders have come into your sanctum but to slay you? They must be stopped!', null, null, null, null, null, null, null, null, '15668', '1', '0', '0', 'thorim SAY_SIF_BEGIN');
INSERT INTO `script_texts` VALUES ('-1603157', 'Impossible! Lord Thorim, I will bring your foes a frigid death!', null, null, null, null, null, null, null, null, '15670', '1', '0', '0', 'thorim SAY_SIF_EVENT');
INSERT INTO `script_texts` VALUES ('-1603158', 'These pathetic mortals are harmless, beneath my station. Dispose of them!', null, null, null, null, null, null, null, null, '15669', '1', '0', '0', 'thorim SAY_SIF_DESPAWN');
INSERT INTO `script_texts` VALUES ('-1603159', 'Hostile entities detected. Threat assessment protocol active. Primary target engaged. Time minus thirty seconds to re-evaluation.', null, null, null, null, null, null, null, null, '15506', '1', '0', '0', 'leviathan SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603160', 'Threat assessment routine modified. Current target threat level: zero. Acquiring new target.', null, null, null, null, null, null, null, null, '15521', '1', '0', '0', 'leviathan SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1603161', 'Total systems failure. Defense protocols breached. Leviathan Unit shutting down.', null, null, null, null, null, null, null, null, '15520', '1', '0', '0', 'leviathan SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603162', 'Threat re-evaluated. Target assessment complete. Changing course.', null, null, null, null, null, null, null, null, '15507', '1', '0', '0', 'leviathan SAY_CHANGE_1');
INSERT INTO `script_texts` VALUES ('-1603163', 'Pursuit objective modified. Changing course.', null, null, null, null, null, null, null, null, '15589', '1', '0', '0', 'leviathan SAY_CHANGE_2');
INSERT INTO `script_texts` VALUES ('-1603164', 'Hostile entity stratagem predicted. Rerouting battle function. Changing course.', null, null, null, null, null, null, null, null, '15509', '1', '0', '0', 'leviathan SAY_CHANGE_3');
INSERT INTO `script_texts` VALUES ('-1603165', 'Unauthorized entity attempting circuit overload. Activating anti-personnel countermeasures.', null, null, null, null, null, null, null, null, '15516', '1', '0', '0', 'leviathan SAY_PLAYER_RIDE');
INSERT INTO `script_texts` VALUES ('-1603166', 'System malfunction. Diverting power to support systems.', null, null, null, null, null, null, null, null, '15517', '1', '0', '0', 'leviathan SAY_OVERLOAD_1');
INSERT INTO `script_texts` VALUES ('-1603167', 'Combat matrix overload. Powering do-o-o-own...', null, null, null, null, null, null, null, null, '15518', '1', '0', '0', 'leviathan SAY_OVERLOAD_2');
INSERT INTO `script_texts` VALUES ('-1603168', 'System restart required. Deactivating weapon systems.', null, null, null, null, null, null, null, null, '15519', '1', '0', '0', 'leviathan SAY_OVERLOAD_3');
INSERT INTO `script_texts` VALUES ('-1603169', 'Orbital countermeasures enabled.', null, null, null, null, null, null, null, null, '15510', '1', '0', '0', 'leviathan SAY_HARD_MODE');
INSERT INTO `script_texts` VALUES ('-1603170', '\'Hodir\'s Fury\' online. Acquiring target.', null, null, null, null, null, null, null, null, '15512', '1', '0', '0', 'leviathan SAY_TOWER_FROST');
INSERT INTO `script_texts` VALUES ('-1603171', '\'Mimiron\'s Inferno\' online. Acquiring target.', null, null, null, null, null, null, null, null, '15513', '1', '0', '0', 'leviathan SAY_TOWER_FIRE');
INSERT INTO `script_texts` VALUES ('-1603172', '\'Thorim\'s Hammer\' online. Acquiring target.', null, null, null, null, null, null, null, null, '15515', '1', '0', '0', 'leviathan SAY_TOWER_ENERGY');
INSERT INTO `script_texts` VALUES ('-1603173', '\'Freya\'s Ward\' online. Acquiring target.', null, null, null, null, null, null, null, null, '15514', '1', '0', '0', 'leviathan SAY_TOWER_NATURE');
INSERT INTO `script_texts` VALUES ('-1603174', 'Alert! Static defense system failure. Orbital countermeasures disabled.', null, null, null, null, null, null, null, null, '15511', '1', '0', '0', 'leviathan SAY_TOWER_DOWN');
INSERT INTO `script_texts` VALUES ('-1603175', '%s pursues $N', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'leviathan EMOTE_PURSUE');
INSERT INTO `script_texts` VALUES ('-1603176', 'Oh, my! I wasn\'t expecting company! The workshop is such a mess! How embarrassing!', null, null, null, null, null, null, null, null, '15611', '1', '0', '0', 'mimiron SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603177', 'Now why would you go and do something like that? Didn\'t you see the sign that said \'DO NOT PUSH THIS BUTTON!\'? How will we finish testing with the self-destruct mechanism active?', null, null, null, null, null, null, null, null, '15629', '1', '0', '0', 'mimiron SAY_HARD_MODE');
INSERT INTO `script_texts` VALUES ('-1603178', 'Oh, my! It would seem that we are out of time, my friends!', null, null, null, null, null, null, null, null, '15628', '1', '0', '0', 'mimiron SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1603179', 'We haven\'t much time, friends! You\'re going to help me test out my latest and greatest creation. Now, before you change your minds, remember, that you kind of owe it to me after the mess you made with the XT-002.', null, null, null, null, null, null, null, null, '15612', '1', '0', '0', 'mimiron SAY_TANK_ACTIVE');
INSERT INTO `script_texts` VALUES ('-1603180', 'MEDIC!', null, null, null, null, null, null, null, null, '15613', '1', '0', '0', 'mimiron SAY_TANK_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603181', 'I can fix that... or, maybe not! Sheesh, what a mess...', null, null, null, null, null, null, null, null, '15614', '1', '0', '0', 'mimiron SAY_TANK_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603182', 'WONDERFUL! Positively marvelous results! Hull integrity at 98.9 percent! Barely a dent! Moving right along.', null, null, null, null, null, null, null, null, '15615', '1', '0', '0', 'mimiron SAY_TANK_DEATH');
INSERT INTO `script_texts` VALUES ('-1603183', 'Behold the VX-001 Anti-personnel Assault Cannon! You might want to take cover.', null, null, null, null, null, null, null, null, '15616', '1', '0', '0', 'mimiron SAY_TORSO_ACTIVE');
INSERT INTO `script_texts` VALUES ('-1603184', 'Fascinating. I think they call that a \'clean kill\'.', null, null, null, null, null, null, null, null, '15617', '1', '0', '0', 'mimiron SAY_TORSO_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603185', 'Note to self: Cannon highly effective against flesh.', null, null, null, null, null, null, null, null, '15618', '1', '0', '0', 'mimiron SAY_TORSO_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603186', 'Thank you, friends! Your efforts have yielded some fantastic data! Now, where did I put-- oh, there it is!', null, null, null, null, null, null, null, null, '15619', '1', '0', '0', 'mimiron SAY_TORSO_DEATH');
INSERT INTO `script_texts` VALUES ('-1603187', 'Isn\'t it beautiful? I call it the magnificent aerial command unit!', null, null, null, null, null, null, null, null, '15620', '1', '0', '0', 'mimiron SAY_HEAD_ACTIVE');
INSERT INTO `script_texts` VALUES ('-1603188', 'Outplayed!', null, null, null, null, null, null, null, null, '15621', '1', '0', '0', 'mimiron SAY_HEAD_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603189', 'You can do better than that!', null, null, null, null, null, null, null, null, '15622', '1', '0', '0', 'mimiron SAY_HEAD_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603190', 'Preliminary testing phase complete. Now comes the true test!!', null, null, null, null, null, null, null, null, '15623', '1', '0', '0', 'mimiron SAY_HEAD_DEATH');
INSERT INTO `script_texts` VALUES ('-1603191', 'Gaze upon its magnificence! Bask in its glorious, um, glory! I present you... V-07-TR-0N!', null, null, null, null, null, null, null, null, '15624', '1', '0', '0', 'mimiron SAY_ROBOT_ACTIVE');
INSERT INTO `script_texts` VALUES ('-1603192', 'Prognosis: Negative!', null, null, null, null, null, null, null, null, '15625', '1', '0', '0', 'mimiron SAY_ROBOT_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603193', 'You\'re not going to get up from that one, friend.', null, null, null, null, null, null, null, null, '15626', '1', '0', '0', 'mimiron SAY_ROBOT_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603194', 'It would appear that I\'ve made a slight miscalculation. I allowed my mind to be corrupted by the fiend in the prison, overriding my primary directive. All systems seem to be functional now. Clear.', null, null, null, null, null, null, null, null, '15627', '1', '0', '0', 'mimiron SAY_ROBOT_DEATH');
INSERT INTO `script_texts` VALUES ('-1603195', 'Combat matrix enhanced. Behold wonderous rapidity!', null, null, null, null, null, null, null, null, '15630', '1', '0', '0', 'mimiron SAY_HELP_YOGG');
INSERT INTO `script_texts` VALUES ('-1603196', 'Leviathan Mk II begins to cast Plasma Blast!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'mimiron EMOTE_PLASMA_BLAST');
INSERT INTO `script_texts` VALUES ('-1603197', 'Aaaaaaaaaaaaaaaaa... Help me!!! Please got to help me!', null, null, null, null, null, null, null, null, '15771', '1', '0', '0', 'yogg SAY_SARA_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1603198', 'What do you want from me? Leave me alone!', null, null, null, null, null, null, null, null, '15772', '1', '0', '0', 'yogg SAY_SARA_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1603199', 'The time to strike at the head of the beast will soon be upon us! Focus your anger and hatred on his minions!', null, null, null, null, null, null, null, null, '15775', '1', '0', '0', 'yogg SAY_SARA_AGGRO');
INSERT INTO `script_texts` VALUES ('-1603201', 'Yes! YES! Show them no mercy! Give no pause to your attacks!', null, null, null, null, null, null, null, null, '15773', '1', '0', '0', 'yogg SAY_SARA_HELP_1');
INSERT INTO `script_texts` VALUES ('-1603202', 'Let hatred and rage guide your blows!', null, null, null, null, null, null, null, null, '15774', '1', '0', '0', 'yogg SAY_SARA_HELP_2');
INSERT INTO `script_texts` VALUES ('-1603203', 'Could they have been saved?', null, null, null, null, null, null, null, null, '15779', '1', '0', '0', 'yogg SAY_SARA_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603204', 'Powerless to act...', null, null, null, null, null, null, null, null, '15778', '1', '0', '0', 'yogg SAY_SARA_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603205', 'Weak-minded fools!', null, null, null, null, null, null, null, null, '15780', '4', '0', '0', 'yogg SAY_WIPE_PHASE_1');
INSERT INTO `script_texts` VALUES ('-1603206', 'I am the lucid dream. The monster in your nightmares. The fiend of a thousand faces. Cower before my true form. BOW DOWN BEFORE THE GOD OF DEATH!', null, null, null, null, null, null, null, null, '15754', '1', '0', '0', 'yogg SAY_PHASE_2_INTRO');
INSERT INTO `script_texts` VALUES ('-1603207', 'Tremble, mortals, before the coming of the end!', null, null, null, null, null, null, null, null, '15777', '1', '0', '0', 'yogg SAY_SARA_PHASE_2_INTRO_A');
INSERT INTO `script_texts` VALUES ('-1603208', 'Suffocate upon your own hate!', null, null, null, null, null, null, null, null, '15776', '1', '0', '0', 'yogg SAY_SARA_PHASE_2_INTRO_B');
INSERT INTO `script_texts` VALUES ('-1603209', 'MADNESS WILL CONSUME YOU!', null, null, null, null, null, null, null, null, '15756', '1', '0', '0', 'yogg SAY_MADNESS');
INSERT INTO `script_texts` VALUES ('-1603210', 'Look upon the true face of death and know that your end comes soon!', null, null, null, null, null, null, null, null, '15755', '1', '0', '0', 'yogg SAY_PHASE_3');
INSERT INTO `script_texts` VALUES ('-1603211', 'Hoohehehahahaha... AHAHAHAHAHAHA!', null, null, null, null, null, null, null, null, '15757', '1', '0', '0', 'yogg SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1603212', 'Eternal suffering awaits!', null, null, null, null, null, null, null, null, '15758', '1', '0', '0', 'yogg SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1603213', 'Your fate is sealed. The end of days is finally upon you and ALL who inhabit this miserable little seedling. Uulwi ifis halahs gag erh\'ongg w\'ssh.', null, null, null, null, null, null, null, null, '15761', '1', '0', '0', 'yogg SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1603214', 'Your will is no longer you own...', null, null, null, null, null, null, null, null, '15759', '4', '0', '0', 'yogg SAY_TO_INSANE_1');
INSERT INTO `script_texts` VALUES ('-1603215', 'Destroy them minion, your master commands it!', null, null, null, null, null, null, null, null, '15760', '4', '0', '0', 'yogg SAY_TO_INSANE_2');
INSERT INTO `script_texts` VALUES ('-1603216', 'Your resilience is admirable.', null, null, null, null, null, null, null, null, '15598', '0', '0', '0', 'yogg SAY_LICH_KING_1');
INSERT INTO `script_texts` VALUES ('-1603217', 'Arrrrrrgh!', null, null, null, null, null, null, null, null, '15470', '1', '0', '0', 'yogg SAY_CHAMPION_1');
INSERT INTO `script_texts` VALUES ('-1603218', 'I\'m not afraid of you!', null, null, null, null, null, null, null, null, '15471', '0', '0', '0', 'yogg SAY_CHAMPION_2');
INSERT INTO `script_texts` VALUES ('-1603219', 'I will break you as I broke him.', null, null, null, null, null, null, null, null, '15599', '0', '0', '0', 'yogg SAY_LICH_KING_2');
INSERT INTO `script_texts` VALUES ('-1603220', 'Yrr n\'lyeth... shuul anagg!', null, null, null, null, null, null, null, null, '15766', '0', '0', '0', 'yogg SAY_YOGG_V3_1');
INSERT INTO `script_texts` VALUES ('-1603221', 'He will learn... no king rules forever; only death is eternal!', null, null, null, null, null, null, null, null, '15767', '0', '0', '0', 'yogg SAY_YOGG_V3_2');
INSERT INTO `script_texts` VALUES ('-1603222', 'It is done... All have been given that which must be given. I now seal the Dragon Soul forever...', null, null, null, null, null, null, null, null, '15631', '0', '0', '0', 'yogg SAY_NELTHARION_1');
INSERT INTO `script_texts` VALUES ('-1603223', 'That terrible glow... should that be?', null, null, null, null, null, null, null, null, '15784', '0', '0', '0', 'yogg SAY_YSERA');
INSERT INTO `script_texts` VALUES ('-1603224', 'For it to be as it must, yes.', null, null, null, null, null, null, null, null, '15632', '0', '0', '0', 'yogg SAY_NELTHARION_2');
INSERT INTO `script_texts` VALUES ('-1603225', 'It is a weapon like no other. It must be like no other.', null, null, null, null, null, null, null, null, '15610', '0', '0', '0', 'yogg SAY_MALYGOS');
INSERT INTO `script_texts` VALUES ('-1603226', 'His brood learned their lesson before too long, you shall soon learn yours!', null, null, null, null, null, null, null, null, '15765', '0', '0', '0', 'yogg SAY_YOGG_V2');
INSERT INTO `script_texts` VALUES ('-1603227', 'Bad news sire. The clans are united under Blackhand in this assault. They will stand together until Stormwind has fallen.', null, null, null, null, null, null, null, null, '15538', '0', '0', '0', 'yogg SAY_GARONA_1');
INSERT INTO `script_texts` VALUES ('-1603228', 'Gul\'dan is bringing up his warlocks by nightfall. Until then, the Blackrock clan will be trying to take the Eastern Wall.', null, null, null, null, null, null, null, null, '15539', '0', '0', '0', 'yogg SAY_GARONA_2');
INSERT INTO `script_texts` VALUES ('-1603229', 'A thousand deaths... ', null, null, null, null, null, null, null, null, '15762', '0', '0', '0', 'yogg SAY_YOGG_V1_1');
INSERT INTO `script_texts` VALUES ('-1603230', 'or one murder.', null, null, null, null, null, null, null, null, '15763', '0', '0', '0', 'yogg SAY_YOGG_V1_2');
INSERT INTO `script_texts` VALUES ('-1603231', 'We will hold until the reinforcements come. As long as men with stout hearts are manning the walls and throne Stormwind will hold.', null, null, null, null, null, null, null, null, '15540', '0', '0', '0', 'yogg SAY_GARONA_3');
INSERT INTO `script_texts` VALUES ('-1603232', 'The orc leaders agree with your assessment.', null, null, null, null, null, null, null, null, '15541', '0', '0', '0', 'yogg SAY_GARONA_4');
INSERT INTO `script_texts` VALUES ('-1603233', 'Your petty quarrels only make me stronger!', null, null, null, null, null, null, null, null, '15764', '0', '0', '0', 'yogg SAY_YOGG_V1_3');
INSERT INTO `script_texts` VALUES ('-1603234', 'Portals open into Yogg-Saron\'s mind!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'yogg EMOTE_VISION_BLAST');
INSERT INTO `script_texts` VALUES ('-1603235', 'The illusion shatters and a path to the central chamber opens!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'yogg EMOTE_SHATTER_BLAST');
INSERT INTO `script_texts` VALUES ('-1604000', 'Drakkari gonna kill anybody who trespass on these lands!', null, null, null, null, null, null, null, null, '14443', '1', '0', '0', 'sladran SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1604001', 'Minions of the scale, heed my call!', null, null, null, null, null, null, null, null, '14444', '1', '0', '0', 'sladran SAY_SUMMON_SNAKE');
INSERT INTO `script_texts` VALUES ('-1604002', 'Our thousand fangs gonna rend your flesh! ', null, null, null, null, null, null, null, null, '14445', '1', '0', '0', 'sladran SAY_SUMMON_CONSTRICTOR');
INSERT INTO `script_texts` VALUES ('-1604003', 'Ye not breathin\'! Good.', null, null, null, null, null, null, null, null, '14446', '1', '0', '0', 'sladran SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1604004', 'You scared now?', null, null, null, null, null, null, null, null, '14447', '1', '0', '0', 'sladran SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1604005', 'I\'ll eat you next, mon!', null, null, null, null, null, null, null, null, '14448', '1', '0', '0', 'sladran SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1604006', 'I sssee now... Ssscourge wasss not... our greatessst enemy...', null, null, null, null, null, null, null, null, '14449', '1', '0', '0', 'sladran SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1604007', '%s begins to cast Poison Nova!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'sladran EMOTE_NOVA');
INSERT INTO `script_texts` VALUES ('-1604008', '%s surges forward!', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'colossus EMOTE_SURGE');
INSERT INTO `script_texts` VALUES ('-1604009', '%s seep into the ground.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'colossus EMOTE_SEEP');
INSERT INTO `script_texts` VALUES ('-1604010', '%s begins to glow faintly.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'colossus EMOTE_GLOW');
INSERT INTO `script_texts` VALUES ('-1604011', 'We fought back da Scourge. What chance joo be thinkin\' JOO got?', null, null, null, null, null, null, null, null, '14721', '1', '0', '0', 'moorabi SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1604012', 'Da ground gonna swallow you up! ', null, null, null, null, null, null, null, null, '14723', '1', '0', '0', 'moorabi SAY_QUAKE');
INSERT INTO `script_texts` VALUES ('-1604013', 'Get ready for somethin\'... much... BIGGAH!', null, null, null, null, null, null, null, null, '14722', '1', '0', '0', 'moorabi SAY_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1604014', 'I crush you, cockroaches!', null, null, null, null, null, null, null, null, '14725', '1', '0', '0', 'moorabi SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1604015', 'Who gonna stop me; you?', null, null, null, null, null, null, null, null, '14726', '1', '0', '0', 'moorabi SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1604016', 'Not so tough now.', null, null, null, null, null, null, null, null, '14727', '1', '0', '0', 'moorabi SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1604017', 'If our gods can die... den so can we...', null, null, null, null, null, null, null, null, '14728', '1', '0', '0', 'moorabi SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1604018', '%s begins to transform!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'moorabi EMOTE_TRANSFORM');
INSERT INTO `script_texts` VALUES ('-1604019', 'I\'m gonna spill your guts, mon!', null, null, null, null, null, null, null, null, '14430', '1', '0', '0', 'galdarah SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1604020', 'Ain\'t gonna be nottin\' left after this!', null, null, null, null, null, null, null, null, '14431', '1', '0', '0', 'galdarah SAY_TRANSFORM_1');
INSERT INTO `script_texts` VALUES ('-1604021', 'You wanna see power? I\'m gonna show you power!', null, null, null, null, null, null, null, null, '14432', '1', '0', '0', 'galdarah SAY_TRANSFORM_2');
INSERT INTO `script_texts` VALUES ('-1604022', 'Gut them! Impale them!', null, null, null, null, null, null, null, null, '14433', '1', '0', '0', 'galdarah SAY_SUMMON_1');
INSERT INTO `script_texts` VALUES ('-1604023', 'Kill them all!', null, null, null, null, null, null, null, null, '14434', '1', '0', '0', 'galdarah SAY_SUMMON_2');
INSERT INTO `script_texts` VALUES ('-1604024', 'Say hello to my BIG friend!', null, null, null, null, null, null, null, null, '14435', '1', '0', '0', 'galdarah SAY_SUMMON_3');
INSERT INTO `script_texts` VALUES ('-1604025', 'What a rush!', null, null, null, null, null, null, null, null, '14436', '1', '0', '0', 'galdarah SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1604026', 'Who needs gods, when WE ARE GODS!', null, null, null, null, null, null, null, null, '14437', '1', '0', '0', 'galdarah SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1604027', 'I told ya so!', null, null, null, null, null, null, null, null, '14438', '1', '0', '0', 'galdarah SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1604028', 'Even the mighty... can fall.', null, null, null, null, null, null, null, null, '14439', '1', '0', '0', 'galdarah SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1604029', '%s transforms into a Mammoth!', null, null, null, null, null, null, null, null, '14724', '2', '0', '0', 'moorabi EMOTE_TRANSFORMED');
INSERT INTO `script_texts` VALUES ('-1604030', '$N is impaled!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'EMOTE_IMPALED');
INSERT INTO `script_texts` VALUES ('-1608000', 'Prison guards, we are leaving! These adventurers are taking over! Go, go, go!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sinclair SAY_BEGIN');
INSERT INTO `script_texts` VALUES ('-1608001', 'I\'m locking the door. Good luck, and thank you for doing this.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'sinclair SAY_LOCK_DOOR');
INSERT INTO `script_texts` VALUES ('-1608002', 'Adventurers, the door is beinning to weaken!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sinclair SAY_SEAL_75');
INSERT INTO `script_texts` VALUES ('-1608003', 'Only half of the door seal\'s strength remains! You must fight on!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sinclair SAY_SEAL_50');
INSERT INTO `script_texts` VALUES ('-1608004', 'The door seal is about to collapse! All is lost if the Blue Dragonflight breaks through the door!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'sinclair SAY_SEAL_5');
INSERT INTO `script_texts` VALUES ('-1608005', 'A Portal Guardian defends the new portal!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'EMOTE_GUARDIAN_PORTAL');
INSERT INTO `script_texts` VALUES ('-1608006', 'An elite Blue Dragonflight squad appears from the portal!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'EMOTE_DRAGONFLIGHT_PORTAL');
INSERT INTO `script_texts` VALUES ('-1608007', 'A Guardian Keeper emerges from the portal!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'EMOTE_KEEPER_PORTAL');
INSERT INTO `script_texts` VALUES ('-1608008', 'Free to--mm--fly now. Ra-aak... Not find us--ekh-ekh! Escape!', null, null, null, null, null, null, null, null, '14218', '1', '0', '0', 'erekem SAY_RELEASE_EREKEM');
INSERT INTO `script_texts` VALUES ('-1608009', 'I... am fury... unrestrained!', null, null, null, null, null, null, null, null, '14229', '1', '0', '0', 'ichoron SAY_RELEASE_ICHORON');
INSERT INTO `script_texts` VALUES ('-1608010', 'Back in business! Now to execute an exit strategy.', null, null, null, null, null, null, null, null, '14498', '1', '0', '0', 'xevozz SAY_RELEASE_XEVOZZ');
INSERT INTO `script_texts` VALUES ('-1608011', 'I am... renewed.', null, null, null, null, null, null, null, null, '13995', '1', '0', '0', 'zuramat SAY_RELEASE_ZURAMAT');
INSERT INTO `script_texts` VALUES ('-1608012', 'Not--caww--get in way of--rrak-rrak--flee!', null, null, null, null, null, null, null, null, '14219', '1', '0', '0', 'erekem SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1608013', 'My---raaak--favorite! Awk awk awk! Raa-kaa!', null, null, null, null, null, null, null, null, '14220', '1', '0', '0', 'erekem SAY_ADD_DIE_1');
INSERT INTO `script_texts` VALUES ('-1608014', 'Nasty little...A-ak,kaw! Kill! Yes,kill you!', null, null, null, null, null, null, null, null, '14221', '1', '0', '0', 'erekem SAY_ADD_DIE_2');
INSERT INTO `script_texts` VALUES ('-1608018', 'No--kaw,kaw--flee...', null, null, null, null, null, null, null, null, '14225', '1', '0', '0', 'erekem SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1608019', 'Stand aside, mortals!', null, null, null, null, null, null, null, null, '14230', '1', '0', '0', 'ichoron SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1608020', 'I will not be contained! Ngyah!!', null, null, null, null, null, null, null, null, '14233', '1', '0', '0', 'ichoron SAY_SHATTERING');
INSERT INTO `script_texts` VALUES ('-1608021', 'Water can hold any form, take any shape... overcome any obstacle.', null, null, null, null, null, null, null, null, '14232', '1', '0', '0', 'ichoron SAY_SHIELD');
INSERT INTO `script_texts` VALUES ('-1608022', 'I am a force of nature!', null, null, null, null, null, null, null, null, '14234', '1', '0', '0', 'ichoron SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1608023', 'I shall pass!', null, null, null, null, null, null, null, null, '14235', '1', '0', '0', 'ichoron SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1608024', 'You can not stop the tide!', null, null, null, null, null, null, null, null, '14236', '1', '0', '0', 'ichoron SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1608025', 'I shall consume,decimate, devastate,and destroy! Yield now to the wrath of the pounding sea!', null, null, null, null, null, null, null, null, '14231', '1', '0', '0', 'ichoron SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1608026', 'I... recede.', null, null, null, null, null, null, null, null, '14237', '1', '0', '0', 'ichoron SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1609000', 'You have made a grave error, fiend!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_1');
INSERT INTO `script_texts` VALUES ('-1609001', 'I was a soldier of the Light once... Look at what I have become... ', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_2');
INSERT INTO `script_texts` VALUES ('-1609002', 'You are hopelessly outmatched, $R.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_3');
INSERT INTO `script_texts` VALUES ('-1609003', 'They brand me unworthy? I will show them unmorthy!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_4');
INSERT INTO `script_texts` VALUES ('-1609004', 'You will allow me a weapon and armor, yes?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_5');
INSERT INTO `script_texts` VALUES ('-1609005', 'I will win my freedom and leave this cursed place!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_6');
INSERT INTO `script_texts` VALUES ('-1609006', 'I will dismantle this festering hellhole!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_7');
INSERT INTO `script_texts` VALUES ('-1609007', 'There can be only one survivor!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_START_8');
INSERT INTO `script_texts` VALUES ('-1609008', 'Let your fears consume you!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1609009', 'HAH! You can barely hold a blade! Yours will be a quick death.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1609010', 'And now you die', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES ('-1609011', 'To battle!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_4');
INSERT INTO `script_texts` VALUES ('-1609012', 'There is no hope for our future...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_5');
INSERT INTO `script_texts` VALUES ('-1609013', 'Sate your hunger on cold steel, $R', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_6');
INSERT INTO `script_texts` VALUES ('-1609014', 'It ends here!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_7');
INSERT INTO `script_texts` VALUES ('-1609015', 'Death is the only cure!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'unworthy SAY_AGGRO_8');
INSERT INTO `script_texts` VALUES ('-1609016', 'No potions!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_A');
INSERT INTO `script_texts` VALUES ('-1609017', 'Remember this day, $n, for it is the day that you will be thoroughly owned.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_B');
INSERT INTO `script_texts` VALUES ('-1609018', 'I\'m going to tear your heart out, cupcake!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_C');
INSERT INTO `script_texts` VALUES ('-1609019', 'Don\'t make me laugh.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_D');
INSERT INTO `script_texts` VALUES ('-1609020', 'Here come the tears...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_E');
INSERT INTO `script_texts` VALUES ('-1609021', 'You have challenged death itself!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_F');
INSERT INTO `script_texts` VALUES ('-1609022', 'The Lich King will see his true champion on this day!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_G');
INSERT INTO `script_texts` VALUES ('-1609023', 'You\'re going down!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_H');
INSERT INTO `script_texts` VALUES ('-1609024', 'You don\'t stand a chance, $n', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'dk_initiate SAY_DUEL_I');
INSERT INTO `script_texts` VALUES ('-1609025', 'Come to finish the job, have you?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_START_1');
INSERT INTO `script_texts` VALUES ('-1609026', 'Come to finish the job, have ye?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_START_2');
INSERT INTO `script_texts` VALUES ('-1609027', 'Come ta finish da job, mon?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_START_3');
INSERT INTO `script_texts` VALUES ('-1609028', 'You\'ll look me in the eyes when...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'special_surprise SAY_EXEC_PROG_1');
INSERT INTO `script_texts` VALUES ('-1609029', 'Well this son o\' Ironforge would like...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'special_surprise SAY_EXEC_PROG_2');
INSERT INTO `script_texts` VALUES ('-1609030', 'Ironic, isn\'t it? To be killed...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'special_surprise SAY_EXEC_PROG_3');
INSERT INTO `script_texts` VALUES ('-1609031', 'If you\'d allow me just one...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'special_surprise SAY_EXEC_PROG_4');
INSERT INTO `script_texts` VALUES ('-1609032', 'I\'d like to stand for...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'special_surprise SAY_EXEC_PROG_5');
INSERT INTO `script_texts` VALUES ('-1609033', 'I want to die like an orc...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'special_surprise SAY_EXEC_PROG_6');
INSERT INTO `script_texts` VALUES ('-1609034', 'Dis troll gonna stand for da...', null, null, null, null, null, null, null, null, '0', '0', '0', '25', 'special_surprise SAY_EXEC_PROG_7');
INSERT INTO `script_texts` VALUES ('-1609035', '$N?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NAME_1');
INSERT INTO `script_texts` VALUES ('-1609036', '$N? Mon?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NAME_2');
INSERT INTO `script_texts` VALUES ('-1609037', '$N, I\'d recognize that face anywhere... What... What have they done to you, $N?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_RECOG_1');
INSERT INTO `script_texts` VALUES ('-1609038', '$N, I\'d recognize those face tentacles anywhere... What... What have they done to you, $N?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_RECOG_2');
INSERT INTO `script_texts` VALUES ('-1609039', '$N, I\'d recognize that face anywhere... What... What have they done to ye, $Glad:lass;?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_RECOG_3');
INSERT INTO `script_texts` VALUES ('-1609040', '$N, I\'d recognize that decay anywhere... What... What have they done to you, $N?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_RECOG_4');
INSERT INTO `script_texts` VALUES ('-1609041', '$N, I\'d recognize those horns anywhere... What have they done to you, $N?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_RECOG_5');
INSERT INTO `script_texts` VALUES ('-1609042', '$N, I\'d recognize dem tusks anywhere... What... What have dey done ta you, mon?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_RECOG_6');
INSERT INTO `script_texts` VALUES ('-1609043', 'You don\'t remember me, do you? Blasted Scourge... They\'ve tried to drain you of everything that made you a righteous force of reckoning. Every last ounce of good... Everything that made you a draenei!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_1');
INSERT INTO `script_texts` VALUES ('-1609044', 'Ye don\'t remember me, do ye? Blasted Scourge... They\'ve tried to drain ye o\' everything that made ye a righteous force o\' reckoning. Every last ounce o\' good... Everything that made you a $Gson:daughter; of Ironforge!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_2');
INSERT INTO `script_texts` VALUES ('-1609045', 'You don\'t remember me, do you? We were humans once - long, long ago - until Lordaeron fell to the Scourge. Your transformation to a Scourge zombie came shortly after my own. Not long after that, our minds were freed by the Dark Lady.', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_3');
INSERT INTO `script_texts` VALUES ('-1609046', 'You don\'t remember me, do you? Blasted Scourge... They\'ve tried to drain you of everything that made you a pint-sized force of reckoning. Every last ounce of good... Everything that made you a gnome!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_4');
INSERT INTO `script_texts` VALUES ('-1609047', 'You don\'t remember me, do you? Blasted Scourge...They\'ve tried to drain of everything that made you a righteous force of reckoning. Every last ounce of good...Everything that made you a human!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_5');
INSERT INTO `script_texts` VALUES ('-1609048', 'You don\'t remember me? When you were a child your mother would leave you in my care while she served at the Temple of the Moon. I held you in my arms and fed you with honey and sheep\'s milk to calm you until she would return. You were my little angel. Blasted Scourge... What have they done to you, $N?', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_6');
INSERT INTO `script_texts` VALUES ('-1609049', 'You don\'t recognize me, do you? Blasted Scourge... They\'ve tried to drain you of everything that made you a righteous force of reckoning. Every last ounce of good... Everything that made you an orc!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_7');
INSERT INTO `script_texts` VALUES ('-1609050', 'You don\'t remember me, do you? Blasted Scourge... They\'ve tried to drain you of everything that made you a righteous force of reckoning. Every last ounce of good... Everything that made you a tauren!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_8');
INSERT INTO `script_texts` VALUES ('-1609051', 'You don\'t remember me, mon? Damn da Scourge! Dey gone ta drain you of everytin dat made ya a mojo masta. Every last ounce of good... Everytin\' dat made ya a troll hero, mon!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_NOREM_9');
INSERT INTO `script_texts` VALUES ('-1609052', 'A pact was made, $Gbrother:sister;! We vowed vengeance against the Lich King! For what he had done to us! We battled the Scourge as Forsaken, pushing them back into the plaguelands and freeing Tirisfal! You and I were champions of the Forsaken!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_THINK_1');
INSERT INTO `script_texts` VALUES ('-1609053', 'You must remember the splendor of life, $Gbrother:sister;. You were a champion of the Kaldorei once! This isn\'t you!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_THINK_2');
INSERT INTO `script_texts` VALUES ('-1609054', 'Think, $N. Think back. Try and remember the majestic halls of Silvermoon City, where you were born. Remember the splendor of life, $Gbrother:sister;. You were a champion of the sin\'dorei once! This isn\'t you.', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_3');
INSERT INTO `script_texts` VALUES ('-1609055', 'Think, $N. Think back. Try and remember the proud mountains of Argus, where you were born. Remember the splendor of life, $Gbrother:sister;. You were a champion of the draenei once! This isn\'t you.', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_4');
INSERT INTO `script_texts` VALUES ('-1609056', 'Think, $N. Think back. Try and remember the snow capped mountains o\' Dun Morogh! Ye were born there, $Glad:lass;. Remember the splendor o\' life, $N! Ye were a champion o\' the dwarves once! This isn\'t ye!', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_5');
INSERT INTO `script_texts` VALUES ('-1609057', 'Think, $N. Think back. Try and remember Gnomeregan before those damned troggs! Remember the feel of an [arclight spanner] $Gbrother:sister;. You were a champion of gnome-kind once! This isn\'t you.', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_6');
INSERT INTO `script_texts` VALUES ('-1609058', 'Think, $N. Think back. Try and remember the hills and valleys of Elwynn, where you were born. Remember the splendor of life, $Gbrother:sister;. You were a champion of the Alliance once! This isn\'t you.', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_7');
INSERT INTO `script_texts` VALUES ('-1609059', 'Think, $N. Think back. Try and remember Durotar, $Gbrother:sister;! Remember the sacrifices our heroes made so that we could be free of the blood curse. Harken back to the Valley of Trials, where we were reborn into a world without demonic influence. We found the splendor of life, $N. Together! This isn\'t you. You were a champion of the Horde once!', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_8');
INSERT INTO `script_texts` VALUES ('-1609060', 'Think, $N. Think back. Try and remember the rolling plains of Mulgore, where you were born. Remember the splendor of life, $Gbrother:sister;. You were a champion of the tauren once! This isn\'t you.', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_9');
INSERT INTO `script_texts` VALUES ('-1609061', 'TINK $N. Tink back, mon! We be Darkspear, mon! Bruddas and sistas! Remember when we fought the Zalazane and done took he head and freed da Echo Isles? MON! TINK! You was a champion of da Darkspear trolls!', null, null, null, null, null, null, null, null, '0', '0', '0', '6', 'special_surprise SAY_EXEC_THINK_10');
INSERT INTO `script_texts` VALUES ('-1609062', 'Listen to me, $N. You must fight against the Lich King\'s control. He is a monster that wants to see this world - our world - in ruin. Don\'t let him use you to accomplish his goals. You were once a hero and you can be again. Fight, damn you! Fight his control!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'special_surprise SAY_EXEC_LISTEN_1');
INSERT INTO `script_texts` VALUES ('-1609063', 'Listen to me, $N Ye must fight against the Lich King\'s control. He\'s a monster that wants to see this world - our world - in ruin. Don\'t let him use ye to accomplish his goals. Ye were once a hero and ye can be again. Fight, damn ye! Fight his control!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'special_surprise SAY_EXEC_LISTEN_2');
INSERT INTO `script_texts` VALUES ('-1609064', 'Listen to me, $N. You must fight against the Lich King\'s control. He is a monster that wants to see this world - our world - in ruin. Don\'t let him use you to accomplish his goals AGAIN. You were once a hero and you can be again. Fight, damn you! Fight his control!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'special_surprise SAY_EXEC_LISTEN_3');
INSERT INTO `script_texts` VALUES ('-1609065', 'Listen ta me, $Gbrudda:sista;. You must fight against da Lich King\'s control. He be a monstar dat want ta see dis world - our world - be ruined. Don\'t let he use you ta accomplish he goals. You be a hero once and you be a hero again! Fight it, mon! Fight he control!', null, null, null, null, null, null, null, null, '0', '0', '0', '5', 'special_surprise SAY_EXEC_LISTEN_4');
INSERT INTO `script_texts` VALUES ('-1609066', 'What\'s going on in there? What\'s taking so long, $N?', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'special_surprise SAY_PLAGUEFIST');
INSERT INTO `script_texts` VALUES ('-1609067', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Silvermoon. This world is worth saving!', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_1');
INSERT INTO `script_texts` VALUES ('-1609068', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Argus. Don\'t let that happen to this world.', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_2');
INSERT INTO `script_texts` VALUES ('-1609069', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both $N... For KHAAAAAAAAZZZ MODAAAAAANNNNNN!!!', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_3');
INSERT INTO `script_texts` VALUES ('-1609070', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Tirisfal! This world is worth saving!', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_4');
INSERT INTO `script_texts` VALUES ('-1609071', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Gnomeregan! This world is worth saving.', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_5');
INSERT INTO `script_texts` VALUES ('-1609072', 'There... There\'s no more time for me. I\'m done for. FInish me off, $N. Do it or they\'ll kill us both. $N...Remember Elwynn. This world is worth saving.', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_6');
INSERT INTO `script_texts` VALUES ('-1609073', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Teldrassil, our beloved home. This world is worth saving.', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_7');
INSERT INTO `script_texts` VALUES ('-1609074', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... For the Horde! This world is worth saving.', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_8');
INSERT INTO `script_texts` VALUES ('-1609075', 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Mulgore. This world is worth saving.', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_9');
INSERT INTO `script_texts` VALUES ('-1609076', 'Der... Der\'s no more time for me. I be done for. Finish me off $N. Do it or they\'ll kill us both. $N... Remember Sen\'jin Village, mon! Dis world be worth saving!', null, null, null, null, null, null, null, null, '0', '0', '0', '18', 'special_surprise SAY_EXEC_TIME_10');
INSERT INTO `script_texts` VALUES ('-1609077', 'Do it, $N! Put me out of my misery!', null, null, null, null, null, null, null, null, '0', '0', '0', '1', 'special_surprise SAY_EXEC_WAITING');
INSERT INTO `script_texts` VALUES ('-1609078', '%s dies from his wounds.', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'special_surprise EMOTE_DIES');
INSERT INTO `script_texts` VALUES ('-1609079', 'I\'ll need to get my runeblade and armor... Just need a little more time.', null, null, null, null, null, null, null, null, '0', '0', '0', '399', 'koltira SAY_BREAKOUT1');
INSERT INTO `script_texts` VALUES ('-1609080', 'I\'m still weak, but I think I can get an anti-magic barrier up. Stay inside it or you\'ll be destroyed by their spells.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'koltira SAY_BREAKOUT2');
INSERT INTO `script_texts` VALUES ('-1609081', 'Maintaining this barrier will require all of my concentration. Kill them all!', null, null, null, null, null, null, null, null, '0', '0', '0', '16', 'koltira SAY_BREAKOUT3');
INSERT INTO `script_texts` VALUES ('-1609082', 'There are more coming. Defend yourself! Don\'t fall out of the anti-magic field! They\'ll tear you apart without its protection!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'koltira SAY_BREAKOUT4');
INSERT INTO `script_texts` VALUES ('-1609083', 'I can\'t keep barrier up much longer... Where is that coward?', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'koltira SAY_BREAKOUT5');
INSERT INTO `script_texts` VALUES ('-1609084', 'The High Inquisitor comes! Be ready, death knight! Do not let him draw you out of the protective bounds of my anti-magic field! Kill him and take his head!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'koltira SAY_BREAKOUT6');
INSERT INTO `script_texts` VALUES ('-1609085', 'Stay in the anti-magic field! Make them come to you!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'koltira SAY_BREAKOUT7');
INSERT INTO `script_texts` VALUES ('-1609086', 'The death of the High Inquisitor of New Avalon will not go unnoticed. You need to get out of here at once! Go, before more of them show up. I\'ll be fine on my own.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'koltira SAY_BREAKOUT8');
INSERT INTO `script_texts` VALUES ('-1609087', 'I\'ll draw their fire, you make your escape behind me.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'koltira SAY_BREAKOUT9');
INSERT INTO `script_texts` VALUES ('-1609088', 'Your High Inquisitor is nothing more than a pile of meat, Crusaders! There are none beyond the grasp of the Scourge!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'koltira SAY_BREAKOUT10');
INSERT INTO `script_texts` VALUES ('-1615000', 'I fear nothing! Least of all you!', null, null, null, null, null, null, null, null, '14111', '1', '0', '0', 'shadron SAY_SHADRON_AGGRO');
INSERT INTO `script_texts` VALUES ('-1615001', 'You are insignificant!', null, null, null, null, null, null, null, null, '14112', '1', '0', '0', 'shadron SAY_SHADRON_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1615002', 'Such mediocre resistance!', null, null, null, null, null, null, null, null, '14113', '1', '0', '0', 'shadron SAY_SHADRON_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1615003', 'We...are superior! How could this...be...', null, null, null, null, null, null, null, null, '14118', '1', '0', '0', 'shadron SAY_SHADRON_DEATH');
INSERT INTO `script_texts` VALUES ('-1615004', 'You are easily bested! ', null, null, null, null, null, null, null, null, '14114', '1', '0', '0', 'shadron SAY_SHADRON_BREATH');
INSERT INTO `script_texts` VALUES ('-1615005', 'I will take pity on you Sartharion, just this once.', null, null, null, null, null, null, null, null, '14117', '1', '0', '0', 'shadron SAY_SHADRON_RESPOND');
INSERT INTO `script_texts` VALUES ('-1615006', 'Father tought me well!', null, null, null, null, null, null, null, null, '14115', '1', '0', '0', 'shadron SAY_SHADRON_SPECIAL_1');
INSERT INTO `script_texts` VALUES ('-1615007', 'On your knees!', null, null, null, null, null, null, null, null, '14116', '1', '0', '0', 'shadron SAY_SHADRON_SPECIAL_2');
INSERT INTO `script_texts` VALUES ('-1615008', 'A Shadron Disciple appears in the Twilight!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'shadron WHISPER_SHADRON_DICIPLE');
INSERT INTO `script_texts` VALUES ('-1615009', 'You have no place here. Your place is among the departed.', null, null, null, null, null, null, null, null, '14122', '1', '0', '0', 'tenebron SAY_TENEBRON_AGGRO');
INSERT INTO `script_texts` VALUES ('-1615010', 'No contest.', null, null, null, null, null, null, null, null, '14123', '1', '0', '0', 'tenebron SAY_TENEBRON_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1615011', 'Typical... Just as I was having fun.', null, null, null, null, null, null, null, null, '14124', '1', '0', '0', 'tenebron SAY_TENEBRON_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1615012', 'I should not... have held back...', null, null, null, null, null, null, null, null, '14129', '1', '0', '0', 'tenebron SAY_TENEBRON_DEATH');
INSERT INTO `script_texts` VALUES ('-1615013', 'To darkness I condemn you...', null, null, null, null, null, null, null, null, '14125', '1', '0', '0', 'tenebron SAY_TENEBRON_BREATH');
INSERT INTO `script_texts` VALUES ('-1615014', 'It is amusing to watch you struggle. Very well, witness how it is done.', null, null, null, null, null, null, null, null, '14128', '1', '0', '0', 'tenebron SAY_TENEBRON_RESPOND');
INSERT INTO `script_texts` VALUES ('-1615015', 'Arrogant little creatures! To challenge powers you do not yet understand...', null, null, null, null, null, null, null, null, '14126', '1', '0', '0', 'tenebron SAY_TENEBRON_SPECIAL_1');
INSERT INTO `script_texts` VALUES ('-1615016', 'I am no mere dragon! You will find I am much, much, more...', null, null, null, null, null, null, null, null, '14127', '1', '0', '0', 'tenebron SAY_TENEBRON_SPECIAL_2');
INSERT INTO `script_texts` VALUES ('-1615017', '%s begins to hatch eggs in the twilight!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'tenebron WHISPER_HATCH_EGGS');
INSERT INTO `script_texts` VALUES ('-1615018', 'It is my charge to watch over these eggs. I will see you burn before any harm comes to them!', null, null, null, null, null, null, null, null, '14093', '1', '0', '0', 'sartharion SAY_SARTHARION_AGGRO');
INSERT INTO `script_texts` VALUES ('-1615019', 'This pathetic siege ends NOW!', null, null, null, null, null, null, null, null, '14103', '1', '0', '0', 'sartharion SAY_SARTHARION_BERSERK');
INSERT INTO `script_texts` VALUES ('-1615020', 'Burn, you miserable wretches!', null, null, null, null, null, null, null, null, '14098', '1', '0', '0', 'sartharion SAY_SARTHARION_BREATH');
INSERT INTO `script_texts` VALUES ('-1615021', 'Shadron! Come to me, all is at risk!', null, null, null, null, null, null, null, null, '14105', '1', '0', '0', 'sartharion SARTHARION_CALL_SHADRON');
INSERT INTO `script_texts` VALUES ('-1615022', 'Tenebron! The eggs are yours to protect as well!', null, null, null, null, null, null, null, null, '14106', '1', '0', '0', 'sartharion SAY_SARTHARION_CALL_TENEBRON');
INSERT INTO `script_texts` VALUES ('-1615023', 'Vesperon! The clutch is in danger! Assist me!', null, null, null, null, null, null, null, null, '14104', '1', '0', '0', 'sartharion SAY_SARTHARION_CALL_VESPERON');
INSERT INTO `script_texts` VALUES ('-1615024', 'Such is the price... of failure...', null, null, null, null, null, null, null, null, '14107', '1', '0', '0', 'sartharion SAY_SARTHARION_DEATH');
INSERT INTO `script_texts` VALUES ('-1615025', 'Such flammable little insects....', null, null, null, null, null, null, null, null, '14099', '1', '0', '0', 'sartharion SAY_SARTHARION_SPECIAL_1');
INSERT INTO `script_texts` VALUES ('-1615026', 'Your charred bones will litter the floor!', null, null, null, null, null, null, null, null, '14100', '1', '0', '0', 'sartharion SAY_SARTHARION_SPECIAL_2');
INSERT INTO `script_texts` VALUES ('-1615027', 'How much heat can you take?', null, null, null, null, null, null, null, null, '14101', '1', '0', '0', 'sartharion SAY_SARTHARION_SPECIAL_3');
INSERT INTO `script_texts` VALUES ('-1615028', 'All will be reduced to ash!', null, null, null, null, null, null, null, null, '14102', '1', '0', '0', 'sartharion SAY_SARTHARION_SPECIAL_4');
INSERT INTO `script_texts` VALUES ('-1615029', 'You will make a fine meal for the hatchlings.', null, null, null, null, null, null, null, null, '14094', '1', '0', '0', 'sartharion SAY_SARTHARION_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1615030', 'You are the grave disadvantage.', null, null, null, null, null, null, null, null, '14096', '1', '0', '0', 'sartharion SAY_SARTHARION_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1615031', 'This is why we call you lesser beeings.', null, null, null, null, null, null, null, null, '14097', '1', '0', '0', 'sartharion SAY_SARTHARION_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1615032', 'The lava surrounding %s churns!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'sartharion WHISPER_LAVA_CHURN');
INSERT INTO `script_texts` VALUES ('-1615033', 'You pose no threat, lesser beings...give me your worst!', null, null, null, null, null, null, null, null, '14133', '1', '0', '0', 'vesperon SAY_VESPERON_AGGRO');
INSERT INTO `script_texts` VALUES ('-1615034', 'The least you could do is put up a fight...', null, null, null, null, null, null, null, null, '14134', '1', '0', '0', 'vesperon SAY_VESPERON_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1615035', 'Was that the best you can do?', null, null, null, null, null, null, null, null, '14135', '1', '0', '0', 'vesperon SAY_VESPERON_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1615036', 'I still have some...fight..in...me...', null, null, null, null, null, null, null, null, '14140', '1', '0', '0', 'vesperon SAY_VESPERON_DEATH');
INSERT INTO `script_texts` VALUES ('-1615037', 'I will pick my teeth with your bones!', null, null, null, null, null, null, null, null, '14136', '1', '0', '0', 'vesperon SAY_VESPERON_BREATH');
INSERT INTO `script_texts` VALUES ('-1615038', 'Father was right about you, Sartharion...You are a weakling!', null, null, null, null, null, null, null, null, '14139', '1', '0', '0', 'vesperon SAY_VESPERON_RESPOND');
INSERT INTO `script_texts` VALUES ('-1615039', 'Aren\'t you tricky...I have a few tricks of my own...', null, null, null, null, null, null, null, null, '14137', '1', '0', '0', 'vesperon SAY_VESPERON_SPECIAL_1');
INSERT INTO `script_texts` VALUES ('-1615040', 'Unlike, I have many talents.', null, null, null, null, null, null, null, null, '14138', '1', '0', '0', 'vesperon SAY_VESPERON_SPECIAL_2');
INSERT INTO `script_texts` VALUES ('-1615041', 'A Vesperon Disciple appears in the Twilight!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'shadron WHISPER_VESPERON_DICIPLE');
INSERT INTO `script_texts` VALUES ('-1615042', '%s begins to open a Twilight Portal!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'sartharion drake WHISPER_OPEN_PORTAL');
INSERT INTO `script_texts` VALUES ('-1616000', 'Lesser beings, intruding here! A shame that your excess courage does not compensate for your stupidity!', null, null, null, null, null, null, null, null, '14512', '1', '0', '0', 'malygos SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1616001', 'None but the blue dragonflight are welcome here! Perhaps this is the work of Alexstrasza? Well then, she has sent you to your deaths.', null, null, null, null, null, null, null, null, '14513', '1', '0', '0', 'malygos SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1616002', 'What could you hope to accomplish, to storm brazenly into my domain? To employ MAGIC? Against ME? <Laughs>', null, null, null, null, null, null, null, null, '14514', '1', '0', '0', 'malygos SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1616003', 'I am without limits here... the rules of your cherished reality do not apply... In this realm, I am in control...', null, null, null, null, null, null, null, null, '14515', '1', '0', '0', 'malygos SAY_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1616004', 'I give you one chance. Pledge fealty to me, and perhaps I won\'t slaughter you for your insolence!', null, null, null, null, null, null, null, null, '14516', '1', '0', '0', 'malygos SAY_INTRO_5');
INSERT INTO `script_texts` VALUES ('-1616005', 'My patience has reached its limit, I WILL BE RID OF YOU!', null, null, null, null, null, null, null, null, '14517', '1', '0', '0', 'malygos SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1616006', 'Watch helplessly as your hopes are swept away...', null, null, null, null, null, null, null, null, '14525', '1', '0', '0', 'malygos SAY_VORTEX');
INSERT INTO `script_texts` VALUES ('-1616007', 'I AM UNSTOPPABLE!', null, null, null, null, null, null, null, null, '14533', '1', '0', '0', 'malygos SAY_SPARK_BUFF');
INSERT INTO `script_texts` VALUES ('-1616008', 'Your stupidity has finally caught up to you!', null, null, null, null, null, null, null, null, '14519', '1', '0', '0', 'malygos SAY_SLAY_1_A');
INSERT INTO `script_texts` VALUES ('-1616009', 'More artifacts to confiscate...', null, null, null, null, null, null, null, null, '14520', '1', '0', '0', 'malygos SAY_SLAY_1_B');
INSERT INTO `script_texts` VALUES ('-1616010', '<Laughs> How very... naive...', null, null, null, null, null, null, null, null, '14521', '1', '0', '0', 'malygos SAY_SLAY_1_C');
INSERT INTO `script_texts` VALUES ('-1616011', 'I had hoped to end your lives quickly, but you have proven more...resilient then I had anticipated. Nonetheless, your efforts are in vain, it is you reckless, careless mortals who are to blame for this war! I do what I must...And if it means your...extinction...THEN SO BE IT!', null, null, null, null, null, null, null, null, '14522', '1', '0', '0', 'malygos SAY_END_PHASE_1');
INSERT INTO `script_texts` VALUES ('-1616012', 'Few have experienced the pain I will now inflict upon you!', null, null, null, null, null, null, null, null, '14523', '1', '0', '0', 'malygos SAY_START_PHASE_2');
INSERT INTO `script_texts` VALUES ('-1616013', 'YOU WILL NOT SUCCEED WHILE I DRAW BREATH!', null, null, null, null, null, null, null, null, '14518', '1', '0', '0', 'malygos SAY_DEEP_BREATH');
INSERT INTO `script_texts` VALUES ('-1616014', 'I will teach you IGNORANT children just how little you know of magic...', null, null, null, null, null, null, null, null, '14524', '1', '0', '0', 'malygos SAY_SHELL');
INSERT INTO `script_texts` VALUES ('-1616015', 'Your energy will be put to good use!', null, null, null, null, null, null, null, null, '14526', '1', '0', '0', 'malygos SAY_SLAY_2_A');
INSERT INTO `script_texts` VALUES ('-1616016', 'I am the spell-weaver! My power is infinite!', null, null, null, null, null, null, null, null, '14527', '1', '0', '0', 'malygos SAY_SLAY_2_B');
INSERT INTO `script_texts` VALUES ('-1616017', 'Your spirit will linger here forever!', null, null, null, null, null, null, null, null, '14528', '1', '0', '0', 'malygos SAY_SLAY_2_C');
INSERT INTO `script_texts` VALUES ('-1616018', 'ENOUGH! If you intend to reclaim Azeroth\'s magic, then you shall have it...', null, null, null, null, null, null, null, null, '14529', '1', '0', '0', 'malygos SAY_END_PHASE_2');
INSERT INTO `script_texts` VALUES ('-1616019', 'Now your benefactors make their appearance...But they are too late. The powers contained here are sufficient to destroy the world ten times over! What do you think they will do to you?', null, null, null, null, null, null, null, null, '14530', '1', '0', '0', 'malygos SAY_INTRO_PHASE_3');
INSERT INTO `script_texts` VALUES ('-1616020', 'SUBMIT!', null, null, null, null, null, null, null, null, '14531', '1', '0', '0', 'malygos SAY_START_PHASE_3');
INSERT INTO `script_texts` VALUES ('-1616021', 'Alexstrasza! Another of your brood falls!', null, null, null, null, null, null, null, null, '14534', '1', '0', '0', 'malygos SAY_SLAY_3_A');
INSERT INTO `script_texts` VALUES ('-1616022', 'Little more then gnats!', null, null, null, null, null, null, null, null, '14535', '1', '0', '0', 'malygos SAY_SLAY_3_B');
INSERT INTO `script_texts` VALUES ('-1616023', 'Your red allies will share your fate...', null, null, null, null, null, null, null, null, '14536', '1', '0', '1', 'malygos SAY_SLAY_3_C');
INSERT INTO `script_texts` VALUES ('-1616024', 'The powers at work here exceed anything you could possibly imagine!', null, null, null, null, null, null, null, null, '14532', '1', '0', '0', 'malygos SAY_SURGE');
INSERT INTO `script_texts` VALUES ('-1616025', 'Still standing? Not for long...', null, null, null, null, null, null, null, null, '14537', '1', '0', '0', 'malygos SAY_SPELL_1');
INSERT INTO `script_texts` VALUES ('-1616026', 'Your cause is lost!', null, null, null, null, null, null, null, null, '14538', '1', '0', '0', 'malygos SAY_SPELL_2');
INSERT INTO `script_texts` VALUES ('-1616027', 'Your fragile mind will be shattered!', null, null, null, null, null, null, null, null, '14539', '1', '0', '0', 'malygos SAY_SPELL_3');
INSERT INTO `script_texts` VALUES ('-1616028', 'UNTHINKABLE! The mortals will destroy... e-everything... my sister... what have you-', null, null, null, null, null, null, null, null, '14540', '1', '0', '0', 'malygos SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1616029', 'I did what I had to, brother. You gave me no alternative.', null, null, null, null, null, null, null, null, '14406', '1', '0', '1', 'alextrasza SAY_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1616030', 'And so ends the Nexus War.', null, null, null, null, null, null, null, null, '14407', '1', '0', '1', 'alextrasza SAY_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1616031', 'This resolution pains me deeply, but the destruction, the monumental loss of life had to end. Regardless of Malygos\' recent transgressions, I will mourn his loss. He was once a guardian, a protector. This day, one of the world\'s mightiest has fallen.', null, null, null, null, null, null, null, null, '14408', '1', '0', '1', 'alextrasza SAY_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1616032', 'The red dragonflight will take on the burden of mending the devastation wrought on Azeroth. Return home to your people and rest. Tomorrow will bring you new challenges, and you must be ready to face them. Life...goes on.', null, null, null, null, null, null, null, null, '14409', '1', '0', '1', 'alextrasza SAY_OUTRO_4');
INSERT INTO `script_texts` VALUES ('-1616033', 'A Power Spark forms from a nearby rift!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'malygos SAY_EMOTE_SPARK');
INSERT INTO `script_texts` VALUES ('-1616034', '%s takes a deep breath...', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'malygos SAY_EMOTE_BREATH');
INSERT INTO `script_texts` VALUES ('-1619000', 'The secrets of the deep shall remain hidden.', null, null, null, null, null, null, null, null, '14033', '1', '0', '0', 'nadox SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1619001', 'The young must not grow hungry...', null, null, null, null, null, null, null, null, '14034', '1', '0', '0', 'nadox SAY_SUMMON_EGG_1');
INSERT INTO `script_texts` VALUES ('-1619002', 'Shhhad ak kereeesshh chak-k-k!', null, null, null, null, null, null, null, null, '14035', '1', '0', '0', 'nadox SAY_SUMMON_EGG_2');
INSERT INTO `script_texts` VALUES ('-1619003', 'Sleep now, in the cold dark.', null, null, null, null, null, null, null, null, '14036', '1', '0', '0', 'nadox SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1619004', 'For the Lich King!', null, null, null, null, null, null, null, null, '14037', '1', '0', '0', 'nadox SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1619005', 'Perhaps we will be allies soon.', null, null, null, null, null, null, null, null, '14038', '1', '0', '0', 'nadox SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1619006', 'Master, is my service complete?', null, null, null, null, null, null, null, null, '14039', '1', '0', '0', 'nadox SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1619007', 'An Ahn\'kahar Guardian hatches!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'nadox EMOTE_HATCH');
INSERT INTO `script_texts` VALUES ('-1619008', 'I will feast on your remains.', null, null, null, null, null, null, null, null, '14360', '1', '0', '0', 'taldaram SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1619009', 'Your heartbeat is music to my ears.', null, null, null, null, null, null, null, null, '14361', '1', '0', '0', 'taldaram SAY_VANISH_1');
INSERT INTO `script_texts` VALUES ('-1619010', 'I am nowhere. I am everywhere. I am the watcher, unseen.', null, null, null, null, null, null, null, null, '14362', '1', '0', '0', 'taldaram SAY_VANISH_2');
INSERT INTO `script_texts` VALUES ('-1619011', 'So appetizing.', null, null, null, null, null, null, null, null, '14363', '1', '0', '0', 'taldaram SAY_FEED_1');
INSERT INTO `script_texts` VALUES ('-1619012', 'Fresh, warm blood. It has been too long.', null, null, null, null, null, null, null, null, '14364', '1', '0', '0', 'taldaram SAY_FEED_2');
INSERT INTO `script_texts` VALUES ('-1619013', 'Bin-dor\'el', null, null, null, null, null, null, null, null, '14365', '1', '0', '0', 'taldaram SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1619014', 'I will drink no blood before it\'s time.', null, null, null, null, null, null, null, null, '14366', '1', '0', '0', 'taldaram SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1619015', 'One final embrace.', null, null, null, null, null, null, null, null, '14367', '1', '0', '0', 'taldaram SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1619016', 'Still I hunger, still I thirst.', null, null, null, null, null, null, null, null, '14368', '1', '0', '0', 'taldaram SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1619017', 'These are sacred halls! Your intrusion will be met with death.', null, null, null, null, null, null, null, null, '14343', '1', '0', '0', 'jedoga SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1619018', 'Who among you is devoted?', null, null, null, null, null, null, null, null, '14344', '1', '0', '0', 'jedoga SAY_CALL_SACRIFICE_1');
INSERT INTO `script_texts` VALUES ('-1619019', 'You there! Step forward!', null, null, null, null, null, null, null, null, '14345', '1', '0', '0', 'jedoga SAY_CALL_SACRIFICE_2');
INSERT INTO `script_texts` VALUES ('-1619020', 'Yogg-Saron, grant me your power!', null, null, null, null, null, null, null, null, '14346', '1', '0', '0', 'jedoga SAY_SACRIFICE_1');
INSERT INTO `script_texts` VALUES ('-1619021', 'Master, a gift for you!', null, null, null, null, null, null, null, null, '14347', '1', '0', '0', 'jedoga SAY_SACRIFICE_2');
INSERT INTO `script_texts` VALUES ('-1619022', 'Glory to Yogg-Saron!', null, null, null, null, null, null, null, null, '14348', '1', '0', '0', 'jedoga SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1619023', 'You are unworthy!', null, null, null, null, null, null, null, null, '14349', '1', '0', '0', 'jedoga SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1619024', 'Get up! You haven\'t suffered enough.', null, null, null, null, null, null, null, null, '14350', '1', '0', '0', 'jedoga SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1619025', 'Do not expect your sacrilege... to go unpunished.', null, null, null, null, null, null, null, null, '14351', '1', '0', '0', 'jedoga SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1619026', 'The elements themselves will rise up against the civilized world! Only the faithful will be spared!', null, null, null, null, null, null, null, null, '14352', '1', '0', '0', 'jedoga SAY_PREACHING_1');
INSERT INTO `script_texts` VALUES ('-1619027', 'Immortality can be yours. But only if you pledge yourself fully to Yogg-Saron!', null, null, null, null, null, null, null, null, '14353', '1', '0', '0', 'jedoga SAY_PREACHING_2');
INSERT INTO `script_texts` VALUES ('-1619028', 'Here on the very borders of his domain. You will experience powers you would never have imagined! ', null, null, null, null, null, null, null, null, '14354', '1', '0', '0', 'jedoga SAY_PREACHING_3');
INSERT INTO `script_texts` VALUES ('-1619029', 'You have traveled long and risked much to be here. Your devotion shall be rewarded.', null, null, null, null, null, null, null, null, '14355', '1', '0', '0', 'jedoga SAY_PREACHING_4');
INSERT INTO `script_texts` VALUES ('-1619030', 'The faithful shall be exalted! But there is more work to be done. We will press on until all of Azeroth lies beneath his shadow!', null, null, null, null, null, null, null, null, '14356', '1', '0', '0', 'jedoga SAY_PREACHING_5');
INSERT INTO `script_texts` VALUES ('-1619031', 'I have been chosen!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'jedoga SAY_VOLUNTEER_1');
INSERT INTO `script_texts` VALUES ('-1619032', 'I give myself to the master!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'jedoga SAY_VOLUNTEER_2');
INSERT INTO `script_texts` VALUES ('-1619033', 'Shgla\'yos plahf mh\'naus.', null, null, null, null, null, null, null, null, '14043', '1', '0', '0', 'volazj SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1619034', 'Gul\'kafh an\'shel. Yoq\'al shn ky ywaq nuul.', null, null, null, null, null, null, null, null, '14044', '1', '0', '0', 'volazj SAY_INSANITY');
INSERT INTO `script_texts` VALUES ('-1619035', 'Ywaq puul skshgn: on\'ma yeh\'glu zuq.', null, null, null, null, null, null, null, null, '14045', '1', '0', '0', 'volazj SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1619036', 'Ywaq ma phgwa\'cul hnakf.', null, null, null, null, null, null, null, null, '14046', '1', '0', '0', 'volazj SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1619037', 'Ywaq maq oou; ywaq maq ssaggh. Ywaq ma shg\'fhn.', null, null, null, null, null, null, null, null, '14047', '1', '0', '0', 'volazj SAY_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1619038', ' ', null, null, null, null, null, null, null, null, '14048', '1', '0', '0', 'volazj SAY_DEATH_1');
INSERT INTO `script_texts` VALUES ('-1619039', 'Iilth vwah, uhn\'agth fhssh za.', null, null, null, null, null, null, null, null, '14049', '1', '0', '0', 'volazj SAY_DEATH_2');
INSERT INTO `script_texts` VALUES ('-1631001', 'This is the beginning AND the end, mortals. None may enter the master\'s sanctum!', null, null, null, null, null, null, null, null, '16950', '1', '0', '0', 'marrowgar SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1631002', 'The Scourge will wash over this world as a swarm of death and destruction!', null, null, null, null, null, null, null, null, '16941', '1', '0', '0', 'marrowgar SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631003', 'BONE STORM!', null, null, null, null, null, null, null, null, '16946', '1', '0', '0', 'marrowgar SAY_BONE_STORM');
INSERT INTO `script_texts` VALUES ('-1631004', 'Bound by bone!', null, null, null, null, null, null, null, null, '16947', '1', '0', '0', 'marrowgar SAY_BONE_SPIKE_1');
INSERT INTO `script_texts` VALUES ('-1631005', 'Stick Around!', null, null, null, null, null, null, null, null, '16948', '1', '0', '0', 'marrowgar SAY_BONE_SPIKE_2');
INSERT INTO `script_texts` VALUES ('-1631006', 'The only escape is death!', null, null, null, null, null, null, null, null, '16949', '1', '0', '0', 'marrowgar SAY_BONE_SPIKE_3');
INSERT INTO `script_texts` VALUES ('-1631007', 'More bones for the offering!', null, null, null, null, null, null, null, null, '16942', '1', '0', '0', 'marrowgar SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631008', 'Languish in damnation!', null, null, null, null, null, null, null, null, '16943', '1', '0', '0', 'marrowgar SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631009', 'I see... only darkness...', null, null, null, null, null, null, null, null, '16944', '1', '0', '0', 'marrowgar SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631010', 'THE MASTER\'S RAGE COURSES THROUGH ME!', null, null, null, null, null, null, null, null, '16945', '1', '0', '0', 'marrowgar SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631011', 'You have found your way here, because you are among the few gifted with true vision in a world cursed with blindness.', null, null, null, null, null, null, null, null, '17272', '1', '0', '0', 'deathwhisper SAY_SPEECH_1');
INSERT INTO `script_texts` VALUES ('-1631012', 'You can see through the fog that hangs over this world like a shroud, and grasp where true power lies.', null, null, null, null, null, null, null, null, '17273', '1', '0', '0', 'deathwhisper SAY_SPEECH_2');
INSERT INTO `script_texts` VALUES ('-1631013', 'Fix your eyes upon your crude hands: the sinew, the soft meat, the dark blood coursing within.', null, null, null, null, null, null, null, null, '16878', '1', '0', '0', 'deathwhisper SAY_SPEECH_3');
INSERT INTO `script_texts` VALUES ('-1631014', 'It is a weakness; a crippling flaw.... A joke played by the Creators upon their own creations.', null, null, null, null, null, null, null, null, '17268', '1', '0', '0', 'deathwhisper SAY_SPEECH_4');
INSERT INTO `script_texts` VALUES ('-1631015', 'The sooner you come to accept your condition as a defect, the sooner you will find yourselves in a position to transcend it.', null, null, null, null, null, null, null, null, '17269', '1', '0', '0', 'deathwhisper SAY_SPEECH_5');
INSERT INTO `script_texts` VALUES ('-1631016', 'Through our Master, all things are possible. His power is without limit, and his will unbending.', null, null, null, null, null, null, null, null, '17270', '1', '0', '0', 'deathwhisper SAY_SPEECH_6');
INSERT INTO `script_texts` VALUES ('-1631017', 'Those who oppose him will be destroyed utterly, and those who serve -- who serve wholly, unquestioningly, with utter devotion of mind and soul -- elevated to heights beyond your ken.', null, null, null, null, null, null, null, null, '17271', '1', '0', '0', 'deathwhisper SAY_SPEECH_7');
INSERT INTO `script_texts` VALUES ('-1631018', 'What is this disturbance?! You dare trespass upon this hallowed ground? This shall be your final resting place.', null, null, null, null, null, null, null, null, '16868', '1', '0', '0', 'deathwhisper SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631019', 'Enough! I see I must take matters into my own hands!', null, null, null, null, null, null, null, null, '16877', '1', '0', '0', 'deathwhisper SAY_PHASE_TWO');
INSERT INTO `script_texts` VALUES ('-1631020', 'Take this blessing and show these intruders a taste of our master\'s power.', null, null, null, null, null, null, null, null, '16873', '1', '0', '0', 'deathwhisper SAY_DARK_EMPOWERMENT');
INSERT INTO `script_texts` VALUES ('-1631021', 'I release you from the curse of flesh!', null, null, null, null, null, null, null, null, '16874', '1', '0', '0', 'deathwhisper SAY_DARK_TRANSFORMATION');
INSERT INTO `script_texts` VALUES ('-1631022', 'Arise and exalt in your pure form!', null, null, null, null, null, null, null, null, '16875', '1', '0', '0', 'deathwhisper SAY_ANIMATE_DEAD');
INSERT INTO `script_texts` VALUES ('-1631023', 'You are weak, powerless to resist my will!', null, null, null, null, null, null, null, null, '16876', '1', '0', '0', 'deathwhisper SAY_DOMINATE_MIND');
INSERT INTO `script_texts` VALUES ('-1631024', 'This charade has gone on long enough.', null, null, null, null, null, null, null, null, '16872', '1', '0', '0', 'deathwhisper SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631025', 'All part of the masters plan! Your end is... inevitable!', null, null, null, null, null, null, null, null, '16871', '1', '0', '0', 'deathwhisper SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631026', 'Do you yet grasp of the futility of your actions?', null, null, null, null, null, null, null, null, '16869', '1', '0', '0', 'deathwhisper SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631027', 'Embrace the darkness... Darkness eternal!', null, null, null, null, null, null, null, null, '16870', '1', '0', '0', 'deathwhisper SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631028', 'BY THE MIGHT OF THE LICH KING!', null, null, null, null, null, null, null, null, '16694', '1', '0', '0', 'saurfang SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631029', 'The ground runs red with your blood!', null, null, null, null, null, null, null, null, '16699', '1', '0', '0', 'saurfang SAY_FALLENCHAMPION');
INSERT INTO `script_texts` VALUES ('-1631030', 'Feast, my minions!', null, null, null, null, null, null, null, null, '16700', '1', '0', '0', 'saurfang SAY_BLOODBEASTS');
INSERT INTO `script_texts` VALUES ('-1631031', 'You are nothing!', null, null, null, null, null, null, null, null, '16695', '1', '0', '0', 'saurfang SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631032', 'Your soul will find no redemption here!', null, null, null, null, null, null, null, null, '16696', '1', '0', '0', 'saurfang SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631033', 'I have become...DEATH!', null, null, null, null, null, null, null, null, '16698', '1', '0', '0', 'saurfang SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631034', 'I... Am... Released.', null, null, null, null, null, null, null, null, '16697', '1', '0', '0', 'saurfang SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631035', 'Let\'s get a move on then! Move ou...', null, null, null, null, null, null, null, null, '16974', '1', '0', '0', 'bronzebeard SAY_INTRO_ALLY_0');
INSERT INTO `script_texts` VALUES ('-1631036', 'For every Horde soldier that you killed, for every Alliance dog that fell, the Lich King\'s armies grew. Even now the Val\'kyr work to raise your fallen... As Scourge.', null, null, null, null, null, null, null, null, '16701', '1', '0', '0', 'saurfang SAY_INTRO_ALLY_1');
INSERT INTO `script_texts` VALUES ('-1631037', 'Things are about to get much worse. Come, taste the power that the Lich King has bestowed upon me!', null, null, null, null, null, null, null, null, '16702', '1', '0', '0', 'saurfang SAY_INTRO_ALLY_2');
INSERT INTO `script_texts` VALUES ('-1631038', 'A lone orc, against the might of the Alliance?', null, null, null, null, null, null, null, null, '16970', '1', '0', '0', 'bronzebeard SAY_INTRO_ALLY_3');
INSERT INTO `script_texts` VALUES ('-1631039', 'Charge!', null, null, null, null, null, null, null, null, '16971', '1', '0', '0', 'bronzebeard SAY_INTRO_ALLY_4');
INSERT INTO `script_texts` VALUES ('-1631040', 'Hahahaha! Dwarves...', null, null, null, null, null, null, null, null, '16703', '1', '0', '0', 'saurfang SAY_INTRO_ALLY_5');
INSERT INTO `script_texts` VALUES ('-1631041', 'Kor\'kron, move out! Champions, watch your backs. The Scourge have been..', null, null, null, null, null, null, null, null, '17103', '1', '0', '0', 'overlord SAY_INTRO_HORDE_1');
INSERT INTO `script_texts` VALUES ('-1631042', 'Join me, father. Join me and we will crush this world in the name of the Scourge -- for the glory of the Lich King!', null, null, null, null, null, null, null, null, '16704', '1', '0', '0', 'saurfang SAY_INTRO_HORDE_2');
INSERT INTO `script_texts` VALUES ('-1631043', 'My boy died at the Wrath Gate. I am here only to collect his body.', null, null, null, null, null, null, null, null, '17097', '0', '0', '0', 'overlord SAY_INTRO_HORDE_3');
INSERT INTO `script_texts` VALUES ('-1631044', 'Stubborn and old. What chance do you have? I am stronger, and more powerful than you ever were.', null, null, null, null, null, null, null, null, '16705', '1', '0', '0', 'saurfang SAY_INTRO_HORDE_4');
INSERT INTO `script_texts` VALUES ('-1631045', 'We named him Dranosh. It means \"Heart of Draenor\" in orcish. I would not let the warlocks take him. My boy would be safe, hidden away by the elders of Garadar.', null, null, null, null, null, null, null, null, '17098', '0', '0', '0', 'overlord SAY_INTRO_HORDE_5');
INSERT INTO `script_texts` VALUES ('-1631046', 'I made a promise to his mother before she died; that I would cross the Dark Portal alone - whether I lived or died, my son would be safe. Untainted...', null, null, null, null, null, null, null, null, '17099', '0', '0', '0', 'overlord SAY_INTRO_HORDE_6');
INSERT INTO `script_texts` VALUES ('-1631047', 'Today, I fulfill that promise.', null, null, null, null, null, null, null, null, '17100', '0', '0', '0', 'overlord SAY_INTRO_HORDE_7');
INSERT INTO `script_texts` VALUES ('-1631048', 'High Overlord Saurfang charges!', null, null, null, null, null, null, null, null, '17104', '2', '0', '0', 'overlord SAY_INTRO_HORDE_8');
INSERT INTO `script_texts` VALUES ('-1631049', 'Pathetic old orc. Come then heroes. Come and face the might of the Scourge!', null, null, null, null, null, null, null, null, '16706', '1', '0', '0', 'saurfang SAY_INTRO_HORDE_9');
INSERT INTO `script_texts` VALUES ('-1631050', '%s gasps for air', null, null, null, null, null, null, null, null, '16975', '2', '0', '0', 'bronzebeard SAY_OUTRO_ALLY_1');
INSERT INTO `script_texts` VALUES ('-1631051', 'That was Saurfang\'s boy - the Horde commander at the Wrath Gate. Such a tragic end...', null, null, null, null, null, null, null, null, '16976', '0', '0', '0', 'bronzebeard SAY_OUTRO_ALLY_2');
INSERT INTO `script_texts` VALUES ('-1631052', 'What in the... There, in the distance!', null, null, null, null, null, null, null, null, '16977', '0', '0', '0', 'bronzebeard SAY_OUTRO_ALLY_3');
INSERT INTO `script_texts` VALUES ('-1631053', 'Soldiers, fall in! Looks like the Horde are comin\' in to take another shot!', null, null, null, null, null, null, null, null, '16978', '1', '0', '0', 'bronzebeard SAY_OUTRO_ALLY_4');
INSERT INTO `script_texts` VALUES ('-1631054', 'Don\'t force my hand, orc. We can\'t let you pass.', null, null, null, null, null, null, null, null, '16972', '0', '0', '0', 'bronzebeard SAY_OUTRO_ALLY_5');
INSERT INTO `script_texts` VALUES ('-1631055', 'Behind you lies the body of my only son. Nothing will keep me from him.', null, null, null, null, null, null, null, null, '17094', '0', '0', '0', 'overlord SAY_OUTRO_ALLY_6');
INSERT INTO `script_texts` VALUES ('-1631056', 'He... I can\'t do it. Get back on your ship and we\'ll spare your life.', null, null, null, null, null, null, null, null, '16973', '0', '0', '0', 'bronzebeard SAY_OUTRO_ALLY_7');
INSERT INTO `script_texts` VALUES ('-1631057', 'Stand down, Muradin. Let a grieving father pass.', null, null, null, null, null, null, null, null, '16690', '0', '0', '0', 'varian SAY_OUTRO_ALLY_8');
INSERT INTO `script_texts` VALUES ('-1631058', 'No\'ku kil zil\'nok ha tar.', null, null, null, null, null, null, null, null, '17096', '0', '1', '0', 'overlord SAY_OUTRO_ALLY_9');
INSERT INTO `script_texts` VALUES ('-1631059', 'I will not forget this kindess. I thank you, highness.', null, null, null, null, null, null, null, null, '17095', '0', '0', '0', 'overlord SAY_OUTRO_ALLY_10');
INSERT INTO `script_texts` VALUES ('-1631060', 'I... I was not at the Wrathgate. But the soldiers who survived told me much of what happened. Your son fought with honor. He died a hero\'s death. He deserves a hero\'s burial.', null, null, null, null, null, null, null, null, '16691', '0', '0', '0', 'varian SAY_OUTRO_ALLY_11');
INSERT INTO `script_texts` VALUES ('-1631061', '%s cries.', null, null, null, null, null, null, null, null, '16651', '2', '0', '0', 'proudmore SAY_OUTRO_ALLY_12');
INSERT INTO `script_texts` VALUES ('-1631062', 'Jaina, why are you crying?', null, null, null, null, null, null, null, null, '16692', '0', '0', '0', 'varian SAY_OUTRO_ALLY_13');
INSERT INTO `script_texts` VALUES ('-1631063', 'It was nothing, your majesty. Just... I\'m proud of my king.', null, null, null, null, null, null, null, null, '16652', '0', '0', '0', 'proudmore SAY_OUTRO_ALLY_14');
INSERT INTO `script_texts` VALUES ('-1631064', 'Bah! Muradin, secure the deck and prepare our soldiers for an assault on the upper citadel. I\'ll send out another regiment from Stormwind.', null, null, null, null, null, null, null, null, '16693', '0', '0', '0', 'varian SAY_OUTRO_ALLY_15');
INSERT INTO `script_texts` VALUES ('-1631065', 'Right away, yer majesty!', null, null, null, null, null, null, null, null, '16979', '0', '0', '0', 'bronzebeard SAY_OUTRO_ALLY_16');
INSERT INTO `script_texts` VALUES ('-1631066', '%s coughs.', null, null, null, null, null, null, null, null, '17105', '2', '0', '0', 'overlord SAY_OUTRO_HORDE_1');
INSERT INTO `script_texts` VALUES ('-1631067', '%s weeps over the corpse of his son.', null, null, null, null, null, null, null, null, '17106', '2', '0', '0', 'overlord SAY_OUTRO_HORDE_2');
INSERT INTO `script_texts` VALUES ('-1631068', 'You will have a proper ceremony in Nagrand next to the pyres of your mother and ancestors.', null, null, null, null, null, null, null, null, '17101', '0', '0', '0', 'overlord SAY_OUTRO_HORDE_3');
INSERT INTO `script_texts` VALUES ('-1631069', 'Honor, young heroes... no matter how dire the battle... Never forsake it!', null, null, null, null, null, null, null, null, '17102', '0', '0', '0', 'overlord SAY_OUTRO_HORDE_4');
INSERT INTO `script_texts` VALUES ('-1631070', 'What? Precious? Noooooooooo!!!', null, null, null, null, null, null, null, null, '16993', '6', '0', '0', 'rotface SAY_PRECIOUS_DIES');
INSERT INTO `script_texts` VALUES ('-1631071', 'WEEEEEE!', null, null, null, null, null, null, null, null, '16986', '1', '0', '0', 'rotface SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631072', 'Icky sticky.', null, null, null, null, null, null, null, null, '16991', '1', '0', '0', 'rotface SAY_SLIME_SPRAY');
INSERT INTO `script_texts` VALUES ('-1631073', 'I think I made an angry poo-poo. It gonna blow!', null, null, null, null, null, null, null, null, '16992', '1', '0', '0', 'rotface SAY_OOZE_EXPLODE');
INSERT INTO `script_texts` VALUES ('-1631074', 'Great news, everyone! The slime is flowing again!', null, null, null, null, null, null, null, null, '17126', '1', '0', '0', 'putricide SAY_SLIME_FLOW_1');
INSERT INTO `script_texts` VALUES ('-1631075', 'Good news, everyone! I\'ve fixed the poison slime pipes!', null, null, null, null, null, null, null, null, '17123', '1', '0', '0', 'putricide SAY_SLIME_FLOW_2');
INSERT INTO `script_texts` VALUES ('-1631076', 'Daddy make toys out of you!', null, null, null, null, null, null, null, null, '16987', '1', '0', '0', 'rotface SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631077', 'I brokes-ded it...', null, null, null, null, null, null, null, null, '16988', '1', '0', '0', 'rotface SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631078', 'Sleepy Time!', null, null, null, null, null, null, null, null, '16990', '1', '0', '0', 'rotface SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631079', 'Bad news daddy.', null, null, null, null, null, null, null, null, '16989', '1', '0', '0', 'rotface SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631080', 'Terrible news, everyone, Rotface is dead! But great news everyone, he left behind plenty of ooze for me to use! Whaa...? I\'m a poet, and I didn\'t know it? Astounding!', null, null, null, null, null, null, null, null, '17146', '6', '0', '0', 'putricide SAY_ROTFACE_DEATH');
INSERT INTO `script_texts` VALUES ('-1631081', 'NOOOO! You kill Stinky! You pay!', null, null, null, null, null, null, null, null, '16907', '6', '0', '0', 'festergut SAY_STINKY_DIES');
INSERT INTO `script_texts` VALUES ('-1631082', 'Fun time!', null, null, null, null, null, null, null, null, '16901', '1', '0', '0', 'festergut SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631083', 'Just an ordinary gas cloud. But watch out, because that\'s no ordinary gas cloud! ', null, null, null, null, null, null, null, null, '17119', '1', '0', '0', 'putricide SAY_BLIGHT');
INSERT INTO `script_texts` VALUES ('-1631084', '%s farts.', null, null, null, null, null, null, null, null, '16911', '2', '0', '0', 'festergut SAY_SPORE');
INSERT INTO `script_texts` VALUES ('-1631085', 'Gyah! Uhhh, I not feel so good...', null, null, null, null, null, null, null, null, '16906', '1', '0', '0', 'festergut SAY_PUNGUENT_BLIGHT');
INSERT INTO `script_texts` VALUES ('-1631086', '%s vomits', null, null, null, null, null, null, null, null, '0', '2', '0', '0', 'festergut SAY_PUNGUENT_BLIGHT_EMOTE');
INSERT INTO `script_texts` VALUES ('-1631087', 'Daddy, I did it', null, null, null, null, null, null, null, null, '16902', '1', '0', '0', 'festergut SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631088', 'Dead, dead, dead!', null, null, null, null, null, null, null, null, '16903', '1', '0', '0', 'festergut SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631089', 'Fun time over!', null, null, null, null, null, null, null, null, '16905', '1', '0', '0', 'festergut SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631090', 'Da ... Ddy...', null, null, null, null, null, null, null, null, '16904', '1', '0', '0', 'festergut SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631091', 'Oh, Festergut. You were always my favorite. Next to Rotface. The good news is you left behind so much gas, I can practically taste it!', null, null, null, null, null, null, null, null, '17124', '6', '0', '0', 'putricide SAY_FESTERGUT_DEATH');
INSERT INTO `script_texts` VALUES ('-1631092', 'Good news, everyone! I think I perfected a plague that will destroy all life on Azeroth!', null, null, null, null, null, null, null, null, '17114', '1', '0', '0', 'putricide SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631093', 'You can\'t come in here all dirty like that! You need that nasty flesh scrubbed off first!', null, null, null, null, null, null, null, null, '17125', '1', '0', '0', 'putricide SAY_AIRLOCK');
INSERT INTO `script_texts` VALUES ('-1631094', 'Two oozes, one room! So many delightful possibilities...', null, null, null, null, null, null, null, null, '17122', '1', '0', '0', 'putricide SAY_PHASE_CHANGE');
INSERT INTO `script_texts` VALUES ('-1631095', 'Hmm. I don\'t feel a thing. Whaa...? Where\'d those come from?', null, null, null, null, null, null, null, null, '17120', '1', '0', '0', 'putricide SAY_TRANSFORM_1');
INSERT INTO `script_texts` VALUES ('-1631096', 'Tastes like... Cherry! Oh! Excuse me!', null, null, null, null, null, null, null, null, '17121', '1', '0', '0', 'putricide SAY_TRANSFORM_2');
INSERT INTO `script_texts` VALUES ('-1631097', 'Hmm... Interesting...', null, null, null, null, null, null, null, null, '17115', '1', '0', '0', 'putricide SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631098', 'That was unexpected!', null, null, null, null, null, null, null, null, '17116', '1', '0', '0', 'putricide SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631099', 'Great news, everyone!', null, null, null, null, null, null, null, null, '17118', '1', '0', '0', 'putricide SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631100', 'Bad news, everyone! I don\'t think I\'m going to make it', null, null, null, null, null, null, null, null, '17117', '1', '0', '0', 'putricide SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631101', 'Foolish mortals. You thought us defeated so easily? The San\'layn are the Lich King\'s immortal soldiers! Now you shall face their might combined!', null, null, null, null, null, null, null, null, '16795', '6', '0', '0', 'lanathel SAY_COUNCIL_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1631102', 'Rise up, brothers, and destroy our enemies', null, null, null, null, null, null, null, null, '16796', '6', '0', '0', 'lanathel SAY_COUNCIL_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1631103', 'Such wondrous power! The Darkfallen Orb has made me INVINCIBLE!', null, null, null, null, null, null, null, null, '16727', '1', '0', '0', 'keleseth SAY_KELESETH_INVOCATION');
INSERT INTO `script_texts` VALUES ('-1631104', 'Blood will flow!', null, null, null, null, null, null, null, null, '16728', '1', '0', '0', 'keleseth SAY_KELESETH_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1631105', 'Were you ever a threat?', null, null, null, null, null, null, null, null, '16723', '1', '0', '0', 'keleseth SAY_KELESETH_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631106', 'Truth is found in death.', null, null, null, null, null, null, null, null, '16724', '1', '0', '0', 'keleseth SAY_KELESETH_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631107', '%s cackles maniacally!', null, null, null, null, null, null, null, null, '16726', '2', '0', '0', 'keleseth SAY_KELESETH_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631108', 'My queen... they come...', null, null, null, null, null, null, null, null, '16725', '1', '0', '0', 'keleseth SAY_KELESETH_DEATH');
INSERT INTO `script_texts` VALUES ('-1631109', 'Tremble before Taldaram, mortals, for the power of the orb flows through me!', null, null, null, null, null, null, null, null, '16857', '1', '0', '0', 'taldaram SAY_TALDARAM_INVOCATION');
INSERT INTO `script_texts` VALUES ('-1631110', 'Delight in the pain!', null, null, null, null, null, null, null, null, '16858', '1', '0', '0', 'taldaram SAY_TALDARAM_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1631111', 'Worm food.', null, null, null, null, null, null, null, null, '16853', '1', '0', '0', 'taldaram SAY_TALDARAM_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631112', 'Beg for mercy!', null, null, null, null, null, null, null, null, '16854', '1', '0', '0', 'taldaram SAY_TALDARAM_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631113', '%s laughs.', null, null, null, null, null, null, null, null, '16856', '2', '0', '0', 'taldaram SAY_TALDARAM_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631114', '%s gurgles and dies.', null, null, null, null, null, null, null, null, '16855', '2', '0', '0', 'taldaram SAY_TALDARAM_DEATH');
INSERT INTO `script_texts` VALUES ('-1631115', 'Naxxanar was merely a setback! With the power of the orb, Valanar will have his vengeance!', null, null, null, null, null, null, null, null, '16685', '1', '0', '0', 'valanar SAY_VALANAR_INVOCATION');
INSERT INTO `script_texts` VALUES ('-1631116', 'My cup runneth over.', null, null, null, null, null, null, null, null, '16686', '1', '0', '0', 'valanar SAY_VALANAR_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1631117', 'Dinner... is served.', null, null, null, null, null, null, null, null, '16681', '1', '0', '0', 'valanar SAY_VALANAR_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631118', 'Do you see NOW the power of the Darkfallen?', null, null, null, null, null, null, null, null, '16682', '1', '0', '0', 'valanar SAY_VALANAR_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631119', 'BOW DOWN BEFORE THE SAN\'LAYN!', null, null, null, null, null, null, null, null, '16684', '1', '0', '0', 'valanar SAY_VALANAR_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631120', '...why...?', null, null, null, null, null, null, null, null, '16683', '1', '0', '0', 'valanar SAY_VALANAR_DEATH');
INSERT INTO `script_texts` VALUES ('-1631121', 'You have made an... unwise... decision.', null, null, null, null, null, null, null, null, '16782', '1', '0', '0', 'blood_queen SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631122', 'Just a taste...', null, null, null, null, null, null, null, null, '16783', '1', '0', '0', 'blood_queen SAY_BITE_1');
INSERT INTO `script_texts` VALUES ('-1631123', 'Know my hunger!', null, null, null, null, null, null, null, null, '16784', '1', '0', '0', 'blood_queen SAY_BITE_2');
INSERT INTO `script_texts` VALUES ('-1631124', 'SUFFER!', null, null, null, null, null, null, null, null, '16786', '1', '0', '0', 'blood_queen SAY_SHADOWS');
INSERT INTO `script_texts` VALUES ('-1631125', 'Can you handle this?', null, null, null, null, null, null, null, null, '16787', '1', '0', '0', 'blood_queen SAY_PACT');
INSERT INTO `script_texts` VALUES ('-1631126', 'Yes... feed my precious one! You\'re mine now!', null, null, null, null, null, null, null, null, '16790', '1', '0', '0', 'blood_queen SAY_MC');
INSERT INTO `script_texts` VALUES ('-1631127', 'Here it comes.', null, null, null, null, null, null, null, null, '16788', '1', '0', '0', 'blood_queen SAY_AIR_PHASE');
INSERT INTO `script_texts` VALUES ('-1631128', 'THIS ENDS NOW!', null, null, null, null, null, null, null, null, '16793', '1', '0', '0', 'blood_queen SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631129', 'But... we were getting along... so well...', null, null, null, null, null, null, null, null, '16794', '1', '0', '0', 'blood_queen SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631130', 'Ready your arms, my Argent Brothers. The Vrykul will protect the Frost Queen with their lives.', null, null, null, null, null, null, null, null, '16819', '1', '0', '0', 'scourgebane SAY_SVALNA_EVENT_1');
INSERT INTO `script_texts` VALUES ('-1631131', 'Even dying here beats spending another day collecting reagents for that madman, Finklestein.', null, null, null, null, null, null, null, null, '16585', '1', '0', '0', 'arnath SAY_SVALNA_EVENT_2');
INSERT INTO `script_texts` VALUES ('-1631132', 'Enough idle banter! Our champions have arrived - support them as we push our way through the hall!', null, null, null, null, null, null, null, null, '16820', '1', '0', '0', 'scourgebane SAY_SVALNA_EVENT_3');
INSERT INTO `script_texts` VALUES ('-1631133', 'You may have once fought beside me, Crok, but now you are nothing more than a traitor. Come, your second death approaches!', null, null, null, null, null, null, null, null, '17017', '1', '0', '0', 'svalna SAY_SVALNA_EVENT_4');
INSERT INTO `script_texts` VALUES ('-1631134', 'Miserable creatures, Die!', null, null, null, null, null, null, null, null, '17018', '1', '0', '0', 'svalna SAY_KILLING_CRUSADERS');
INSERT INTO `script_texts` VALUES ('-1631135', 'Foolish Crok, you brought my reinforcements with you! Arise Argent Champions and serve the Lich King in death!', null, null, null, null, null, null, null, null, '17019', '1', '0', '0', 'svalna SAY_RESSURECT');
INSERT INTO `script_texts` VALUES ('-1631136', 'Come Scourgebane, I\'ll show the Lich King which one of us is truly worthy of the title, champion!', null, null, null, null, null, null, null, null, '17020', '1', '0', '0', 'svalna SAY_SVALNA_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631137', 'What? They died so easily? No matter.', null, null, null, null, null, null, null, null, '17022', '1', '0', '0', 'svalna SAY_KILL_CAPTAIN');
INSERT INTO `script_texts` VALUES ('-1631138', 'What a pitiful choice of an ally Crok.', null, null, null, null, null, null, null, null, '17021', '1', '0', '0', 'svalna SAY_KILL_PLAYER');
INSERT INTO `script_texts` VALUES ('-1631139', 'Perhaps... you were right... Crok.', null, null, null, null, null, null, null, null, '17023', '1', '0', '0', 'svalna SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631140', 'Heroes, lend me your aid! I... I cannot hold them off much longer! You must heal my wounds!', null, null, null, null, null, null, null, null, '17064', '1', '0', '0', 'dreamwalker SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631141', 'I have opened a portal into the Dream. Your salvation lies within, heroes.', null, null, null, null, null, null, null, null, '17068', '1', '0', '0', 'dreamwalker SAY_PORTAL');
INSERT INTO `script_texts` VALUES ('-1631142', 'My strength is returning! Press on, heroes!', null, null, null, null, null, null, null, null, '17070', '1', '0', '0', 'dreamwalker SAY_75_HEALTH');
INSERT INTO `script_texts` VALUES ('-1631143', 'I will not last much longer!', null, null, null, null, null, null, null, null, '17069', '1', '0', '0', 'dreamwalker SAY_25_HEALTH');
INSERT INTO `script_texts` VALUES ('-1631144', 'Forgive me for what I do! I... cannot... stop... ONLY NIGHTMARES REMAIN!', null, null, null, null, null, null, null, null, '17072', '1', '0', '0', 'dreamwalker SAY_0_HEALTH');
INSERT INTO `script_texts` VALUES ('-1631145', 'A tragic loss...', null, null, null, null, null, null, null, null, '17066', '1', '0', '0', 'dreamwalker SAY_PLAYER_DIES');
INSERT INTO `script_texts` VALUES ('-1631146', 'FAILURES!', null, null, null, null, null, null, null, null, '17067', '1', '0', '0', 'dreamwalker SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631147', 'I am renewed! Ysera grants me the favor to lay these foul creatures to rest!', null, null, null, null, null, null, null, null, '17071', '1', '0', '0', 'dreamwalker SAY_VICTORY');
INSERT INTO `script_texts` VALUES ('-1631148', 'You are fools who have come to this place! The icy winds of Northrend will consume your souls!', null, null, null, null, null, null, null, null, '17007', '1', '0', '0', 'sindragosa SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631149', 'Suffer, mortals, as your pathetic magic betrays you!', null, null, null, null, null, null, null, null, '17014', '1', '0', '0', 'sindragosa SAY_UNCHAINED_MAGIC');
INSERT INTO `script_texts` VALUES ('-1631150', 'Can you feel the cold hand of death upon your heart?', null, null, null, null, null, null, null, null, '17013', '1', '0', '0', 'sindragosa SAY_BLISTERING_COLD');
INSERT INTO `script_texts` VALUES ('-1631151', 'Aaah! It burns! What sorcery is this?!', null, null, null, null, null, null, null, null, '17015', '1', '0', '0', 'sindragosa SAY_RESPIRE');
INSERT INTO `script_texts` VALUES ('-1631152', 'Your incursion ends here! None shall survive!', null, null, null, null, null, null, null, null, '17012', '1', '0', '0', 'sindragosa SAY_TAKEOFF');
INSERT INTO `script_texts` VALUES ('-1631153', 'Now feel my master\'s limitless power and despair!', null, null, null, null, null, null, null, null, '17016', '1', '0', '0', 'sindragosa SAY_PHASE_3');
INSERT INTO `script_texts` VALUES ('-1631154', 'Perish!', null, null, null, null, null, null, null, null, '17008', '1', '0', '0', 'sindragosa SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631155', 'A flaw of mortality...', null, null, null, null, null, null, null, null, '17009', '1', '0', '0', 'sindragosa SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631156', 'Enough! I tire of these games!', null, null, null, null, null, null, null, null, '17011', '1', '0', '0', 'sindragosa SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1631157', 'Free...at last...', null, null, null, null, null, null, null, null, '17010', '1', '0', '0', 'sindragosa SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1631158', 'So...the Light\'s vaunted justice has finally arrived. Shall I lay down Frostmourne and throw myself at your mercy, Fordring?', null, null, null, null, null, null, null, null, '17349', '1', '0', '0', 'lich_king SAY_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1631159', 'We will grant you a swift death, Arthas. More than can be said for the thousands you\'ve tortured and slain.', null, null, null, null, null, null, null, null, '17390', '1', '0', '0', 'tirion SAY_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1631160', 'You will learn of that first hand. When my work is complete, you will beg for mercy -- and I will deny you. Your anguished cries will be testament to my unbridled power.', null, null, null, null, null, null, null, null, '17350', '1', '0', '0', 'lich_king SAY_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1631161', 'So be it. Champions, attack!', null, null, null, null, null, null, null, null, '17391', '1', '0', '0', 'tirion SAY_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1631162', 'I\'ll keep you alive to witness the end, Fordring. I would not want the Light\'s greatest champion to miss seeing this wretched world remade in my image.', null, null, null, null, null, null, null, null, '17351', '1', '0', '0', 'lich_king SAY_INTRO_5');
INSERT INTO `script_texts` VALUES ('-1631163', 'Come then champions, feed me your rage!', null, null, null, null, null, null, null, null, '17352', '1', '0', '0', 'lich_king SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1631164', 'I will freeze you from within until all that remains is an icy husk!', null, null, null, null, null, null, null, null, '17369', '1', '0', '0', 'lich_king SAY_REMORSELESS_WINTER');
INSERT INTO `script_texts` VALUES ('-1631165', 'Watch as the world around you collapses!', null, null, null, null, null, null, null, null, '17370', '1', '0', '0', 'lich_king SAY_SHATTER_ARENA');
INSERT INTO `script_texts` VALUES ('-1631166', 'Val\'kyr, your master calls!', null, null, null, null, null, null, null, null, '17373', '1', '0', '0', 'lich_king SAY_SUMMON_VALKYR');
INSERT INTO `script_texts` VALUES ('-1631167', 'Frostmourne hungers...', null, null, null, null, null, null, null, null, '17366', '1', '0', '0', 'lich_king SAY_HARVEST_SOUL');
INSERT INTO `script_texts` VALUES ('-1631168', 'You have come to bring Arthas to justice? To see the Lich King destroyed?', null, null, null, null, null, null, null, null, '17394', '1', '0', '0', 'terenas SAY_FM_TERENAS_AID_1');
INSERT INTO `script_texts` VALUES ('-1631169', 'First, you must escape Frostmourne\'s hold, or be damned as I am; trapped within this cursed blade for all eternity.', null, null, null, null, null, null, null, null, '17395', '1', '0', '0', 'terenas SAY_FM_TERENAS_AID_2');
INSERT INTO `script_texts` VALUES ('-1631170', 'Aid me in destroying these tortured souls! Together we will loosen Frostmourne\'s hold and weaken the Lich King from within!', null, null, null, null, null, null, null, null, '17396', '1', '0', '0', 'terenas SAY_FM_TERENAS_AID_3');
INSERT INTO `script_texts` VALUES ('-1631171', 'Argh... Frostmourne, obey me!', null, null, null, null, null, null, null, null, '17367', '1', '0', '0', 'lich_king SAY_FM_PLAYER_ESCAPE');
INSERT INTO `script_texts` VALUES ('-1631172', 'Frostmourne feeds on the soul of your fallen ally!', null, null, null, null, null, null, null, null, '17368', '1', '0', '0', 'lich_king SAY_FM_PLAYER_DEATH');
INSERT INTO `script_texts` VALUES ('-1631173', 'Apocalypse!', null, null, null, null, null, null, null, null, '17371', '1', '0', '0', 'lich_king SAY_SPECIAL_1');
INSERT INTO `script_texts` VALUES ('-1631174', 'Bow down before your lord and master!', null, null, null, null, null, null, null, null, '17372', '1', '0', '0', 'lich_king SAY_SPECIAL_2');
INSERT INTO `script_texts` VALUES ('-1631175', 'You gnats actually hurt me! Perhaps I\'ve toyed with you long enough, now taste the vengeance of the grave!', null, null, null, null, null, null, null, null, '17359', '1', '0', '0', 'lich_king SAY_LAST_PHASE');
INSERT INTO `script_texts` VALUES ('-1631176', 'Hope wanes!', null, null, null, null, null, null, null, null, '17363', '1', '0', '0', 'lich_king SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1631177', 'The end has come!', null, null, null, null, null, null, null, null, '17364', '1', '0', '0', 'lich_king SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1631178', 'Face now your tragic end!', null, null, null, null, null, null, null, null, '17365', '1', '0', '0', 'lich_king SAY_ENRAGE');
INSERT INTO `script_texts` VALUES ('-1631179', 'No question remains unanswered. No doubts linger. You are Azeroth\'s greatest champions! You overcame every challenge I laid before you. My mightiest servants have fallen before your relentless onslaught, your unbridled fury...', null, null, null, null, null, null, null, null, '17353', '1', '0', '0', 'lich_king SAY_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1631180', 'Is it truly righteousness that drives you? I wonder', null, null, null, null, null, null, null, null, '17354', '1', '0', '0', 'lich_king SAY_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1631181', 'You trained them well, Fordring. You delivered the greatest fighting force this world has ever known... right into my hands -- exactly as I intended. You shall be rewarded for your unwitting sacrifice.', null, null, null, null, null, null, null, null, '17355', '1', '0', '0', 'lich_king SAY_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1631182', 'Watch now as I raise them from the dead to become masters of the Scourge. They will shroud this world in chaos and destruction. Azeroth\'s fall will come at their hands -- and you will be the first to die.', null, null, null, null, null, null, null, null, '17356', '1', '0', '0', 'lich_king SAY_OUTRO_4');
INSERT INTO `script_texts` VALUES ('-1631183', 'I delight in the irony.', null, null, null, null, null, null, null, null, '17357', '1', '0', '0', 'lich_king SAY_OUTRO_5');
INSERT INTO `script_texts` VALUES ('-1631184', 'LIGHT, GRANT ME ONE FINAL BLESSING. GIVE ME THE STRENGTH... TO SHATTER THESE BONDS!', null, null, null, null, null, null, null, null, '17392', '1', '0', '0', 'tirion SAY_OUTRO_6');
INSERT INTO `script_texts` VALUES ('-1631185', 'Impossible...', null, null, null, null, null, null, null, null, '17358', '1', '0', '0', 'lich_king SAY_OUTRO_7');
INSERT INTO `script_texts` VALUES ('-1631186', 'No more, Arthas! No more lives will be consumed by your hatred!', null, null, null, null, null, null, null, null, '17393', '1', '0', '0', 'tirion SAY_OUTRO_8');
INSERT INTO `script_texts` VALUES ('-1631187', 'Free at last! It is over, my son. This is the moment of reckoning.', null, null, null, null, null, null, null, null, '17397', '1', '0', '0', 'terenas SAY_OUTRO_9');
INSERT INTO `script_texts` VALUES ('-1631188', 'Rise up, champions of the Light!', null, null, null, null, null, null, null, null, '17398', '1', '0', '0', 'terenas SAY_OUTRO_10');
INSERT INTO `script_texts` VALUES ('-1631189', 'THE LICH KING...MUST...FALL!', null, null, null, null, null, null, null, null, '17389', '1', '0', '0', 'tirion SAY_OUTRO_11');
INSERT INTO `script_texts` VALUES ('-1631190', 'Now I stand, the lion before the lambs... and they do not fear.', null, null, null, null, null, null, null, null, '17361', '1', '0', '0', 'lich_king SAY_OUTRO_12');
INSERT INTO `script_texts` VALUES ('-1631191', 'They cannot fear.', null, null, null, null, null, null, null, null, '17362', '1', '0', '0', 'lich_king SAY_OUTRO_13');
INSERT INTO `script_texts` VALUES ('-1631192', '%s dies', null, null, null, null, null, null, null, null, '17374', '2', '0', '0', 'lich_king SAY_OUTRO_14');
INSERT INTO `script_texts` VALUES ('-1632000', 'More souls to power the engine!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'boss_bronjahm SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES ('-1632001', 'Finally...a captive audience!', null, null, null, null, null, null, null, null, '16595', '1', '0', '0', 'boss_bronjahm SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES ('-1632002', 'Fodder for the engine!', null, null, null, null, null, null, null, null, '16596', '1', '0', '0', 'boss_bronjahm SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1632003', 'Another soul to strengthen the host!', null, null, null, null, null, null, null, null, '16597', '1', '0', '0', 'boss_bronjahm SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1632004', 'My soul for you, master.', null, null, null, null, null, null, null, null, '16598', '1', '0', '0', 'boss_bronjahm SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1632005', 'The vortex of the harvested calls to you!', null, null, null, null, null, null, null, null, '16599', '1', '0', '0', 'boss_bronjahm SAY_SOULSTORM');
INSERT INTO `script_texts` VALUES ('-1632006', 'I will sever the soul from your body!', null, null, null, null, null, null, null, null, '16600', '1', '0', '0', 'boss_bronjahm SAY_CORRUPT_SOUL');
INSERT INTO `script_texts` VALUES ('-1632007', 'You dare look upon the host of souls?! I SHALL DEVOUR YOU WHOLE!', null, null, null, null, null, null, null, null, '16884', '1', '0', '0', 'boss_devourer SAY_MALE_1_AGGRO');
INSERT INTO `script_texts` VALUES ('-1632008', 'You dare look upon the host of souls?! I SHALL DEVOUR YOU WHOLE!', null, null, null, null, null, null, null, null, '16890', '1', '0', '0', 'boss_devourer SAY_FEMALE_AGGRO');
INSERT INTO `script_texts` VALUES ('-1632009', 'Damnation!', null, null, null, null, null, null, null, null, '16885', '1', '0', '0', 'boss_devourer SAY_MALE_1_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1632010', 'Damnation!', null, null, null, null, null, null, null, null, '16891', '1', '0', '0', 'boss_devourer SAY_FEMALE_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1632011', 'Damnation!', null, null, null, null, null, null, null, null, '16896', '1', '0', '0', 'boss_devourer SAY_MALE_2_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1632012', 'Doomed for eternity!', null, null, null, null, null, null, null, null, '16886', '1', '0', '0', 'boss_devourer SAY_MALE_1_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1632013', 'Doomed for eternity!', null, null, null, null, null, null, null, null, '16892', '1', '0', '0', 'boss_devourer SAY_FEMALE_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1632014', 'Doomed for eternity!', null, null, null, null, null, null, null, null, '16897', '1', '0', '0', 'boss_devourer SAY_MALE_2_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1632015', 'The swell of souls will not be abated! You only delay the inevitable!', null, null, null, null, null, null, null, null, '16887', '1', '0', '0', 'boss_devourer SAY_MALE_1_DEATH');
INSERT INTO `script_texts` VALUES ('-1632016', 'The swell of souls will not be abated! You only delay the inevitable!', null, null, null, null, null, null, null, null, '16893', '1', '0', '0', 'boss_devourer SAY_FEMALE_DEATH');
INSERT INTO `script_texts` VALUES ('-1632017', 'The swell of souls will not be abated! You only delay the inevitable!', null, null, null, null, null, null, null, null, '16898', '1', '0', '0', 'boss_devourer SAY_MALE_2_DEATH');
INSERT INTO `script_texts` VALUES ('-1632018', 'SUFFERING! ANGUISH! CHAOS! RISE AND FEED!', null, null, null, null, null, null, null, null, '16888', '1', '0', '0', 'boss_devourer SAY_MALE_1_SOUL_ATTACK');
INSERT INTO `script_texts` VALUES ('-1632019', 'SUFFERING! ANGUISH! CHAOS! RISE AND FEED!', null, null, null, null, null, null, null, null, '16894', '1', '0', '0', 'boss_devourer SAY_FEMALE_SOUL_ATTACK');
INSERT INTO `script_texts` VALUES ('-1632020', 'SUFFERING! ANGUISH! CHAOS! RISE AND FEED!', null, null, null, null, null, null, null, null, '16899', '1', '0', '0', 'boss_devourer SAY_MALE_2_SOUL_ATTACK');
INSERT INTO `script_texts` VALUES ('-1632021', 'Stare into the abyss, and see your end!', null, null, null, null, null, null, null, null, '16889', '1', '0', '0', 'boss_devourer SAY_MALE_1_DARK_GLARE');
INSERT INTO `script_texts` VALUES ('-1632022', 'Stare into the abyss, and see your end!', null, null, null, null, null, null, null, null, '16895', '1', '0', '0', 'boss_devourer SAY_FEMALE_DARK_GLARE');
INSERT INTO `script_texts` VALUES ('-1632023', '%s begins to cast Mirrored Soul!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'boss_devourer EMOTE_MIRRORED_SOUL');
INSERT INTO `script_texts` VALUES ('-1632024', '%s begins to Unleash Souls!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'boss_devourer EMOTE_UNLEASH_SOULS');
INSERT INTO `script_texts` VALUES ('-1632025', '%s begins to cast Wailing Souls!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'boss_devourer EMOTE_WAILING_SOULS');
INSERT INTO `script_texts` VALUES ('-1649000', 'Welcome champions, you have heard the call of the argent crusade and you have boldly answered. It is here in the crusaders coliseum that you will face your greatest challenges. Those of you who survive the rigors of the coliseum will join the Argent Crusade on it\'s marsh to ice crown citadel.', null, null, null, null, null, null, null, null, '16036', '1', '0', '0', 'tirion SAY_TIRION_RAID_INTRO_LONG');
INSERT INTO `script_texts` VALUES ('-1649001', 'Welcome to the trials of the crusader. Only the most powerful combatants of azeroth are allowed to undergo these trials. You are among the worthy few.', null, null, null, null, null, null, null, null, '16053', '1', '0', '0', 'tirion SAY_RAID_TRIALS_INTRO');
INSERT INTO `script_texts` VALUES ('-1649002', 'Hailing from the deepest, darkest carverns of the storm peaks, Gormok the Impaler! Battle on, heroes!', null, null, null, null, null, null, null, null, '16038', '1', '0', '0', 'tirion SAY_TIRION_BEAST_1');
INSERT INTO `script_texts` VALUES ('-1649003', 'Your beast will be no match for my champions Tirion.', null, null, null, null, null, null, null, null, '16069', '1', '0', '0', 'varian SAY_VARIAN_BEAST_1');
INSERT INTO `script_texts` VALUES ('-1649004', 'I have seen more worthy challenges in the ring of blood, you waste our time paladin.', null, null, null, null, null, null, null, null, '16026', '1', '0', '0', 'garrosh SAY_GARROSH_BEAST_1');
INSERT INTO `script_texts` VALUES ('-1649005', 'Steel yourselves, heroes, for the twin terrors Acidmaw and Dreadscale. Enter the arena!', null, null, null, null, null, null, null, null, '16039', '1', '0', '0', 'tirion SAY_TIRION_BEAST_2');
INSERT INTO `script_texts` VALUES ('-1649006', 'The air freezes with the introduction of our next combatant, Icehowl! Kill or be killed, champions!', null, null, null, null, null, null, null, null, '16040', '1', '0', '0', 'tirion SAY_TIRION_BEAST_3');
INSERT INTO `script_texts` VALUES ('-1649007', 'The monstrous menagerie has been vanquished!', null, null, null, null, null, null, null, null, '16041', '1', '0', '0', 'tirion SAY_TIRION_BEAST_SLAY');
INSERT INTO `script_texts` VALUES ('-1649008', 'Tragic... They fought valiantly, but the beasts of Northrend triumphed. Let us observe a moment of silence for our fallen heroes.', null, null, null, null, null, null, null, null, '16042', '1', '0', '0', 'tirion SAY_TIRION_BEAST_WIPE');
INSERT INTO `script_texts` VALUES ('-1649009', 'Grand Warlock Wilfred Fizzlebang will summon forth your next challenge. Stand by for his entry!', null, null, null, null, null, null, null, null, '16043', '1', '0', '0', 'tirion SAY_TIRION_JARAXXUS_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649010', 'Thank you, Highlord! Now challengers, I will begin the ritual of summoning! When I am done, a fearsome Doomguard will appear!', null, null, null, null, null, null, null, null, '16268', '1', '0', '0', 'wilfred SAY_WILFRED_JARAXXUS_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649011', 'Prepare for oblivion!', null, null, null, null, null, null, null, null, '16269', '1', '0', '0', 'wilfred SAY_WILFRED_JARAXXUS_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1649012', 'Ah ha! Behold the absolute power of Wilfred Fizzlebang, master summoner! You are bound to ME, demon!', null, null, null, null, null, null, null, null, '16270', '1', '0', '0', 'wilfred SAY_WILFRED_JARAXXUS_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1649013', 'Trifling gnome, your arrogance will be your undoing!', null, null, null, null, null, null, null, null, '16143', '1', '0', '0', 'jaraxxus SAY_JARAXXUS_JARAXXAS_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649014', 'But I\'m in charge her-', null, null, null, null, null, null, null, null, '16271', '1', '0', '0', 'wilfred SAY_WILFRED_DEATH');
INSERT INTO `script_texts` VALUES ('-1649015', 'Quickly, heroes! Destroy the demon lord before it can open a portal to its twisted demonic realm!', null, null, null, null, null, null, null, null, '16044', '1', '0', '0', 'tirion SAY_TIRION_JARAXXUS_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1649016', 'The loss of Wilfred Fizzlebang, while unfortunate, should be a lesson to those that dare dabble in dark magic. Alas, you are victorious and must now face the next challenge.', null, null, null, null, null, null, null, null, '16045', '1', '0', '0', 'tirion SAY_TIRION_JARAXXUS_EXIT_1');
INSERT INTO `script_texts` VALUES ('-1649017', 'Treacherous Alliance dogs! You summon a demon lord against warriors of the Horde!? Your deaths will be swift!', null, null, null, null, null, null, null, null, '16021', '1', '0', '0', 'garrosh SAY_GARROSH_JARAXXUS_EXIT_1');
INSERT INTO `script_texts` VALUES ('-1649018', 'The Alliance doesn\'t need the help of a demon lord to deal with Horde filth. Come, pig!', null, null, null, null, null, null, null, null, '16064', '1', '0', '0', 'varian SAY_VARIAN_JARAXXUS_SLAY');
INSERT INTO `script_texts` VALUES ('-1649019', 'Everyone, calm down! Compose yourselves! There is no conspiracy at play here. The warlock acted on his own volition - outside of influences from the Alliance. The tournament must go on!', null, null, null, null, null, null, null, null, '16046', '1', '0', '0', 'tirion SAY_TIRION_JARAXXUS_EXIT_2');
INSERT INTO `script_texts` VALUES ('-1649020', 'The next battle will be against the Argent Crusade\'s most powerful knights! Only by defeating them will you be deemed worthy...', null, null, null, null, null, null, null, null, '16047', '1', '0', '0', 'tirion SAY_TIRION_PVP_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649021', 'The Horde demands justice! We challenge the Alliance. Allow us to battle in place of your knights, paladin. We will show these dogs what it means to insult the Horde!', null, null, null, null, null, null, null, null, '16023', '1', '0', '0', 'garrosh SAY_GARROSH_PVP_A_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649022', 'Our honor has been besmirched! They make wild claims and false accusations against us. I demand justice! Allow my champions to fight in place of your knights, Tirion. We challenge the Horde!', null, null, null, null, null, null, null, null, '16066', '1', '0', '0', 'varian SAY_VARIAN_PVP_H_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649023', 'Very well, I will allow it. Fight with honor!', null, null, null, null, null, null, null, null, '16048', '1', '0', '0', 'tirion SAY_TIRION_PVP_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1649024', 'Fight for the glory of the Alliance, heroes! Honor your king and your people!', null, null, null, null, null, null, null, null, '16065', '1', '0', '0', 'varian SAY_VARIAN_PVP_H_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1649025', 'Show them no mercy, Horde champions! LOK\'TAR OGAR!', null, null, null, null, null, null, null, null, '16022', '1', '0', '0', 'garrosh SAY_GARROSH_PVP_A_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1649026', 'GLORY TO THE ALLIANCE!', null, null, null, null, null, null, null, null, '16067', '1', '0', '0', 'varian SAY_VARIAN_PVP_A_WIN');
INSERT INTO `script_texts` VALUES ('-1649027', 'That was just a taste of what the future brings. FOR THE HORDE!', null, null, null, null, null, null, null, null, '16024', '1', '0', '0', 'garrosh SAY_GARROSH_PVP_H_WIN');
INSERT INTO `script_texts` VALUES ('-1649028', 'A shallow and tragic victory. We are weaker as a whole from the losses suffered today. Who but the Lich King could benefit from such foolishness? Great warriors have lost their lives. And for what? The true threat looms ahead - the Lich King awaits us all in death.', null, null, null, null, null, null, null, null, '16049', '1', '0', '0', 'tirion SAY_TIRION_PVP_WIN');
INSERT INTO `script_texts` VALUES ('-1649029', 'Only by working together will you overcome the final challenge. From the depths of Icecrown come two of the Scourge\'s most powerful lieutenants: fearsome val\'kyr, winged harbingers of the Lich King!', null, null, null, null, null, null, null, null, '16050', '1', '0', '0', 'tirion SAY_TIRION_TWINS_INTRO');
INSERT INTO `script_texts` VALUES ('-1649030', 'Let the games begin!', null, null, null, null, null, null, null, null, '16037', '1', '0', '0', 'tirion SAY_RAID_INTRO_SHORT');
INSERT INTO `script_texts` VALUES ('-1649031', 'Not even the lich king\'s most powerful minions could stand against the alliance. All hail our victors.', null, null, null, null, null, null, null, null, '16068', '1', '0', '0', 'varian SAY_VARIAN_TWINS_A_WIN');
INSERT INTO `script_texts` VALUES ('-1649032', 'Do you still question the might of the Horde, paladin? We will take on all comers!', null, null, null, null, null, null, null, null, '16025', '1', '0', '0', 'garrosh SAY_GARROSH_TWINS_H_WIN');
INSERT INTO `script_texts` VALUES ('-1649033', 'A mighty blow has been dealt to the Lich King! You have proven yourselves able bodied champions of the Argent Crusade. Together we will strike at Icecrown Citadel and destroy what remains of the Scourge! There is no challenge that we cannot face united!', null, null, null, null, null, null, null, null, '16051', '1', '0', '0', 'tirion SAY_TIRION_TWINS_WIN');
INSERT INTO `script_texts` VALUES ('-1649034', 'You will have your challenge, Fordring.', null, null, null, null, null, null, null, null, '16321', '1', '0', '0', 'lich_king SAY_LKING_ANUB_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649035', 'Arthas! You are hopelessly outnumbered! Lay down Frostmourne and I will grant you a just death.', null, null, null, null, null, null, null, null, '16052', '1', '0', '0', 'tirion SAY_TIRION_ABUN_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649036', 'The Nerubians built an empire beneath the frozen wastes of Northrend. An empire that you so foolishly built your structures upon. MY EMPIRE.', null, null, null, null, null, null, null, null, '16322', '1', '0', '0', 'lich_king SAY_LKING_ANUB_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1649037', 'The souls of your fallen champions will be mine, Fordring.', null, null, null, null, null, null, null, null, '16323', '1', '0', '0', 'lich_king SAY_LKING_ANUB_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1649038', 'Ahhh, our guests have arrived, just as the master promised.', null, null, null, null, null, null, null, null, '16235', '1', '0', '0', 'anubarak SAY_ANUB_ANUB_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1649039', '%s glares at $N and lets out a bellowing roar!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'icehowl EMOTE_MASSIVE_CRASH');
INSERT INTO `script_texts` VALUES ('-1649040', 'You face Jaraxxus, eredar lord of the Burning Legion!', null, null, null, null, null, null, null, null, '16144', '1', '0', '0', 'jaraxxus SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1649041', 'Insignificant gnat!', null, null, null, null, null, null, null, null, '16145', '1', '0', '0', 'jaraxxus SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1649042', 'Banished to the Nether!', null, null, null, null, null, null, null, null, '16146', '1', '0', '0', 'jaraxxus SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1649043', 'Another will take my place. Your world is doomed.', null, null, null, null, null, null, null, null, '16147', '1', '0', '0', 'jaraxxus SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1649044', '<SD2 Text missing>', null, null, null, null, null, null, null, null, '16148', '1', '0', '0', 'jaraxxus SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1649045', 'Flesh from bone!', null, null, null, null, null, null, null, null, '16149', '1', '0', '0', 'jaraxxus SAY_INCINERATE');
INSERT INTO `script_texts` VALUES ('-1649046', 'Come forth, sister! Your master calls!', null, null, null, null, null, null, null, null, '16150', '1', '0', '0', 'jaraxxus SAY_MISTRESS');
INSERT INTO `script_texts` VALUES ('-1649047', 'Inferno!', null, null, null, null, null, null, null, null, '16151', '1', '0', '0', 'jaraxxus SAY_INFERNO');
INSERT INTO `script_texts` VALUES ('-1649048', 'Weakling!', null, null, null, null, null, null, null, null, '16017', '1', '0', '0', 'garrosh SAY_GARROSH_PVP_A_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1649049', 'Pathetic!', null, null, null, null, null, null, null, null, '16018', '1', '0', '0', 'garrosh SAY_GARROSH_PVP_A_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1649050', 'Overpowered.', null, null, null, null, null, null, null, null, '16019', '1', '0', '0', 'garrosh SAY_GARROSH_PVP_A_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1649051', 'Lok\'tar!', null, null, null, null, null, null, null, null, '16020', '1', '0', '0', 'garrosh SAY_GARROSH_PVP_A_SLAY_4');
INSERT INTO `script_texts` VALUES ('-1649052', 'Hah!', null, null, null, null, null, null, null, null, '16060', '1', '0', '0', 'varian SAY_VARIAN_PVP_H_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1649053', 'Hardly a challenge!', null, null, null, null, null, null, null, null, '16061', '1', '0', '0', 'varian SAY_VARIAN_PVP_H_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1649054', 'Worthless scrub.', null, null, null, null, null, null, null, null, '16062', '1', '0', '0', 'varian SAY_VARIAN_PVP_H_SLAY_3');
INSERT INTO `script_texts` VALUES ('-1649055', 'Is this the best the Horde has to offer?', null, null, null, null, null, null, null, null, '16063', '1', '0', '0', 'varian SAY_VARIAN_PVP_H_SLAY_4');
INSERT INTO `script_texts` VALUES ('-1649056', 'In the name of our dark master. For the Lich King. You. Will. Die.', null, null, null, null, null, null, null, null, '16272', '1', '0', '0', 'twin_valkyr SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1649057', 'You are finished!', null, null, null, null, null, null, null, null, '16273', '1', '0', '0', 'twin_valkyr SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1649058', 'Chaos!', null, null, null, null, null, null, null, null, '16274', '1', '0', '0', 'twin_valkyr SAY_COLORSWITCH');
INSERT INTO `script_texts` VALUES ('-1649059', 'The Scourge cannot be stopped...', null, null, null, null, null, null, null, null, '16275', '1', '0', '0', 'twin_valkyr SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1649060', 'You have been measured, and found wanting!', null, null, null, null, null, null, null, null, '16276', '1', '0', '0', 'twin_valkyr SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1649061', 'Unworthy!', null, null, null, null, null, null, null, null, '16277', '1', '0', '0', 'twin_valkyr SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1649062', 'Let the dark consume you!', null, null, null, null, null, null, null, null, '16278', '1', '0', '0', 'twin_valkyr SAY_TO_BLACK');
INSERT INTO `script_texts` VALUES ('-1649063', 'Let the light consume you!', null, null, null, null, null, null, null, null, '16279', '1', '0', '0', 'twin_valkyr SAY_TO_WHITE');
INSERT INTO `script_texts` VALUES ('-1649064', 'This place will serve as your tomb!', null, null, null, null, null, null, null, null, '16234', '1', '0', '0', 'anubarak SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1649065', 'F-lakkh shir!', null, null, null, null, null, null, null, null, '16236', '1', '0', '0', 'anubarak SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1649066', 'Another soul to sate the host.', null, null, null, null, null, null, null, null, '16237', '1', '0', '0', 'anubarak SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1649067', 'I have failed you, master...', null, null, null, null, null, null, null, null, '16238', '1', '0', '0', 'anubarak SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1649068', '<SD2 Text missing>', null, null, null, null, null, null, null, null, '16239', '1', '0', '0', 'anubarak SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1649069', 'Auum na-l ak-k-k-k, isshhh. Rise, minions. Devour...', null, null, null, null, null, null, null, null, '16240', '1', '0', '0', 'anubarak SAY_SUBMERGE');
INSERT INTO `script_texts` VALUES ('-1649070', 'The swarm shall overtake you!', null, null, null, null, null, null, null, null, '16241', '1', '0', '0', 'anubarak SAY_LEECHING_SWARM');
INSERT INTO `script_texts` VALUES ('-1658001', 'Intruders have entered the masters domain. Signal the alarms!', null, null, null, null, null, null, null, null, '16747', '1', '0', '0', 'tyrannus SAY_TYRANNUS_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1658002', 'Heroes of the Alliance, attack!', null, null, null, null, null, null, null, null, '16626', '1', '0', '0', 'jaina SAY_JAINA_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1658003', 'Soldiers of the Horde, attack!', null, null, null, null, null, null, null, null, '17045', '1', '0', '0', 'sylvanas SAY_SYLVANAS_INTRO_1');
INSERT INTO `script_texts` VALUES ('-1658004', 'Hrmph, fodder. Not even fit to labor in the quarry. Relish these final moments for soon you will be nothing more than mindless undead.', null, null, null, null, null, null, null, null, '16748', '1', '0', '0', 'tyrannus SAY_TYRANNUS_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1658005', 'Your last waking memory will be of agonizing pain.', null, null, null, null, null, null, null, null, '16749', '1', '0', '0', 'tyrannus SAY_TYRANNUS_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1658006', 'No! You monster!', null, null, null, null, null, null, null, null, '16627', '1', '0', '0', 'jaina SAY_JAINA_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1658007', 'Pathetic weaklings!', null, null, null, null, null, null, null, null, '17046', '1', '0', '0', 'sylvanas SAY_SYLVANAS_INTRO_2');
INSERT INTO `script_texts` VALUES ('-1658008', 'Minions, destroy these interlopers!', null, null, null, null, null, null, null, null, '16751', '1', '0', '0', 'tyrannus SAY_TYRANNUS_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1658009', 'I do what I must. Please forgive me, noble soldiers.', null, null, null, null, null, null, null, null, '16628', '1', '0', '0', 'jaina SAY_JAINA_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1658010', 'You will have to make your way across this quarry on your own.', null, null, null, null, null, null, null, null, '16629', '0', '0', '0', 'jaina SAY_JAINA_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1658011', 'You will have to battle your way through this cesspit on your own.', null, null, null, null, null, null, null, null, '17047', '0', '0', '0', 'sylvanas SAY_SYLVANAS_INTRO_3');
INSERT INTO `script_texts` VALUES ('-1658012', 'Free any Alliance slaves that you come across. We will most certainly need their assistance in battling Tyrannus. I will gather reinforcements and join you on the other side of the quarry.', null, null, null, null, null, null, null, null, '16630', '0', '0', '0', 'jaina SAY_JAINA_INTRO_5');
INSERT INTO `script_texts` VALUES ('-1658013', 'Free any Horde slaves that you come across. We will most certainly need their assistance in battling Tyrannus. I will gather reinforcements and join you on the other side of the quarry.', null, null, null, null, null, null, null, null, '17048', '0', '0', '0', 'sylvanas SAY_SYLVANAS_INTRO_4');
INSERT INTO `script_texts` VALUES ('-1658014', 'Tiny creatures under feet, you bring Garfrost something good to eat!', null, null, null, null, null, null, null, null, '16912', '1', '0', '0', 'garfrost SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1658015', 'Will save for snack. For later.', null, null, null, null, null, null, null, null, '16913', '1', '0', '0', 'garfrost SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1658016', 'That one maybe not so good to eat now. Stupid Garfrost! BAD! BAD!', null, null, null, null, null, null, null, null, '16914', '1', '0', '0', 'garfrost SAY_BOULDER_HIT');
INSERT INTO `script_texts` VALUES ('-1658017', 'Garfrost hope giant underpants clean. Save boss great shame. For later.', null, null, null, null, null, null, null, null, '16915', '1', '0', '0', 'garfrost SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1658018', 'Axe too weak. Garfrost make better and CRUSH YOU!', null, null, null, null, null, null, null, null, '16916', '1', '0', '0', 'garfrost SAY_FORGE_1');
INSERT INTO `script_texts` VALUES ('-1658019', 'That one maybe not so good to eat now. Stupid Garfrost! BAD! BAD!', null, null, null, null, null, null, null, null, '16917', '1', '0', '0', 'garfrost SAY_FORGE_2');
INSERT INTO `script_texts` VALUES ('-1658020', 'Another shall take his place. You waste your time.', null, null, null, null, null, null, null, null, '16752', '1', '0', '0', 'tyrannus SAY_TYRANNUS_GARFROST');
INSERT INTO `script_texts` VALUES ('-1658021', 'The forgemaster is dead! Get geared up men, we have a Scourgelord to kill.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'victus_or_ironskull SAY_GENERAL_GARFROST');
INSERT INTO `script_texts` VALUES ('-1658022', '%s hurls a massive saronite boulder at you!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'garfrost EMOTE_THROW_SARONITE');
INSERT INTO `script_texts` VALUES ('-1658023', '%s casts Deep Freeze at $N.', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'garfrost EMOTE_DEEP_FREEZE');
INSERT INTO `script_texts` VALUES ('-1658024', 'Our work must not be interrupted! Ick! Take care of them!', null, null, null, null, null, null, null, null, '16926', '1', '0', '0', 'krick SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1658025', 'Ooh...We could probably use these parts!', null, null, null, null, null, null, null, null, '16927', '1', '0', '0', 'krick SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1658026', 'Arms and legs are in short supply...Thanks for your contribution!', null, null, null, null, null, null, null, null, '16928', '1', '0', '0', 'krick SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1658027', 'Enough moving around! Hold still while I blow them all up!', null, null, null, null, null, null, null, null, '16929', '1', '0', '0', 'krick SAY_ORDER_STOP');
INSERT INTO `script_texts` VALUES ('-1658028', 'Quickly! Poison them all while they\'re still close!', null, null, null, null, null, null, null, null, '16930', '1', '0', '0', 'krick SAY_ORDER_BLOW');
INSERT INTO `script_texts` VALUES ('-1658029', 'No! That one! That one! Get that one!', null, null, null, null, null, null, null, null, '16931', '1', '0', '0', 'krick SAY_TARGET_1');
INSERT INTO `script_texts` VALUES ('-1658030', 'I\'ve changed my mind...go get that one instead!', null, null, null, null, null, null, null, null, '16932', '1', '0', '0', 'krick SAY_TARGET_2');
INSERT INTO `script_texts` VALUES ('-1658031', 'What are you attacking him for? The dangerous one is over there,fool!', null, null, null, null, null, null, null, null, '16933', '1', '0', '0', 'krick SAY_TARGET_3');
INSERT INTO `script_texts` VALUES ('-1658032', '%s begins rapidly conjuring explosive mines!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'krick EMOTE_KRICK_MINES');
INSERT INTO `script_texts` VALUES ('-1658033', '%s begins to unleash a toxic poison cloud!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'ick EMOTE_ICK_POISON');
INSERT INTO `script_texts` VALUES ('-1658034', '%s is chasing you!', null, null, null, null, null, null, null, null, '0', '5', '0', '0', 'ick EMOTE_ICK_CHASING');
INSERT INTO `script_texts` VALUES ('-1658035', 'Wait! Stop! Don\'t kill me, please! I\'ll tell you everything!', null, null, null, null, null, null, null, null, '16934', '1', '0', '0', 'krick SAY_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1658036', 'I\'m not so naive as to believe your appeal for clemency, but I will listen.', null, null, null, null, null, null, null, null, '16611', '1', '0', '0', 'jaina SAY_JAINA_KRICK_1');
INSERT INTO `script_texts` VALUES ('-1658037', 'Why should the Banshee Queen spare your miserable life?', null, null, null, null, null, null, null, null, '17033', '1', '0', '0', 'sylvanas SAY_SYLVANAS_KRICK_1');
INSERT INTO `script_texts` VALUES ('-1658038', 'What you seek is in the master\'s lair, but you must destroy Tyrannus to gain entry. Within the Halls of Reflection you will find Frostmourne. It... it holds the truth.', null, null, null, null, null, null, null, null, '16935', '1', '0', '0', 'krick SAY_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1658039', 'Frostmourne lies unguarded? Impossible!', null, null, null, null, null, null, null, null, '16612', '1', '0', '0', 'jaina SAY_JAINA_KRICK_2');
INSERT INTO `script_texts` VALUES ('-1658040', 'Frostmourne? The Lich King is never without his blade! If you are lying to me...', null, null, null, null, null, null, null, null, '17034', '1', '0', '0', 'sylvanas SAY_SYLVANAS_KRICK_2');
INSERT INTO `script_texts` VALUES ('-1658041', 'I swear it is true! Please, don\'t kill me!!', null, null, null, null, null, null, null, null, '16936', '1', '0', '0', 'krick SAY_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1658042', 'Worthless gnat! Death is all that awaits you!', null, null, null, null, null, null, null, null, '16753', '1', '0', '0', 'tyrannus SAY_TYRANNUS_KRICK_1');
INSERT INTO `script_texts` VALUES ('-1658043', 'Urg... no!!', null, null, null, null, null, null, null, null, '16937', '1', '0', '0', 'krick SAY_OUTRO_4');
INSERT INTO `script_texts` VALUES ('-1658044', 'Do not think that I shall permit you entry into my master\'s sanctum so easily. Pursue me if you dare.', null, null, null, null, null, null, null, null, '16754', '1', '0', '0', 'tyrannus SAY_TYRANNUS_KRICK_2');
INSERT INTO `script_texts` VALUES ('-1658045', 'What a cruel end. Come, heroes. We must see if the gnome\'s story is true. If we can separate Arthas from Frostmourne, we might have a chance at stopping him.', null, null, null, null, null, null, null, null, '16613', '1', '0', '0', 'jaina SAY_JAINA_KRICK_3');
INSERT INTO `script_texts` VALUES ('-1658046', 'A fitting end for a traitor. Come, we must free the slaves and see what is within the Lich King\'s chamber for ourselves.', null, null, null, null, null, null, null, null, '17035', '1', '0', '0', 'sylvanas SAY_SYLVANAS_KRICK_3');
INSERT INTO `script_texts` VALUES ('-1658047', 'Your pursuit shall be in vain, adventurers, for the Lich King has placed an army of undead at my command! Behold!', null, null, null, null, null, null, null, null, '16755', '1', '0', '0', 'tyrannus SAY_TYRANNUS_AMBUSH_1');
INSERT INTO `script_texts` VALUES ('-1658048', 'Persistent whelps! You will not reach the entrance of my lord\'s lair! Soldiers, destroy them!', null, null, null, null, null, null, null, null, '16756', '1', '0', '0', 'tyrannus SAY_TYRANNUS_AMBUSH_2');
INSERT INTO `script_texts` VALUES ('-1658049', 'Rimefang! Trap them within the tunnel! Bury them alive!', null, null, null, null, null, null, null, null, '16757', '1', '0', '0', 'tyrannus SAY_GAUNTLET');
INSERT INTO `script_texts` VALUES ('-1658050', 'Alas, brave, brave adventurers, your meddling has reached its end. Do you hear the clatter of bone and steel coming up the tunnel behind you? That is the sound of your impending demise.', null, null, null, null, null, null, null, null, '16758', '1', '0', '0', 'tyrannus SAY_PREFIGHT_1');
INSERT INTO `script_texts` VALUES ('-1658051', 'Heroes! We will hold off the undead as long as we can, even to our dying breath. Deal with the Scourgelord!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'victus_or_ironskull SAY_GENERAL_TRASH');
INSERT INTO `script_texts` VALUES ('-1658052', 'Ha, such an amusing gesture from the rabble. When I have finished with you, my master\'s blade will feast upon your souls. Die!', null, null, null, null, null, null, null, null, '16759', '1', '0', '0', 'tyrannus SAY_PREFIGHT_2');
INSERT INTO `script_texts` VALUES ('-1658053', 'I shall not fail The Lich King! Come and meet your end!', null, null, null, null, null, null, null, null, '16760', '1', '0', '0', 'tyrannus SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1658054', 'Such a shameful display...', null, null, null, null, null, null, null, null, '16761', '1', '0', '0', 'tyrannus SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1658055', 'Perhaps you should have stayed in the mountains!', null, null, null, null, null, null, null, null, '16762', '1', '0', '0', 'tyrannus SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1658056', 'Impossible! Rimefang...Warn...', null, null, null, null, null, null, null, null, '16763', '1', '0', '0', 'tyrannus SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1658057', 'Rimefang, destroy this fool!', null, null, null, null, null, null, null, null, '16764', '1', '0', '0', 'tyrannus SAY_MARK');
INSERT INTO `script_texts` VALUES ('-1658058', 'Power... overwhelming!', null, null, null, null, null, null, null, null, '16765', '1', '0', '0', 'tyrannus SAY_SMASH');
INSERT INTO `script_texts` VALUES ('-1658059', 'The frostwyrm %s gazes at $N and readies an icy attack!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'rimefang EMOTE_RIMEFANG_ICEBOLT');
INSERT INTO `script_texts` VALUES ('-1658060', '%s roars and swells with dark might!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'tyrannus EMOTE_SMASH');
INSERT INTO `script_texts` VALUES ('-1658061', 'Brave champions, we owe you our lives, our freedom... Though it be a tiny gesture in the face of this enormous debt, I pledge that from this day forth, all will know of your deeds, and the blazing path of light you cut through the shadow of this dark citadel.', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'victus_or_ironskull SAY_GENERAL_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1658062', 'This day will stand as a testament not only to your valor, but to the fact that no foe, not even the Lich King himself, can stand when Alliance and Horde set aside their differences and ---', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'victus_or_ironskull SAY_GENERAL_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1658063', 'Heroes, to me!', null, null, null, null, null, null, null, null, '16614', '0', '0', '0', 'jaina SAY_JAINA_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1658064', 'Take cover behind me! Quickly!', null, null, null, null, null, null, null, null, '17037', '0', '0', '0', 'sylvanas SAY_SYLVANAS_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1658065', 'The Frost Queen is gone. We must keep moving - our objective is near.', null, null, null, null, null, null, null, null, '16615', '0', '0', '0', 'jaina SAY_JAINA_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1658066', 'I... I could not save them... Damn you, Arthas! DAMN YOU!', null, null, null, null, null, null, null, null, '16616', '0', '0', '0', 'jaina SAY_JAINA_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1658067', 'I thought he\'d never shut up. At last, Sindragosa silenced that long-winded fool. To the Halls of Reflection, champions! Our objective is near... I can sense it.', null, null, null, null, null, null, null, null, '17036', '0', '0', '0', 'sylvanas SAY_SYLVANAS_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1724000', 'Help! I am trapped within this tree! I require aid!', null, null, null, null, null, null, null, null, '17490', '6', '0', '0', 'xerestraza SAY_HELP');
INSERT INTO `script_texts` VALUES ('-1724001', 'Your power wanes, ancient one! Soon, you will join your friends!', null, null, null, null, null, null, null, null, '17525', '6', '0', '0', 'baltharus SAY_INTRO');
INSERT INTO `script_texts` VALUES ('-1724002', 'Thank you! I could have not held out for much longer. A terrible thing has happened here.', null, null, null, null, null, null, null, null, '17491', '1', '0', '0', 'xerestraza SAY_THANKS');
INSERT INTO `script_texts` VALUES ('-1724003', 'We believed that the Sanctum was well fortified, but we were not prepareted for the nature of this assault.', null, null, null, null, null, null, null, null, '17492', '0', '0', '0', 'xerestraza SAY_OUTRO_1');
INSERT INTO `script_texts` VALUES ('-1724004', 'The Black Dragonkin materialized from thin air, and set upon us before we could react.', null, null, null, null, null, null, null, null, '17493', '0', '0', '0', 'xerestraza SAY_OUTRO_2');
INSERT INTO `script_texts` VALUES ('-1724005', 'We did not stand a chance. As my brethren perished around me, I managed to retreat hear and bar the entrance.', null, null, null, null, null, null, null, null, '17494', '0', '0', '0', 'xerestraza SAY_OUTRO_3');
INSERT INTO `script_texts` VALUES ('-1724006', 'They slaughtered us with cold efficiency, but the true focus of their interest seemed to be the eggs kept here in the sanctum.', null, null, null, null, null, null, null, null, '17495', '0', '0', '0', 'xerestraza SAY_OUTRO_4');
INSERT INTO `script_texts` VALUES ('-1724007', 'The commander of the forces on the ground here is a cruel brute named Zarithrian. But I fear there are greater powers at work.', null, null, null, null, null, null, null, null, '17496', '0', '0', '0', 'xerestraza SAY_OUTRO_5');
INSERT INTO `script_texts` VALUES ('-1724008', 'In their initial assault I caught a glimpse of their true leader, a fearsome full-grown Twilight Dragon.', null, null, null, null, null, null, null, null, '17497', '0', '0', '0', 'xerestraza SAY_OUTRO_6');
INSERT INTO `script_texts` VALUES ('-1724009', 'I know not the extent of their plans heroes, but I know this: they cannot be allowed to succeed!', null, null, null, null, null, null, null, null, '17498', '0', '0', '0', 'xerestraza SAY_OUTRO_7');
INSERT INTO `script_texts` VALUES ('-1724010', 'Ah, the entertainment has arrived.', null, null, null, null, null, null, null, null, '17520', '1', '0', '0', 'baltharus SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1724011', 'Baltharus leaves no survivors!', null, null, null, null, null, null, null, null, '17521', '1', '0', '0', 'baltharus SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1724012', 'This world has enough heroes.', null, null, null, null, null, null, null, null, '17522', '1', '0', '0', 'baltharus SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1724013', 'I... Didn\'t see that coming...', null, null, null, null, null, null, null, null, '17523', '1', '0', '0', 'baltharus SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1724014', 'Twice the pain and half the fun.', null, null, null, null, null, null, null, null, '17524', '1', '0', '0', 'baltharus SAY_SPLIT');
INSERT INTO `script_texts` VALUES ('-1724015', 'You will suffer for this intrusion!', null, null, null, null, null, null, null, null, '17528', '1', '0', '0', 'saviana SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1724016', 'As it should be...', null, null, null, null, null, null, null, null, '17529', '1', '0', '0', 'saviana SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1724017', 'Halion will be pleased.', null, null, null, null, null, null, null, null, '17530', '1', '0', '0', 'saviana SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1724018', 'Burn in the master\'s flame!', null, null, null, null, null, null, null, null, '17532', '1', '0', '0', 'saviana SAY_SPECIAL');
INSERT INTO `script_texts` VALUES ('-1724019', 'Alexstrasza has chosen capable allies... A pity that I must END YOU!', null, null, null, null, null, null, null, null, '17512', '1', '0', '0', 'zarithrian SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1724020', 'You thought you stood a chance?', null, null, null, null, null, null, null, null, '17513', '1', '0', '0', 'zarithrian SAY_SLAY_1');
INSERT INTO `script_texts` VALUES ('-1724021', 'It\'s for the best.', null, null, null, null, null, null, null, null, '17514', '1', '0', '0', 'zarithrian SAY_SLAY_2');
INSERT INTO `script_texts` VALUES ('-1724022', 'HALION! I...', null, null, null, null, null, null, null, null, '17515', '1', '0', '0', 'zarithrian SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1724023', 'Turn them to ash, minions!', null, null, null, null, null, null, null, null, '17516', '1', '0', '0', 'zarithrian SAY_SUMMON');
INSERT INTO `script_texts` VALUES ('-1724024', 'Meddlesome insects! You\'re too late: The Ruby Sanctum\'s lost.', null, null, null, null, null, null, null, null, '17499', '6', '0', '0', 'halion SAY_SPAWN');
INSERT INTO `script_texts` VALUES ('-1724025', 'Your world teeters on the brink of annihilation. You will ALL bear witness to the coming of a new age of DESTRUCTION!', null, null, null, null, null, null, null, null, '17500', '1', '0', '0', 'halion SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1724026', 'Another hero falls.', null, null, null, null, null, null, null, null, '17501', '1', '0', '0', 'halion SAY_SLAY');
INSERT INTO `script_texts` VALUES ('-1724027', 'Relish this victory, mortals, for it will be your last! This world will burn with the master\'s return!', null, null, null, null, null, null, null, null, '17503', '1', '0', '0', 'halion SAY_DEATH');
INSERT INTO `script_texts` VALUES ('-1724028', 'Not good enough.', null, null, null, null, null, null, null, null, '17504', '1', '0', '0', 'halion SAY_BERSERK');
INSERT INTO `script_texts` VALUES ('-1724029', 'The heavens burn!', null, null, null, null, null, null, null, null, '17505', '1', '0', '0', 'halion SAY_FIREBALL');
INSERT INTO `script_texts` VALUES ('-1724030', 'Beware the shadow!', null, null, null, null, null, null, null, null, '17506', '1', '0', '0', 'halion SAY_SPHERES');
INSERT INTO `script_texts` VALUES ('-1724031', 'You will find only suffering within the realm of twilight! Enter if you dare!', null, null, null, null, null, null, null, null, '17507', '1', '0', '0', 'halion SAY_PHASE_2');
INSERT INTO `script_texts` VALUES ('-1724032', 'I am the light and the darkness! Cower, mortals, before the herald of Deathwing!', null, null, null, null, null, null, null, null, '17508', '1', '0', '0', 'halion SAY_PHASE_3');
INSERT INTO `script_texts` VALUES ('-1724033', 'The orbining spheres pulse with dark energy!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'halion EMOTE_SPHERES');
INSERT INTO `script_texts` VALUES ('-1724034', 'Your efforts force %s further out of the twillight realm!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'halion EMOTE_OUT_OF_TWILLIGHT');
INSERT INTO `script_texts` VALUES ('-1724035', 'Your efforts force %s further out of the physical realm!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'halion EMOTE_OUT_OF_PHYSICAL');
INSERT INTO `script_texts` VALUES ('-1724036', 'Your companions\' efforts force Halion further into the twillight realm!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'halion EMOTE_INTO_TWILLIGHT');
INSERT INTO `script_texts` VALUES ('-1724037', 'Your companions\' efforts force Halion further into the physical realm!', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'halion EMOTE_INTO_PHYSICAL');
INSERT INTO `script_texts` VALUES ('-1724038', 'Without pressure in both realms %s begins to regenerate.', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'halion EMOTE_REGENERATE');
INSERT INTO `script_texts` VALUES ('-1999900', 'Let the games begin.', null, null, null, null, null, null, null, null, '8280', '1', '0', '0', 'example_creature SAY_AGGRO');
INSERT INTO `script_texts` VALUES ('-1999901', 'I see endless suffering. I see torment. I see rage. I see everything.', null, null, null, null, null, null, null, null, '8831', '1', '0', '0', 'example_creature SAY_RANDOM_0');
INSERT INTO `script_texts` VALUES ('-1999902', 'Muahahahaha', null, null, null, null, null, null, null, null, '8818', '1', '0', '0', 'example_creature SAY_RANDOM_1');
INSERT INTO `script_texts` VALUES ('-1999903', 'These mortal infedels my lord, they have invaded your sanctum and seek to steal your secrets.', null, null, null, null, null, null, null, null, '8041', '1', '0', '0', 'example_creature SAY_RANDOM_2');
INSERT INTO `script_texts` VALUES ('-1999904', 'You are already dead.', null, null, null, null, null, null, null, null, '8581', '1', '0', '0', 'example_creature SAY_RANDOM_3');
INSERT INTO `script_texts` VALUES ('-1999905', 'Where to go? What to do? So many choices that all end in pain, end in death.', null, null, null, null, null, null, null, null, '8791', '1', '0', '0', 'example_creature SAY_RANDOM_4');
INSERT INTO `script_texts` VALUES ('-1999906', '$N, I sentance you to death!', null, null, null, null, null, null, null, null, '8588', '1', '0', '0', 'example_creature SAY_BESERK');
INSERT INTO `script_texts` VALUES ('-1999907', 'The suffering has just begun!', null, null, null, null, null, null, null, null, '0', '1', '0', '0', 'example_creature SAY_PHASE');
INSERT INTO `script_texts` VALUES ('-1999908', 'I always thought I was a good dancer.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_creature SAY_DANCE');
INSERT INTO `script_texts` VALUES ('-1999909', 'Move out Soldier!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_creature SAY_SALUTE');
INSERT INTO `script_texts` VALUES ('-1999910', 'Help $N! I\'m under attack!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_AGGRO1');
INSERT INTO `script_texts` VALUES ('-1999911', 'Die scum!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_AGGRO2');
INSERT INTO `script_texts` VALUES ('-1999912', 'Hmm a nice day for a walk alright', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_WP_1');
INSERT INTO `script_texts` VALUES ('-1999913', 'Wild Felboar attack!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_WP_2');
INSERT INTO `script_texts` VALUES ('-1999914', 'Time for me to go! See ya around $N!', null, null, null, null, null, null, null, null, '0', '0', '0', '3', 'example_escort SAY_WP_3');
INSERT INTO `script_texts` VALUES ('-1999915', 'Bye Bye!', null, null, null, null, null, null, null, null, '0', '0', '0', '3', 'example_escort SAY_WP_4');
INSERT INTO `script_texts` VALUES ('-1999916', 'How dare you leave me like that! I hate you! =*(', null, null, null, null, null, null, null, null, '0', '3', '0', '0', 'example_escort SAY_DEATH_1');
INSERT INTO `script_texts` VALUES ('-1999917', '...no...how could you let me die $N', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_DEATH_2');
INSERT INTO `script_texts` VALUES ('-1999918', 'ugh...', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_DEATH_3');
INSERT INTO `script_texts` VALUES ('-1999919', 'Taste death!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_SPELL');
INSERT INTO `script_texts` VALUES ('-1999920', 'Fireworks!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_RAND_1');
INSERT INTO `script_texts` VALUES ('-1999921', 'Hmm, I think I could use a buff.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_escort SAY_RAND_2');
INSERT INTO `script_texts` VALUES ('-1999922', 'Normal select, guess you\'re not interested.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_gossip_codebox SAY_NOT_INTERESTED');
INSERT INTO `script_texts` VALUES ('-1999923', 'Wrong!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_gossip_codebox SAY_WRONG');
INSERT INTO `script_texts` VALUES ('-1999924', 'You\'re right, you are allowed to see my inner secrets.', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_gossip_codebox SAY_CORRECT');
INSERT INTO `script_texts` VALUES ('-1999925', 'Hi!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'example_areatrigger SAY_HI');
INSERT INTO `script_texts` VALUES ('-1469003', 'You dare to disturb my waters? Death! Death for you all!', null, null, null, null, null, null, null, null, '0', '0', '0', '0', 'maru SAY_ENTER_COMBAT');
